var book = {
	"name": "ယ့ၫရမဲအၫ",
	"numChapters": 52,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စဟံၫလကဲအၫအဖိၪခွၫ စယ့ၫရမဲအၫလၧၦလုဆၧ အကျၩ,လၧအအီၪဝ့ၫလၧအၫ့အၥီၭလၧခးဘံၪ့ယမံၫ့",
			"2": "<sup>2</sup> အဖၧၩ့လဂၩအဆၧချဲၩ့း- အဝ့ၫဒၪနီၪယဟိဝၩအလူ လၩ့ဘၪဝ့ၫလၧယုဒၫအစဎွၩအၫမၧၫ့အဖိၪခွၫ စယိၫစံ အၫအမုနံၩလဖၪ လၧအကဲၪစဎွၩလဆံၫၥၧၫ့နံၪ့လနံၪ့",
			"3": "<sup>3</sup> အဖၧၩ့နီၪလီၫ.- တၭဘၪဆ့ လၧယုဒၫအစဎွၩယိၫစံ အၫအဖိၪခွၫစယဟီအကံၫ့အမုနံၩလဖၪထီၩ့လၩ့လၧ ယုဒၫအစဎွၩ ယိၫစံအၫအဖိၪခွၫစဇ့ၭဒကဲအၫ အနံၪ့ လဆံၫလနံၪ့ထီၩ့လၩ့လၧဆၧဆိၬထၪ့ခွံၬ အၪ့မၧၫ့ဎီးၦ ယရုစလံၫ့ဖိၪလၧလၩယဲဘံၪ့လဘံၪ့အဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"5": "<sup>5</sup> စံၭဝ့ၫဒၪ,- လၧယလချႃၭမၩကဲၪထၪ့ဒံၭဘၪနၧၩလၧ ဆၧဂူၭဖိၫ့ဖၧၩ့နီၪ, ယၥ့ၪယၫနၧၩ,ဒဲနလချႃၭဂဲၫထၪ့ခွံၬ ဒံၭဘၪလၧဆၧဒၧၩ့လးဖၧၩ့နီၪ, ယအီၪက့ၪဆံၫ့ဎံၪနၧၩ လၧမီၪလဂၩလၧၦဆၨၩလဖၪအဂးလီၫ.",
			"6": "<sup>6</sup> တၭယစံၭ,အၩလါ,ကဆါယဟိဝၩဧ့း ယချဲၩ့ဆၧ",
			"7": "<sup>7</sup> ၥ့ၪအ့ၬ,အဂဲးဘဲၫယီၩယမွဲဖိၪၥၪဒံၭလီၫ.- အ့ၪမွဲယဟိ ဝၩစံၭယၧၩ, ယမွဲဖိၪၥၪဒံၭနီၪ,ထီးစံၭလဂ့ၩ. အဂဲး ဘဲၫယီၩနမိဘၪလ့ၩလၧကယဲၦလၧယအၪ့မၧၫ့လၩ့န့ နၧၩအအီၪတၭ, နမိဘၪလီၩကယဲဆၧလၧယမၪလူၬ",
			"8": "<sup>8</sup> နၧၩကိၭအမံၩ့ဒ့ၭလီၫ.- ထီးၥၭမဲၪ အဝ့ၫၥံၪ အမ့ၬလ ဂ့ၩ,အဂဲးဘဲၫယီၩယအီၪလၧနၥိၭ ဘဲၫၥိၭယမိမၩဖီၩ့",
			"9": "<sup>9</sup> ဖျ့ၭနၧၩးယဟိဝၩစံၭဝ့ၫဒၪ.- ထီးနီၪလဖၧၫ့ယဟိဝၩ ယူၬထၪ့အစူၪ,ထိၭဘၪယနိၭလီၫ. တၭယဟိဝၩစံၭ ယၧၩ,ယိခွါ,ယအီၪက့ၪယူၭယဆၧချဲၩ့ လၧနနိၭဖၧၩ့",
			"10": "<sup>10</sup> ယူၭ.- ယိခွါ,ဆၧလၧမုဆၫလနံၩယီၩ, ယအီၪက့ၪ လၩ့နၧၩလၧၦဆၨၩလဖၪအဖၫ့ခိၪ, ဒဲလၧဘၩ့မုးလဖၪ အဖၫ့ခိၪ, ဘဲၫၥိၭနမိထ့ၭထၪ့ခွံၬဆၧ, ဒဲမၩလၩ့ဎီးဆၧ, ဒဲမၩဂၭဂီၩ့ဆၧ, ဒဲရိလၩ့ခွံၬဆၧ, ဘဲၫၥိၭနမိမၩထၪ့ ထဲၩ့ဆၧ,ဒဲၥုၪ့လၩ့ဖျၭလၩ့ဆၧလီၫ.",
			"11": "<sup>11</sup> လၧနီၪအမ့ၬယၫယဟိဝၩ အလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ,စယ့ၫရမဲအၫဧ့,မွဲနဒၪဘၪဆၧနီၪလဲၪ. တၭ",
			"12": "<sup>12</sup> ယစံၭ,ယဒၪဘၪၥံၪ့ၡၩကၭထံၭအထဲၩ့လီၫ.- ထီးနီၪ လဖၧၫ့ယဟိဝၩစံၭယၧၩ, နဒၪဆၧဘၪယူၭ, အဂဲးဘဲၫ ယီၩယမိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယလူချဲၫ့ချဲၫ့လီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩနံၫဖၧၫ့လဖၧၫ့တၭ,စံၭ ဝ့ၫဒၪ,မွဲနဒၪဘၪဆၧနီၪလမံၩ့လဲၪ. တၭယစံၭ, ယဒၪ ဘၪဖၧၩ့လၬထၪ့တၭ, အမ့ၬအီၪတီၩလၧမုဖၩလခီၫ",
			"14": "<sup>14</sup> လီၫ.- ထီးနီၪလဖၧၫ့ယဟိဝၩစံၭယၧၩ, ဆၧအၧၩ့လၧ အမိဘၪၦၡၩထံၫဖိၪခးဖိၪထီးအလူၬနီၪ မိဂဲၫလၧမုဖၩ လခီၫနီၪလီၫ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩ,ယိခွါ, ယမိကိၭန့ဘၩ့ၥံၪမုးၥံၪလၧ မုဖၩအၡၩဂံၪ့ဒီၪ့ ထီးအလူၬနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪး အဝ့ၫၥံၪမိဂဲၫဝ့ၫ, မိအီၪက့ၪလဂၩလၧအလးဆီၩ့ဆီဒၪ ဝ့ၫ,လဂၩလၧအလးဆီၩ့ဆီဒၪဝ့ၫ, ထီးဆၧလ့ၩနုၬလၧ ယရုစလံၫ့အတရၫ့ဖၧၩ့, ဒဲလၧအထၫ့ဒၩအခိၪဒၧၩ့ဝၬ",
			"16": "<sup>16</sup> ဖီၩ့ဝ့ၫ,ဒဲထၫ့ဒၩယုဒၫအဒိၩ့ထီးအလူၬလီၫ.- ယမိစ့ၩ ရၫ့အခွး, ဒဲစ့ၩရၫ့စၪအဝ့ၫၥံၪ လၧအဆၧအၧၩ့ထီးအ လူၬအကၠီၩ့, လၧအစဲၪ့ဒၪယၧၩ,ဒဲဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧယွၩအဂူၫဂၩလဖၪအဂး, ဒဲဘိၪ့ထၪ့ဘၩထၪ့ဆၧ",
			"17": "<sup>17</sup> လၧအဝ့ၫၥံၪအစူၪဒၪဝ့ၫတဲၩ့န့အကၠီၩ့နီၪလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, နဝ့ၫဒၪယီၩခဲးထူၬနယးဒံၩ့,ဂဲထုၪ့တၭ, စံၭအဝ့ၫၥံၪလၧကယဲဆၧလၧယမၪလူၬနၧၩကိၭအမံၩ့ ဒ့ၭဆံၭ. ထီးၥၭမဲၪအဝ့ၫၥံၪအမ့ၬလဂ့ၩ. ဘၪလဘၪ ယမိမၩမဲဘၪခိၬနမ့ၬ လၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ, ယိခွါ, ယဝ့ၫဒၪယီၩ, လၧမုဆၫလနံၩ ယီၩယအီၪက့ၪနၧၩ လၧဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖျိၪ့, ဒဲထုၪ့ထၭလကုၭ, ဒဲအဒီၪ့ၥံၪထီးဘၩ့ထၫ့ဒၩခးထၧၫ့ ဘံၪ့ယၫ, ဒဲထၫ့ဒၩယုဒၫအစဎွၩ, ဒဲထၫ့ဒၩအၦဒိၪဖၭ ဒိၪလဖၪ,ထၫ့ဒၩအၡၩလုဆၧလဖၪ, ဒဲထၫ့ဒၩထံၫၥံၪ",
			"19": "<sup>19</sup> ခးၥံၪအၡၩခမျၧးလီၫ.- တၭအဝ့ၫၥံၪမိဒုၭဆၧထၫ့ဒုၪ ဒၩနၧၩ,အ့ၪမွဲအဝ့ၫၥံၪမိမၩစၪဘၪနၧၩအ့ၬ. အဂဲးဘဲၫ ယီၩယအီၪလၧနၥိၭဘဲၫၥိၭယမိမၩဖီၩ့ဖျ့ၭနၧၩ, ယဟိ ဝၩစံၭဝ့ၫဒၪ."
		},
		"2": {
			"1": "<sup>1</sup> မၩဒီၭလဖၧၫ့ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ, လ့ၩထၪ့တၭ, ကိၭထၪ့လၧယရုစလံၫ့အနါ",
			"2": "<sup>2</sup> ဖၧၩ့ဘီၪ,စံၭ,- ယဟိဝၩစံၭဘဲၫယီၩ, ယနၪ့ထၪ့ထဲၩ့ နၥၭဘၪ့အဂ့ၩအဘွၩလၧနဂး, ဆၧဖျၫ့လိၬနၧၩအဆၧ အဲၪ,ထီးနဖိၬယခဲၫ့လၧၡါမုနၧၫ့ဖၫ လၧခးလဘံၪ့အ",
			"3": "<sup>3</sup> ဖၧၩ့ထီးဆၧချံၫလဎွံၪဘၪအၥၭလၧအဖၧၩ့လီၫ.- အံၫ စရ့လၭမွဲဆၧဆံၫ့ဎံၪလၧယဟိဝၩအဂး, အဆၧအၪ ထၪ့အၥၪဆိၫလီၫ. ကယဲၦလၧအအၪ့ဝ့ၫထီးအလူၬနီၪ ဘၪဆၧဒဲၩဘၭလီၫ. ဆၧအၧၩ့မိဘၪအဝ့ၫၥံၪနီၪ, ယ",
			"4": "<sup>4</sup> ဟိဝၩစံၭဝ့ၫဒၪ,- စယၫကူၭအၡၩဂံၪ့ဖိၪ, ဒဲအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪအဒီၪ့ထီးအလူၬၥံၪဧ့, ခိၭနၪယဟိဝၩအ",
			"5": "<sup>5</sup> လူဆံၭ.- ယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၫၥိၭနၥံၪအဖါၥံၪမိ လ့ၩဆၧယဲၩ့လၧယၧၩတၭ, ဖိၬဆၧပျီၩပျီၩအခဲၫ့, ဒဲ ကဲၪထၪ့ဆၧပျီၩပျီၩအကၠီၩ့နီၪတၭ, မွဲအဒၪဘၪဆၧလ",
			"6": "<sup>6</sup> တီၩဘၪနီၪလၧယဖၧၩ့လမံၩ့လဲၪ.- ယဟိဝၩလၧအဒုၭ ဂဲၫထၪ့ခွံၬပၧၩ လၧခးအံဇံၭအဖၧၩ့လၧအၥိၫ့ပၧၩလၧ ၡါမုနၧၫ့ဖၫ, ခးလၧဆၧလမဲၪထၪ့ဘၪလၧအဖၧၩ့တၭ, အီၪလၧဆၧဖၧၩ့လဖၪ, ခးလၧထံၫလအီၪဘၪတၭ,အီၪ လၧဆၧၥံၫအလၩၡုၪ, ခးလၧၦၡၩလခၫ့ဂၬဘၪ ဒဲထီး ၦၡၩလအီၪဘၪနးဂၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪတၭ, အ",
			"7": "<sup>7</sup> ဝ့ၫၥံၪအၪ့စၪ့ဘၪအ့ၬ.- တၭယဒုၭဂဲၫနၥံၪလၧခးအီၪ ဝ့ၫလၧဆၧၥၪအလးလဖၪ, ဘဲၫၥိၭနၥံၪမိအၪ့အဆၧၥၪ ဒဲအဆၧဂ့ၩလီၫ. အ့ၪမွဲထီးနၥံၪဂဲၫနုၬတၭ, နၥံၪမၩ ဘၪၥၭလိၪယခးတၭ, ဒုၭကဲၪထၪ့ယဆၧန့ၥၫနီၪလၧ",
			"8": "<sup>8</sup> ဆၧၥၭလိၪအလးလီၫ.- ယဟိဝၩအီၪခီၫခီၫလဲၪနီၪ, ၦ လုဆၧလဖၪစံၭဝ့ၫဆ့အ့ၬ. တၭၦလၧအၥီၪ့လိၪယဆၧ ၥီၪ့ဆၧၥၫ့နီၪၥ့ၪယၫယၧၩအ့ၬ. တၭၦအခိၪနီၪမၩမၪ ဘၪယၧၩ,ဒဲမီၪၥံၪချဲၩ့ဆၧလၧမီၪအချိၬလၧဘၫအလၭ အလူဒဲဖိၬဆၧလၧအလန့ကၩဘၪဆၧအခဲၫ့လီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမိဂဲးလိၬတ့ၭလိၬဒံၭလၧန ၥံၪ,ယဟိဝၩစံၭဝ့ၫဒၪး တၭယမိဂဲးလိၬတ့ၭလိၬ နၥံၪ",
			"10": "<sup>10</sup> အဖိၪနၥံၪ အလံၩအဖိၪအလံၩလီၫ.- အဂဲးဘဲၫယီၩ လ့ၩထီၩ့ လၧဆံၭထံၫ့အကျိၩ့လဖၪတၭ, ယိဆံၭ. တၭ အၪ့မၧၫ့ လၩ့ဆၧလၧကံဒၧၫတၭ, ဆီၫ့မီၪ့ထံၫ ထံၫ ဆၭဆၭတၭ, ဆၧဘဲၫနီၪမွဲအအီၪလအီၪဘၪလဲၪ",
			"11": "<sup>11</sup> နီၪ,ယိခွါဘီၪ.- ၦလဆၨၩအၪ့လဲၩအယွၩၥံၪ လၧ အလမွဲဘၪအယွၩဒၪ ဝ့ၫဆ့ဧၪ. အ့ၪမွဲယၡၩခမျၧး အၪ့လဲၩအလၩအဖၩ့ လၧဆၧလန့ကၩဘၪ ဆၧအဂး",
			"12": "<sup>12</sup> လီၫ.- မူၭခိၪဧ့, အီၪက့ၪ ထီၫမံၫထီၫမၪနၥံၪအၥၭ လၧဆၧနီၪအကၠီၩ့ဆံၭ. ၥၭမဲၪၥၭဖျဲၩ့နၭနၭဆံၭ. ဒဲ",
			"13": "<sup>13</sup> အီၪယူတၡါနၥံၪဝ့ၫဆံၭ, ယဟိဝၩစံၭဝ့ၫဒၪ.- အ ဂဲးဘဲၫယီၩယၡၩခမျၧးမၩဆၧ အၧၩ့နံၫမံၩ့, ယဝ့ၫဒၪ ထံၫမၧၫ့အထံၫထၪ့ဖျိၭနီၪ, အဝ့ၫ ၥံၪစဲၪ့ဒၪခွံၬဝ့ၫ, ဒဲခုၪ့ န့ကမၫလဖၪလၧအဂးဒၪဝ့ၫ, ကမၫဂၭဂီၩ့လၧထံၫ အီၪခၧၫ့လၧအဖၧၩ့လၥ့ၪဘၪလီၫ.",
			"14": "<sup>14</sup> အံၫစရ့လၭမွဲဆၧအဎီးအၡၩဧၪ. မွဲအအီၪဖျဲၪလၧဂံၪ့ ဖၧၩ့ဆ့ဧၪ.မွဲဘၪနီၫလၧအကဲၪဘၪ ဆၧအၪ့ဂူၬန့ဝ့ၫ",
			"15": "<sup>15</sup> နီၪလဲၪ.- ဆၬလၥၧၫ့ဖိၪယုၩ့ဆၧလၧအလီၩ့တၭ, ထုၭ ထၪ့အလူနီၪ အဝ့ၫၥံၪဒုၭအီၪယူအထံၫအခးလီၫ. အဒိၩ့အထၫ့လဖၪနီၪ မ့ၪအၪ့ခွံၬယူၭဝ့ၫယူၭ. ၦအီၪဝ့ၫ",
			"16": "<sup>16</sup> လၧအဖၧၩ့နးဂၩအ့ၬ.- ၦနီဖၭဖိၪဆ့ ဒဲၦတဟၭဖနံၭ",
			"17": "<sup>17</sup> ဖိၪဒုၭအၪ့လူၬခွံၬ နခိၪဒၧၩ့ယူၭ.- လၧအၥိၫ့နၧၩလၧ ဖၧၩ့ၥၭနီၪ, မွဲလၧနစဲၪ့ဒၪ ယဟိဝၩနယွၩအကၠီၩ့တၭ",
			"18": "<sup>18</sup> နမၩလၩ့နၥၭလၧဆၧနီၪလမံၩ့မွဲအ့ၬဧၪ.- တၭဘိၩ့နဲၪ့ ယီၩ,ဆၧဘၪဆဲၫ့လၧနၧၩ လၧအံဇံၭ အဖၧၩ့ၥၭဖၧၩ့ ဘဲၫၥိၭနမိအီၩ အံဇံၭအထံၫမိၡါအထံၫနီၪ, မွဲဆၧနီၪ လမံၩ့လဲၪ. မွဲဆၧဘၪဆဲၫ့လၧနၧၩနီၪ လၧအစံရအၫ အဖၧၩ့ၥၭဖၧၩ့ဘဲၫၥိၭနမိအီၩထံၫမိၡါအထံၫနီၪ, မွဲဆၧ",
			"19": "<sup>19</sup> နီၪလမံၩ့လဲၪ.- နဆၧအၧၩ့ဒၪနဝ့ၫမိအၪ့ၥီၪ့နၧၩ, ဒဲနမၩ မၪဆၧနီၪ, မိမၩၡၪ့မၩနၭနၧၩလီၫ. မၩအၥၭဘဲၫနီၪ တၭၥ့ၪယၫ,ယိထံၫဆၧလၧနစဲၪ့ဒၪယဟိဝၩနယွၩ,ဒဲ ဆၧၥၭမဲၪယွၩလအီၪဘၪလၧနဖၧၩ့နီၪ, မွဲဆၧအၧၩ့ဒဲ ဆၧကၪဆၧဂဲၩနီၪဘီၪ. ယဟိဝၩဆၧၥုၭမုခမျၧးအက ဆါစံၭဝ့ၫဒၪ.",
			"20": "<sup>20</sup> မွဲမၬ, လၧဖျိၩ့ယမၩခါနနိၪယိၭဘီၩ့, ဒဲမၩထ့ၬဖျံၩ ဆၧစၧၩ့ထၬနၧၩတၭ, နစံၭ, ယမိမၩမၪဆၧအ့ၬ.မွဲလါ နၫ့လၧဆၧစီၩ့ခိၪထီၫ ကိၭစီၪ့ဒ့ၭအလီၩ့, ဒဲလၧၥံၪ့ၥံၫ့ ဆ့ၬကိၭထုၪ့ဒ့ၭအဖၫ့လၬနီၪ, နမံၫနၩ့ယူၭ, ဒဲမၩဆၧ",
			"21": "<sup>21</sup> လဲးဆၧဘျၪယူၭလီၫ.- တၭယဝ့ၫဒၪယီၩယၥုၪ့လၩ့ နၧၩလၧစဘံၭမုဂ့ၩဂ့ၩလ့ၬ, ဆၧအချံၫအၥၪတၡါထၧၫ့ ဖျိၪ့ယၫတၭ, နအၪ့လဲၩလိၬနၥၭလၧစဘံၭမုအထဲၩ့လၧ",
			"22": "<sup>22</sup> အအၧၩ့လၩ့ဒၪဝ့ၫလၧယမ့ၬယၫနီၪ,မွဲဘၪလဲၪ.- အဂဲး ဘဲၫယီၩနအ့ၪၥူၫဝၭဆံၫ့နၥၭလၧဂၪ့ခိၪဆၭပၠၫ, ဒဲမၩ န့ဆၭပၠၫလၧအအၪလါနၫ့တၭ, နဆၧအၧၩ့ကွ့ၭအၥၭ",
			"23": "<sup>23</sup> လၧယမ့ၬယၫ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- ယဘၪၥၭ လိၪအ့ၬ, ယဖိၬဘၫအလၭလဖၪအခဲၫ့အ့ၬ. နမိစံၭဘဲၫ ၥ့ၪလဲၪ. ယိနဖၧၩ့ၥၭလၧခိၪလီၩ့ဆူၭဖၧၩ့, ၥ့ၪယၫဆၧ လၧနမၩဆၧဘီၪ. နမွဲကလအူၭဖိၪဖိၬဘၪအဖၧၩ့ၥၭ",
			"24": "<sup>24</sup> ဒၪဝ့ၫး- ကၥ့ၪယီၩ့မံၩ့ လၧအၥ့ၪယၫၡါမုနၧၫ့ဖၫနီၪ, ထီးဒၪအၥၭၥွံၭထၪ့လံၩလီၫ. ထီးအဆၧၫ့အထီဘၪ နီၪ,မွဲပလၫဘိၭကၠၪခွံၬအဝ့ၫမိၥ့ၪလဂၩလဲၪ. ၦလၧအ အၪ့ဎၬအဝ့ၫမၩပွံၭအၥၭနးဂၩအ့ၬ. အလၩအ့ၪဘၪ",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪမိဒၪန့အဝ့ၫလီၫ.- နလၥိၭဘၪခၪ့ဖံၭနီၪ ထီးအီၪလဂ့ၩး ဒဲထီးဒုၭဎဲၫ့ထၬနခိၬဖၧၩ့လၧဆၧၥူၫ အီၩထံၫအကၠီၩ့လဂ့ၩး အ့ၪမွဲနစံၭ,ယိလါဆၧအလး အီၪအ့ၬးလအီၪဘၪနီၪ, အဂဲးဘဲၫယီၩ ယအဲၪယူၭ ၦၡၩဂူၫဂၩတၭ, ယမိဖိၬအဝ့ၫၥံၪအခဲၫ့လီၫ.",
			"26": "<sup>26</sup> ဘဲၫၦအၪ့ဂူၪအၪ့ဘျၪဆၧလဂၩ ထီးၦၡၩဒၪန့အဝ့ၫ တၭ,အီၪက့ၪမဲအမ့ၬအၥိၭနီၪ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အမ့ၬမဲဘဲၫနီၪအၥိၭး အဝ့ၫၥံၪနီၪအစဎွၩလဖၪ,အၦ ဒိၪဖၭဒိၪလဖၪ, ဒဲအၡၩလုဆၧလဖၪ,အမီၪၥံၪလဖၪနီၪ",
			"27": "<sup>27</sup> လီၫ.- အဝ့ၫၥံၪစံၭ,ၥံၪ့လကုၭဧ့, နဝ့ၫဒၪနမွဲယဖါလီၫ. တၭစံၭလိးလဖျိၪ့ဧ့,နဆီၫ့အီၪန့ယၧၩလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪကၠၪဒိၭချိၫ့အၥၭလၧယၧၩ, မွဲလၧအမ့ၬ အ့ၬ.မွဲလါနၫ့တၭ,လၧအဆၧအၧၩ့အထီနီၪမိစံၭဝ့ၫ,",
			"28": "<sup>28</sup> ဂဲထုၪ့တၭထိးထဲၩ့တၩ့ထဲၩ့ပၧၩဆံၭ.- တၭနယွၩလ ဖၪလၧနတဲၩ့န့လၧနဂးဒၪနဝ့ၫနီၪ, မွဲအအီၪခီၫခီၫလဲၪ. လၧဆၧအၧၩ့အထီနီၪမၩဖီၩ့မၩဖျ့ၭနၧၩအ့ၪၥ့ၪတၭ, မွဲ အဂဲထုၪ့ဆံၭ. အဂဲးဘဲၫယီၩနယွၩအၪဎွ့ၩၥိၭလၧန",
			"29": "<sup>29</sup> ဒိၩ့လဖၪနီၪ, ယုဒၫဧ့,- နမိချဲၩ့ခွးလၧယၧၩမွဲဘၪလဲၪ. နၥံၪမၩမၪဘၪယူၭယၧၩကိၭဂၩဒ့ၭယူၭ, ယဟိဝၩစံၭ",
			"30": "<sup>30</sup> ဝ့ၫဒၪ.- ယထးယူၭနၥံၪအဖိၪပျီၩပျီၩယူၭး အဝ့ၫၥံၪ ဒိၭန့ဆၧအၪ့ၥီၪ့ဝ့ၫအ့ၬ. နၥံၪအနၭဒၪနၥံၪဝ့ၫအၪ့ခွံၬန ၥံၪအမီၪလဖၪဘဲၫဆၬလၥၧၫ့ မၩဂၭဂီၩ့ဆၧအၥိၭနီၪ လီၫ.",
			"31": "<sup>31</sup> ၦလဆိၩယီၩၥံၪဧ့, ယိထံၫယိဆၭယဟိဝၩအလူ ဆံၭ. မွဲယကဲၪထၪ့ယူၭၡါမုနၧၫ့ဖၫလၧအံၫစရ့လၭအ ဂးနီၪဆ့ဧၪ. ဒဲဆၧခံၭအခးဆ့ဧၪ. ပစဲၪ့ဒၪဆၧတၭ, ပ ဂဲၫထဲၩ့လၧၩ့ လၧနအီၪအ့ၬ, မွဲဘၪနီၫယၡၩခမျၧးစံၭ",
			"32": "<sup>32</sup> ဘဲၫနီၪလဲၪ.- ၦမုၪနၩ့မိၥၭနၪ့အကယၧၩ့ကယီၫ,ဒဲတ လၭမူၭမုၪအခၧၩ့ယးနီၪဆ့ဧၪ. မွဲလါနၫ့တၭယၡၩခ မျၧးၥၭနၪ့ယူၭယၧၩ မုနံၩလၧပဝံထၪ့နၬထၪ့လၥ့ၪဘၪ",
			"33": "<sup>33</sup> ယူၭလီၫ.- နမၩဂ့ၩထၪ့နဖၧၩ့ၥၭဘဲၫၥိၭနမိအၪ့ဎၬဆၧ အဲၪနီၪ,မွဲဘၪလဲၪ. မၩအၥၭဘဲၫနီၪတၭ, နၥီၪ့လိၪၦ",
			"34": "<sup>34</sup> အၧၩ့လၧနဖၧၩ့ၥၭလီၫ.- တၭၦၡၪ့ဖိၪလၧအဆၧဒဲၩ ဘၭလအီၪဘၪလဖၪ အဆၧမၧၫ့အၥွံၪနီၪ ဘုၭထၬဝ့ၫ လၧနဆၧကီၩ့ဆၧၥိၭလီၫ. ယအၪ့ဎၬၥူၪဝ့ၫ လဒၪဘၪ နီၪ,အဂဲးဘဲၫယီၩ,အီၪဝ့ၫလၧၦထီးအလူၬနီၪအလီၩ့",
			"35": "<sup>35</sup> လီၫ.- မွဲလါနၫ့ဘိၩ,နစံၭ,မွဲယဆၧဒဲၩဘၭလအီၪတၭ, အၥၭထၪ့မိကၠၪအၥၭ လၧယအီၪတၡါလ့ၬလီၫ. ယိ ခွါ,ယမိချဲၩ့ခွးလၧနၧၩ လၧနစံၭယဆၧဒဲၩဘၭလအီၪ",
			"36": "<sup>36</sup> ဘၪနီၪအကၠီၩ့လီၫ.- နစဲၪ့ဝံၩ့ဝၩ့ဆၧလၧအအၪဘဲၫၥိၭ နမိအၪ့လဲၩနဖၧၩ့ၥၭနီၪမွဲဘၪလဲၪ. နမ့ၬမိမဲဆ့လၧခး အံဇံၭအကၠီၩ့ ဘဲၫနမ့ၬမဲလၧအစံရအၫ အကၠီၩ့အၥိၭ",
			"37": "<sup>37</sup> နီၪလီၫ.- မွဲမၬ,နမိစဲၪ့ထၪ့ဆ့လၧအဖၧၩ့အီၪဒဲနစူၪလၧ နခိၪအလီၩ့လီၫ. အဂဲးဘဲၫယီၩယဟိဝၩ ခွံၬၡိၭဆၧ လၧနဒိၭနဲၩ့နၥၭ လၧအဝ့ၫၥံၪတၭ, နဘီၪထၪ့ယီၫထၪ့ လၧအဖၧၩ့အ့ၬ."
		},
		"3": {
			"1": "<sup>1</sup> အဝ့ၫၥံၪစံၭၦၡၩအ့ၪခွံၬၡိၭအမၫတၭ, အဝ့ၫဒၪစဲၪ့ ထၪ့ခွံၬဝ့ၫကဲၪထၪ့ၦခွၫအဂူၫဂၩအမၫနီၪ, အဝၩမိထဲၩ့ ကဒၩထဲၩ့ လၧအအီၪဆ့ဧၪ. ဆၧလၧခးလဘံၪ့နီၪ မိ ဘၪဆၧမၩစံၪစၪဖၭဒိၪမွဲအ့ၬဧၪ. မွဲလါနၫ့တၭ, နမၩ မၪဆၧလၧၦလၧနအဲၪဝ့ၫအၪဂၩတၭ, နမိဂဲၫထဲၩ့ထဲၩ့",
			"2": "<sup>2</sup> လၧယအီၪဆ့ဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- စၪ့ထၪ့နမ့ၬၥၪ လၧဆၧအလးထၪ့ထီၫတၭ, ယိဆၧအလးထီးၦၡၩလ မံၫဘၪဒဲနၧၩနီၪဆံၭ. နဆၧၫ့နၩ့အီၪခိၭၦၡၩလၧအဖၧၩ့ ၥၭအနဲၩ့ထံၭဘဲၫၦအရ့ဘၠၫဖိၪ လၧၡါမုနၧၫ့ဖၫနီၪတၭ, နမၩဘၪၥၭလိၪထံၫၥံၪခးၥံၪ လၧနမၩဆၧလဲးဆၧဘျၪ,",
			"3": "<sup>3</sup> ဒဲနဆၧအၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧပဒၩ့ဆၧ ဆၧၩ့,ဒဲဆၧဂဲၫဆၧၩ့လၧခဲၫ့အထီနီၪအီၪဆ့အ့ၬး တၭ နအီၪလၧၦမဲၩဎွဲၩမုၪအမ့ၬထုးခိၪ, နအီၪက့ၪမ့ၬမဲနၥၭ",
			"4": "<sup>4</sup> အ့ၬ.- ထီးယီၩစူၩယၫနမိကိၭထၪ့ယၧၩ, ယဖါဧ့,နမွဲ",
			"5": "<sup>5</sup> ၦလၧအၥိၫ့ယၧၩလၧယၥၭဘၪ့နီၪ,မွဲအ့ၬဧၪ.- ယိခွါ, နမိချဲၩ့ဆၧလါနၫ့တၭ, နမၩဆၧအၧၩ့ထီးနမၩၥ့ၪလီၫ.",
			"6": "<sup>6</sup> လၧစဎွၩယိၫစံအၫအမုနံၩလဖၪနီၪ, ယဟိဝၩစံၭ ယၧၩအံၫစရ့လၭလၧအၥၭဂၭဂီၩ့နီၪ, မွဲအမၩဝ့ၫဘဲၫ ၥ့ၪလဲၪ,ဘဲၫၥ့ၪလဲၪနီၪ,နဒၪဘၪယူၭဧၪ. မွဲအလ့ၩထၪ့ လၧကယဲခိၪလီၩ့ထီၫအလီၩ့, ဒဲလၧကယဲၥံၪ့ၥံၫ့ဆ့ၬအ",
			"7": "<sup>7</sup> ဖၫ့လၬတၭ,မၩဆၧလဲးဆၧဘျၪထီးနီၪလီၫ.- တၭမွဲအ မၩဝ့ၫဘဲၫနီၪအလးခဲၫ့တၭ, ယစံၭ, ဂဲၫထဲၩ့ထဲၩ့လၧယ အီၪဆံၭ. မွဲလါနၫ့တၭ,ဂဲၫထဲၩ့ဝ့ၫအ့ၬ.တၭအထၧၫ့ဖု",
			"8": "<sup>8</sup> ဝဲမုၪယုဒၫလၧအလူလတီၩဘၪနီၪဒၪဘၪဝ့ၫလီၫ.- တၭ ထီးယခွံၬၡိၭအံၫစရ့လၭ လၧအၥၭဂၭဂီၩ့အကၠီၩ့ တၭ,ဖ့ၫလၫ့အဝ့ၫလၧလံၬလၩ့ၡၪလဘံၪ့, လၧအအဲၪ ဘိၩ့အဝၩအဂဲးထီးအလူၬအကၠီၩ့တၭ, ယဒၪဘၪလၧ အထၧၫ့ဖုဝဲမုၪယုဒၫလၧအလူလတီၩဘၪနီၪ ၥၭမဲၪဆၧ အ့ၬ. အ့ၪမွဲအလ့ၩမၩဆၧလဲးဆၧဘျၪလခီၫဆ့လီၫ.",
			"9": "<sup>9</sup> ဆၧမၩအၥၭ လၧအမၩဆၧလဲးဆၧဘျၪနီၪဂၧၫ့ထၪ့ၥၩ လၩ့တၭ,မၩဘၪၥၭလိၪခးထၧၫ့ဘံၪ့ယၫ, ဒဲအဲၪဘိၩ့",
			"10": "<sup>10</sup> ဝၩလၧလိးၥံၪလဲၫ့ၥံၪ, ဒဲၥံၪ့ၥံၪဝၪၥံၪနီၪလီၫ.- တၧလၧ ဆၧထီးအလူၬအကၠီၩ့နီၪ အထၧၫ့ဖုဝဲမုၪယုဒၫလၧအ လူလတီၩဘၪနီၪ ဂဲၫထဲၩ့ထဲၩ့လၧယအီၪလၧအၥၭ ထၧၫ့ဖျိၪ့ယၫအ့ၬ, အ့ၪမွဲကျဲၩ့မၩဝ့ၫနီၪ ယဟိဝၩ စံၭ ဝ့ၫဒၪ.",
			"11": "<sup>11</sup> တၭယဟိဝၩစံၭယၧၩ, အံၫစရ့လၭလၧအၥၭဂၭဂီၩ့ နီၪအီၪက့ၪအၥၭဒၪဝ့ၫတီၩနဲၪ့လီၩ့နဲၪ့ ယုဒၫလၧအလူ",
			"12": "<sup>12</sup> လတီၩဘၪဒံၭလီၫ.- လ့ၩကိၭထၪ့ဆၧချဲၩ့ယီၩ လၧမု ဖၩတၭ,စံၭ, အံၫစရ့လၭလၧအၥၭဂၭဂီၩ့ဧ့း ဂဲၫထဲၩ့ ထဲၩ့ဘီၪးယၥၭထၪ့နီၪ, မွဲယဒုၭလၩ့ဘၪလၧနၥံၪအ လီၩ့အ့ၬ. ယဟိဝၩစံၭဝ့ၫဒၪ. အဂဲးဘဲၫယီၩယအီၪ လၧဆၧအခိးအတၩတၭ, ယၥၭထၪ့ အဆိၩအကၠၪ",
			"13": "<sup>13</sup> အ့ၬးယဟိဝၩစံၭဝ့ၫဒၪ.- မွဲလါနၫ့ဘိၩလီၩလၩ့နဆၧ ဒဲၩဘၭအၪ့ကံၩ့လၩ့နၥၭ လၧနမၩမၪဘၪယူၭယဟိဝၩ နယွၩဒဲလၧနစဲၪ့ဝံၩ့ဝၩ့ဆၧလၧဂူၫဂၩအအီၪလၧကယဲ ၥံၪ့ၥံၫ့ဆ့ၬအဖၫ့လၬ, ဒဲလၧနၥံၪလခိၭနၪဘၪယလူနီၪ",
			"14": "<sup>14</sup> ဆံၭ.ယဟိဝၩစံၭဝ့ၫဒၪ.- ဖိၪၥံၪလံၩၥံၪလၧအၥၭဂၭ ဂီၩ့ၥံၪဧ့,ဂဲၫထဲၩ့ထဲၩ့ဘီၪ. ယခွံၬၡိၭခွံၬ လါနၫ့နၥံၪ တၭယမိထိးဆၧၫ့ထဲၩ့ဒီၭ, ယဟိဝၩစံၭဝ့ၫဒၪ. လဂၩ လၧလဒိၩ့လဂၩလၧလဒိၩ့အဖၧၩ့, ဒဲနံၫဂၩလၧလဂံၪ့ ဒီၪ့နံၫဂၩလၧလဂံၪ့ဒီၪ့အကျၩ, ဒဲယမိဒုၭဂဲၫနၥံၪလၧ",
			"15": "<sup>15</sup> ဇံအိၫ့လီၫ.- တၭယမိဖ့ၪလၫ့နၥံၪလၧၦၡၩယိဆၧလ ဖၪလၧအဘၪယၥၭ လၧအမိဒုၭအၪ့နၥံၪလၧဆၧၥ့ၪ",
			"16": "<sup>16</sup> ယၫ,ဒဲဆၧဒုၭထီးလၩ့နၥံၪအၥၭလီၫ.- တၭထီးနၥံၪ အ့ၪအၪထၪ့, ဒဲဒိၪထၪ့လဲထၪ့လၧခးဖၧၩ့တၭ, ဆၧမိ မၩအၥၭလၧမုနံၩလဖၪနီၪ ယဟိဝၩစံၭဝ့ၫဒၪ, အဝ့ၫ ၥံၪစံၭလၧၩ့ယဟိဝၩ အဆၧအုၩ့လၩ့အတလၫနီၪအ့ၬ. ဒဲဆီၫ့မီၪ့လၧၩ့ဝ့ၫလၧအဂဲးအ့ၬ, ဒဲနၪ့ထၪ့ထဲၩ့လၧၩ့ဝ့ၫ",
			"17": "<sup>17</sup> အ့ၬး ဒဲအီၪၡီၩ့လၧၩ့ဝ့ၫအ့ၬး ဒဲမၩလၧၩ့ဝ့ၫအ့ၬ.- အထီ ထီးနီၪအဝ့ၫၥံၪမိကိၭယရုစလံၫ့ လၧယဟိဝၩအလး ဆီၩ့ဆီတၭ, ၦအဆၨၩထီးအလူၬ မိအီၪကိၩ့အီၪကီၪ့ ထီးနီၪလၧယဟိဝၩအမံၩ့, လၧယရုစလံၫ့အဖၧၩ့လီၫ. တၭအဝ့ၫၥံၪလ့ၩဖိၬလၧၩ့အၥၭအၧၩ့ အနါကဲၪ့အဖၧၩ့",
			"18": "<sup>18</sup> ၥၭနီၪဆ့အ့ၬ.- ဆၧလၧမုနံၩလဖၪနီၪ, ယုဒၫအၡၩဂံၪ့ ဖိၪမိလ့ၩဎုၬ လၧအံၫစရ့လၭအဂံၪ့ဖိၪတၭ, မိဂဲၫလစီၪ့ ဎးလၧခးမုဖၩ လၧခးလၧယဖ့ၪၥၫနၥံၪအဖါ လဖၪ လီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲယစံၭ, ယမိအီၪက့ၪနၧၩလၧဖိၪၥၪအကျၩ, ဒဲဖ့ၪလၫ့နၧၩလၧအခးမုၬ, ဆၧန့ၥၫအလၩအဖၩ့လၧ ၦဆၨၩလဖၪအၥုၭမုခမျၧး အကျၩဘဲၫၥ့ၪလဲၪး တၭ ယစံၭနကိၭယၧၩ, ယဖါဧ့, တၭနမိကၠၪခွံၬနၥၭလၧ",
			"20": "<sup>20</sup> ယအီၪအ့ၬ.- မွဲမၬဘဲၫၦအမၫလၧအလူလတီၩဘၪ လၧအဝၩအၥိၭနီၪ, နၥံၪအလူလတီၩဘၪလၧယၧၩ ဘဲၫနီၪၥိၭ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယဟိဝၩစံၭ ဝ့ၫဒၪ.",
			"21": "<sup>21</sup> ဆၧအၥီၫဂၧၫ့ထၪ့လၧဆၧစီၩ့ခိၪအလီၩ့လဖၪတၭ, မွဲၦအံၫစရ့လၭဖိၪဂၪ့ဆၧ, ဒဲအၪ့ကံၩ့အၪ့ယၫဆၧလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩကဲၪ့အဖၧၩ့ၥၭ, ဒဲၥၭနၪ့ယ ဟိဝၩအဝ့ၫၥံၪအယွၩလီၫ.",
			"22": "<sup>22</sup> ဖိၪၥံၪလံၩၥံၪလၧအၥၭဂၭဂီၩ့ၥံၪဧ့, ဂဲၫထဲၩ့ထဲၩ့ဘီၪ. တၭယမိမၩဘျၪထဲၩ့နၥံၪအၥၭဂၭဂီၩ့နီၪလီၫ. ယိခွါ, ပဂဲၫလၧနအီၪလီၫ. အဂဲးဘဲၫယီၩနမွဲယဟိဝၩပယွၩ",
			"23": "<sup>23</sup> လီၫ.- မွဲမၬ, ပအၪ့ဎၬဆၧအၪလၧဆၧစီၩ့ခိၪလဖၪ,ဒဲ လၧခိၪလီၩ့ထိၩ့ချိၬနီၪပျီၩပျီၩလီၫ. မွဲမၬ, အံၫစရ့လၭ အဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪ, အီၪဝ့ၫလၧယဟိဝၩပယွၩ",
			"24": "<sup>24</sup> အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩဆၧမ့ၬမဲအလးအၪ့ခွံၬပဖါ အစူၪလးအခၪ့ခိၪ ခီၫလၧပဖိၪၥၪခွၫထၪ့လံၩလံၩ, အ",
			"25": "<sup>25</sup> ၥိၪအဘ့ၪ,ဒဲအချီ,အဖိၪခွၫၥံၪ,ဒဲအဖိၪမုၪၥံၪလီၫ.- ပမံၫ နၩ့လၧပဆၧမ့ၬမဲအဖၧၩ့တၭ, ပဆၧအၧၩ့လုၬဘံၭပၧၩ လီၫ.အဂဲးဘဲၫယီၩပမၩမၪဘၪယဟိဝၩပယွၩ, ပဝ့ၫ ဒၪဒဲပဖါခီၫလၧပဖိၪၥၪခွၫထၪ့ ထီးမုဆၫလနံၩယီၩ တၭ,ပခိၭနၪယဟိဝၩပယွၩအလူအ့ၬ."
		},
		"4": {
			"1": "<sup>1</sup> နအ့ၪဂဲၫထဲၩ့ထဲၩ့,အံၫစရ့လၭဧ့, ယဟိဝၩစံၭဝ့ၫဒၪ, ဂဲၫထဲၩ့လၧယအီၪဆံၭ. တၭနအ့ၪအီၪက့ၪခွံၬ နဆၧ ဘၪၥၭလိၪလဖၪလၧယမ့ၬယၫတၭ, နမိဂၭဝံၩ့ဝၩ့လၧၩ့",
			"2": "<sup>2</sup> အ့ၬ.- နအ့ၪဆိၪလၩ့နၥၭလၧယဟိဝၩမၧၫ့ဝ့ၫလၧဆၧ မွဲဆၧတီၩ,လၧဆၧစ့ၩရၫ့တီၩ, ဒဲလၧဆၧတီၩဆၧလီၩ့ အဖၧၩ့တၭ, ၦဆၨၩလဖၪမိဆိၪဂ့ၩလၩ့အၥၭ လၧယ ဟိဝၩအဖၧၩ့တၭ,အဝ့ၫၥံၪမိအီၪက့ၪဖိၫလိၫအၥၭလၧ အဝ့ၫဒၪအဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭယုဒၫဒဲ ယရုစလံၫ့အ ၦၡၩၥံၪဘဲၫယီၩ,ထဲၫထၪ့နၥံၪအဂၪ့ခိၪ လၧအလဘၪဘၪ ဆၧထဲၫဝ့ၫဘီၪး ထီးဎွံၪဆၧလၧဆၧဆူၪဆၧမဲၪအကျၩ",
			"4": "<sup>4</sup> လဂ့ၩ.- ကူၭတရံၭလၩ့နၥံၪအၥၭလၧယဟိဝၩအဂး တၭ,ၥုၭခွံၬ နၥံၪအၥၭအခိၪဖံၭနီၪဆံၭ, ယုဒၫအၡၩ ဒဲယရုစလံၫ့အဒိၩ့ဖိၪၥံၪဧ့း လၧနၥံၪမၩဆၧအၧၩ့အ ကၠီၩ့နီၪ,ယၥၭထၪ့မိဂဲၫဘၪခိၬဘဲၫမ့ၪအၥိၭတၭ, မိအၪ့ ဆၧထီးၦမၩလၩ့ဖံၬခွံၬၥ့ၪနးဂၩအ့ၬ.",
			"5": "<sup>5</sup> ဒုၭလီၩလၩ့လၬလၩ့ဆၧလၧယုဒၫအဖၧၩ့, ဒဲဒုၭနါ ဂၧၫ့ဆၧလၧယရုစလံၫ့အဖၧၩ့တၭ, စံၭ,အူၪခွ့ၩလၧခး ဖၧၩ့,ကိၭၡၭထၪ့တၭ, စံၭ, အီၪကိၩ့အီၪကီၪ့တၭ, လ့ၩ နုၬၡီၩ့လၧဒိၩ့လဖၪလၧအအီၪဝ့ၫ လၧအခိၪဒၧၩ့ၥံၪအ",
			"6": "<sup>6</sup> ဖၧၩ့ဘီၪ.- ဘီၩ့ထၪ့ၥုၭဖိၪအလၫ့လၧဇံအိၫ့ဘီၪ. စဲၪ့ထၪ့ ခွံၬ,အီၪထီလဂ့ၩ, အဂဲးဘဲၫယီၩယမိဒုၭဂဲၫဆၧအၧၩ့",
			"7": "<sup>7</sup> လၧမုဖၩ,ဒဲဆၧမၩဂၭဂီၩ့ဖၭဒိၪလီၫ.- ဆၬလၥၧၫ့ဂဲၫ ထၪ့လၧအဆၧၡိၬကျၩတၭ, ဆၧမၩဂၭဂီၩ့ၦဆၨၩလ ဖၪဂဲၫဝ့ၫတၭ, စဲၪ့ထၪ့ယူၭ လၧအလးနီၪဘဲၫၥိၭအမိ မၩအီၪယူနခးလီၫ. နဒိၩ့ၥံၪမိအီၪယူ ထီးၦၡၩအီၪဝ့ၫ",
			"8": "<sup>8</sup> လၧအဖၧၩ့နးဂၩအ့ၬ.- လၧဆၧယီၩအကၠီၩ့နီၪခဲးထူၬ နၥံၪအယးဒံၩ့ လၧရၧၬအဆၧယၬ, ဒဲနၥံၪအၥၭနၫၡါ နီၪ,အိၩ့ယိၩ့ထၪ့ဘီၪ. အဂဲးဘဲၫယီၩယဟိဝၩအဆၧ",
			"9": "<sup>9</sup> ၥၭထၪ့နီၪကၠၪခွံၬအၥၭလၧပအီၪအ့ၬ.- တၭဆၧမိမၩ အၥၭလၧမုလနံၩနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, စဎွၩအၥၭမိ ဂၭဂီၩ့,ဒဲၦဒိၪဖၭဒိၪလဖၪအၥၭ, ဒဲၦလုဆၧမိထီၫမံၫ ထီၫမၪ,ဒဲမီၪလဖၪမိဆီၫ့မီၪ့လၩ့လၭဆၧလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့ယစံၭ, အၩလါ, ကဆါယဟိဝၩဧ့း မွဲမၬ, နအၪ့လီၫန့ၦခမျၧးယီၩဒဲၦယရုစလံၫ့ဖိၪဒိၪမၬ လီၫ.နစံၭလါနၫ့နၥံၪမိအီၪ လၧဆၧဘၪလိၬအိၭလိၭ တၭ,နၭၥံၪဖၩ့ၥံၪနုၬဖိးလၧအၥၭလီၫ.",
			"11": "<sup>11</sup> အထီထီးနီၪဆၧမိစံၭၦခမျၧး ဒဲၦယရုစလံၫ့ဖိၪ, လံၩအူၪၥူၫထၪ့ ဂဲၫလၧဆၧစီၩ့ခိၪလဖၪလၧၡါမုနၧၫ့ဖၫတီၩ လၧယၡၩခမျၧးအဖိၪမုၪအအီၪ ဘဲၫအမိဎၬဘုၪ,ဒဲမၩ",
			"12": "<sup>12</sup> ဆံၫ့ထၪ့ဆၧအၥိၭနီၪမွဲအ့ၬ.- လံၩဆီၪ့နဲၪ့အနီၪမိဂဲၫ လၧယဂးလီၫ. ဘိၩ့နဲၪ့ယီၩယမိစ့ၩရၫ့ထၫ့ဒုၪဒၩအဝ့ၫ",
			"13": "<sup>13</sup> ၥံၪအခွးလီၫ.- ယိခွါ,မွဲအမိဂဲၫထၪ့ဘဲၫဆၧအုၪ့အၥိၭ နီၪတၭ,အလဲၪ့ၥုၭလဖၪမၩ အၥၭဘဲၫလံၩၥဝံၭအၥိၭ လီၫ.အကၥ့ၪလဖၪလ့ၩဆၧချဲၫ့နဲၪ့ လံၬကျီၫ့ကျီၫ့ၥံၪဒံၭ လီၫ.ပဝ့ၫဒၪယီၩပဘၪဆၧအၡၪ့, အဂဲးဘဲၫယီၩဆၧ",
			"14": "<sup>14</sup> မၩဂၭဂီၩ့ပၧၩလီၫ.- ယရုစလံၫ့ဧ့, ဘဲၫၥိၭနမိထီၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့နၧၩ, ၥူၫဝၭခွံၬဆၧအၧၩ့လၧနၥၭ နီၪဆံၭ.ဆၧကိၪ့ထၪ့ဖၭလၩ့ အအၧၩ့အၥၫ့နီၪ မိအီၪ",
			"15": "<sup>15</sup> လၧနဖၧၩ့ဆံၭယံၬလဲၪ.- အဂဲးဘဲၫယီၩ ဆၧအလူလီၩ လၩ့လၬလၩ့ဆၧလၧဒၫ့တၭ, ဒုၭနါဂၧၫ့ဆၧအၧၩ့လၧ",
			"16": "<sup>16</sup> ခိၪလီၩ့အံဖြံၫ့နီၪလီၫ.- ဒုၭၥ့ၪယၫ ၦဆၨၩလဖၪဘီၪ. ယိခွါ,ဒုၭနါဂၧၫ့ဆၧထၫ့ဒၩယရုစလံၫ့, ၦခိၭဆၧၥံၪဂဲၫ ဝ့ၫလၧခးယဲၩ့, ကိၭၡၭထၪ့ထၫ့ဒုၪဒၩယုဒၫအဒိၩ့လဖၪ",
			"17": "<sup>17</sup> လီၫ.- ဘဲၫၦပၧၩ့ဆံၬၥံၪနၩၥံၪအၥိၭနီၪ, ၦအီၪဝၬဖီၩ့ထၫ့ ဒုၪဒၩအဝ့ၫး အဂဲးဘဲၫယီၩမွဲအပိၩ့ထၪ့ယၧၩ,ယဟိဝၩ",
			"18": "<sup>18</sup> စံၭဝ့ၫဒၪ.- နဖၧၩ့ၥၭဒဲနမၩဆၧနီၪ မၩန့ဆၧလဖၪနီၪလၧ နဂးတၭး အနီၪမွဲနဆၧအၧၩ့ဆၧၥၫ့, မွဲဆၧမၩခိမၩဝီၩ နၭမၬ,အဂဲးဘဲၫယီၩမွဲအဖိးလၧနၥၭခံဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> ယဎွံၬဧ့ၬ ယဎွံၬဧ့ၬ ဆၧဆိၭက့ၭလၧယၥၭဖၧၩ့လီၫ. ယၥၭၥီၫထၪ့, ယအီၪလၩ့မါပံၭကဲၪအ့ၬ. အဂဲးဘဲၫ ယီၩယၥၭဧ့, နနါဂၧၫ့ခွ့ၩအၥီၫဆၧဒုၭၥုၭကိၭၡၭထၪ့",
			"20": "<sup>20</sup> လီၫ.- ဆၧကိၭထၪ့ဆၧဂၭဂီၩ့လၧဆၧဂၭဂီၩ့အဖၫ့ခိၪ နီၪလီၫ.မွဲမၬ, ခးထၧၫ့ဘံၪ့ယၫအီၪယူဝ့ၫလီၫ. ဆၧမၩ ဂၭဂီၩ့ၡုၭယတဲၩလဖၪ, ဒဲယတဲၩအကလကၫလဖၪ",
			"21": "<sup>21</sup> လီၫ.- ယမိဒၪဘၪၥုၭဖိၪအလၫ့, ယမိနါဂၧၫ့ခွ့ၩအၥီၫ",
			"22": "<sup>22</sup> နီၪဆံၭယံၬလဲၪ.- အဂဲးဘဲၫယီၩယၡၩခမျၧးမွဲယၡၩ ဂၭဂီၩ့ဖိၪ,ၥ့ၪယၫယၧၩအ့ၬ. မွဲဖိၪလၧအဂီၩ့အၥုၪ့ဆၭ အၥၭဆၭအီၪအ့ၬ. ကိၪ့ဆၧၥ့ၪ ဘဲၫၥိၭအမိမၩဆၧ အၧၩ့နီၪအ့ၪမွဲဘဲၫၥိၭ အမိမၩဆၧဂ့ၩ ၥ့ၪယၫဝ့ၫအ့ၬ.",
			"23": "<sup>23</sup> ယယိဂၪ့ခိၪတၭ, ယိခွါ,အီၪယူဒဲအီၪပျီၩတၭ,ယ",
			"24": "<sup>24</sup> ယိမူၭခိၪနီၪ,အဆၧဖၩ့အီၪအ့ၬ.- ယယိခိၪလီၩ့ထိၩ့ ချိၬတၭ,ယိခွါ,ဝၭဝ့ၫ, ဒဲဆၧစီၩ့ခိၪထီးအလူၬဝၬၡိၩ့ၡိၬ",
			"25": "<sup>25</sup> ဝ့ၫလီၫ.- ယယိဆၧတၭ,ယိခွါ, ၦၡၩအီၪအ့ၬ. ဒဲဆၧ",
			"26": "<sup>26</sup> ဖိၭဖၫ့အထိၪၥံၪလံၪၥံၪယူၩထၪ့ခွံၬယူၭ.- ယယိဆၧ တၭ,ယိခွါ, ဆၧၥၪအလးနီၪမွဲၡါမုနၧၫ့ဖၫ,ဒဲအဒိၩ့ၥံၪ ထီးအလူၬလၩ့ဎီးလၧယဟိဝၩအမ့ၬယၫလၧအၥၭခဲၩ",
			"27": "<sup>27</sup> ထၪ့အကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, ခးထၧၫ့ဘံၪ့ယၫမိအီၪယူဝ့ၫးမွဲလါနၫ့ယမၩထီးအလူၬ",
			"28": "<sup>28</sup> အ့ၬ.- မၩအၭဘဲၫနီၪတၭ,ဂၪ့ခိၪၥုၪ့အုၭၥၭအုၭ, ဒဲမူၭ ခိၪလၧထၭလခီၫမိၥၧၫ့ထၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩယမိ ချဲၩ့ထၪ့တၭ,ယနီၫ့ယါလၩ့ထဲၩ့ယၥၭအ့ၬ. ယစ့ၩရၫ့",
			"29": "<sup>29</sup> ဝဲၩယူၭတၭ, ယဂၧၩ့ထဲၩ့ယၥၭဆ့အ့ၬ.- ဒိၩ့ထၧၫ့ဒိၩ့ ယၫစဲၪ့ဖျိၭလၧကၥ့ၪၥုၭဖိၪ, ဒဲၦခၭချံၪဖိၪအၥီၫအကၠီၩ့း လ့ၩနုၬဝ့ၫလၧဆၧၡိၬတၪ့အကျၩနီၪ, ဒဲထၪ့လိးၥံၪလဲၫ့ ၥံၪလီၫ. ၦၡၩမိစဲၪ့ဒၪဒိၩ့ကိၭဒိၩ့ဒ့ၭတၭ,ၦအီၪဝ့ၫလၧ",
			"30": "<sup>30</sup> အဖၧၩ့နးဂၩအ့ၬ.- တၭနဝ့ၫဒၪနဘၪဆၧမၩဂၭဂီၩ့နၧၩ ဧ့,နမိမၩဆၧနီၪလဲၪး နအ့ၪကီၩ့ၥိၭဆၧအဝီၩလါနၫ့ တၭ,နအ့ၪကယၧၩ့ကယီၫနၥၭ လၧဆၧကယၧၩ့က ယီၫထီၫ့လါနၫ့, နအ့ၪဂုၪမၩဆွၪ့ထၪ့နမ့ၬ လၧၥံၪလါ နၫ့,နအီၪက့ၪနၥၭလၧအဎံၫအလၩပျီၩပျီၩလီၫ. ၦလၧ နအဲၪဝ့ၫလဖၪမိမၩကြၩ့ထမးနၧၩ, မိအၪ့ဎၬနၥၭမၧၫ့ လီၫ.",
			"31": "<sup>31</sup> မွဲမၬ,ယနါဂၧၫ့ၦၡၩအလူ ဘဲၫၦမုၪလၧအဂူၭဆၫအ ၥိၭနီၪ, ဆၧၡၪ့ဆၧနၭဘဲၫၦမုၪလၧအဆီၫ့အီၪအဖိၪဝဲ ၡါအၥိၭနီၪမွဲဇံအိၫ့အဖိၪမုၪအလူ,ၥၪၡိၪဝ့ၫ, ယူၬထၪ့ အစူၪတၭ,စံၭဝ့ၫ, ယဘၪၡၪ့ဖီၩၬ အဂဲးဘဲၫယီၩယၥၭ လၩ့ဘဲၩလၧၦမၩၥံၫၦၡၩအကၠီၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> စဲၪ့တလဲးဝံၩ့ဝၩ့လၧ ယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့တၭ, အၪ့ဎၬၥ့ၪယၫဒဲယိဆၧလၧအလးဖၭလဲနီၪဘီၪ. နၥံၪ အ့ၪဒၪၦၡၩလဂၩ, ၦအ့ၪအီၪလၧအမၩဆၧစ့ၩရၫ့တီၩ လၧအအၪ့ဎၬဆၧမွဲဆၧတီၩတၭ, ယမိမၩဖီၩ့ဖျ့ၭဝ့ၫ",
			"2": "<sup>2</sup> လီၫ.- တၭယဟိဝၩမၧၫ့ဝ့ၫနီၪ,အဝ့ၫၥံၪအ့ၪစံၭလါနၫ့ တၭမွဲအဆိၪလၩ့အၥၭ ကဘျံၭကဘျၪၡါမၫလ့ၬလီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩဧ့, နမ့ၬၥၪယိဆၧတီၩဆၧလီၩ့မွဲအ့ၬဧၪ.နထး အဝ့ၫၥံၪလါနၫ့တၭ,အၥုၪ့အုၭအၥၭအုၭဝ့ၫအ့ၬး နမၩ လူၬခွံၬဝ့ၫလါနၫ့နီၪ, အဝ့ၫၥံၪဒိၭန့ဆၧအၪ့ၥီၪ့ဝ့ၫဆ့အ့ၬး တၭအဝ့ၫၥံၪအီၪက့ၪအမ့ၬနီၩ့နဲၪ့ဒံၭလိးလီၫ. ဂဲၫထဲၩ့",
			"4": "<sup>4</sup> ထဲၩ့နီၪအၥၭအီၪအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယစံၭ, အဝ့ၫၥံၪယီၩ,မွဲန့ၫၦၡၪ့ဖိၪယၬဖိၪ,မွဲၦဂၭဂီၩ့ဖိၪလီၫ. အဂဲးဘဲၫယီၩမွဲအၥ့ၪယၫယဟိဝၩအဖၧၩ့ၥၭဒဲအယွၩ",
			"5": "<sup>5</sup> အဆၧစ့ၩရၫ့အ့ၬ.- ယမိလ့ၩလၧၦအဒိၪလဖၪအအီၪ တၭ,ယမိချဲၩ့ဆၧလၧအဝ့ၫၥံၪလီၫ. အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪနီၪၥ့ၪယၫယဟိဝၩအဖၧၩ့ၥၭ အယွၩအဆၧစ့ၩ ရၫ့လီၫ.မွဲလါနၫ့တၭ အဝ့ၫၥံၪနီၪ, မၩခါနိၪယိၭဘီၩ့,",
			"6": "<sup>6</sup> မၩထ့ၬခွံၬဖျံၩစၧၩ့ထၬနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၬလၥၧၫ့လၧမံၩ့လၬကျၩ မိမၩၥံၫအဝ့ၫၥံၪ, မုဂၪလၩ့ အထွံၪမံၩ့မိမၩဂၭဂီၩ့ဝ့ၫ, ခ့ၫစံၫဖီးအီၪခိၭၥူၪလၧအ ဒိၩ့အနဲၩ့ထံၭလီၫ. ကယဲၦလၧအလ့ၩထၪ့ လၧခီၫ့လ ဂၩလါလါနီၪ, ဆၧမိအဲၪ့ၡၫ့ခွံၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အဆၧမၪအီၪအၪမၬ, ဒဲအၥၭဂၭဂီၩ့အဘျၩ့အၪထၪ့",
			"7": "<sup>7</sup> ဝ့ၫလီၫ.- ယမိမၩဖီၩ့မၩဖျ့ၭနၧၩ လၧဆၧယီၩအကၠီၩ့ ဘဲၫၥ့ၪလဲၪ. နဖိၪနလံၩစဲၪ့ဒၪယၧၩယူၭး ဒဲဆိၪလၩ့အ ၥၭလၧဆၧလၧအလမွဲဘၪယွၩအမ့ၬယၫလီၫ. ယဒုၭ ဘျဲၩအၪ့အဝ့ၫၥံၪလါနၫ့တၭ, အဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩ,",
			"8": "<sup>8</sup> ဒဲအီၪကိၩ့အီၪကီၪ့လၧမဲၩဎွဲၩမုၪအဂံၪ့ဖၧၩ့လီၫ.- မွဲဝ့ၫ ဘဲၫကၥ့ၪဖၫလၧအအၪ့ဘျဲၩအၪ့လီၫ. ကိၭထၪ့ဆိၫ့န့",
			"9": "<sup>9</sup> ဘၪဂူၫဂၩအမၫကိၭဂၩဒ့ၭဆုၬဆုၬလီၫ.- ယမိစ့ၩရၫ့ ဆၧလၧဆၧနီၪလဖၪအကၠီၩ့မွဲအ့ၬဧၪး ယဟိဝၩစံၭဝ့ၫ ဒၪ.တၭယၥၭမိမၩဆၧၫ့ဆၧအၧၩ့ လၧၦလဆၨၩဘဲၫ",
			"10": "<sup>10</sup> ယီၩမွဲအ့ၬဧၪ.- ထၪ့ဘၭအခိၪဒၧၩ့, မၩဂၭဂီၩ့ဆၧဆံၭ. မွဲလါနၫ့တၭမၩထီးအလူၬလဂ့ၩ. မၩန့ခွံၬအစဘံၭမု အစူၪဖုၬဆံၭ. အဂဲးဘဲၫယီၩမွဲယဟိဝၩအဆၧအ့ၬ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ ဒဲယုဒၫအၡၩ ဂံၪ့ဖိၪအၪ့လီၫဆၧထၫ့ဒၩယၧၩဒိၪမၬ, ယဟိဝၩစံၭ ဝ့ၫဒၪ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪချဲၩ့ဆၧကဘျံၭကဘျၪ လၧယဟိဝၩ အဂဲးတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩအီၪအ့ၬး တၭဆၧအၧၩ့ ဘၪပၧၩအ့ၬ. တၭဖၩ့ၥံၪနၭၥံၪ ဒဲဆၧၥၭဝံလၩ့ဒိၩနီၪ",
			"13": "<sup>13</sup> ပမိဒၪဘၪဆ့အ့ၬ.- ဒဲမီၪလဖၪနီၪ မွဲလံၩမုတၭဆၧအ လူနီၪအီၪလၧအဖၧၩ့အ့ၬ. ဆၧမိမၩဘဲၫနီၪၥိၭလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭ ဝ့ၫဘဲၫယီၩ, မွဲနၥံၪချဲၩ့ဆၧချဲၩ့လထံၪနီၪအကၠီၩ့တၭ, ယိခွါ,ယမိအီၪက့ၪယဆၧချဲၩ့လၧနနိၭဖၧၩ့လၧမ့ၪ, ဒဲ",
			"15": "<sup>15</sup> ၦခမျၧးလၧၥံၪ့မုတၭ,မိအၪ့ခွံၬအဝ့ၫၥံၪလီၫ.- ယိခွါ, ယမိဒုၭဂဲၫၦလဆၨၩလၧအယဲၩ့ထၫ့ဒုၪဒၩနၥံၪ, အံၫစ ရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲၦလ ဆၨၩအဒိၪအဆီၪ့, ၦလဆၨၩလၧအအီၪဝ့ၫလၧဖျိၩ့, ၦလဆၨၩလၧနလၥ့ၪယၫဘၪအလၨ, ဒဲအဆၧချဲၩ့ဘဲၫ",
			"16": "<sup>16</sup> ၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪနနၪၥ့ၪဆ့အ့ၬ.- အလၧၫ့ဖီၩ့နီၪ မွဲဆၧၥွၪခိၪဖၧၩ့အီၪဝဲထၪ့အၥၭလီၫ. အဝ့ၫၥံၪမွဲဝ့ၫ",
			"17": "<sup>17</sup> လၧၦအဆီၪ့ထီးအလူၬလီၫ.- တၭအဝ့ၫၥံၪမိအၪ့ခွံၬ နဘုၪကူၭအၥၭ, ဒဲနကိၪလၧနဖိၪမုၪၥံၪ, ဒဲနဖိၪခွၫၥံၪ ကြၨၭအၪ့ဝ့ၫး မိအၪ့ခွံၬနၥိၪနဘ့ၪၥံၪ, ဒဲနချီၥံၪတၭး မိအၪ့ခွံၬနစဘံၭမုၥံၪ ဒဲနချိၪ့ဒိၩ့ၥံၪ, မိမၩလၩ့ၡၪ့ခွံၬန ဒိၩ့ၥံၪအီၪလၧအခိၪဒၧၩ့လၧနဒိၭနဲၩ့နၥၭ လၧအဝ့ၫၥံၪ,",
			"18": "<sup>18</sup> လၧနၭၥံၪဖၩ့ၥံၪလီၫ.- မွဲလါနၫ့ဘိၩ,လၧမုနံၩလဖၪနီၪ ယမိမၩလူၬခွံၬနၥံၪထီးနၥံၪမိလူၬလခီၫနီၪဆ့အ့ၬ.",
			"19": "<sup>19</sup> ယဟိဝၩစံၭဝ့ၫဒၪ,တၭထီးနၥံၪအ့ၪစံၭ, ယဟိဝၩပ ယွၩမၩပၧၩလၧဆၧလဖၪနီၪမွဲဘၪလဲၪနီၪး ဆၧမိမၩ အၥၭလၧနမိဘၪစံၭဆၧၫ့အဝ့ၫၥံၪ, ဘဲၫနၥံၪစဲၪ့ဒၪ ယၧၩတၭ,မၩၦလခီၫဘၩ့မုးဖိၪအယွၩလဖၪ အဆၧ လၧနၥံၪအထံၫအခးအဖၧၩ့အၥိၭနီၪ, နၥံၪမိဘၪမၩၦ လခီၫဘၩ့မုးဖိၪအဆၧ လၧခးဖၧၩ့လၧအလမွဲဘၪနၥံၪ",
			"20": "<sup>20</sup> အဆၧဘဲၫနီၪၥိၭလီၫ.- လီၩလၩ့လၬလၩ့ဆၧယီၩလၧ စယၫကူၭအၡၩဂံၪ့ဖိၪ, ဒဲဒုၭနါဂၧၫ့ဆၧယီၩလၧယုဒၫ",
			"21": "<sup>21</sup> အဖၧၩ့ဆံၭး- တၭစံၭ,ၦဂီၩ့ဖိၪခမျၧးလၧအၥုၪ့ဆၭအ ၥၭဆၭလအီၪဘၪ, ဒဲအမ့ၬၥၪအီၪလါနၫ့လဒၪဘၪဆၧ, ဒဲအနါအီၪလါနၫ့လနါဂၧၫ့ဘၪဆၧၥံၪဧ့, ခိၭနၪဆံၭ.",
			"22": "<sup>22</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, နၥံၪဝၭထိၬ လၧယမ့ၬယၫအ့ၬဧၪ. ၦလၧအစ့ၩရၫ့ဂုးဂုးခၧၫ့ခၧၫ့အကၠီၩ့ ယအီၪက့ၪလၩ့မ့ၭ ဘဲၫဆၧမၩထၬမၫဆမံၭနဲၩ့အၥိၭ, ဘဲၫၥိၭအလ့ၩဖီၩ့ ခွံၬၥ့ၪအ့ၬးအလပီၩလဖၪထၪ့ဆီၪ့ဆီၪ့လ့ၬ လါနၫ့မၩ နၧၩ့ဝ့ၫအ့ၬး အဝ့ၫၥံၪၥီၫထၪ့ဖၭဒိၪလါနၫ့ လ့ၩဖၬခွံၬ",
			"23": "<sup>23</sup> ဝ့ၫၥ့ၪအ့ၬ.နၥံၪၥၭမဲၪယၧၩအ့ၬဧၪ.- အ့ၪမွဲၦခမျၧးယီၩ အီၪဝ့ၫလၧအၥၭလၧအပိၩ့ထၪ့ဒၪဆၧ, ဒဲတုၩ့ထၪ့တုၩ့",
			"24": "<sup>24</sup> လၩ့ဒၪဆၧလီၫ. ပိၩ့ထၪ့ဝ့ၫတၭစဲၪ့ထၪ့ခွံၬယူၭ.- အဝ့ၫ ၥံၪလစံၭဘၪလၧအၥၭဖၧၩ့, မွဲပၥၭမဲၪၡီၩ့ယဟိဝၩ ပ ယွၩလၧအဖ့ၪလၫ့ဆၧဆၧၩ့ လၧအဆိၫမွဲဂ့ၩ, ဒဲလၧခဲၫ့ မွဲဂ့ၩ, လၧအထီဒၪဝ့ၫအဖၧၩ့း လၧအအီၪက့ၪခၧၫ့ဆၧ နွ့ၫလဖၪ လၧပဂးလၧအအီၪဝဲၩဝ့ၫ လၧကူၭဘုၪအဂး",
			"25": "<sup>25</sup> နီၪဆံၭ.- နၥံၪအဆၧအၧၩ့ဘိၭကၠၪကဒၩထဲၩ့ဆၧနီၪ လဖၪလၧနၥံၪအအီၪတၭ, နၥံၪအဆၧဒဲၩဘၭပဒၩ့ထၬ",
			"26": "<sup>26</sup> ဆၧဂ့ၩလၧနၥံၪလီၫ.- အဂဲးဘဲၫယီၩၦလတီၩလလီၩ့ ဘၪလဖၪ အီၪဝ့ၫလၧယၡၩခမျၧးအကျၩလီၫ. အဝ့ၫ ၥံၪခိၭၥူၪဝ့ၫဘဲၫၦမၩန့ထိၪၥံၪလံၪၥံၪအၥိၭနီၪ, အီၪက့ၪ",
			"27": "<sup>27</sup> ဖျံၩခွၩ့ဘဲၫၥိၭအမိဖီၪ့န့ၦၡၩလီၫ.- ဘဲၫထိၪအဎၩလၧ အဎွ့ၩဝ့ၫလၧထိၪၥံၪလံၪၥံၪအၥိၭတၭ, အဝ့ၫၥံၪအဂံၪ့ လဖၪဎွ့ၩဝ့ၫလၧဆၧအၪ့လီၫဝ့ၫဘဲၫနီၪၥိၭဆ့း မၩအ ၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪကဲၪဒိၪကဲၪၡါထၪ့, ဒဲအဎၧၩ့",
			"28": "<sup>28</sup> အဎီလၧၫ့ထၪ့ဎွ့ၩထၪ့လီၫ.- အဝ့ၫၥံၪဘီၪ့ထၪ့ဝ့ၫယုၩ့ ယဲထၪ့ဝ့ၫ, မွဲမၬ,အမၩဆၧအၧၩ့ဒိၪဒံၭလီၫ. အဝ့ၫၥံၪ စ့ၩရၫ့ၦၡၩအခွးအ့ၬ, ဒဲစ့ၩရၫ့ၦဖိၪဎွ့ၪအခွးဆ့အ့ၬ. မွဲ လါနၫ့တၭဘီၪထၪ့ယီၫထၪ့ဝ့ၫတၭး ၦၡၪ့ဖိၪယၬဖိၪအ",
			"29": "<sup>29</sup> ခွးနီၪအဝ့ၫၥံၪစ့ၩရၫ့အ့ၬ.- ယမိစ့ၩရၫ့ဆၧလၧဆၧနီၪ လဖၪအကၠီၩ့မွဲအ့ၬဧၪး ယဟိဝၩစံၭဝ့ၫဒၪ, ယၥၭမိမၩ ဆၧၫ့ဆၧအၧၩ့လၧၦလဆၨၩဘဲၫယီၩၥိၭ, မွဲအ့ၬဧၪ. ဆၧၥၭလိၪလၩ့လၭ မၩအၥၭလၧခးဖၧၩ့,",
			"30": "<sup>30</sup> မီၪၥံၪ ချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪ, ဒဲၦလုဆၧလဖၪ ပၧၩ့ဆၧလၧအဝ့ၫၥံၪအစူၪဖၧၩ့တၭး ယၡၩခမျၧးအဲၪ ဆၧဘဲၫနီၪၥိၭဆ့တၭ, လၧအထုၬနီၪ, မွဲနၥံၪမိမၩဘဲၫ ၥ့ၪလဲၪ."
		},
		"6": {
			"1": "<sup>1</sup> ၦဘံၪ့ယမံၫ့ဖိၪၥံၪဧ့, အီၪကီၪ့နၥံၪဝ့ၫ ဘဲၫၥိၭနၥံၪမိ စဲၪ့ထၪ့ခွံၬလၧယရုစလံၫ့အဖၧၩ့ဘီၪး အူၪထၪ့ခွ့ၩလၧ တကိအၫအဖၧၩ့တၭ, အီၪက့ၪထၪ့ဆၧမၩနဲၪ့လၧမ့ၪ လၧဘ့ၫၥဟ့ၭစရံၫ့အဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧ အၧၩ့လၧအမွဲဆၧဂၭဂီၩ့ဖၭဒိၪနီၪ ဂဲၫလၧမုဖၩလခီၫ",
			"2": "<sup>2</sup> ဖျီၪထၪ့လီၫ.- ယမိဒီၩ့လၩ့ဇံအိၫ့အဖိၪမုၪ, ဘဲၫၦအီၪ",
			"3": "<sup>3</sup> လၧအဎံၫအလၩၦအဆါအၥိၭနီၪလီၫ.- ၦယိၥိၪလ ဖၪအီၪလၧအၥိၪအဘ့ၪၥံၪ မိဂဲၫလၧအအီၪ,မိၥုၪ့အတဲၩ အီၪဝၬဖီၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪမိအၪ့အဆၪလဂၩလၧအ",
			"4": "<sup>4</sup> လးဒၪဝ့ၫ,လဂၩလၧအလးဒၪဝ့ၫနီၪလီၫ.- တဲၩ့ဝဲၩဆၧ ဒုၭၥုၭထၫ့ဒၩအဝ့ၫ,ဂဲထုၪ့, မွဲပလ့ၩထၪ့ၡီၩ့ထီးမုထုၪ့ နီၪဘီၪ,ပဘၪအၡၪ့ဖီၩၬ အဂဲးဘဲၫယီၩမုဎဲးလၩ့,မုဂၪ",
			"5": "<sup>5</sup> လၩ့အလၩၡုၪထုၭထီၫထၪ့အၥၭလီၫ.- ဂဲထုၪ့ဘီၪ,မွဲ ပလ့ၩၡီၩ့လၧမုနၩလခီၫတၭ, မၩဂၭဂီၩ့ၡီၩ့ အနီးၥံၪ ဆံၭ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩ စံၭဘဲၫယီၩ, ခူၬလၩ့ၥံၪ့နီၪ, အီၪက့ၪထိၬၥံၪထၫ့ဒၩ ယရုစလံၫ့ဘီၪ, ဒိၩ့လၧဆၧမိစ့ၩရၫ့ဝ့ၫထၧၫ့ဒိၩ့ယၫနီၪမွဲအယီၩး ဆၧ",
			"7": "<sup>7</sup> မၩအၧၩ့ထီးအလူၬ အီၪဝ့ၫလၧအၥၭကျၩလီၫ.- ဘဲၫ ထံၫထၪ့ဖျိၭဒုၭယွၩလၩ့အထံၫအၥိၭနီၪ, အဝ့ၫဒၪဒုၭ ယွၩလၩ့အဆၧအၧၩ့ဘဲၫနီၪၥိၭလီၫ. ဆၧမၩအၧၩ့ဒဲ ဆၧအၪ့ဂူၬန့နီၪ ဂၧၫ့ထၪ့ဝ့ၫလၧအဖၧၩ့း ဆၧဘၪထံၭ ဆၫအလး, ဒဲဆၧဖၧၩ့လးအီၪဝ့ၫလၧယမ့ၬယၫလထံၪ",
			"8": "<sup>8</sup> ဎးလီၫ.- ဒိၭဆၧအၪ့ၥီၪ့ဆံၭ,ယရုစလံၫ့ဧ့,ယၥၭမိစဲၪ့ ထၪ့ခွံၬဘၪခိၬလၧနအီၪလီၫ. ယမိဒုၭအီၪယူဘၪခိၬ နၧၩ,ခးလၧၦၡၩအီၪလၧအဖၧၩ့နးဂၩအ့ၬ.",
			"9": "<sup>9</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ယၡၩမိ မၩန့အံၫစရ့လၭအၡၩ အီၪလၩ့ထးလူၬထူၬဆံၫ့ဘၩ့ ဘဲၫစဘံၭမုအၥၪအၥိၭနီၪလီၫ. ကၠၪစိၩဒီၭနစူၪဘဲၫၦ",
			"10": "<sup>10</sup> အၪ့ဒ့ၭစဘံၭၥၪလၧဒၩ့ဖၧၩ့အၥိၭနီၪဘီၪ.- ယမိချဲၩ့ဆၧ တၭ,ပဂၨၪထၪ့အခဲၫ့ဘဲၫၥိၭ အမိခိၭနၪဆၧလၧပ လၫလဂၩလဲၪ. ယိခွါ,အနါဒိၭဆၧကူၭတရံၭအ့ၬး မွဲ အနါဂၧၫ့ဆၧၥ့ၪအ့ၬ. ယိခွါ, ယဟိဝၩအလူ,မွဲဆၧဒုၪ ဒွ့ၪအလးလၧအဝ့ၫၥံၪအဂး, မုၬလၩလၧအဖၧၩ့နးစီၪ့",
			"11": "<sup>11</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧ ယဟိဝၩအၥၭခဲၩထၪ့တၭ,ယထိးကဲၪအ့ၬ. ယမိလူၫ လၩ့အဝ့ၫလၧဖိၪၥၪၥံၪအီၪလၧခီၫ့ ဒဲလၧဖိၪၥၪခွၫအီၪ ကိၩ့အီၪကီၪ့အဖၫ့ခိၪနီၪလီၫ. မွဲမၬ,ၦၡၩမိဖီၪ့န့ထၧၫ့ မၫဝၩနံၫဂၩ, ဒဲအၥၭၡါဒဲၦလၧအနံၩအၥၫ့ဎွ့ၩထၪ့ဝ့ၫ",
			"12": "<sup>12</sup> လီၫ.- တၭအဝ့ၫၥံၪအဂံၪ့အဎၫ့နီၪဆၧမိဖ့ၪလၫ့ဝ့ၫလၧ ၦဂူၫဂၩအဆံၬအနၩဒဲအဖိၪအမၫလစီၪ့ဎးလီၫ. အဂဲး ဘဲၫယီၩယမိယၩ့ထၪ့ယစူၪလၧၦခးဖိၪအဖၫ့ခိၪ, ယ",
			"13": "<sup>13</sup> ဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩ ဆၧအဆံၭထုၬထီၩ့ လၧအဒိၪထုၬနီၪၦၡၩၥၭကွံၩဆၧကိၭဂၩဒ့ၭ, ဒဲအမီၪ ၥံၪထီၩ့လၧၦလုဆၧနီၪ ၦၡၩအၪ့လီၫဆၧကိၭဂၩဒ့ၭ",
			"14": "<sup>14</sup> လီၫ.- အဝ့ၫၥံၪမၩဘျၪထဲၩ့ ယၡၩခမျၧးအဖိၪမုၪအ ဖၧၩ့လးပျီၩပျီၩတၭ, စံၭဝ့ၫ,ဆၧမုၬလၩ, ဆၧမုၬလၩ",
			"15": "<sup>15</sup> တၭး ဆၧမုၬလၩအီၪအ့ၬ.- ထီးအဝ့ၫၥံၪမၩဆၧဘၪ ၥၭလိၪနီၪ,မွဲအမ့ၬမဲဆ့ဧၪ. မွဲအ့ၬး အမ့ၬမဲနးဆံၭအ့ၬ. အမ့ၬထၪ့ဝီၩနီၪဆ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫ ၥံၪမိလၩ့ထံၩဖါလၧၦလၩ့ထံၩဖါအကျၩလီၫ. အဆၧၫ့ အထီလၧယစ့ၩရၫ့ဝ့ၫနီၪ အဝ့ၫၥံၪအခၪ့မိဘၪထၧၩ့ လီၫးယဟိဝၩစံၭဝ့ၫဒၪ.",
			"16": "<sup>16</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧၫ့ထုၪ့လၧဖၧၩ့ၥၭဖၧၩ့,ယိ ဆၧဒဲအၪ့စၪ့ဆၧလၧဖၧၩ့ၥၭလးလံၩလဖၪအဂဲး, ဖၧၩ့ ၥၭအဂ့ၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪနီၪဘီၪး တၭဖိၬဖၧၩ့ ၥၭနီၪဘီၪ.တၭနၥံၪမိဒၪန့ဆၧအီၪပွံၭ လၧနၥံၪအၥၭ",
			"17": "<sup>17</sup> အဂးလီၫ.အ့ၪမွဲအဝ့ၫၥံၪနီၪစံၭဝ့ၫဒၪ,ပဖိၬအ့ၬ.- ယ အီၪက့ၪဆ့ၦခိၭဆၧလၧနၥံၪအဖၫ့ခိၪတၭ, စံၭ, ခိၭနၪ ခွ့ၩအၥီၫဘီၪ. တၭအဝ့ၫၥံၪစံၭ,ပခိၭနၪအ့ၬ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦဆၨၩၥံၪဧ့,ခိၭနၪဆံၭ.ၦခ မျၧးအီၪကီၪ့ၥံၪဧ့,ၥ့ၪယၫဆၧအီၪလၧအကျၩဘီၪ.",
			"19": "<sup>19</sup> ဂၪ့ခိၪဧ့,ခိၭနၪဘီၪ, ယိခွါ,ယမိဒုၭဘၪၦခမျၧးယီၩ လၧဆၧအၧၩ့အကိၪ့ထၪ့ဖၭလၩ့ဆၧအဆၧၥၪ, အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪလခိၭနၪဘၪ ယဆၧချဲၩ့လဖၪမွဲဂ့ၩ, ယဆၧၥီၪ့ဆၧၥၫ့နီၪမွဲဂ့ၩ, အ့ၪမွဲခွံၬၡိၭခွံၬဝ့ၫဒၪလခီၫ",
			"20": "<sup>20</sup> လီၫ.- ၦဂဲၫဆိၬလီဘၫ့လၧၡံဘၫနီၪ, ထီၩ့လၧယအီၪ, ဒဲဆံၫဖိၬလၧထံၫယဲၩ့ခးယဲၩ့တၭ, မွဲအအိၭနီၪလဲၪ.န ၥံၪအဆၧလုမ့ၪဘၪယၥၭအ့ၬ. နၥံၪလုထၪ့ဆၧနီၪယ",
			"21": "<sup>21</sup> အဲၪဒိၭအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩစံၭဘဲၫ ယီၩ,ယိခွါ,ယမိအီၪက့ၪဆၧဘၪထၧၩ့အလးယီၩလၧ ၦခမျၧးအမ့ၬယၫတၭ, ဖါလဖၪဒဲဖိၪခွၫၥံၪမိလၩ့ထံၩ ဖါလၧအဖၫ့ခိၪလစီၪ့ဎးနီၪ, ဒဲၦလၧအနဲၩ့ထံၭ, ဒဲအ ထံၩအၥိၭမိထီၩ့လၧဆၧဂၭဂီၩ့လစီၪ့ဎးလီၫ.",
			"22": "<sup>22</sup> ယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ၦခမျၧးမိဂဲၫလၧမုဖၩ,",
			"23": "<sup>23</sup> ၦလဆၨၩဖၭဒိၪမိဂဲထုၪ့လၧဂၪ့ခိၪအထုၬလီၫ.- အဝ့ၫ ၥံၪဖီၪ့ထၬချံၪဒဲဖၩ့း အၥုၪ့နီၩ့အၥၭနီၩ့တၭ, ယၫ့ၥၭ ဆၧအ့ၬ.အလူၥီၫထၪ့ဘဲၫမၫဆမံၭအၥိၭး တဲၩ့ဝဲၩက ၥ့ၪတၭ,ထူၬဝ့ၫဘဲၫၦၥုၭဖိၪအၥိၭထၫ့ဒၩနၧၩ, ဒဲဇံအိၫ့",
			"24": "<sup>24</sup> အဖိၪမုၪဧ့,- ပနါဂၧၫ့အပရၧၫ့,ပစူၪလၩ့ဆါ,ဆၧၡၪ့ ဆၧနၭဖီၪ့ထၬပၧၩ, ဆၧဆိၭက့ၭဘဲၫၦမုၪဘၪဆၧဂူၭ",
			"25": "<sup>25</sup> ဆၫအၥိၭနီၪလီၫ.- လ့ၩထၪ့လၧဆၧပျၩ့ဖၧၩ့လဂ့ၩ,ဖိၬ ဖၧၩ့ၥၭမုလဂ့ၩ. အဂဲးဘဲၫယီၩဆၧအဒုၪအဒၩအနၭ,",
			"26": "<sup>26</sup> ဆၧၥၭမဲၪအီၪကိၭစီၪ့ဒ့ၭလီၫ.- ယၡၩခမျၧးအဖိၪမုၪ ဧ့,ခဲးထူၬနယးဒံၩ့လၧရၧၬအဆၧယၬတၭ, လွၫလၩ့န ၥၭလၧဖံၫ့ချၪအကျၩ, ၥုၪ့အုၭၥၭအုၭဘဲၫဖိၪလဂၩဎး အၥိၭနီၪ,ဂၪ့ကိၭၡၭထၪ့ဘီၪ. အဂဲးဘဲၫယီၩဆၧမၩ",
			"27": "<sup>27</sup> ဂၭဂီၩ့ဆၧနီၪမိဂဲၫဘၪၡုၭပၧၩလီၫ.- ယအီၪက့ၪနၧၩ လၧၦအၪ့ကဲၪ့စ့ၩ လၧယၡၩခမျၧးအကျၩ, ၦခိၭဆၧ",
			"28": "<sup>28</sup> ဘဲၫၥိၭနမိၥ့ၪယၫ, ဒဲမၩခွါအဖၧၩ့ၥၭလီၫ.- အဝ့ၫၥံၪ ထီးအလူၬနီၪမွဲၦပိၩ့ထၪ့ဆၧတၭ, ပိၩ့ထၪ့ဝ့ၫလၧဆၧချဲၩ့ ခဲၪၥံၪလီၫ. မွဲထီးဒဲထၭး ၦမၩဘၪၥၭလိၪဆၧကိၭဂၩ",
			"29": "<sup>29</sup> ဒ့ၭလီၫ.- အဎီၫ့နီၪမ့ၪအၪ့ခွံၬယူၭ.ၡၬနီၪလူၬယူၭလၧ မ့ၪဖၧၩ့ယူၭ. ၦအၪ့ကဲၪ့ဆၧနီၪမၩဝ့ၫပျီၩပျီၩလီၫ. အဂဲး",
			"30": "<sup>30</sup> ဘဲၫယီၩၦလတီၩလလီၩ့ဘၪနီၪလၩ့ဖၭအ့ၬ.- ၦၡၩ မိကိၭအဝ့ၫၥံၪ စ့ၩလၧဆၧခွံၬၡိၭခွံၬဝ့ၫနီၪ, အဂဲးဘဲၫ ယီၩယဟိဝၩခွံၬၡိၭဝ့ၫလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪစယ့ၫရမဲအၫနီၪ, စံၭ ဝ့ၫဒၪ, ဆၧၫ့ထုၪ့လၧယဟိဝၩအဂံၪ့အတရၫ့ဖၧၩ့တၭ,",
			"2": "<sup>2</sup> ကိၭထၪ့ဆၧချဲၩ့ယီၩထီးနီၪတၭ,- စံၭ, ၦယုဒၫဖိၪလၧ အလ့ၩနုၬလၧတရၫ့ၥံၪယီၩ ဘဲၫၥိၭနၥံၪမိဘၩထၪ့ယ",
			"3": "<sup>3</sup> ဟိဝၩထီးအလူၬၥံၪဧ့,ခိၭနၪယဟိဝၩအလူဆံၭ.- ဆၧ ၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩစံၭဘဲၫ ယီၩ,မၩဂ့ၩထၪ့ထဲၩ့နၥံၪအဖၧၩ့ၥၭ ဒဲနၥံၪအဆၧမၩ",
			"4": "<sup>4</sup> ဘီၪ.တၭယမိဒုၭအီၪနၥံၪလၧအလးယီၩလီၫ.- ဒိၭ နဲၩ့နၥံၪအၥၭ လၧဆၧချဲၩ့ အဘျံၭအဘျၪ လၧအစံၭ, ယဟိဝၩအနီး, ယဟိဝၩအနီး, ယဟိဝၩအနီး,မွဲအ",
			"5": "<sup>5</sup> ယီၩလဖၪနီၪလဂ့ၩ.- မွဲလါနၫ့တၭနၥံၪအ့ၪမၩဂ့ၩထၪ့ ထဲၩ့တၡါနၥံၪအဖၧၩ့ၥၭ, ဒဲနၥံၪမၩဆၧဂ့ၩဂ့ၩလ့ၬ, နၥံၪအ့ၪစ့ၩရၫ့ၦလဂၩဒဲၦလၧအနဲၩ့ထံၭအခွးတီၩတီၩ",
			"6": "<sup>6</sup> တၭ,- နၥံၪအ့ၪလမၩအၧၩ့ဘၪၦလခီၫဘၩ့မုးဖိၪ, ၦဖိၪ ဎွ့ၪဒဲၦမုၪမဲၫ, ဒဲအ့ၪလဂါလၩ့ဘၪဆၧၥွံၪလၧအဆၧ ဒဲၩဘၭလအီၪဘၪထီးယီၩ, ဒဲလဖိၬဘၪၦဂူၫဂၩၥံၪအ",
			"7": "<sup>7</sup> ခဲၫ့လၧနၥံၪအဆၧအၧၩ့ဒၪနၥံၪဝ့ၫအဂးတၭး- ထီးနီၪ လဖၧၫ့ယမိဒုၭအီၪနၥံၪလၧအလးထီးယီၩ, လၧခးဖၧၩ့ လၧယဖ့ၪလၫ့နၥံၪအဖါလဖၪ လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"8": "<sup>8</sup> ယိခွါ, နၥံၪဒိၭနဲၩ့နၥံၪအၥၭလၧဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪ",
			"9": "<sup>9</sup> လၧအလန့ကဲၩ့န့ကၩဘၪဆၧလီၫ.- နၥံၪအၪ့ဂူၪဆၧ, ဒဲမၩၥံၫၦၡၩ, ဒဲအဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩ, ဒဲဆိၪဆၧလ တီၩဘၪ,ဒဲဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧဘၭဘလၧၫ့အဂး, ဖိၬယွၩအဂူၫဂၩလဖၪအခဲၫ့ လၧနၥံၪလၥ့ၪယၫဘၪဝ့ၫ",
			"10": "<sup>10</sup> လါနၫ့,- တၭမွဲနၥံၪဂဲၫဆၧၫ့ထုၪ့လၧယမ့ၬယၫလၧဂံၪ့ ဖၧၩ့ယီၩ,လၧဆၧကိၭဝ့ၫလၧယမံၩ့တၭ, စံၭ,ပဖီၩ့ဖျ့ၭ ယူၭလၧနၥံၪမၩဆၧဘၪၥၭလိၪအဘိၩ့ဘၭနီၪ, ဘၪမိ",
			"11": "<sup>11</sup> ၥ့ၪဘဲၫၥ့ၪလဲၪ.- ဂံၪ့ယီၩလၧဆၧကိၭဝ့ၫလၧယမံၩ့နီၪ, မွဲအကဲၪထၪ့ထမျၬအအိၩ့ဖၧၩ့ လၧနၥံၪအမ့ၬယၫဆ့ ဧၪ.ယိခွါ,အဝ့ၫဒၪယီၩယဒၪဘၪဆ့ယူၭ, ယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"12": "<sup>12</sup> တၭလ့ၩလါလၧယလးလၧၡဲလိၫအဖၧၩ့ ထီးယအီၪ က့ၪယမံၩ့လၧအခၪ့ထံၭ, ဒဲဆၧလၧယမၩဝ့ၫ လၧယ ၡၩခမျၧးအံၫစရ့လၭ အဆၧအၧၩ့ဆၧၥၫ့ အကၠီၩ့နီၪ,",
			"13": "<sup>13</sup> ယိဆီၫ့မီၪ့ယဆၧမၩနီၪဆံၭ.- ဘိၩ့နဲၪ့ယီၩမွဲလၧနၥံၪ မၩဆၧယီၩထီးအလူၬအကၠီၩ့တၭ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယချဲၩ့ဆၧလၧနၥံၪ, ယဂဲထုၪ့ဂီၩဂီၩတၭ, ချဲၩ့ဆၧလၧ နၥံၪတၭ, နၥံၪခိၭနၪဆၧအ့ၬ.တၭယကိၭထၪ့နၥံၪတၭ,",
			"14": "<sup>14</sup> နၥံၪစံၭဆၧၫ့ဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိမၩ ဂံၪ့ယီၩလၧဆၧကိၭလၧယမံၩ့, ထီးနၥံၪဒိၭနဲၩ့နၥံၪအ ၥၭလၧအဖၧၩ့, လၧအလးလၧယဖ့ၪလၫ့နၥံၪဒဲနၥံၪအ",
			"15": "<sup>15</sup> ဖါလဖၪနီၪ,ဘဲၫယမၩၡဲလိၫအၥိၭနီၪလီၫ.- တၭယမိ ခွံၬၡိၭခွံၬနၥံၪလၧယမ့ၬယၫ, ဘဲၫယခွံၬၡိၭခွံၬယူၭနၥံၪ အထၧၫ့ဖုဝဲထီးအလူၬအၥိၭနီၪ, အံဖြံၫ့အချံၫအၥၪထီး အလူၬလီၫ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ, နဝ့ၫဒၪယီၩထီးဘၩဆိၪဖၪန့ ၦခမျၧးယီၩအဂးလဂ့ၩး တၭကိၭၡၭထၪ့ဆၧဘၩဆိၪ ဖၪလၧအဝ့ၫၥံၪအဂးလဂ့ၩး တၭအၪ့ကံၩ့အၪ့ယၫယၧၩ",
			"17": "<sup>17</sup> လၧအဂးလဂ့ၩ.အဂဲးဘဲၫယီၩယခိၭနၪနလူအ့ၬ.- ဆၧ လၧအဝ့ၫၥံၪမၩလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့, ဒဲလၧ",
			"18": "<sup>18</sup> ယရုစလံၫ့အဖၧၩ့ၥၭအဖၧၩ့နီၪနဒၪဘၪအ့ၬဧၪ.- ဖိၪဒံၩ ဖိၪၥၪလဖၪအၪ့ထုၫ့ကီၪ့ၥံၪ့မု, ဒဲအဖါလဖၪဆူၭခဲၩမ့ၪ, ဒဲၦမုၪဘံၭကိၪၥံၫ့ဆ့ၬ လၧအမိမၩကိၪပၪပဲၪလၧမူၭခိၪ အနးဎွၩမုၪအဂး, ဒဲလၧအမိလူၫလၩ့ဆၧလုအီၩလၧ ယွၩအဂူၫဂၩလဖၪအဂး ဘဲၫၥိၭအမိထိၪဂဲၩၥၭထၪ့",
			"19": "<sup>19</sup> ယၧၩလီၫ.- မွဲအထိၪဂဲၩ ၥၭထၪ့ယၧၩဧၪး ယဟိဝၩ စံၭဝ့ၫဒၪ,မၩခိအၥၭဒၪဝ့ၫထီးအအီၪက့ၪမဲအမ့ၬနီၪ,",
			"20": "<sup>20</sup> မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,ယိခွါ,ယၥၭထၪ့ဒဲယၥၭခဲၩထၪ့ မိလူၫလၩ့အၥၭ လၧအလးယီၩအဖၫ့ခိၪလၧၦၡၩအလီၩ့, ဒဲလၧဆၧဖိၪ ဆၧဎါအလီၩ့, ဒဲလၧၥံၪ့လၧမံၩ့လၬကျၩအဖၫ့ခိၪ, ဒဲ လၧဂၪ့ခိၪအဆၧၥၪ အဖၫ့ခိၪလီၫ. တၭမိအၪ့ခွံၬဆၧ တၭ,လၩ့ဖံၬဝ့ၫအ့ၬ.",
			"21": "<sup>21</sup> ၥုၭမုခမျၧးအယဟိဝၩအံၫစရ့လၭအယွၩ, စံၭဘဲၫ ယီၩ,အီၪက့ၪကီၪ့နၥံၪအဆၧလုမ့ၪ လၧနၥံၪအဆၧလု",
			"22": "<sup>22</sup> လးအဖၫ့ခိၪတၭ,အၪ့ဆၧယၪဘီၪ.- အဂဲးဘဲၫယီၩမု လနံၩလၧယဒုၭစဲၪ့ထၪ့နၥံၪအဖါ လၧခးအံဇံၭအဖၧၩ့ နီၪယလီၩဘၪအဝ့ၫၥံၪအ့ၬ. ယမၪလူၬအဝ့ၫၥံၪလၧ",
			"23": "<sup>23</sup> ဆၧလုမ့ၪဒဲဆၧလုအဂဲးအကၠီၪ့အ့ၬ.- အ့ၪမွဲယမၪလူၬ ယူၭအဝ့ၫၥံၪလၧဆၧယီၩလမံၩ့တၭ, စံၭ,ခိၭနၪယလူ ဆံၭးတၭယမိကဲၪထၪ့နၥံၪအယွၩ, ဒဲနၥံၪမိကဲၪထၪ့ ယၡၩခမျၧး ဘဲၫၥိၭဆၧမိဂ့ၩထၪ့ လၧနၥံၪအဂးနီၪ,",
			"24": "<sup>24</sup> ဖိၬဖၧၩ့ၥၭလၧယမၪလူၬနၥံၪကိၭဘီၩ့ဒ့ၭဆံၭ.- မွဲလါ နၫ့တၭ,အဝ့ၫၥံၪခိၭနၪအ့ၬး ဒဲဒိၭအနါဆ့အ့ၬ. လ့ၩဝ့ၫ ထီးဒၪအၥၭအၧၩ့အနါကဲၪ့ အဆၧကိၪ့ထၪ့ဖၭလၩ့အ",
			"25": "<sup>25</sup> ဖၧၩ့တၭ,ဂုၩ့ထဲၩ့အၥၭတၭ, လ့ၩလၧယၫအ့ၬ.- ခီၫ လၧမုလနံၩလၧနၥံၪအဖါၥံၪစဲၪ့ထၪ့ခွံၬ, လၧခးအံဇံၭ နီၪ,ထီၩ့လၩ့လၧမုလနံၩယီၩ, ယအၪ့မၧၫ့လၩ့ယခ့ၫ ယၡၩမီၪၥံၪထီးအလူၬ, ယဂဲထုၪ့ဂီၩဂီၩ ကိၭမုနံၩဒ့ၭ",
			"26": "<sup>26</sup> တၭ,ယအၪ့မၧၫ့လၩ့အဝ့ၫၥံၪလီၫ.- မွဲလါနၫ့တၭအဝ့ၫ ၥံၪခိၭနၪယလူအ့ၬ. မွဲအခိၬဆီၪ့တၭ, ဒိၭအနါအ့ၬ.",
			"27": "<sup>27</sup> မၩဝ့ၫနၭနဲၪ့ဒံၭ အဖါၥံၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးနအ့ၪချဲၩ့ဆၧချဲၩ့ယီၩ ထီးအလူၬလါနၫ့တၭ,အဝ့ၫ ၥံၪမိခိၭနၪနလူအ့ၬ. ထီးနအ့ၪကိၭအဝ့ၫၥံၪတၭ,မိချဲၩ့",
			"28": "<sup>28</sup> ဆၧၫ့နၧၩဆ့အ့ၬ.- မွဲလါနၫ့ဘဲၫနီၪတၭ,နမိဘၪစံၭအ ဝ့ၫၥံၪ,အယီၩမွဲၦလဆၨၩ လၧအလခိၭနၪဘၪယဟိ ဝၩအဝ့ၫၥံၪအယွၩအလူ, ဒဲလဒိၭန့ဘၪအဆၧၥီၪ့တၭ, ဆၧမွဲဆၧတီၩလၩ့မါယူၭ, ဒဲဘၪဆၧဒၪ့ထ့ၬခွံၬလၧအ နိၭယူၭ.",
			"29": "<sup>29</sup> ထံၬခွံၬနခိၪၥူၫတၭ, ခွံၬၡိၭခွံၬဘီၪး ဂၪ့ဆၧယၧၩ့ ဆၧလၧဆၧအလးထၪ့ထီၫ အဖၫ့ခိၪဆံၭ. အဂဲးဘဲၫ ယီၩယဟိဝၩခွံၬၡိၭ ဒဲစဲၪ့ဒၪခွံၬၦလဆၨၩယီၩလၧအ",
			"30": "<sup>30</sup> ၥၭထၪ့ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩၦယုဒၫဖိၪမၩဆၧအၧၩ့ လၧယမ့ၬယၫ, ယဟိဝၩစံၭဝ့ၫဒၪး အဝ့ၫၥံၪအီၪက့ၪ ဆၧဘၪၥၭလိၪအလးနီၪ လၧဂံၪ့ဖၧၩ့ လၧဆၧကိၭဝ့ၫ",
			"31": "<sup>31</sup> လၧယမံၩ့ဘဲၫၥိၭအမိဘၪၥၭလိၪဝ့ၫလီၫ.- တၭအဝ့ၫ ၥံၪၥုၪ့ထၪ့ထိဖ့ၭအလးထၪ့ထီၫလဖၪ လၧအအီၪဝ့ၫလၧ စဟံၪ့နၧၫ့အဖိၪခွၫအခိၪလီၩ့ဆူၭဖၧၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪ မိဆူၭခွံၬအဖိၪခွၫလဖၪ, ဒဲအဖိၪမုၪလဖၪလၧမ့ၪဖၧၩ့ လၧယလမၪလူၬဘၪ, ဒဲအီၪလၧယၥၭခံဖၧၩ့ဆ့အ့ၬ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩစံၭဝ့ၫဒၪ,ယိခွါ,မုနံၩ လဖၪမိဘၪဝ့ၫ,ထီးထိဖ့ၭမွဲဂ့ၩ, စဟံၪ့နၧၫ့အဖိၪခွၫအ ခိၪလီၩ့ဆူၭမွဲဂ့ၩ, ဆၧကိၭလၧၩ့ဝ့ၫအ့ၬ, အ့ၪမွဲမၩၥံၫ ဆၧအခိၪလီၩ့ဆူၭလီၫ. အဂဲးဘဲၫယီၩၦၡၩမိခုၪ့လၩ့ ဘၧၩ့ခွံၬဆၧလၧထိဖ့ၭ ထီးအလး လအီၪလၧၩ့ဘၪ",
			"33": "<sup>33</sup> လီၫ.- ၦၡၩခမျၧးယီၩအစွၪလဖၪ မိကဲၪထၪ့ဆၧအၪ့ လၧထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့အဂး, ဒဲဂၪ့ခိၪအဆၧ",
			"34": "<sup>34</sup> ဖိၪဆၧဎါအဂးတၭ, ဆၧမၩတုၩ့ခွံၬဝ့ၫအ့ၬ.- ထီးနီၪ လဖၧၫ့ယမိဒုၭလၩ့မါဆၧၥုၪ့ထိၬၥၭထိၬအၥီၫ, တလၭ မူၭအခွၫအလူဒဲတလၭမူၭအမုၪအလူလၧယုဒၫအဒိၩ့ လဖၪအဖၧၩ့, ဒဲယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့တၭ, ထံၫၥံၪ ခးၥံၪမိအီၪယူဝ့ၫလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, အထီထီးနီၪၦၡၩမိဂဲၫဆိၬထၪ့ ခွံၬယုဒၫအစဎွၩလဖၪအဎွံၪ, ဒဲၦဒိၪဖၭဒိၪလဖၪအဎွံၪ, ဒဲၦလုဆၧအဎွံၪ,ဒဲမီၪလဖၪအဎွံၪ,ဒဲၦယရုစလံၫ့ဖိၪလဖၪ",
			"2": "<sup>2</sup> အဎွံၪလၧအၥွၪခိၪဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪမိအီၪက့ၪ လၩ့ဝ့ၫလၧမုအမ့ၬယၫ, ဒဲလၩအမ့ၬယၫ, ဒဲမူၭခိၪအၥုၭ မုခမျၧးအမ့ၬယၫလၧအအဲၪယူၭဝ့ၫ, လၧအမၩအဆၧ, လၧအဖိၬအခဲၫ့, လၧအအၪ့ဎၬဝ့ၫ, ဒဲလၧအဘိၪ့ထၪ့ ဘၩထၪ့ဝ့ၫလီၫ. ဆၧအၪ့ထုၫ့ကီၪ့ဘၪအဝ့ၫအ့ၬ. တၭ ဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫဆ့အ့ၬ. မိအီၪဝ့ၫဘဲၫဆၧအ့ၪ",
			"3": "<sup>3</sup> အၥိၭနီၪလၧဂၪ့ခိၪချိၫ့လီၫ.- တၭၦလၧအအီၪလၩ့ထး လၧၦလဆၨၩအအၧၩ့ယီၩအကျၩ, လၧအအီၪလၩ့ ထးထီးယနၫ့ထၪ့ခွံၬဒုၭအီၪဝ့ၫအလးထီးအလူၬနီၪ,မိ အၪ့ဎၬဆၧၥံၫအၪနဲၪ့ဒံၭ ဆၧမၧၫ့အလးလီၫ. ဆၧၥုၭ မုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ.",
			"4": "<sup>4</sup> လၧနီၪအမ့ၬယၫနမိဘၪစံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭ ဘဲၫယီၩ, အဝ့ၫၥံၪမိလၩ့ထံၩဖါတၭ, ဂဲထုၪ့ထဲၩ့အ့ၬ",
			"5": "<sup>5</sup> ဧၪ.မိကၠၪခွံၬအၥၭတၭ, ကၠၪထဲၩ့အၥၭအ့ၬဧၪ.- ယရု စလံၫ့အၡၩခမျၧးထဲၩ့ထဲၩ့ ဒဲထဲၩ့ထဲၩ့ဒၪဆၧလထံၪဎး နီၪ,မွဲဘၪလဲၪ. အဝ့ၫၥံၪဖီၪ့ထၬဆၧအၪ့လီၫ, ဂဲၫထဲၩ့",
			"6": "<sup>6</sup> ထဲၩ့နီၪအၥၭအီၪအ့ၬ.- ယခိၭနၪဆၧ, ယနါဂၧၫ့ဆၧ တၭ,အဝ့ၫၥံၪချဲၩ့ဆၧအတီၩအ့ၬ. ၦၡၩနီၫ့ယါလၩ့ထဲၩ့ အၥၭလၧဆၧအၧၩ့အကၠီၩ့နးဂၩအ့ၬး မွဲယမၩနီၫလဲၪ နီၪ,စံၭဝ့ၫဆ့အ့ၬ. ၦၡၩကၠၪစိၩအၥၭ လၧအစဲၪ့ဆၧ အလး,ဘဲၫကၥ့ၪၡိၫနုၬ လၧဒုၭၥုၭအဖၧၩ့ အၥိၭနီၪ",
			"7": "<sup>7</sup> လီၫ.- မွဲမၬ,ထိၪဖၭဒိၪၥ့ၪယၫအဆၧၫ့အထီ, ထိၪဘျံၪ့ ဘျၪ့ဒဲထိၪယီၩ့ထီးန့ အဆၧၫ့အထီ လၧအမိဂဲၫထဲၩ့ ထဲၩ့းအ့ၪမွဲယၡၩခမျၧးၥံၪ ၥ့ၪယၫယဟိဝၩအဆၧစ့ၩ",
			"8": "<sup>8</sup> ရၫ့အ့ၬ.- ၦကိၪ့ဆၧၥ့ၪတၭ,ယဟိဝၩအဆၧၥီၪ့ဆၧၥၫ့ အီၪဝ့ၫလၧပၥိၭနီၪ, နၥံၪမိစံၭဘဲၫၥ့ၪလဲၪ, ယိခွါ, မၩ ဝ့ၫပျီၩပျီၩလီၫ. ၦကွ့ၭဆဲၫလံၬအနိၪကွ့ၭ အီၪပျီၩပျီၩ",
			"9": "<sup>9</sup> လီၫ.- ၦကိၪ့ဆၧၥ့ၪအမ့ၬမဲတၭး ၡုၭဝ့ၫတၭနုၬဝ့ၫလၧ ဖျံၩခွၩ့ဖၧၩ့နီၪး ယိခွါ, အဝ့ၫၥံၪခွံၬၡိၭယဟိဝၩအလူ တၭဆၧကိၪ့ၥ့ၪကိၪ့ဘၪလၧအဝ့ၫၥံၪအဖၧၩ့နီၪ မွဲဆၧ နီၪလဲၪ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမိဖ့ၪလၫ့အဝ့ၫၥံၪအမၫလ ဖၪလၧၦဂူၫဂၩ, ဒဲအဂၪ့ခိၪအဝၩ့လဖၪလၧၦလၧအမိန့ ၥၫဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလၧအဆံၭထုၬ ဖိး လၧအဒိၪထုၬနီၪၥၭကွံၩဆၧကိၭဂၩဒ့ၭလီၫ. လၧမီၪ လဖၪဖိးလၧၦလုဆၧနီၪမၩဝ့ၫတၭ, အၪ့လီၫဆၧကိၭ",
			"11": "<sup>11</sup> ဂၩဒ့ၭလီၫ.- အဂဲးဘဲၫယီၩ မွဲအမၩဘျၪထဲၩ့ ယၡၩ ခမျၧးအဖိၪမုၪအဖၧၩ့လးပျီၩပျီၩတၭ, စံၭဝ့ၫဆၧအ",
			"12": "<sup>12</sup> မုၬ,ဆၧအမုၬနီၪး ထီးဆၧအမုၬအီၪနးစီၪ့အ့ၬ.- ထီး အမၩဆၧၥၭလိၪတၭ,မွဲအမ့ၬမဲဆ့ဧၪး အမ့ၬမဲနးဆံၭ အ့ၬ.ၥ့ၪယၫဆၧမ့ၬမဲအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫ ၥံၪမိလၩ့ထံၩဖါဝ့ၫ လၧၦလၧအလၩ့ထံၩဖါလဖၪအ ကျၩလီၫ. အဆၧၫ့အထီလၧအမိစ့ၩရၫ့ဝ့ၫနီၪ, အခၪ့",
			"13": "<sup>13</sup> မိဘၪထၧၩ့, ယဟိဝၩစံၭဝ့ၫဒၪ.- မွဲမၬ,ယမိမၩလူၬခွံၬ အဝ့ၫၥံၪလူၬထူၬဆံၫ့ဘၩ့, ယဟိဝၩစံၭဝ့ၫဒၪ. စဘံၭ ၥၪအီၪဘၪလၧစဘံၭမုအလီၩ့အ့ၬ, ချိၪ့ဒိၩ့ၥၪအီၪလၧ ချိၪ့ဒိၩ့အလီၩ့ဆ့အ့ၬ. တၭအလၪမိဎဲၫ့ထၪ့တၭ, ဆၧ လၧယဖ့ၪလၫ့အဝ့ၫၥံၪမိလၩ့မါခွံၬဝ့ၫဒၪလီၫ.",
			"14": "<sup>14</sup> ပဆၧၫ့နၩ့အီၪလၩ့မါပံၭမွဲဘၪလဲၪ. အီၪကိၩ့အီၪကီၪ့ တၭ, လ့ၩနုၬၡီၩ့ဒိၩ့လဖၪ အီၪလၧအခိၪဒၧၩ့ အဖၧၩ့ တၭ, အီၪလၩ့မါပံၭၡီၩ့ထီးနီၪဘီၪ. အဂဲးဘဲၫယီၩယ ဟိဝၩပယွၩဒုၭအီၪလၩ့မါပံၭပၧၩတၭ, ဖ့ၪအီၩပၧၩ လၧထံၫလဲၩဎုၬလၧၥံၪခၪ, အဂဲးဘဲၫယီၩပမၩမၪဘၪ",
			"15": "<sup>15</sup> ယဟိဝၩလီၫ.- ပယိလါဆၧဘၪလိၬအိၭလိၬ အဖၧၩ့ ၥၭမွဲလါနၫ့ဘိၩ, ဆၧအဂ့ၩအီၪအ့ၬး လၧဆၧမၩဘျၪ ထဲၩ့အထီအဂးတၭ, ယိခွါ, ဆၧမၩခိမၩဝီၩဆၧလီၫ.",
			"16": "<sup>16</sup> အကၥ့ၪၥၪ လၧအနၫဖၧၩ့အၥီၫနီၪ ဆၧနါဂၧၫ့ဂဲၫထၪ့ လၧဒၫ့အခးဖၧၩ့တၭ, ခးဝၭဝ့ၫထၧၫ့ဘံၪ့ယၫ လၧဆၧ အဆီၪ့လဖၪအၥီၫထၪ့ဝ့ၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဂဲၫဝ့ၫတၭ, အၪ့ခွံၬခး, ဒဲကယဲဆၧအီၪဝ့ၫလၧ",
			"17": "<sup>17</sup> အဖၧၩ့,ဒိၩ့နီၪဒဲၦလၧအအီၪလၧအဖၧၩ့လီၫ.- အဂဲး ဘဲၫယီၩ, ယိခွါ, ယမိအၪ့မၧၫ့လၩ့ဂူၥံၪ, ဂူအၧၩ့လၧ နၥံၪအကျၩ, လၧဆၧအူၪဆၧပီၩ မၩနၧၩ့လၥ့ၪဘၪ တၭ,မိဖျၬနၥံၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"18": "<sup>18</sup> မွဲဆၧမၩမုၬထၪ့ ထဲၩ့ယၧၩ လၧယၥုၪ့အုၭၥၭအုၭ",
			"19": "<sup>19</sup> အကၠီၩ့ဆံၭ. ယၥၭလၩ့ဆါလၧယဖၧၩ့လီၫ.- ယိခွါ, ယၡၩခမျၧးအဖိၪမုၪ အဆၧကိၭၡၭထၪ့ လၧထံၫယဲၩ့ ခးယဲၩ့လီၫ. ယဟိဝၩအီၪဝ့ၫလၧဇံအိၫ့အဖၧၩ့မွဲအ့ၬဧၪ. အစဎွၩအီၪဝ့ၫလၧအဖၧၩ့မွဲအ့ၬဧၪ. မွဲအမၩၥၭထၪ့ယၧၩ လၧအဆၧဂၩ့ဆၧဖၪ့, လၧၦလခီၫဘၩ့မုးဖိၪ အဆၧပျီၩ",
			"20": "<sup>20</sup> ပျီၩနီၪမွဲဘၪလဲၪ.- ကူၭဆၧအထီဖီၩ့ခွံၬယူၭး ဆၧခိအ ထီထုၬဝ့ၫဒၪတၭ, ပထီၩ့ဒံၭလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"21": "<sup>21</sup> ဆ့အ့ၬ.- လၧယၡၩခမျၧးအဖိၪမုၪဆၫအကၠီၩ့နီၪ ယ ၥုၪ့ခါၥၭလၩ့, ဒဲၥုၪ့အုၭၥၭအုၭ, ယၥၧၫ့တၭ, ဆၧထီၫမံၫ",
			"22": "<sup>22</sup> ထီၫမၪဖီၪ့ထၬယၧၩလီၫ.- လၧဂံလအၭအဖၧၩ့နီၪ, ၥံၪ့ စရံအထူၭအီၪအ့ၬဧၪ. ၥံၪဆရၫအီၪထီးနီၪအ့ၬဧၪ. အ့ၪ မွဲဘဲၫနီၪ ယၡၩခမျၧးအဖိၪမုၪ အဆၧဆၫလဘျၪထဲၩ့ ဘၪနီၪမွဲဘၪလဲၪ."
		},
		"9": {
			"1": "<sup>1</sup> ဘဲၫၥိၭယမ့ၬထံၫမိလၩ့မုဆၫဆၫမုနၩနၩ လၧၦဘၪ ဆဲၫ့လၧယၡၩခမျၧးအဖိၪမုၪနီၪ ဘၪဆၧမၩၥံၫဝ့ၫအ ကၠီၩ့တၭ,ယခိၪဎွံၪမွဲလါထံၫၥံၪနီၫ့ၥံၪ, ဒဲယမ့ၬၥၪၥံၪမွဲ လါမ့ၬထံၫအထံၫထၪ့ဖျိၭနီၪဆံၭၬ",
			"2": "<sup>2</sup> ဘဲၫၥိၭယမိစဲၪ့ဒၪယၡၩခမျၧး, ဒဲစဲၪ့ထၪ့ခွံၬလၧအဝ့ၫ ၥံၪအအီၪနီၪ, မွဲယအီၪလါလၧၥရိၬဘၪဆဲၫ့ လၧၦမွံၩ နီၪလၧၡါမုနၧၫ့ဖၫနးဖျိၪ့ဆံၭၬ အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ မွဲၦအဲၪဘိၩ့မၫထီးအလူၬ, ၦအၪ့လီၫဆၧအဆၧအီၪ",
			"3": "<sup>3</sup> ကီၪ့လီၫ.- မွဲအဘိၭထၪ့အဖျ့ၩဘဲၫအချံၪအၥိၭလၧအၪ့ လီၫဆၧအဂး, ဒဲအီၪက့ၩဒူၩအၥၭလၧအဆၧမွဲဆၧတီၩ အဂးလၧခးဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလ့ၩဆၧ လၧအဆၧအၧၩ့ နၭထၪ့ထူထူ လၧအဆၧအၧၩ့တၭ,",
			"4": "<sup>4</sup> ၥ့ၪယၫယၧၩအ့ၬး ယဟိဝၩစံၭဝ့ၫဒၪ.- ထီးလၩ့နၥံၪအ ၥၭကိၭဂၩဒ့ၭ လၧနၥံၪအထံၩအၥိၭအကၠီၩ့ဘီၪ. တၭ ဒိၭနဲၩ့နၥံၪအၥၭလၧနၥံၪအထၧၫ့ဖုဝဲနးဂၩလဂ့ၩ. အဂဲး ဘဲၫယီၩကယဲထၧၫ့ဖုဝဲလဂၩလါလါနီၪ မိအၪ့လီၫဆၧ တၡါ, ဒဲကယဲၦထံၩၦၥိၭလဂၩလါလါနီၪ မိလ့ၩချဲၩ့",
			"5": "<sup>5</sup> ခဲၪဆၧလီၫ.- အဝ့ၫၥံၪမိအၪ့လီၫန့ၦလၧအနဲၩ့ထံၭတၭ, ချဲၩ့ဆၧမွဲဆၧတီၩအ့ၬ. အဝ့ၫၥံၪၥီၪ့လိၪအဖျ့ၩဘဲၫၥိၭ မိချဲၩ့ဆၧအဘျံၭအဘျၪ, မၩဆၧအၧၩ့ ထီးဆၧပွံၭအ",
			"6": "<sup>6</sup> ၥၭလီၫ.- နအီၪအလးနီၪ မွဲဆၧအၪ့လီၫအကျၩလီၫ. မွဲအအၪ့လီၫဆၧအကၠီၩ့တၭ, မိၥ့ၪယၫယၧၩယီၩအၥၭ",
			"7": "<sup>7</sup> အီၪအ့ၬး ယဟိဝၩစံၭဝ့ၫဒၪ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧၥုၭမုးခမျၧးအယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ယိခွါ,ယမိ မၩဖံၪထၪ့အဝ့ၫၥံၪဒဲမၩခွါဝ့ၫလီၫ. အဂဲးဘဲၫယီၩလၧ ယၡၩခမျၧးအဖိၪမုၪအဂးနီၪ, ယမိမၩဆၧအဂူၫဂၩၥ့ၪ",
			"8": "<sup>8</sup> ဘဲၫၥ့ၪလဲၪ.- အဝ့ၫၥံၪအဖျ့ၩမၩအၥၭ ဘဲၫဖျါခၭယူၭ အၥိၭနီၪတၭ, ချဲၩ့အၪ့လီၫဆၧလီၫ. ၦလဂၩချဲၩ့ဆၧ ဘၪလိၬအိၭလိၬ လၧၦလၧအနဲၩ့ထံၭ လၧအနိၭလခီၫ လီၫ.အ့ၪမွဲလၧအၥၭခံဖၧၩ့နီၪ အီၪခိၭၥူၪဆၧလၧအဂး",
			"9": "<sup>9</sup> လီၫ.- ယမိဘၪစ့ၩရၫ့အဝ့ၫၥံၪ လၧဆၧလဖၪနီၪအကၠီၩ့ မွဲအ့ၬဧၪ. ယဟိဝၩ စံၭဝ့ၫဒၪ, ယၥၭမိမၩဆၧၫ့ဆၧ",
			"10": "<sup>10</sup> အၧၩ့လၧၦဆၨၩဘဲၫယီၩၥိၭမွဲအ့ၬဧၪ.- ယမ့ၬထံၫမိ လၩ့တၭ, ယမိဂၪ့လၧခိၪလီၩ့ထိၩ့ချိၬအကၠီၩ့, ယမိဂၪ့ လၧၡါမုနၧၫ့ဖၫ အၪ့အဆၪအလးအကၠီၩ့လီၫ. အဂဲး ဘဲၫယီၩ မ့ၪအၪ့ခွံၬဝ့ၫထီးၦလ့ၩခၫ့ဂၬအလးနီၪၥ့ၪနး ဂၩအ့ၬ.ဒဲဆၧဖိၪဆၧဎါအဒိၩ့အလူနီၪ ၦၡၩနါဂၧၫ့ဘၪ လၧၩ့အ့ၬ. တၭထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့နီၪ ဒဲဆၧ",
			"11": "<sup>11</sup> ဖိၪဆၧဎါနီၪစဲၪ့ခွံၬယူၭး- ယမိမၩယရုစလံၫ့လၧဆၧ ပိၩ့လဖၪ, ထွံၪဂၪ့ခိၪအီၪအလးတၭ, ယမိမၩအီၪယူ ယုဒၫအဒိၩ့လဖၪ ထီးၦအီၪဝ့ၫလၧအဖၧၩ့နးဂၩအ့ၬ.",
			"12": "<sup>12</sup> ၦကိၪ့ဆၧၥ့ၪလၧအနၪၥ့ၪဆၧယီၩ မွဲပလၫလဂၩလဲၪ. တၭၦလၧယဟိဝၩအနိၭမိချဲၩ့ဝ့ၫ, ဘဲၫၥိၭအမိဒုၭနဲၪ ဝ့ၫနီၪ,မွဲပလၫလဂၩလဲၪ. ခးဂၭဂီၩ့, မ့ၪအၪ့ခွံၬဝ့ၫဘဲၫ ၡါမုနၧၫ့ဖၫအၥိၭနီၪ, ထီးၦၡၩလလ့ၩခၫ့ဂၬဘၪဝ့ၫနး ဂၩနီၪမွဲဘၪလဲၪ.",
			"13": "<sup>13</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲအဝ့ၫၥံၪခွံၬၡိၭ ယဆၧၥီၪ့ဆၧ ၥၫ့လၧယအီၪက့ၪလၩ့ လၧအမ့ၬယၫတၭ, လခိၭနၪ",
			"14": "<sup>14</sup> ဘၪယလူတၭ,လ့ၩဝ့ၫလၧအဖၧၩ့ဆ့အ့ၬ.- အ့ၪမွဲလ့ၩ ဖိၬအၥၭဒၪဝ့ၫအနါကဲၪ့အခဲၫ့တၭ, လ့ၩဖိၬဘၫအလၭ",
			"15": "<sup>15</sup> လဖၪအခဲၫ့လၧပဖါၥံၪၥီၪ့လိၪဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ, ဆၧၥုၭမုခမျၧး အယဟိဝၩ အံၫစရ့လၭအယွၩ စံၭဝ့ၫဒၪ, ယိခွါ, ယမိဒုၭအၪ့ၦခမျၧးယီၩလၧရီးခၥီၫ,",
			"16": "<sup>16</sup> ဒဲဒုၭအီၩဝ့ၫလၧၥံၪခၪအထံၫလီၫ.- ယမိမၩလၩ့ပြံၩ လၩ့ပၩအဝ့ၫၥံၪလၧၦဆၨၩလဖၪအကျၩ လၧအဝ့ၫၥံၪ မွဲဂ့ၩ,ဒဲအဖါလဖၪမွဲဂ့ၩၥ့ၪယၫဝ့ၫအ့ၬ, တၭယမိအၪ့ မၧၫ့နၭလဘံၪ့လ့ၩဖိၬအခဲၫ့ ထီးယမၩလူၬခွံၬဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩ, ဆီၫ့မီၪ့ဆၧ တၭကိၭန့ၦမုၪလၧအဂၪ့ဆၧဘဲၫၥိၭအမိဂဲၫတၭ, အၪ့ မၧၫ့လၩ့ဆၧလၧ ၦမၩဆၧၥ့ၪအအီၪနီၪ ဘဲၫၥိၭအမိဂဲၫ",
			"18": "<sup>18</sup> ဆံၭ.- တၭမွဲအမၩဆၧချဲၫ့ချဲၫ့, ဒဲဂၪ့လၧပကၠီၩ့ဘဲၫၥိၭ ပမ့ၬထံၫမိယွၩလၩ့, ဒဲပမ့ၬထံၫဂဲၫဖျိၭထၪ့ လၧပမ့ၬ",
			"19": "<sup>19</sup> ဖံၭနီၪဘီၪ.- မွဲမၬ, ဂၪ့ဆၧယၧၩ့ဆၧအၥီၫဂၧၫ့ထၪ့ဝ့ၫ လၧဇံအိၫ့အဖၧၩ့လီၫ. ပဘၪဆၧမၩဆီၪ့န့ပၧၩဆံၭဒိၪ လဲၪၬပအီၪက့ၪမဲပမ့ၬ ဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ ပ စဲၪ့ထၪ့လၧခးဖၧၩ့, မွဲၦၡၩမၩလၩ့ဎီးခွံၬ ပဂံၪ့အဂဲး",
			"20": "<sup>20</sup> လီၫ.- မွဲလါနၫ့တၭ, ၦမုၪၥံၪဧ့, ခိၭနၪယဟိဝၩအလူ တၭ,ဒုၭနါဂၧၫ့နၥံၪအနါ လၧအနိၭအဆၧချဲၩ့တၭ,ၥီၪ့ လိၪနၥံၪအဖိၪမုၪလၧအမိဂၪ့ဆၧဘီၪ. တၭမွဲၦၡၩၥီၪ့ လိၪလဂၩအလိၭဖၪ့ လဂၩအလိၭဖၪ့ လၧဆၧဂၪ့ဆၧ",
			"21": "<sup>21</sup> ယၧၩ့ဆံၭ.- အဂဲးဘဲၫယီၩဆၧၥံၫဂဲၫနုၬ လၧပဂံၪ့တရၫ့ လံၩလဖၪနီၪ, ဒဲဂဲၫနုၬဝ့ၫလၧပနီးလဖၪအဖၧၩ့နီၪ,ဘဲၫ ၥိၭအမိဖ့ၬခွံၬ ဖိၪဒံၩဖိၪၥၪလၧဖၧၩ့ၥၭဖၧၩ့, ဒဲၦဖိၪၥၪ",
			"22": "<sup>22</sup> ခွၫလၧဖၧၩ့ၥၭမုဖၭလဲအဖၧၩ့နီၪလီၫ.- စံၭ, ယဟိဝၩ စံၭဝ့ၫဘဲၫယီၩ, ၦၡၩအစွၪနီၪမိလၩ့ထ့ၬဘဲၫဆၧအ့ၪ လၧဆၧပျၩ့ဖၧၩ့အၥိၭနီၪ, ဒဲဘဲၫဘုၪအစူၪၥံၪလၧၦကူၭ ဆၧအလးခဲၫ့ လၧၦလအၪ့ထုၫ့ထၪ့ဘၪနးဂၩအၥိၭနီၪ လီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ၦကိၪ့ဆၧၥ့ၪနီၪ,မွဲအထီးအၪ့ အူၭလၩ့အၥၭ လၧဆၧကိၪ့ၥ့ၪအကၠီၩ့နီၪလဂ့ၩး တၭ ၦလၧအဂဲးဆီၪ့အဘၭဆီၪ့နီၪ, မွဲအထီးအၪ့အူၭလၩ့ အၥၭလၧအဂဲးအဘၭအကၠီၩ့လဂ့ၩး တၭၦၥထံၫနီၪ, မွဲအထီးအၪ့အူၭလၩ့အၥၭလၧအဆၧထူၭဆၧလၧၫ့",
			"24": "<sup>24</sup> အကၠီၩ့နီၪလဂ့ၩ.- အ့ၪမွဲၦလၧအအၪ့အူၭလၩ့အၥၭ နီၪ,မွဲအအၪ့အူၭလၩ့အၥၭ လၧအယီၩလမံၩ့အကၠီၩ့, လၧအနၪၥ့ၪယဂဲးယကၠီၪ့, ဒဲၥ့ၪယၫယၧၩလၧယမွဲယ ဟိဝၩလၧအမၩဆၧအဲၪအခိးအတၩ ဒဲဆၧစ့ၩရၫ့တီၩ, ဒဲဆၧတီၩဆၧလီၩ့လၧဂၪ့ခိၪချိၫ့နီၪဆံၭ. အဂဲးဘဲၫယီၩ ဘၪယၥၭလၧဆၧနီၪလဖၪ, ယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"25": "<sup>25</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ,မုနံၩလဖၪဂဲၫလၧယမိစ့ၩ ရၫ့စၪကယဲၦဒိၭဆၧကူၭတရံၭအီၪဝ့ၫလၧၦလဒိၭဘၪ",
			"26": "<sup>26</sup> ဆၧကူၭတရံၭအၥိၭနီၪ,- အံဇံၭဒဲယုဒၫ, ဒဲအံဒၧၫ့, ၦ အၫမၧၫ့ဖိၪ, ဒဲၦမိအၭဖိၪ, ဒဲၦလၧအလိၩ့အခၪလၬဆီၪ့ အနိၪ့လဖၪ လၧအအီၪဝ့ၫလၧၡါမုနၧၫ့ဖၫလီၫ. အဂဲး ဘဲၫယီၩၦဆၨၩထီးအလူၬနီၪ ဒိၭဆၧကူၭတရံၭအ့ၬ. တၭအံၫစရ့လၭအဂံၪ့ဖိၪထီးအလူၬ ဒိၭဆၧကူၭတရံၭ လၧအၥၭခံဖၧၩ့ဆ့အ့ၬ."
		},
		"10": {
			"1": "<sup>1</sup> အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ခိၭနၪဆၧချဲၩ့လၧယ",
			"2": "<sup>2</sup> ဟိဝၩချဲၩ့ဆၧလၧနၥံၪဆံၭ.- ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ထီးမၩလိၪၦဆၨၩလဖၪအဖၧၩ့ၥၭလဂ့ၩး တၭမူၭခိၪ အဆၧလၩ့လၭလဖၪနီၪ ၦဆၨၩလဖၪ ၥၭမဲၪလါနၫ့,",
			"3": "<sup>3</sup> ထီးၥၭမဲၪ နၥံၪဝ့ၫလဂ့ၩး- အဂဲးဘဲၫယီၩ ၦခမျၧးအ ထူၫအရူၫနီၪမွဲဆၧပျီၩပျီၩလီၫ. အဂဲးဘဲၫယီၩၦလဂၩ ခူၬလၩ့ဝ့ၫလၧၥံၪ့လထံၭလၧမံၩ့လၬကျၩ, ၦမၩဆၧၥ့ၪ",
			"4": "<sup>4</sup> အစူၪစိၭဝ့ၫလၧကွၩလီၫ.- အဝ့ၫၥံၪကယၧၩ့ကယီၫဝ့ၫ လၧကျိၪၥံၪစ့ၩၥံၪ, ဒဲထီၫ့ၥံၪလွ့ၫၥံၪတၭ, ဖျၩထၬဝ့ၫ လၧထၭစဲၩၥံၪ ဒဲစၭခုၪဘဲၫၥိၭ အထီးဂဲၩဝၭလဂ့ၩ.",
			"5": "<sup>5</sup> မွဲအအီၪထုၪ့လုၪ့ ဘဲၫၥံၪ့ စီၩ့မလီၫ့အၥိၭလါနၫ့တၭ, ချဲၩ့ဆၧၥ့ၪအ့ၬ. ၦၡၩဘၪဆိၬဝ့ၫနီၪ, အဂဲးဘဲၫယီၩလ့ၩ ဆၧၥ့ၪအ့ၬ. ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩး အဂဲးဘဲၫယီၩ",
			"6": "<sup>6</sup> မၩအၧၩ့ဆၧၥ့ၪအ့ၬ, ဒဲမၩဂ့ၩဆၧၥ့ၪဆ့အ့ၬ.- မွဲမၬ, ဆၧလၩ့ဂၬလၧနၧၩအီၪအ့ၬ, ယဟိဝၩဧ့,နမွဲဆၧအဒိၪ",
			"7": "<sup>7</sup> တၭ,နမံၩ့ဒိၪဝ့ၫလၧဆၧအစီၩ့အမၩ့အကၠီၩ့လီၫ.- ၦ ဆၨၩလဖၪအစဎွၩဧ့, ၦလၧအလၥၭမဲၪဘၪနၧၩနီၪ, မွဲပလၫလဂၩလဲၪ. အဂဲးဘဲၫယီၩဆၧၥၭမဲၪကြၨၭလၧ နၧၩလီၫ. အဂဲးဘဲၫယီၩလၧၦကိၪ့ၥ့ၪထီးအလူၬလၧ ၦဆၨၩလဖၪအကျၩ, ဒဲလၧအဘၩ့အမုး ထီးအလူၬ",
			"8": "<sup>8</sup> အဖၧၩ့နီၪဆၧလၩ့ဂၬနၧၩအီၪအ့ၬ.- တၭအဝ့ၫၥံၪမွဲ ၦဘၪဆဲၫ့လၧဆၧဖိၪဆၧဎါ, ဒဲၦဂၭဂီၩ့ဖိၪလစီၪ့ဎးလီၫ. ၥံၪ့အထုၪ့နီၪမွဲဆၧၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ အဆၧပျီၩပျီၩလီၫ.",
			"9": "<sup>9</sup> စ့ၩပၪပဲၪအဘံၪ့ၥံၪနီၪ ၦဂဲၫဆိၬဝ့ၫလၧတၫၡံၭ, ဒဲဂဲၫန့ ထီၫ့လၧယုဖဇၭနီၪ, ၦမၩဆၧ, ဒဲၦၥိၫ့ဆၧအဆၧမၩ လီၫ.ဆၧလၫဒဲဆၧလုၭဖုၭနီၪမွဲအကီၩ့အၥိၭလီၫ. ဆၧ",
			"10": "<sup>10</sup> ထီးအလူၬနီၪမွဲၦမၩဆၧၥ့ၪအဆၧမၩလီၫ.- အ့ၪမွဲယ ဟိဝၩမွဲယွၩ အမွဲအတီၩ, အဝ့ၫဒၪမွဲယွၩ လၧအမၧၫ့ ဝ့ၫ,ဒဲစဎွၩအဆိၩအကၠၪလီၫ. ဂၪ့ခိၪမိဝၭလၧအၥၭထၪ့ အကၠီၩ့, ဒဲၦဆၨၩလဖၪအီၪဝ့ၫလၧအၥၭခဲၩထၪ့အမ့ၬ ယၫကဲၪအ့ၬ.",
			"11": "<sup>11</sup> (နၥံၪမိဘၪစံၭအဝ့ၫၥံၪဘဲၫယီၩ, ယွၩလဖၪလၧအ လတဲၩ့လၩ့ဘၪမူၭခိၪဒဲဂၪ့ခိၪနီၪ, မိလၩ့မါခွံၬလၧဂၪ့",
			"12": "<sup>12</sup> ခိၪချိၫ့ဒဲလၧမူၭခိၪယီၩအဖၫ့လၬလီၫ.)- အဝ့ၫဒၪတဲၩ့ လၩ့ဂၪ့ခိၪလၧအစီၩ့အမၩ့, မၩခၧၫ့ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ လၧအဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒဲပၠၪထၪ့မူၭခိၪလၧအဆၧ",
			"13": "<sup>13</sup> ကိၪ့ဆၧဖၭလီၫ.- ထီးအဒုၭၥီၫထၪ့အလူနီၪ, ထံၫခမျၧး အီၪဝ့ၫလၧမူၭဖိၭဖၫ့, ဒဲဒုၭအွံၩထၪ့ဆၧ လၧဂၪ့ခိၪအ ထုၬနီၪလီၫ. အဆၧတဲၩ့လၫ့ဝဲဒံၭ အီၪလၧဆၧဆၧၩ့ တၭ,ဂဲၫဆိၬထၪ့ခွံၬလံၩ လၧအဆၧအီၪက့ၪကီၪ့အလး",
			"14": "<sup>14</sup> ဖၧၩ့လီၫ.- လၧဆၧၥ့ၪယၫအဖၧၩ့နီၪအဝ့ၫၥံၪဘၪဆဲၫ့ လၧဆၧဖိၪ ဆၧဎါကိၭဂၩဒ့ၭလီၫ. ကယဲၦၥိၫ့ဆၧအ ဆၧဂၩ့နီၪအီၪက့ၪမဲအမ့ၬလီၫ. အဂဲးဘဲၫယီၩအဆၧ ဂၩ့ၥိၫ့အၥၭနီၪမွဲဆၧအဘျံၭအဘျၪတၭ, အၥၪၡိၫအီၪ",
			"15": "<sup>15</sup> လၧအဖၧၩ့အ့ၬ.- အဝ့ၫၥံၪမွဲဆၧပျီၩပျီၩ, ဆၧဒုၪဒွ့ၪအ လးလီၫ. ထီးဆၧစ့ၩရၫ့အဆၧၫ့အထီနီၪ, အဝ့ၫၥံၪမိ",
			"16": "<sup>16</sup> ဂၭဂီၩ့လီၫ.- စယၫကူၭအဂးနီၪလၩ့ဂၬအဝ့ၫၥံၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪ မွဲၦတဲၩ့ဆၧထီးအလူၬတၭ, အံၫစရ့လၭ မွဲအဆၧန့ၥၫ အနိၪထိၪလီၫ. ဆၧၥုၭမု ခမျၧးအယဟိဝၩနီၪမွဲအမံၩ့လီၫ.",
			"17": "<sup>17</sup> ၦအီၪလၧထိၬဖၧၩ့ၥံၪဧ့, အၪ့ထုၫ့ထၪ့နဆၧဖိၪဆၧ လံၩလၧခးဖၧၩ့ဘီၪ.-",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭဘဲၫ ယီၩ,ယိခွါ, ယမိခွံၬၡိၭၦခးဖိၪလဖၪလၧဆၧခွံၬလဖၧၫ့ ဎးတၭ, ယမိမၩခိမၩဝီၩဝ့ၫ ထီးအၥ့ၪယၫအၥၭလီၫ.",
			"19": "<sup>19</sup> မွဲယဘၪဆၧမၩဆၫယၧၩတၭ, ယဘၪဆၧအၡၪ့, ယဖၧၩ့လးဆၫနၭမၬလီၫ. မွဲလါနၫ့တၭယစံၭ, မွဲမၬ, အဝ့ၫယီၩမွဲယဆၧၡၪ့ဆၧနၭ ဒဲယဘၪအွံၪၥၭဆၧၩ့",
			"20": "<sup>20</sup> လီၫ.- ယတဲၩဂၭဂီၩ့ယူၭ, ဒဲယဖျံၩထီးအလူၬထ့ၬခွံၬ ယူၭ,ယဖိၪၥံၪထီးအလူၬ စဲၪ့ထၪ့ခွံၬယူၭလၧယအီၪ တၭအီၪလၧၩ့အ့ၬ. ၦဆုးထၪ့ယတဲၩဒဲဘျၭထၪ့ကလ",
			"21": "<sup>21</sup> ကၫနီၪအီၪလၧၩ့အ့ၬ.- အဂဲးဘဲၫယီၩၦယူၬၥိၪၥံၪထီး အလူၬနီၪ ကဲၪထၪ့ၦဘၪဆဲၫ့လၧဆၧဖိၪဆၧဎါတၭ, အၪ့ဎၬယဟိဝၩအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ဘီၪထၪ့ ယီၫထၪ့အ့ၬ, တၭအၥိၪအဒီၪ့ၥံၪလၩ့ပြံၩလၩ့ပၩထီး",
			"22": "<sup>22</sup> အလူၬလီၫ.- ဆၧအပရၧၫ့ၥီၫထၪ့,ယိခွါ,ဂဲၫဝ့ၫ,ဒဲဆၧ တုၩ့ထၪ့တုၩ့လၩ့ဖၭဒိၪ လၧခးလၧမုဖၩလခီၫဘဲၫၥိၭ အမိမၩယူယုဒၫအဒိၩ့လဖၪ, ဒဲမၩဝ့ၫလၧထွံၪဂၪ့ခိၪ အီၪဝ့ၫအလးလီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩဧ့, ယၥ့ၪယၫလၧၦၡၩအဖၧၩ့ၥၭအီၪလၧ အနၫ့ဆါဒၪဝ့ၫအဖၧၩ့အ့ၬး တၭၦလၧအလ့ၩဆၧနီၪ",
			"24": "<sup>24</sup> ပၧၩ့အခၫထၪ့လဖၪၥ့ၪအ့ၬ.- ယဟိဝၩဧ့, အၪ့ၥီၪ့ ယၧၩလါနၫ့, မွဲလၧနဆၧစ့ၩရၫ့အဖၧၩ့, မၩလၧနၥၭ",
			"25": "<sup>25</sup> ထၪ့လဂ့ၩ, နမိမၩလၩ့မါခွံၬဘၪခိၬယၧၩလီၫ.- လူၫ လၩ့ခွံၬနၥၭထၪ့လၧၦဆၨၩလဖၪ လၧအလၥ့ၪယၫဘၪ နၧၩ,ဒဲလၧၦဂံၪ့ဒီၪ့လဖၪ လၧအလကိၭထၪ့ဘၪနမံၩ့နီၪ အလီၩ့ဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအၪ့ခွံၬစယၫကူၭ တၭ,ယုလၩ့ခွံၬဝ့ၫဒဲမၩလူၬခွံၬဝ့ၫ, ဒဲမၩယူဝ့ၫအလး လၧအအီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪစယ့ၫရမဲအၫ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- ခိၭနၪဆၧအုၩ့လၩ့ယီၩအလူ, ချဲၩ့ဆၧလၧယုဒၫ",
			"3": "<sup>3</sup> အၡၩ,ဒဲၦယရုစလံၫ့ဖိၪ,- တၭစံၭအဝ့ၫၥံၪ,ယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ၦလၧအလခိၭနၪဘၪ ဆၧအုၩ့လၩ့ယီၩအလူ လၧယမၪလူၬနၥံၪအဖါနီၪ,မွဲ",
			"4": "<sup>4</sup> အဘၪဆၧဆိၪအၧၩ့ဆံၭ.- လၧမုလနံၩလၧယဒုၭစဲၪ့ ထၪ့ခွံၬအဝ့ၫၥံၪလၧခးအံဇံၭအဖံၫ့ချၪထၭအဖၧၩ့, ယ စံၭခိၭနၪယလူတၭ, မၩနၥံၪဝ့ၫဘဲၫကယဲဆၧလၧယ မၪလူၬနၥံၪဆံၭ. နၥံၪကဲၪထၪ့ယၡၩခမျၧး ဘဲၫနီၪၥိၭ",
			"5": "<sup>5</sup> တၭ,ယမိကဲၪထၪ့နၥံၪအယွၩ,- ဘဲၫၥိၭယမိမၩဎွ့ၩ ထၪ့ဆၧလၧယဆိၪလၩ့ယၥၭ လၧနၥံၪအဖါလဖၪလၧ ယမိဖ့ၪလၫ့ဝ့ၫ လၧခးလဘံၪ့ လၧအယွၩလၩ့ဝ့ၫလၧ ဆၧနူထံၫ ဒဲန့ၫစၩ့ဘဲၫလၧမုဆၫလနံၩယီၩအၥိၭလီၫ. ထီးနီၪလဖၧၫ့ ယစံၭဆၧၫ့ဆၧတၭ, စံၭ,အၩမံၩ့, ယ ဟိဝၩဧ့,",
			"6": "<sup>6</sup> တၭယဟိဝၩစံၭယၧၩ, မၩဂၧၫ့ထၪ့ၥၩလၩ့ဆၧချဲၩ့ ထီးအလူၬယီၩ လၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့, ဒဲလၧ ယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့တၭ, စံၭ, ဆၧအုၩ့လၩ့အလူ",
			"7": "<sup>7</sup> ယီၩခိၭနၪဒဲထီးန့ဆံၭ.- အဂဲးဘဲၫယီၩယထိးယၥၭ တၡါလ့ၬ လၧနၥံၪအဖါလဖၪ လၧမုလနံၩလၧယဒုၭ စဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧခးအံဇံၭ ထီးလၩ့မုဆၫလနံၩ ယီၩ,ယဂဲထုၪ့ဂီၩဂီၩတၭ, ထိးယၥၭတၭ,စံၭ,ခိၭနၪ",
			"8": "<sup>8</sup> ယလူဆံၭ.- မွဲလါနၫ့တၭအဝ့ၫၥံၪခိၭနၪအ့ၬ. မွဲအဒိၭ အနါဆ့အ့ၬတၭ, လ့ၩဖိၬအၥၭအၧၩ့အဖၧၩ့ၥၭလဂၩ ဘၪလဂၩဆုၬဆုၬလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယမိဒုၭ ဂဲၫဘၪအဝ့ၫၥံၪ လၧဆၧအုၩ့လၩ့အလူယီၩ ထီးအလူၬ လၧယမၪလူၬလၧအမိဘၪမၩတၭ, အဝ့ၫၥံၪမၩဝ့ၫအ့ၬ.",
			"9": "<sup>9</sup> တၭယဟိဝၩစံၭယၧၩ, ဆၧအုၩ့လၩ့အအၧၩ့အီၪ ဝ့ၫလၧယုဒၫအၦၡၩအကျၩ, ဒဲလၧယရုစလံၫ့ဖိၪအ",
			"10": "<sup>10</sup> ကျၩလီၫ.- အဝ့ၫၥံၪထဲၩ့ထဲၩ့ဝ့ၫ လၧအဖါအဆၧမၪ လၧအခၪ့ထံၭ, လၧအလခိၭနၪဘၪယဆၧချဲၩ့တၭ,ဖိၬ ယွၩဂူၫဂၩလဖၪအခဲၫ့ဘဲၫၥိၭအမိမၩအဆၧလီၫ. အံၫ စရ့လၭအၡၩဂံၪ့ဖိၪ, ဒဲယုဒၫအၡၩဂံၪ့ဖိၪ, မၩဂၭဂီၩ့ ယူၭယဆၧအုၩ့လၩ့လၧယအုၩ့လၩ့ယူၭ လၧအဝ့ၫၥံၪ",
			"11": "<sup>11</sup> အဖါလဖၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭ ဘဲၫယီၩ, ယိခွါ,ယမိဒုၭဘၪအဝ့ၫၥံၪလၧဆၧအၧၩ့လၧ အဖီၩ့ဖျ့ၭဝ့ၫလၥ့ၪဘၪတၭ, အ့ၪကိၭထၪ့ယၧၩလါနၫ့",
			"12": "<sup>12</sup> တၭ,ယခိၭနၪအလူအ့ၬ.- ထီးနီၪလဖၧၫ့ယုဒၫအဒိၩ့ လဖၪအဖိၪ, ဒဲၦယရုစလံၫ့ဖိၪ မိလ့ၩကိၭထၪ့ဆၧလၧ ယွၩလဖၪ လၧအဝ့ၫၥံၪဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧအဂး လီၫ.မွဲလါနၫ့တၭ, လၧအဘၪဆၧၡၪ့ဆၧနၭအဘိၩ့",
			"13": "<sup>13</sup> ဘၭ,ဆၧလဖၪနီၪမိမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪအ့ၬ.- အဂဲး ဘဲၫယီၩနယွၩလဖၪအီၪဝ့ၫဎွ့ၩဎီၩ့လၧနဒိၩ့လဖၪ, ယု ဒၫဧ့း တၭနၥံၪမၩထၪ့ဆၧလုအလး, ဆၧမ့ၬမဲအလး ဎွ့ၩဎီၩ့လၧယရုစလံၫ့အဖၧၩ့ၥၭလဖၪ, ဆၧလုအလး ဘဲၫၥိၭနၥံၪမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧဘၫအလၭအဂး",
			"14": "<sup>14</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးဘၩဆိၪဖၪန့ၦခမျၧး ယီၩအဂးလဂ့ၩး တၭထီးကိၭၡၭထၪ့ဆၧအၪ့ယၫလၧ အဂးလဂ့ၩး အဂဲးဘဲၫယီၩ အထီလၧအကိၭထၪ့ယၧၩ လၧအဘၪဆၧခိဆၧဝီၩအကၠီၩ့တၭ, ယခိၭနၪအလူ",
			"15": "<sup>15</sup> အ့ၬ.-ၦလၧယအဲၪဝ့ၫလဂၩ မၩဆၧလဲးဆၧဘျၪလၧ ၦအၪဂၩတၭ,မွဲအမိမၩဆၧနီၫလၫ လၧယဂံၪ့ဖၧၩ့နီၪ လဲၪ.တၭဆၧယၪဆံၫ့ဎံၪ လ့ၩဖီၩ့ခွံၬယူၭ လၧနအီၪ",
			"16": "<sup>16</sup> ယူၭ.ထီးနမၩဆၧအၧၩ့တၭနၥုၪ့ဎွံၫၥၭယီၫလီၫ.- ယ ဟိဝၩကိၭနမံၩ့လၧအလဲအိၫ့အၥံၫ့ဆ့ၬ အဎံၫအလၩ, ဒဲအဆၧၥၪဂ့ၩလီၫ. ဆူၭခဲၩထၪ့မ့ၪလၧအဖၫ့ခိၪအီၪလၧ",
			"17": "<sup>17</sup> အၥီၫဖၭဒိၪတၭ, အထဲၩ့ခါလၩ့ယူၭလီၫ.- အဂဲးဘဲၫ ယီၩဆၧၥုၭမုခမျၧးအယဟိဝၩ လၧအၥုၪ့လၩ့န့နၧၩ နီၪချဲၩ့ထၪ့ဆၧအၧၩ့ထၫ့ဒုၪဒၩနၧၩ, ဒဲလၧအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪအဆၧအၧၩ့အကၠီၩ့ ဒဲလၧယုဒၫအၡၩဂံၪ့ ဖိၪအဆၧအၧၩ့အကၠီၩ့ လၧအမၩဝ့ၫလၧအဆူၭခဲၩဆၧ နၧၫ့မၧၫ့လၧဘၫအလၭအဂးတၭ, ထိၪဂဲၩယၥၭထၪ့ လီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩဒုၭၥ့ၪယၫယၧၩတၭ,ယၥ့ၪယၫလီၫ. ထီး နီၪလဖၧၫ့နဒုၭနဲၪယၧၩ လၧအဝ့ၫၥံၪအဆၧမၩလီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယမၩယၥၭဘဲၫၥိၪဖိၪမွဲဂ့ၩ, ချီဖၫ မွဲဂ့ၩ,လၧဆၧမီၩ့မၩၥံၫဝ့ၫအၥိၭနီၪလီၫ. အဝ့ၫၥံၪကိၪ့ ထၪ့ဖၭလၩ့ဆၧထၫ့ဒၩယၧၩနီၪ ယၥ့ၪယၫအ့ၬ, တၭ စံၭဝ့ၫ,မွဲပမၩဂၭဂီၩ့ၡီၩ့ၥံၪ့အဆၧၥၪဘီၪး မွဲပဒၪ့ထ့ၬ ၡီၩ့အဝ့ၫလၧဆၧမၧၫ့အခးဖၧၩ့ ဘဲၫၥိၭဆၧထီးနၪ့ထၪ့",
			"20": "<sup>20</sup> ထဲၩ့အမံၩ့နီၪလဂ့ၩဆံၭ.- တၭဆၧၥုၭမုခမျၧးအယဟိ ဝၩလၧအစ့ၩရၫ့ဆၧတီၩ, လၧအမၩခွါပလ့ ဒဲပၥၭလ ဂၩဧ့,ဒုၭဒၪဘၪလါယၧၩ လၧနမၩဆၧၫ့ဆၧအၧၩ့လၧ အဝ့ၫၥံၪအလီၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ယနဲၪဖျီၪယခွး လၧနမ့ၬယၫလီၫ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧဘၪဆဲၫ့လၧၦအၫ့အၥီၭ ဖိၪ,ၦလၧအအၪ့ဎၬမၩၥံၫနၧၩတၭ, စံၭဝ့ၫ, ဘဲၫၥိၭန ထီးၥံၫလၧပစူၪလဂ့ၩတၭ, ထီးချဲၩ့ဆၧလၧမီၪအချိၬ လၧယဟိဝၩအမံၩ့လဂ့ၩ, ယဟိဝၩစံၭဘဲၫနီၪလီၫး",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭ ဘဲၫယီၩ,ယိခွါ, ယမိစ့ၩရၫ့အဝ့ၫၥံၪလီၫ. ၦဖိၪၥၪခွၫ နီၪမိၥံၫလၧနၭ, အဖိၪခွၫၥံၪဒဲအဖိၪမုၪၥံၪမိၥံၫလၧဆၧ",
			"23": "<sup>23</sup> ၥၭဝံလၩ့ဒိၩး- တၭၦအီၪလၩ့ထးဘၪလၧအကျၩအ့ၬ, အဂဲးဘဲၫယီၩ ယမိဒုၭဘၪ ၦအၫ့အၥီၭဖိၪ လၧဆၧ အၧၩ့,ဆၧစ့ၩရၫ့အနံၪ့အလၩဒၪလ့ၬလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, ထီးယချဲၩ့ခွးလၧနၧၩတၭ,နမွဲဆၧတီၩ လီၫ. မွဲလါနၫ့တၭ, ဒုၭချဲၩ့ယၧၩလၧနစ့ၩရၫ့ဆၧအဂဲး အကၠီၪ့ဆံၭ. ၦလတီၩလလီၩ့ဘၪအဖၧၩ့ၥၭဘီၪထၪ့ ယီၫထၪ့မွဲအဂဲးဘဲၫၥ့ၪလဲၪ. ၦလၧအအၪ့လီၫဆၧထီး",
			"2": "<sup>2</sup> အလူၬနီၪ,မွဲအအီၪမုၬဝ့ၫဘဲၫၥ့ၪလဲၪ.- နၥုၪ့လၩ့အဝ့ၫ ၥံၪတၭ, အဝံဆဲၩလၩ့ဒိၪထၪ့ဝ့ၫ, ဒဲၥၪထၪ့ဝ့ၫလီၫ. န",
			"3": "<sup>3</sup> အီၪဘူၭလၧအနိၭတၭ,ယဲၩ့လၧအၥၭလီၫ.- အ့ၪမွဲန ဝ့ၫဒၪယဟိဝၩဧ့, နၥ့ၪယၫယၧၩ,နယိယၧၩတၭ, နမၩ ခွါယၥၭ လၧအအီၪလၧနၧၩလီၫ. ထုၭထၪ့အဝ့ၫၥံၪ ဘဲၫၥိၪလၧဆၧမၩၥံၫဝ့ၫအဂးအၥိၭ, ဒဲအီၪက့ၪဝ့ၫလၧ",
			"4": "<sup>4</sup> ဆၧမၩၥံၫအမုနံၩအဂးနီၪဆံၭ.- ခးနီၪမိၥုၪ့အုၭၥၭ အုၭ,ဒဲနၪ့ၥံၪမံၩ့ၥံၪ လၧခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့ဎဲၫ့ထၪ့ ခွံၬလၧၦလၧအအီၪဝ့ၫ လၧအဖၧၩ့အဆၧအၧၩ့အကၠီၩ့ နီၪဆံၭယံၬလဲၪ. ဆၧဖိၪဆၧဎါဒဲထိၪၥံၪလံၪၥံၪလူၬဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩအဝ့ၫၥံၪစံၭ, ထီးၦအ့ၪထုၬခိၬတၭ, အဝ့ၫနီၪမိဒၪဘၪဆ့အ့ၬ.",
			"5": "<sup>5</sup> နစဲၪ့လၧၦလၧအစဲၪ့လၧအခၪ့လဖၪအၥိၭနီၪ, အဝ့ၫ ၥံၪအ့ၪမၩပွံၭနၥၭတၭ, နမိစဲၪ့ပၧၩ့လၧကၥ့ၪၥုၭဘဲၫ ၥ့ၪလဲၪ.တၭဆၧအ့ၪမၩအၥၭဘဲၫနီၪ လၧခးမုၬအဖၧၩ့ တၭ,ထီးယီၫဒၫ့အထံၫအ့ၪလုၬဘံၭဆၧတၭ, နမိမၩ",
			"6": "<sup>6</sup> ဘဲၫၥ့ၪလဲၪ.- အဂဲးဘဲၫယီၩ နထၧၫ့ဖုဝဲဒၪနဝ့ၫနဖါအ ၡၩဂံၪ့ဖိၪဒၪလ့ၬ, မၩနၧၩလၧဆၧအၪ့လီၫတၭ, မွဲမၬ, အဝ့ၫၥံၪကိၭၦၡၩခမျၧးၥံၪဖိၬအခဲၫ့လီၫ. အဝ့ၫၥံၪအ့ၪ ချဲၩ့လၧနၧၩမုၬမုၬလါနၫ့တၭ, နဲၩအဝ့ၫၥံၪလဂ့ၩ.",
			"7": "<sup>7</sup> ယစဲၪ့ဒၪယူၭယဂံၪ့, ယစဲၪ့ဖၭလၧယဆၧန့ၥၫ,ဆၧ လၧယၥၭအဲၪဝ့ၫနီၪ ယဖ့ၪလၫ့ခွံၬယူၭလၧအဒုၪအဒၩ",
			"8": "<sup>8</sup> အစူၪဖၧၩ့ယူၭ.- ယဆၧန့ၥၫမွဲလၧယဂးဘဲၫဆၬလၥၧၫ့ လၧမံၩ့လၬကျၩအၥိၭနီၪလီၫ. မွဲအကိၭၡၭထၪ့အလူ ထၫ့ဒၩယၧၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယၥၭဂဲၫ့အ",
			"9": "<sup>9</sup> ဝ့ၫလီၫ.- ယဆၧန့ၥၫနီၪမၩအၥၭဘဲၫထိၪအဒူၩလဘံၪ့ အၥိၭ, ထိၪအဒူၩအီၩဝၬဖီၩ့ဝ့ၫလီၫ. ဂဲၫနၥံၪဝ့ၫဘီၪ, ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩ ထီးအလူၬနီၪ ဒုၭအီၪ",
			"10": "<sup>10</sup> ကိၩ့အီၪကီၪ့ဘီၪ,ဒုၭအၪ့ဆၧဘီၪ.- ၦယိဆၧလဖၪအၪ ဂၩမၩဂၭဂီၩ့ယူၭယစဘံၭမုအလး, အဝ့ၫၥံၪယဲးလၩ့ ယဆၧန့ၥၫလၧအခၪ့ယၫၥၭအဖၩ့လၬ, မၩယဆၧန့ၥၫ လၧအဘၪဒၪဆၧအၥၭ လၧမံၩ့လၬကျၩအီၪယူဝ့ၫလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫၥံၪမၩအီၪယူဝ့ၫနီၪ, အီၪယူဝ့ၫအကၠီၩ့တၭ, မွဲအ ၥုၪ့အုၭၥၭအုၭ လၧယကၠီၩ့လီၫ. ခးနီၪအီၪယူဝ့ၫ ထၧၫ့ဘံၪ့ယၫလီၫ. အဂဲးဘဲၫယီၩ ၦၡၩအီၪက့ၪဆၧ",
			"12": "<sup>12</sup> လၧအၥၭဖၧၩ့နးဂၩအ့ၬ.- ၦအၪ့ဂူၬဆီၪ့ဆၧဂဲၫထၪ့ဘၪ လၧအလးထၪ့ထီၫ လၧမံၩ့လၬကျၩ ထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩ အနၭအၪ့ဆၧလၧခးအထုၬ လခီၫတၭ, ဖိးလၧခးအထုၬလခီၫဒၪနီၪ, ဆၧဖံၭဆၧယၪ",
			"13": "<sup>13</sup> အီၪမုၬနးစီၪ့အ့ၬ.- အဝ့ၫၥံၪဎွံၪယူၭဘုၪကၠိၩ့ယူၭတၭ, မိကူၭဆၧဆူၪလီၫ. မၩပွံၭလၩ့ယူၭ အၥၭယူၭတၭ, န့အခိးအ့ၬ. အမ့ၬမိမဲလၧအန့ဘၪဆၧအကၠီၩ့,လၧယွၩ အၥၭခဲၩထၪ့အကၠီၩ့လီၫ.",
			"14": "<sup>14</sup> ၦအအၧၩ့အီၪလၧယနဲၩ့ထံၭလဖၪနီၪ, လၧအထိၭ ဘၪယဆၧန့ၥၫလၧယဒုၭန့ၥၫ ယၡၩခမျၧးအံၫစရ့လၭ နီၪ,ယဟိဝၩချဲၩ့ထၫ့ဒုၪဒၩဝ့ၫဘဲၫယီၩ, ယိခွါ, ယမိ ထ့ၭထၪ့ခွံၬဝ့ၫလၧအခးဖၧၩ့တၭ, ယမိထ့ၭထၪ့ခွံၬယု",
			"15": "<sup>15</sup> ဒၫအၡၩဂံၪ့ဖိၪလၧအကျၩလီၫ.- တၭဆၧမၩအၥၭလၧ ယထ့ၭထၪ့ခွံၬ အဝ့ၫၥံၪအလးခဲၫ့နီၪ, ယမိထဲၩ့ထဲၩ့ဒဲ ယၫ့ၥုၪ့ယၫ့ၥၭဝ့ၫ, ယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ၦၡၩလဂၩလၧ အဆၧန့ၥၫဆုၬဆုၬ, ဒဲၦၡၩလဂၩ လၧအခးဖၧၩ့ဆုၬ",
			"16": "<sup>16</sup> ဆုၬလီၫ.- တၭဆၧမိမၩအၥၭ, လၧအဝ့ၫၥံၪအ့ၪမၩလိၪ တၡါ ယၡၩခမျၧး အဖၧၩ့ၥၭလဖၪ, ဘဲၫၥိၭအမိဆိၪ လၩ့အၥၭလၧယမံၩ့အမ့ၬယၫ, ယဟိဝၩမၧၫ့ဝ့ၫး ဘဲၫ ၥိၭအဝ့ၫၥံၪၥီၪ့လိၪ ယၡၩခမျၧးလၧ အမိဆိၪလၩ့အၥၭ လၧဘၭဘလၧၫ့အမ့ၬယၫအၥိၭနီၪတၭ, ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိဘၪဆၧမၩထၪ့ဝ့ၫ လၧယၡၩခမျၧးအကျၩ",
			"17": "<sup>17</sup> လီၫ.- အ့ၪမွဲအဝ့ၫၥံၪအ့ၪလခိၭနၪဘၪဆၧနီၪယမိထ့ၭ ထၪ့ခွံၬၦလဆၨၩနီၪ ဒဲမၩဂၭဂီၩ့လူၬဆ့လီၫ. ယဟိဝၩ စံၭဝ့ၫဒၪ."
		},
		"13": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭယၧၩဘဲၫယီၩ, လ့ၩမၩန့နခၧၩ့ယးလၧ ဘၩ့ဘွၩဖျ့ၫလံၬကံၭတၭ, ခဲးထူၬနယးဒံၩ့ဘီၪ. တၭ",
			"2": "<sup>2</sup> အီၪက့ၪဝ့ၫလၧထံၫကျၩလဂ့ၩ.- အခိးမွဲယမၩန့ခၧၩ့ ယးလဘံၪ့ဘဲၫယဟိဝၩအလူအၥိၭတၭ, ခဲးထူၬယ ယးဒံၩ့လီၫ.",
			"3": "<sup>3</sup> တၭယဟိဝၩအလူလၩ့ဘၪယၧၩ နံၫဖၧၫ့လဖၧၫ့တၭ,",
			"4": "<sup>4</sup> စံၭဝ့ၫဒၪ,- မၩန့နခၧၩ့ယးနီၪလၧနန့ဘၪဝ့ၫလၧအအီၪ ဝ့ၫလၧနယးဒံၩ့အလီၩ့တၭ, ဂဲထုၪ့လ့ၩလၧယုၫပ့တံၫ",
			"5": "<sup>5</sup> တၭ,အီၪက့ၪၥူၪဝ့ၫလၧလိးအိၩဖၧၩ့ထီးနီၪဆံၭ.- တၭ ယလ့ၩအီၪက့ၪၥူၪဝ့ၫလၧယုၫပ့တံၫ ဘဲၫယဟိဝၩမၪ",
			"6": "<sup>6</sup> လူၬယၧၩအၥိၭနီၪလီၫ.- ဆၧမၩအၥၭလၧအၪနံၩအၪ ၥၫ့ဖီၩ့ခွံၬနီၪ,ယဟိဝၩစံၭယၧၩ, ဂဲထုၪ့လ့ၩလၧယုၫပ့ တံၫတၭ,မၩန့ခၧၩ့ယးနီၪ လၧယမၪလူၬနၧၩအီၪက့ၪ",
			"7": "<sup>7</sup> ၥူၪထီးနီၪဆံၭ.- ထီးနီၪလဖၧၫ့ယလ့ၩလၧယုပ့တံၫ ယခုၪ့ဆၧတၭ, ယမၩန့ထၪ့ခၧၩ့ယးနီၪထီးအလးလၧ ယအီၪက့ၪၥူၪဝ့ၫတၭ, ယိခွါ, ခၧၩ့ယးနီၪဂၭဂီၩ့ယူၭ,",
			"8": "<sup>8</sup> အိၭလၧၩ့ဆၧနးမံၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ယဟိဝၩအလူ",
			"9": "<sup>9</sup> လၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ.- ယဟိဝၩစံၭဘဲၫယီၩ, ယုဒၫအၥၭထၪ့ထီၫ, ဒဲယရုစလံၫ့အၥၭထၪ့ထီၫဒိၪဒိၪ",
			"10": "<sup>10</sup> လ့ၬနီၪ, ယမိမၩဂၭဂီၩ့ဝ့ၫဘဲၫနီၪၥိၭလီၫ.- ၦၡၩခမျၧး အအၧၩ့ယီၩ, လၧအမိခိၭနၪယလူအၥၭလအီၪဘၪနီၪး လၧအလ့ၩဖိၬအၥၭအၧၩ့အဖၧၩ့ၥၭ, ဒဲဖိၬယွၩအဂူၫဂၩ လဖၪအခဲၫ့, ဘဲၫၥိၭအမိမၩအဆၧဒဲဘိၪ့ထၪ့ဘၩထၪ့ ဝ့ၫနီၪ, မိမၩအၥၭဘဲၫခၧၩ့ယးလဘံၪ့ယီၩလၧအလန့",
			"11": "<sup>11</sup> ကဲၩ့န့ကၩလၧၩ့ဘၪ ဆၧနးမံၩ့အၥိၭနီၪလီၫ.- အဂဲး ဘဲၫယီၩဘဲၫခၧၩ့ယးဘုၭထၬလၧၦၡၩအယးဒံၩ့အၥိၭ နီၪ,အံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီးအလူၬ, ဒဲယုဒၫအၡၩ ဂံၪ့ဖိၪထီးအလူၬနီၪ, ယမိဒုၭဘုၭထၬလၧယၧၩဘဲၫနီၪ အၥိၭ,ယဟိဝၩစံၭဝ့ၫဒၪ. ဘဲၫၥိၭအဝ့ၫၥံၪမိကဲၪထၪ့ ၦခမျၧးလစီၪ့ဎးလၧယဂး, ဒဲလၧဆၧလမံၩ့အဂး, ဒဲ လၧဆၧစံၭထၪ့အၪ့အူၭ အလးအဂး, ဒဲလၧဆၧလၩ ဆၧဖၩ့အလးအဂးလီၫ. မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪခိၭနၪ အ့ၬ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, နမိဘၪစံၭအဝ့ၫၥံၪလၧဆၧချဲၩ့ ယီၩ,ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ကယဲ ထိၪ့ဆၧဖံၭမိဎွ့ၩဝ့ၫလၧစဘံၭထံၫလီၫ. တၭအဝ့ၫၥံၪ မိစံၭနၧၩ,ပၥ့ၪယၫလၩ့ထံးလၩ့ဆ့ၭလၧ ကယဲထိၪ့ဆၧ ဖံၭမိဎွ့ၩဝ့ၫလၧစဘံၭထံၫမွဲအ့ၬဧၪ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့နမိဘၪစံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဘဲၫ ယီၩ,ယိခွါ, ယမိမၩဎွ့ၩၦၡၩခးဖိၪ ထီးအလူၬယီၩ, စဎွၩလဖၪ လၧအဆၧၫ့နၩ့လၧစဒၫဝံၭ အလးဆီၩ့ဆီ ဒၪလ့ၬ, ဒဲၦလုဆၧၥံၪ, ဒဲမီၪၥံၪ, ဒဲယရုစလံၫ့ဖိၪထီးအ",
			"14": "<sup>14</sup> လူၬ လၧဆၧအီၩမၧၩ့အၥၭး- တၭယမိစုၭလၩ့ဝ့ၫလ ဂၩဒဲလဂၩ, ဖါၥံၪဒဲဖိၪခွၫၥံၪဒၪလ့ၬလစီၪ့ဎး, ယဟိဝၩ စံၭဝ့ၫဒၪး ယၥၭလလၩ့ဘၪ,ယလလီၫ့ကီၩ့ဘၪ,ယလ ယၫ့ၥၭဘၪး အ့ၪမွဲယမိမၩဂၭဂီၩ့ အဝ့ၫၥံၪလခီၫလီၫ.",
			"15": "<sup>15</sup> ခိၭနၪတၭ,ဒိၭနၥံၪအနါဆံၭ. အီၪက့ၪထၪ့ထီၫနၥံၪ အၥၭလဂ့ၩ အဂဲးဘဲၫယီၩ ယဟိဝၩချဲၩ့ဆၧလီၫ.",
			"16": "<sup>16</sup> လၧအလချႃၭမၩဒံၭဘၪဆၧခံၭ, လၧနၥံၪအခၪ့လချႃၭ ဘၪထၧၩ့ဒံၭဘၪလၧခိၪလီၩ့ခံၭအလီၩ့တၭ, နၥံၪယိလါ ဆၧဖၩ့အဖၧၩ့ၥၭအဘိၩ့ဘၭတၭ, အဆၧဒုၭကဲၪထဲၩ့ ဝ့ၫလၧဆၧၥံၫအလၩၡုၪ အီၪက့ၪဝ့ၫလၧဆၧခံၭၥၧၫ့နီၪ တၭ,မၩနၥံၪဝ့ၫဒုၭလၩဖၩ့ ယဟိဝၩနၥံၪအယွၩဆံၭ.",
			"17": "<sup>17</sup> အ့ၪမွဲနၥံၪအ့ၪလခိၭနၪဘၪတၭ, ယၥၭအမ့ၬထံၫမိလၩ့ လၧအလးအီၪကဒုၩ လၧနၥံၪအၥၭထၪ့ထီၫ အကၠီၩ့ လီၫ.ယမ့ၬထံၫမိလၩ့နၭနၭလ့ၬတၭ, ယမ့ၬထံၫမိယွၩ လၩ့လီၫ.အဂဲးဘဲၫယီၩ ယဟိဝၩအၥိၪလဒီၪ့နီၪဆၧ",
			"18": "<sup>18</sup> ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလီၫ.- စံၭစဎွၩဒဲနးဎွၩမုၪ, ဆၧၫ့နၩ့ လၧအလးလၩ့ဖၨၪနီၪဆံၭ. အဂဲးဘဲၫယီၩနၥံၪအလၩ အဖၩ့အခိၪလူၬမိလၩ့ထ့ၬခွံၬ လၧနၥံၪအခိၪဎွံၪအလီၩ့",
			"19": "<sup>19</sup> နီၪလီၫ.- ဒိၩ့ၥံၪလၧမုခံၫ့လဖၪအတရၫ့ၥံၪကၭဘံၭထၬ အၥၭတၭ, ၦၡၩဝဲထၪ့အဝ့ၫၥံၪနးဂၩအ့ၬ. ၦၡၩမိဆိၬ ထၪ့အၪ့မၧၫ့ဎီးယုဒၫထီးအလူၬ, ဆၧမိဆိၬထၪ့အၪ့မၧၫ့",
			"20": "<sup>20</sup> ဎီးဝ့ၫလူၬထူၬဆံၫ့ဘၩ့လီၫ.- စၪ့ထၪ့နၥံၪအမ့ၬၥၪတၭ, ယိအဝ့ၫၥံၪ, ၦၡၩဂဲၫလၧမုဖၩလခီၫဆံၭ. ၥိၪလဒီၪ့လၧ ဆၧဖ့ၪလၫ့နၧၩ နၥိၪလဒီၪ့အီၪလၧအဎံၫအလၩနီၪ, မွဲ",
			"21": "<sup>21</sup> အအီၪခီၫခီၫလဲၪ.- ထီးအဝ့ၫဒၪအ့ၪစ့ၩရၫ့စၪနၧၩတၭ, မွဲနမိစံၭဆၧနီၪလဲၪ. အဂဲးဘဲၫယီၩ နၥီၪ့လိၪအဝ့ၫၥံၪ ဘဲၫၥိၭအမိကဲၪထၪ့ ၦဒိၪဖၭဒိၪလၧနဖၫ့ခိၪလီၫ. ဆၧ ၥုၪ့အုၭၥၭအုၭမိဖီၪ့ထၬနၧၩ ဘဲၫၦမုၪလၧအဂူၭဆၫအ",
			"22": "<sup>22</sup> ၥိၭနီၪမွဲအ့ၬဧၪ.- နအ့ၪစံၭလၧနၥၭခံဖၧၩ့, ဆၧယီၩလ ဖၪဘၪယၧၩမွဲဘၪလဲၪတၭ, နဆၧဒဲၩဘၭအဒိၪအကၠီၩ့",
			"23": "<sup>23</sup> နီၪဆၧဝဲထၪ့နနံၪတၭ,နခၪ့နိးခဲၫ့အီၪဘိၪ့ဝ့ၫလီၫ.- ၦကု ၡၫဖိၪအၪ့လဲၩအဖံၭမွဲဂ့ၩ, ခ့ၫစံၫဖီးအၪ့လဲၩအဖံၭ အစံၫဖီးအဖျိၪ့ၥံၪနီၪမွဲဂ့ၩ, ဘၪမိၥ့ၪဧၪ. အ့ၪမွဲဘဲၫနီၪ တၭ,နၥံၪဝ့ၫဆ့, နၥံၪမၩယုၩယါဆၧအၧၩ့နီၪမိမၩဆၧ",
			"24": "<sup>24</sup> ဂ့ၩၥ့ၪဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယမိမၩလၩ့ပြံၩ လၩ့ပၩအဝ့ၫၥံၪဘဲၫလီခၫ့အမုၬ လၧအဒံၩခွံၬလၧမံၩ့",
			"25": "<sup>25</sup> လၬကျၩအလံၩအမ့ၬယၫအၥိၭနီၪလီၫ.- အနီၪမွဲနဂး, ဆၧလၧယတိၪ့န့နၧၩ, ယဟိဝၩစံၭဝ့ၫဒၪ, အဂဲးဘဲၫ ယီၩနၥၭနၪ့ယၧၩတၭ, နဒိၭနဲၩ့နၥၭလၧဆၧကဘျံၭက",
			"26": "<sup>26</sup> ဘျၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယမိဘျံၭထၪ့နနံၪလၧန",
			"27": "<sup>27</sup> ခိၪလခီၫတၭ, နဆၧမ့ၬမဲအလးမိဖျီၪထၪ့လီၫ.- ယဒၪ ဘၪယူၭနမၩမၪ ၦမၫၦဝၩ နအဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩ တၭ,နၥၭလဲးၥၭဘျၪအမၩမၪဆၧ, ဒဲနဆၧၥၭလိၪအ လးလၧခိၪလီၩ့ခိၪဒဲလၧဆၧပျၩ့ဖၧၩ့လီၫ. ယရုစလံၫ့ ဧ့,နဘၪအၡၪ့လီၫ. နမိထိးဆၧမၩဆံၫ့နၧၩအ့ၬဧၪ. မွဲ ဆံၭယံၬခိၬနးဖၧၫ့လဲၪ."
		},
		"14": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪ စယ့ၫရမဲအၫလၧ ထံၫလအီၪဘၪအဂဲးအကၠီၪ့လီၫ.",
			"2": "<sup>2</sup> ယုဒၫၥုၪ့အုၭၥၭအုၭ, ဒဲအတရၫ့လဖၪလၩ့ဘဲၩဝ့ၫ, ၡီၫ့လၩ့အခိၪထီၩ့လၩ့လၧဂၪ့ခိၪလီၩ့တၭ, ယရုစလံၫ့",
			"3": "<sup>3</sup> အကိၭၡၭထၪ့နီၪလ့ၩထၪ့ဝ့ၫလီၫ.- တၭၦအီၪလၧအ လၩအဖၩ့လဖၪအၪ့မၧၫ့လၩ့ အခ့ၫအၡၩလဖၪလၧထံၫ အလးလီၫ. အဝ့ၫၥံၪဂဲၫလၧထံၫဖၧၩ့တၭ, ထံၫအီၪအ့ၬ. ဂဲၫထဲၩ့ထဲၩ့တၭ, အထံၫဆဲၩအီၪပျီၩလီၫ. အမ့ၬမဲတၭ,",
			"4": "<sup>4</sup> အီၪက့ၪမဲအမ့ၬတၭ,ချႃၬဘံၭအခိၪလီၫ.- အဂဲးဘဲၫ ယီၩဂၪ့ခိၪထ့ဖၭလီၫ. မွဲဆၧလဂဲၫဆၧၩ့ဘၪလၧဂၪ့ခိၪ ချိၫ့အဂဲးလီၫ. ၦမၩကၩလၧဂၪ့ခိၪလဖၪအမ့ၬမဲတၭ,",
			"5": "<sup>5</sup> ချႃၬဘံၭအခိၪလီၫ.- ထီးခံၫဘၩ့မိဖိၪဆါလၧဆၧပျၩ့ ဖၧၩ့တၭ,စဲၪ့ဒၪဝ့ၫ လၧနၪ့ၥံၪမံၩ့ၥံၪ လအီၪဘၪအကၠီၩ့",
			"6": "<sup>6</sup> လီၫ.- တၭကၥ့ၪယီၩ့မံၩ့ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧစီၩ့ခိၪအ လီၩ့,ၥွံၭထၪ့လံၩ ဘဲၫထွံၪဂၪ့ခိၪအၥိၭနီၪ, အမ့ၬၥၪၥံၪ လူၬခွံၬဝ့ၫလၧနၪ့ၥံၪမံၩ့ၥံၪ လအီၪဘၪအကၠီၩ့လီၫ.",
			"7": "<sup>7</sup> ယဟိဝၩဧ့, ၦဆၧအၧၩ့လဖၪထိးအၥၭထၫ့ဒၩပၧၩ လါနၫ့တၭ,နဝ့ၫဒၪမၩလၧနမံၩ့ဒၪနဝ့ၫအကၠီၩ့ဆံၭ. အ အဂဲးဘဲၫယီၩပၥၭဂၭဂီၩ့ယူၭအၪဘျၩ့ယူၭ, ပမၩမၪဘၪ",
			"8": "<sup>8</sup> နၧၩယူၭ.- အံၫစရ့လၭအဆၧယိလါ, ဆၧထိးထဲၩ့ တၩ့ထဲၩ့ဝ့ၫလၧအဘၪၡၪ့ဘၪနၭအထီနီၪ, လဂၩဧ့, န ကဲၪထၪ့ဆၧဘဲၫၦလခီၫဘၩ့မုးဖိၪလၧခးအဖၧၩ့, ဒဲဘဲၫ ၦဖိၬဖၧၩ့ၥၭလဂၩလၧအပၠၪထၪ့အတဲၩလၧမုလနၩအ",
			"9": "<sup>9</sup> ဂးနီၪ,မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- နမၩနၥၭဘဲၫၦလၧအၥၭ အီၪယူတၡါ, ဒဲဘဲၫၦအဆီၪ့လၧအထိးထဲၩ့တၩ့ထဲၩ့ ဆၧလၥ့ၪဘၪအၥိၭနီၪ, မွဲဘၪလဲၪ. မွဲလါနၫ့တၭယဟိ ဝၩဧ့, နအီၪလၧပကျၩတၭ,ဆၧကိၭပၧၩလၧနမံၩ့လီၫ. ထီးစဲၪ့ဒၪပၧၩလဂ့ၩ.",
			"10": "<sup>10</sup> ယဟိဝၩစံၭၦခမျၧးယီၩဘဲၫယီၩ, အဝ့ၫၥံၪအဲၪဆၧ လၧအမိဂၭဝံၩ့ဝၩ့ဆၧဘဲၫနီၪတၭ, ပဒၩ့အခၪ့အ့ၬ. မၩ အၥၭဘဲၫနီၪတၭ, ယဟိဝၩထိးဆၧၫ့အဝ့ၫၥံၪအ့ၬ. ဘိၩ့ နဲၪ့ယီၩမွဲအနၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪအဆၧအၧၩ့, ဒဲစ့ၩရၫ့",
			"11": "<sup>11</sup> အဆၧဒဲၩဘၭလီၫ.- ထီးနီၪလဖၧၫ့ယဟိဝၩစံၭယၧၩ ထီးဘၩဆိၪဖၪန့ ၦခမျၧးယီၩ လၧဆၧအဂ့ၩအဂးလ",
			"12": "<sup>12</sup> ဂ့ၩ.- အ့ၪဒုၪဆၧအၪ့ဆၧအီၩလါနၫ့တၭ, ယခိၭနၪအ အၪ့ကံၩ့အၪ့ယၫဆၧအ့ၬး အ့ၪလုထၪ့ဆၧလုမ့ၪဒဲဆၧ မၩဘိၪ့ကိၪလါနၫ့တၭ, ယထိးဆၧၫ့ဝ့ၫအ့ၬ. ယမိမၩ လူၬခွံၬဝ့ၫလၧနၭ, ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ ဒဲလၧဆၧၥံၫ ချဲၫ့လီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ယစံၭ, အၩလါ,ကဆါယဟိဝၩဧ့း ယိခွါ, မီၪလဖၪစံၭအဝ့ၫၥံၪ, နၥံၪဒၪဘၪနၭအ့ၬ, ဒဲနၥံၪ အဆၧၥၭဝံလၩ့ဒိၩမိအီၪဆ့အ့ၬ. အ့ၪမွဲယဟိဝၩမိဖ့ၪ လၫ့တၡါနၥံၪ, လၧဆၧဘၪလိၬအိၭလိၬ လၧအလး",
			"14": "<sup>14</sup> ယီၩအဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ ယဟိဝၩစံၭယၧၩ, မီၪလဖၪချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪယလအၪ့ မၧၫ့လၩ့န့ဘၪအဝ့ၫၥံၪတၭ, ယမၪလူၬအဝ့ၫၥံၪဆ့အ့ၬ. ယချဲၩ့ဆၧလၧအဝ့ၫၥံၪဆ့အ့ၬ. အဝ့ၫၥံၪချဲၩ့ဆၧလၧ မီၪအချိၬလၧဆၧဒၪဆၧအၪ့လီၫဝ့ၫတၭ,ဒဲလၧဆၧအူၪ ဆၧပီၩ,ဒဲဆၧပျီၩပျီၩ, ဒဲဆၧဘၪဆဲၫ့လၧအၪ့လီၫဆၧ",
			"15": "<sup>15</sup> လၧအၥၭဒၪဝ့ၫအဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ ဟိဝၩစံၭလၧမီၪၥံၪအဂဲးအကၠီၪ့, လၧအချဲၩ့ဆၧလၧ မီၪအချိၬလၧယမံၩ့တၭ, ယအၪ့မၧၫ့လၩ့န့ဝ့ၫအ့ၬ. အဝ့ၫၥံၪစံၭဝ့ၫ, နၭ, ဒဲဆၧၥၭဝံလၩ့ဒိၩမိအီၪဘၪလၧ ခးဖၧၩ့ယီၩဆ့အ့ၬ. တၭမီၪလဖၪနီၪ မိလူၬခွံၬဝ့ၫလၧ",
			"16": "<sup>16</sup> နၭ,ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩနီၪလီၫ.- တၭၦခမျၧးလၧအ ဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအချိၬလၧအမ့ၬယၫနီၪ, မိဘၪဆၧ ခွံၬၡိၭခွံၬဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့, လၧဆၧၥၭ ဝံလၩ့ဒိၩ,ဒဲလၧနၭအကၠီၩ့လီၫ. တၭအဝ့ၫၥံၪအမၫၥံၪ, ဒဲအဖိၪခွၫၥံၪ, ဒဲအဖိၪမုၪၥံၪနီၪ ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ အီၪအ့ၬ.အဂဲးဘဲၫယီၩယမိလူၫလၩ့အဆၧအၧၩ့လၧ",
			"17": "<sup>17</sup> အလီၩ့လီၫ.- တၭနဘၪချဲၩ့ဆၧချဲၩ့ယီၩ လၧအဝ့ၫၥံၪ, ဒဲမ့ၬထံၫယွၩလၩ့လၧမုဆၫဆၫမုနၩနၩဆံၭ. တၭမွဲအ ထီးထုၬလဂ့ၩ. အဂဲးဘဲၫယီၩ ယၡၩခမျၧးအမုၪနၩ့ ဘၪဆၧဆ့ၭဝ့ၫ လၧဆၧဆ့ၭဖၭဒိၪတၭ, ဆၧဖ့ၬဝ့ၫနၭ,",
			"18": "<sup>18</sup> မၬလီၫ.- ယအ့ၪလ့ၩထၪ့လၧခီၫ့တၭ, ထီးနီၪလဖၧၫ့ ယိခွါ,ၦလၧအဘၪဆၧမၩၥံၫဝ့ၫလၧနၭၬ ယအ့ၪလ့ၩ နုၬလၧဒိၩ့ဖၧၩ့တၭ, ထီးနီၪလဖၧၫ့,ယိခွါ, ၦလၧအဎွ့ လၩ့ဝ့ၫလၧဆၧၥၭဝံလၩ့ဒိၩဖီၩၬ မွဲမၬ, မီၪဒဲၦလုဆၧ နံၫဂၩလူၬ မိစဲၪ့ဝံၩ့ဝၩ့လၧခးလဘံၪ့ လၧအလၥ့ၪယၫ ဘၪဝ့ၫလီၫ.",
			"19": "<sup>19</sup> ယုဒၫနီၪမွဲနခွံၬၡိၭလူၬထူၬဆ့ဧၪး ဇံအိၫ့နီၪမွဲနၥၭ လိၪဆ့ဧၪ. နထးပၧၩတၭ, ဆၧမၩဘျၪထဲၩ့ပၧၩနီၪ, မွဲ အအီၪအ့ၬဧၪ. ပယိလါဆၧဘၪလိၬအိၭလိၬအဖၧၩ့ၥၭ တၭ,ဆၧဂ့ၩအီၪအ့ၬ. ပယိလါဆၧမၩဘျၪထဲၩ့အထီ",
			"20": "<sup>20</sup> တၭ,ယိခွါ,ဆၧမၩခိမၩဝီၩဖီၩၬ- ယဟိဝၩဧ့,ပအုၩ့ လၩ့ပဆၧအၧၩ့ဒဲပဖါၥံၪ အဆၧအၧၩ့လီၫ. အဂဲးဘဲၫ",
			"21": "<sup>21</sup> ယီၩပမၩမၪဘၪယူၭနၧၩယူၭ.- လၧနမံၩ့အကၠီၩ့နီၪ ထီးခွံၬၡိၭပၧၩလဂ့ၩ, မၩဂၭဂီၩ့နလးဆီၩ့ဆီအလၩ အဖၩ့လဂ့ၩ,နၪ့ထၪ့ထဲၩ့ဆံၭး ထီးမၩဂၭဂီၩ့နဆၧအုၩ့",
			"22": "<sup>22</sup> လၩ့လၧပၧၩနီၪလဂ့ၩ.- လၧၦဆၨၩလဖၪအဆၧပျီၩ ပျီၩအကျၩနီၪ, ဆၧဖ့ၪလၫ့ဆၧဂဲၫဆၧၩ့ၥ့ၪနီၪ, မွဲအအီၪ ဝ့ၫလမံၩ့မံၩ့ဆ့ဧၪ. မွဲမူၭခိၪဒုၭဆၧၩ့လၩ့ဒၪဆၧဘၪမိၥ့ၪ ဧၪ.ယဟိဝၩပယွၩဧ့, နဝ့ၫဒၪယီၩနမွဲအဝ့ၫဒၪမွဲအ့ၬဧၪ. မၩအၥၭဘဲၫနီၪတၭ, ပမိဒိၭနဲၩ့ပၥၭလၧနၧၩလီၫ. အ ဂဲးဘဲၫယီၩနတဲၩ့လၩ့ဆၧထီးအလူၬနီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> မၩဒီၭလဖၧၫ့ယဟိဝၩစံၭယၧၩ, စမိစ့ၭ,ဒဲစစၫမုၫ အ့လၭအ့ၪဆၧၫ့ထုၪ့လၧယမ့ၬယၫလါနၫ့တၭ, ယကၠၪ စိၩယၥၭ လၧယၡၩခမျၧးအအီၪအ့ၬ. နၫ့ထၪ့ခွံၬအ ဝ့ၫၥံၪလၧယမ့ၬယၫတၭ, ဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪဆံၭ.",
			"2": "<sup>2</sup> တၭဆၧမိမၩအၥၭထီးၦၡၩအ့ၪစံၭနၧၩ, မွဲပမိစဲၪ့ထၪ့ ခီၫခီၫလဲၪနီၪတၭး ထီးနီၪလဖၧၫ့ နမိဘၪစံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဘဲၫယီၩ, ၦလၧအအီၪဝ့ၫလၧဆၧၥံၫအဂး နီၪ,လၧဆၧၥံၫအအီၪး ဒဲၦလၧအအီၪဝ့ၫလၧနၭအဂး နီၪ,လၧနၭအအီၪး ဒဲၦလၧအအီၪဝ့ၫလၧဆၧၥၭဝံလၩ့ ဒိၩအဂးနီၪ, လၧဆၧၥၭဝံလၩ့ဒိၩအအီၪး ဒဲၦလၧအ အီၪလၧဆၧအၪ့မၧၫ့ဎီးအဂးနီၪ, လၧဆၧအၪ့မၧၫ့ဎီး အအီၪနီၪလီၫ.",
			"3": "<sup>3</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, ယမိအီၪက့ၪလၩ့ဆၧလၧအ ဖၫ့ခိၪနးလံမံၩ့, နၭလမံၩ့ဘဲၫၥိၭအမိမၩၥံၫဆၧ, ဒဲထွံၪ ၥံၪလမံၩ့,ဘဲၫၥိၭအမိအဲၪ့ၡၫ့ဆၧ, ဒဲထိၪလၧဆၧဖိၭဖၫ့ လမံၩ့,ဒဲဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩလမံၩ့, ဘဲၫၥိၭ",
			"4": "<sup>4</sup> အမိအၪ့ဆၧဒဲမၩဂၭဂီၩ့ဆၧလီၫ.- တၭယမိမၩလၩ့ ပြံၩလၩ့ပၩဝ့ၫ ဖိးလၧဂၪ့ခိၪအဘၩ့မုး ထီးအလူၬအ ဖၧၩ့,လၧယုဒၫအစဎွၩဟ့ၭဇကဲအၫအဖိၪခွၫ, စမနၭ စ့ၫအကၠီၩ့,လၧဆၧလၧအမၩဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့ အကၠီၩ့လီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ မွဲပလၫမိယၫ့ၥၭနၧၩလဂၩလဲၪ.ယ ရုစလံၫ့ဧ့,မွဲပလၫမိမၩမုၬထၪ့နၧၩလဂၩလဲၪး မွဲပလၫ မိကၠၪအၥၭတၭ, အၪ့စၪ့နအီၪမုၬဆ့ဧၪနီၪ,လဂၩလဲၪ.",
			"6": "<sup>6</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, နစဲၪ့ဒၪယူၭယၧၩယူၭ. နဂုၩ့ထဲၩ့ နလးခဲၫ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ,ယမိယၩ့ထၪ့ယစူၪ လၧနလီၩ့, ဒဲမၩဂၭဂီၩ့နၧၩလီၫ. ဆၧနီၫ့ယါလၩ့ထဲၩ့",
			"7": "<sup>7</sup> နီၪမၩပွံၭယၥၭလီၫ.- ယမိဎၬအဝ့ၫၥံၪလၧချဲၩလၧခး အတရၫ့ဖၧၩ့, ယမိမၩန့ခွံၬအဖိၪလဖၪ, ယမိမၩဂၭဂီၩ့ ယၡၩခမျၧးလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪထဲၩ့ခွံၬလၧ",
			"8": "<sup>8</sup> အဖၧၩ့ၥၭဒၪဝ့ၫအ့ၬ.- အဝ့ၫၥံၪအမုၪမဲၫလဖၪမိအၪနဲၪ့ ဒံၭမၫဆမံၭနဲၩ့အမ့ၭဒံၭလီၫ. ယမိဒုၭဂဲၫထၪ့ထၫ့ဒုၪ ဒၩၦဖိၪၥၪခွၫၥံၪအမိနီၪ, လၧၦအၪ့ဂူၬန့ဆၧလၧမုထုၪ့, ဒဲယဒုၭလၩ့ဘၪအဝ့ၫၥံၪ လၧဆၧၥၭမဲၪဝၭထိၬလၧဒိၩ့",
			"9": "<sup>9</sup> နီၪချဲၫ့မၬလီၫ.- ၦလၧအအီၪဖျဲၪန့နွ့ၫဂၩနီၪ လၩ့ဘဲၩ ဝ့ၫ,အၥၭစဲၪ့ထၪ့ခွံၬ, အမုလၩ့နုၬ လၧမုဆၫလခီၫ, အမ့ၬမဲတၭ, အီၪမဲအမ့ၬတၭ,ၦအီၪလၩ့ထ့ၬလၧအ ကျၩနီၪယမိဖ့ၪလၫ့ခွံၬဝ့ၫလၧနၭအဂး လၧအဒုၪအဒၩ အမ့ၬယၫလီၫ. ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"10": "<sup>10</sup> ယဘၪဆၧအၡၪ့လီၫး ယမိဧ့, နဆီၫ့အီၪန့ယၧၩ, ဘဲၫၥိၭယမိကဲၪထၪ့ၦအဲၪ့လိၬဆိၭချဲၩ့လိၬဆၧ, ဒဲၦလၧ အဂဲးလိၬတ့ၭလိၬလၧအၡၩခးဖိၪထီးအလူၬလီၫ. ယ အၪ့လီးစ့ၩလၧမျၭအဂးအ့ၬ ဒဲယဒုၭအၪ့လီးစ့ၩလၧ အမျၭအဂးလၧၦၡၩနီၪဆ့အ့ၬ. မွဲလါနၫ့ၦထီးအလူၬ",
			"11": "<sup>11</sup> နီၪဆိၪအၧၩ့ယၧၩကိၭဂၩဒ့ၭလီၫ.- တၭယဟိဝၩစံၭ ယၧၩ,မွဲတီၩယမိမၩဖီၩ့မၩဖျ့ၭနၧၩ လၧဆၧဂ့ၩအဂး လီၫ.လၧဆၧအၧၩ့အထီဒဲဆၧခိအထီနီၪ ယမိဒုၭမၩ",
			"12": "<sup>12</sup> ဆၧၩ့နၧၩလၧဆၧအဒုၪအဒၩလီၫ.- ၦမၩခါထၭဒဲထီး",
			"13": "<sup>13</sup> ဘၪဆဲၫ့ လၧမုဖၩနီၪဘၪမိၥ့ၪဧၪ.- နစူၪလးခၪ့ခိၪဒဲန ဆၧအီၪက့ၪကီၪ့လဖၪနီၪ ယမိဖ့ၪလၫ့ဝ့ၫလၧဆၧအၪ့ဂူၬ န့လီၫ. လၧဆၧအဎွ့ၩအကၠီၩ့မွဲအ့ၬး မွဲလၧနဆၧဒဲၩ ဘၭထီးအလူၬအကၠီၩ့ လၧနခးအနဲၩ့ထံၭထီးအလူၬ",
			"14": "<sup>14</sup> အဖၧၩ့လီၫ.- တၭယမိဒုၭမၩနၧၩလၧနဒုၪနဒၩအဆၧ လၧခးလဘံၪ့အဖၧၩ့လၧနလၥ့ၪယၫဘၪလီၫ. အဂဲးဘဲၫ ယီၩ ယၥၭထၪ့ဆူၭခဲၩထၪ့မ့ၪတၭ, မိအၪ့ဆၧထၫ့ဒုၪ ဒၩနၥံၪလီၫ.",
			"15": "<sup>15</sup> ယဟိဝၩဧ့,နၥ့ၪယၫဆၧဘၪဆဲၫ့လၧယၧၩလီၫ. နၪ့ ထၪ့ထဲၩ့ယၧၩတၭ,စ့ၩရၫ့တီၩန့ယၧၩ ဒဲမၩဆၧၫ့ဆၧ အၧၩ့လၧၦလၧအမၩအၧၩ့ယၧၩဆံၭ. မွဲနအွံၪၥၭဆၧၩ့ ဆၧတၭ,ဆိၬထၪ့ခွံၬယၧၩလဂ့ၩ, ၥ့ၪယၫလၧယဘၪ",
			"16": "<sup>16</sup> ဆၧဒုၪဒွ့ၪလၧနကၠီၩ့ဆံၭ.- ယဒၪန့နဆၧချဲၩ့ၥံၪတၭ, ယအၪ့ခွံၬဝ့ၫလီၫ. နလူမွဲယဆၧၥုၪ့ထိၬၥၭထိၬ, ဒဲယ ဆၧၥုၪ့ဎွံၫၥၭယီၫအလးလီၫ. အဂဲးဘဲၫယီၩယဟိဝၩ ဆၧၥုၭမုခမျၧးအယွၩဧ့, ဆၧကိၭယၧၩလၧနမံၩ့လီၫ.",
			"17": "<sup>17</sup> ယၥၭထိၬဒဲဆၧၫ့နၩ့ လၧၦဒုၪဒွ့ၪအဆၧအီၪကီၪ့အဖၧၩ့ နီၪမွဲအ့ၬ. ယဆၧၫ့နၩ့လဂၩဎး လၧနစူၪအကၠီၩ့လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩနမၩဎွ့ၩယၥၭ ဒဲဆၧခိဆၧဝီၩလီၫ.- ယ ဆၧဆိၭက့ၭအီၪဝ့ၫလထံၪဎးလဘီၩ့ဎးတၭ, ယဖၧၩ့ လးလၧအလအုၩ့လၩ့ဘၪ လၧဆၧမၩဘျၪထဲၩ့ဝ့ၫနီၪ, ဘျၪထဲၩ့ၥ့ၪအ့ၬးမွဲဘၪလဲၪ. နမိကဲၪထၪ့လၧယဂးဘဲၫ ၦအၪ့လီၫဆၧအၥိၭ, ဘဲၫထံၫလၧအလၩ့ၥံၭဝ့ၫအၥိၭ နီၪဆ့ဧၪ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩစံၭဘဲၫယီၩ, နအ့ၪ ထဲၩ့ထဲၩ့တၭ,ယမိဒုၭဂဲၫထဲၩ့နၧၩတၭ, နမိဆၧၫ့ထုၪ့ လၧယမ့ၬယၫလီၫ. နအ့ၪအၪ့နၩ့ဖၭမၩန့ဆၧလူဒိၪဎွ့ၩ ဒိၪလၧဆၧအၧၩ့ အကျၩတၭ, နမိမၩနၥၭဘဲၫယနိၭ အၥိၭနီၪလီၫ. အဝ့ၫၥံၪမိထဲၩ့ထဲၩ့လၧနအီၪလီၫ. အ့ၪ မွဲနဝ့ၫဒၪယီၩ ထီးထဲၩ့ထဲၩ့လၧအဝ့ၫၥံၪအအီၪလဂ့ၩ.",
			"20": "<sup>20</sup> တၭယမိအီၪက့ၪနၧၩ လၧဆၧအဒီၪ့ထီးဘၩ့နီၪလၧၦ ခမျၧးယီၩအဂးတၭ, ထီးအဝ့ၫၥံၪမိဒုၭဆၧလၧနၧၩနီၪ လါနၫ့မၩနၧၩ့ဘၪနၧၩအ့ၬ. အဂဲးဘဲၫယီၩယအီၪလၧ နၥိၭဘဲၫၥိၭယမိထိးထဲၩ့တၩ့ထဲၩ့နၧၩ, ဒဲမၩဖီၩ့မၩဖျ့ၭ",
			"21": "<sup>21</sup> နၧၩ,ယဟိဝၩစံၭဝ့ၫဒၪ,- ယမိမၩဖီၩ့မၩဖျ့ၭနၧၩလၧ ၦလတီၩဘၪအစူၪဖၧၩ့တၭ, ယမိဎွ့ၩန့ထဲၩ့နၧၩလၧ ၦလၧအၥၭမဲၪဆၧအလးအစူၪဖၧၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ, နဝ့ၫ ဒၪယီၩထီးန့မၫလဂ့ၩတၭ, ဖိၪခွၫမွဲဂ့ၩ, ဖိၪမုၪမွဲဂ့ၩ,",
			"3": "<sup>3</sup> ထၪ့ဖိၪလၧဆၧအလးထီးယီၩလဂ့ၩ.- အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭလၧၦအဖိၪခွၫ, ဒဲၦအဖိၪမုၪ,လၧအအီၪဖျဲၪ လၧဆၧအလးထီးယီၩအဂဲး, ဒဲအမိလၧအဆီၫ့အီၪန့ ဝ့ၫအဂဲး, ဒဲအဖါလၧအထၪ့ဖိၪဝ့ၫလၧခးယီၩအဂဲးဘဲၫ",
			"4": "<sup>4</sup> ယီၩ,- မိၥံၫဝ့ၫလၧဆၧၥံၫလမုၬဘၪ,ၦဂၪ့ဝ့ၫလၧအကၠီၩ့ အ့ၬ.တၭၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫအ့ၬ, မိမၩအၥၭဘဲၫ ဆၧအ့ၪလၧဂၪ့ခိၪအၥိၭနီၪတၭ, မိလူၬခွံၬဝ့ၫလၧနၭဒဲ ဆၧၥၭဝံလၩ့ဒိၩတၭ, အစွၪလဖၪမိကဲၪထၪ့ဆၧအၪ့လၧ ဆၧဖိၭဖၫ့ အထိၪလဖၪအဂး, ဒဲလၧဂၪ့ခိၪအဆၧဖိၪ",
			"5": "<sup>5</sup> ဆၧဎါအဂးလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, လ့ၩနုၬလၧၦဂၪ့ဆၧအဂံၪ့ဖၧၩ့လဂ့ၩတၭ, လ့ၩဂၪ့ဆၧ လၧၦၡၩအကၠီၩ့လဂ့ၩ, မၩမုၬထၪ့ထဲၩ့ဝ့ၫလဂ့ၩ,အဂဲး ဘဲၫယီၩယဟိဝၩစံၭဝ့ၫဒၪ, ယဆၧမုၬဆၧလၩ,ဒဲယဆၧ အဲၪအခိးအတၩ, ဒဲယၥၭအီၪဆၧနီၪယမၩန့ထၪ့ထဲၩ့",
			"6": "<sup>6</sup> လၧၦၡၩခမျၧးယီၩလီၫ.- အဒိၪမွဲဂ့ၩ, အဆံၭမွဲဂ့ၩ, မိၥံၫဝ့ၫလၧခးလဘံၪ့ယီၩအဖၧၩ့တၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬအဝ့ၫၥံၪအ့ၬး တၭၦဂၪ့ဝ့ၫလၧအကၠီၩ့နီၪဆ့အ့ၬ. ၦ ဂ့ၬလၩ့အၥၭလၧအကၠီၩ့အ့ၬး ၦလိၩ့အခိၪလၧအကၠီၩ့",
			"7": "<sup>7</sup> နီၪဆ့အ့ၬ.- ၦကံၪ့ဘျ့ၭကိၪ လၧအကၠီၩ့လၧအၥၭအုၭ အဘိၩ့ဘၭ,ဘဲၫၥိၭအမိမၩမုၬထၪ့ထဲၩ့ဝ့ၫ လၧၦၥံၫအ ကၠီၩ့အ့ၬ. လၧအဖါအကၠီၩ့မွဲဂ့ၩ, လၧအမိအကၠီၩ့မွဲ ဂ့ၩ,ၦဖ့ၪအီၩဝ့ၫလၧထွ့ၫမၩမုၬဆၧအ့ၬ.",
			"8": "<sup>8</sup> တၭနလ့ၩဘၪလၧဆၧအၪ့ဆၧအီၩအဂံၪ့ဖၧၩ့ဘဲၫၥိၭ",
			"9": "<sup>9</sup> နမိဆၧၫ့နၩ့အၪ့ဆၧဒဲအီၩဆၧဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭ အယွၩစံၭဝ့ၫ ဒၪ,ယိခွါ,လၧနၥံၪအမ့ၬယၫ, လၧနၥံၪအနံၩအၥၫ့နီၪ, ယမိဒုၭအီၪလၩ့မါပံၭ ဆၧၥုၪ့ဎွံၫၥၭယီၫအၥီၫ, ဒဲဆၧ ၥုၪ့ထိၬၥၭထိၬအၥီၫ, ဒဲအတလၭမူၭခွၫအၥီၫ, ဒဲအတ လၭမူၭမုၪအၥီၫထီးယီၩလီၫ.",
			"10": "<sup>10</sup> ဆၧမိမၩအၥၭ ထီးနလီၩဘၪဆၧချဲၩ့ထီးအလူၬလ ဖၪယီၩလၧၦၡၩခမျၧးနီၪတၭ, အဝ့ၫၥံၪမိစံၭနၧၩ, ယ ဟိဝၩစံၭ ဆၧအၧၩ့ဖၭဒိၪယီၩ ထၫ့ဒုၪဒၩပၧၩမွဲဘၪ လဲၪးတၭပဆၧဒဲၩဘၭမွဲနီၫလဲၪး တၭပဆၧမၪလၧပမၩ",
			"11": "<sup>11</sup> မၪယဟိဝၩပယွၩမွဲနီၫလဲၪနီၪတၭ,- ထီးနီၪလဖၧၫ့နမိ ဘၪစံၭအဝ့ၫၥံၪ, အဂဲးဘဲၫယီၩနၥံၪစဲၪ့ဒၪယၧၩ, ယဟိ ဝၩစံၭဝ့ၫဒၪ, ဒဲဖိၬယွၩအဂူၫဂၩလဖၪအခဲၫ့, မၩအဆၧ, ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫ, ဒဲစဲၪ့ဒၪယၧၩတၭ, ထီးန့ယဆၧ",
			"12": "<sup>12</sup> ၥီၪ့ဆၧၥၫ့အ့ၬ.- နၥံၪမၩယူၭဆၧအၧၩ့နဲၪ့ နၥံၪအဖါ လဖၪဒံၭလီၫ. အဂဲးဘဲၫယီၩနၥံၪလ့ၩဖိၬလဂၩအၥၭ အၧၩ့အဆၧဆီၫ့မီၪ့အခဲၫ့, လဂၩဘၪလဂၩကိၭဂၩဒ့ၭ",
			"13": "<sup>13</sup> ဆုၬဆုၬတၭ, နၥံၪခိၭနၪယလူအ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,ယမိနၫ့ထၪ့ခွံၬ နၥံၪလၧခးလဘံၪ့ယီၩအဖၧၩ့,ထီၩ့ လၧခးလဘံၪ့ဒၪအဖၧၩ့,လၧနၥံၪမွဲဂ့ၩ, နၥံၪအဖါလဖၪ မွဲဂ့ၩ, လၥ့ၪယၫဘၪဝ့ၫတၭ, နၥံၪမိမၩယွၩ အဂူၫဂၩ လဖၪအဆၧ လၧမုနၩနၩမုဆၫဆၫထီးနီၪလီၫ. အဂဲး ဘဲၫယီၩယယၫ့ၥၭနၥံၪအ့ၬ.",
			"14": "<sup>14</sup> မွဲလါနၫ့တၭ,ယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ,မုနံၩလဖၪ မိဂဲၫလၧၦလစံၭလၧၩ့ဘၪ, ယဟိဝၩမၧၫ့ဝ့ၫလၧအဒုၭ စဲၪ့ထၪ့ခွံၬအံၫစရ့လၭဖိၪလၧခးအံဇံၭအဖၧၩ့နီၪတၭ,",
			"15": "<sup>15</sup> အ့ၪမွဲ,ဆၧမိစံၭ, ယဟိဝၩမၧၫ့ဝ့ၫ လၧအဒုၭဂဲၫထဲၩ့ ထဲၩ့ဝ့ၫၦအံၫစရ့လၭဖိၪလၧခးမုဖၩလခီၫ, ဒဲလၧကယဲ ခးလၧအဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫထီၩ့လၧအဖၧၩ့နီၪလီၫ. အ ဂဲးဘဲၫယီၩယမိဒုၭဂဲၫထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫလၧယဖ့ၪ လၫ့အဖါဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> ယိခွါ,ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိအၪ့မၧၫ့လၩ့ ၦမၩယၪဖိၪ အၪဂၩတၭ, အဝ့ၫၥံၪမိမၩန့ၦလဖၪနီၪ တၭ,လၧအလးခဲၫ့နီၪ ယမိအၪ့မၧၫ့လၩ့ ၦလီၩ့ခၭ ဆၧဖိၪဆၧဎါလဖၪ လၧအမိလီၩ့ခၭအဝ့ၫၥံၪ လၧ ခိၪလီၩ့ထိၩ့ချိၬ, ဒဲလၧကယဲလၧစီၩ့ခိၪ,ဒဲလၧလိး",
			"17": "<sup>17</sup> အိၩဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩယမ့ၬၥၪအီၪဝ့ၫလၧအဝ့ၫ ၥံၪအဖၧၩ့ၥၭလီၩ့လီၫ. အဝ့ၫၥံၪအီၪကဒုၩခွံၬလၧယမ့ၬ အ့ၬ.တၭအဆၧဒဲၩဘၭအီၪၥူၪ လၧယမ့ၬယၫဆ့အ့ၬ.",
			"18": "<sup>18</sup> တၭလၧအခၪ့ထံၭနီၪ ယမိမၩဆၧၫ့အဆၧဒဲၩဘၭဒဲအ ဆၧမၪနံၫစၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩဘၪၥၭ လိၪယခးလၧဆၧအစွၪလဖၪလၧဆၧလုထၪ့ဆၧဂၩ့ ဆၧဖၪ့, ဒဲမၩဎွ့ၩယဆၧန့ၥၫလၧဆၧၥၭဂဲၫ့အလးလဖၪ လီၫ.",
			"19": "<sup>19</sup> ယဂဲးယဘၭ, ယထိၬယထၬ,ယအီၪကဒုၩအလး လၧဆၧမၩခိမၩဝီၩအမုနံၩ, ယဟိဝၩဧ့းၦဆၨၩလဖၪ မိဂဲၫလၧနအီၪလၧဂၪ့ခိၪအထုၬလဖၪတၭ,မိစံၭ,မွဲမၬ, ပဖါလဖၪန့ၥၫ ဆၧအဘျံၭအဘျၪ, ဆၧပျီၩပျီၩဒဲဆၧ",
			"20": "<sup>20</sup> လၧအလန့ကဲၩ့န့ကၩဘၪလီၫ.- ၦၡၩမိတဲၩ့အယွၩလ",
			"21": "<sup>21</sup> ဖၪလၧအဂးဒၪဝ့ၫ,ဒဲလမွဲဘၪအယွၩၥံၪဆ့ဧၪ.- မၩအ ၥၭဘဲၫနီၪတၭ,ယိခွါ, အယီၩလဖၧၫ့ ယမိဒုၭၥ့ၪယၫ အဝ့ၫၥံၪလၧယစူၪ, ဒဲယစီၩ့ယမၩ့း တၭအဝ့ၫၥံၪမိၥ့ၪ ယၫလၧယမံၩ့မွဲယဟိဝၩလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ယုဒၫအဆၧဒဲၩဘၭကွ့ၭအၥၭလၧနိၪကွ့ၭတၭ, လၧ လိးစံၪ့အခိၪစူၩလီၫ. ကွ့ၭဝ့ၫလၧအၥၭ အပၪအလီၩ့,",
			"2": "<sup>2</sup> ဒဲလၧဆၧလုလးအနိၩ့လဖၪအလီၩ့လီၫ.- တၭအဖိၪအ လံၩနၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪအဆၧလုလးလဖၪ, ဒဲအၡ့ရိၫ အဆၧဂၩ့လၧၥံၪ့ၥံၫ့ဆ့ၬအနဲၩ့, လၧဆၧစီၩ့ခိၪထီၫအ",
			"3": "<sup>3</sup> လီၩ့လီၫ.- ယခိၪလီၩ့ဒဲဆၧအီၪလၧခီၫ့ဧ့,ယမိဖ့ၪလၫ့ နဆၧဖိၪဆၧလံၩ, နဆၧအီၪက့ၪကီၪ့လဖၪလၧဆၧအၪ့ ဂူၬန့အဂး, နလးအီၪထၪ့ထီၫလၧဆၧဒဲၩဘၭအကၠီၩ့,",
			"4": "<sup>4</sup> လၧနခးအနဲၩ့ထံၭ ထီးအလူၬလီၫ.- တၭနနၫ့ဆါဒၪ နဝ့ၫနမိအီၪလၧၩ့အ့ၬး လၧနဆၧန့ၥၫအဖၧၩ့လၧယဖ့ၪ လၫ့နၧၩတၭ, ယမိဒုၭမၩနၧၩလၧနဒုၪနဒၩအဆၧလၧ ခးလဘံၪ့ လၧနလၥ့ၪယၫဘၪအဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩယဆူၭခဲၩထၪ့မ့ၪလၧယၥၭထၪ့အဖၧၩ့ လၧအမိ အၪ့ခွံၬဆၧလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ၦလၧအဒိၭနဲၩ့အၥၭလၧၦ ၡၩ,ဒဲအီၪက့ၪၦၡၩလၧအစီၩ့အမၩ့တၭ, အၥၭစဲၪ့ဒၪ",
			"6": "<sup>6</sup> ယဟိဝၩနီၪ, ဘၪဆိၪအၧၩ့ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩအ ဝ့ၫဒၪမိမၩအၥၭဘဲၫၥံၪ့ဎဲၫ့လၧဆၧပျၩ့ဖၧၩ့အၥိၭ, ထီး ဆၧဂ့ၩဂဲၫဝ့ၫတၭ, ဒၪဘၪဝ့ၫအ့ၬး အ့ၪမွဲမိအီၪဝ့ၫလၧ ဂၪ့ခိၪဎဲၫ့ထၬလၧၡါမုနၧၫ့ဖၫအဖၧၩ့လၧဂၪ့ခိၪအီၪလၧ",
			"7": "<sup>7</sup> ထံၫလၪတၭ, ၦၡၩအီၪဝ့ၫလၧအဖၧၩ့အ့ၬ.- ၦလၧအ ဒိၭနဲၩ့အၥၭလၧယဟိဝၩ, လၧအယိလါဆၧအလးနီၪ",
			"8": "<sup>8</sup> မွဲယဟိဝၩတၭ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမိမၩအၥၭဘဲၫၥံၪ့ၥုၪ့လၩ့အၥၭ လၧထံၫချိၬနဲၩ့ အၥိၭ,လၧအဝံတရၩလၩ့အၥၭ လၧထံၫချိၬနဲၩ့တၭ, ထီးဆၧခိဂဲၫဝ့ၫတၭ,ဒၪဘၪဝ့ၫအ့ၬး အ့ၪမွဲအလၪအီၪ ၥံၫ့ဆ့ၬတၭ, နံၪ့လၧဆၧလဆၧၩ့လၩ့ဘၪနီၪ လၩ့ယံၭ ဝ့ၫအ့ၬးတၭၥၪထၪ့ဆၧၥၪနီၪထုၬဝ့ၫအ့ၬ.",
			"9": "<sup>9</sup> ၦၡၩအၥၭနီၪအၪ့လီၫန့ဆၧဒိၪနဲၪ့ဒံၭဆၧထီးအလူၬ တၭ,အၧၩ့ဝ့ၫဒိၪဒိၪလ့ၬတၭး မွဲပလၫၥ့ၪယၫဝ့ၫမိၥ့ၪ",
			"10": "<sup>10</sup> လဂၩလဲၪ.- ယၧၩယဟိဝၩယီၩယအၪ့ဎူၫအၪ့ဎၬဆၧ လၧၦအၥၭခံဖၧၩ့, ယမၩခွါၦအလ့ဘဲၫၥိၭယမိဖ့ၪလၫ့ ၦၡၩဆုၬဆုၬဘဲၫအဖၧၩ့ၥၭအၥိၭ, ဒဲအမၩဆၧအဆၧ",
			"11": "<sup>11</sup> ၥၪအၥိၭနီၪလီၫ.- ဘဲၫထိၪဂံၬဂုၪလၧအလမွဲဘၪအဒံၪ ဒၪဝ့ၫအဖၫ့ခိၪအၥိၭနီၪး ၦလၧအန့ဘၪအစူၪလးခၪ့ခိၪ လတီၩဘၪတၭ, မိစဲၪ့ဒၪဝ့ၫလၧအမုနံၩလဖၪအကျၩ",
			"12": "<sup>12</sup> တၭ,အထုၬနီၪ,အဝ့ၫမိကဲၪထၪ့ၦဂီၩ့ဖိၪလီၫ.- ပလး ဆံၫ့ဎံၪနီၪ မွဲဆၧလးဆီၩ့ဆီ လၧအလၩအဖၩ့ခီၫလၧ",
			"13": "<sup>13</sup> အခၪ့ထံၭလီၫ.- အံၫစရ့လၭဖိၪအဆၧယိလါ,ယဟိဝၩ ဧ့,ကယဲၦလၧအစဲၪ့ဒၪနၧၩနီၪအမ့ၬမိမဲထီးအလူၬ, ၦ လၧအစဲၪ့ဒၪယၧၩလဖၪနီၪ အမံၩ့မိကွ့ၭအၥၭလၧဂၪ့ ခိၪအလီၩ့, အဂဲးဘဲၫယီၩမွဲအစဲၪ့ဒၪယဟိဝၩလၧအမွဲ ထံၫမၧၫ့အထံၫထၪ့ဖျိၭလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩဧ့း မၩဘျၪထဲၩ့ယၧၩဆံၭ, တၭယမိဘျၪ ထဲၩ့ယဝ့ၫးထိးထဲၩ့တၩ့ထဲၩ့ယၧၩဆံၭး တၭယမိန့ ဘၪဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလီၫ. အဂဲးဘဲၫယီၩ န",
			"15": "<sup>15</sup> မွဲယဆၧစံၭထၪ့အၪ့အူၭအလးလီၫ.- ယိခွါ,ၦစံၭယၧၩ, ယဟိဝၩအလူအထၫနီၪ မွဲအအီၪခီၫခီၫလဲၪ. မွဲအဂဲၫ",
			"16": "<sup>16</sup> ထၪ့ဘိၩ့နဲၪ့ယီၩဆံၭ.- အ့ၪမွဲဆၧလၧယၧၩယီၩကဲၪၦ ယိၥိၪဖိၬနခဲၫ့အလးနီၪယစဲၪ့ဒၪအ့ၬ. တၭယလဆိၫ့ ဘၪဆၧၡၪ့ဆၧနၭအနံၩနီၪနၥ့ၪယၫနဝ့ၫလီၫ. ဆၧထၪ့",
			"17": "<sup>17</sup> ဖျ့ၭလၧယနိၭနီၪအီၪတီၩဝ့ၫလၧနမ့ၬယၫလီၫ.- ထီး ကဲၪထၪ့ဆၧၥၭမဲၪအလးလၧယဂးလဂ့ၩ. နမွဲယဆၧ",
			"18": "<sup>18</sup> ယိလါလၧဆၧအၧၩ့အမုနံၩအထးဖၧၩ့နီၪလီၫ.- ၦလၧ အမၩအၧၩ့ယၧၩလဖၪနီၪမွဲအမ့ၬမဲဆံၭ. အ့ၪမွဲယဝ့ၫ ဒၪယီၩမွဲယထီးဘၪဆၧမ့ၬမဲလဂ့ၩ. မွဲအဝ့ၫၥံၪၥၭမဲၪ ဆၧဆံၭ.အ့ၪမွဲယဝ့ၫဒၪယီၩ မွဲယထီးၥၭမဲၪဆၧလ ဂ့ၩ.ဒုၭဘၪအဝ့ၫၥံၪလၧဆၧအၧၩ့အမုလနံၩနီၪ, ဒုၭ ဂၭဂီၩ့အဝ့ၫၥံၪလၧဆၧဂၭဂီၩ့နံၫစၩဆံၭ.",
			"19": "<sup>19</sup> ယဟိဝၩစံၭယၧၩဘဲၫယီၩ, လ့ၩဆၧၫ့ထုၪ့လၧၦ ခမျၧးအဖိၪအတရၫ့ဖၧၩ့, ထီးယုဒၫအစဎွၩၥံၪဂဲၫနုၬ, ဒဲအဝ့ၫၥံၪစဲၪ့ထၪ့အလး, ဒဲလၧယရုစလံၫ့အတရၫ့ထီး",
			"20": "<sup>20</sup> အလူၬအဖၧၩ့း- တၭစံၭအဝ့ၫၥံၪ, ယုဒၫအစဎွၩလဖၪ, ဒဲၦယုဒၫဖိၪထီးအလူၬ, ဒဲကယဲၦယရုစလံၫ့ဖိၪလၧအ လ့ၩနုၬလၧတရၫ့ယီၩၥံၪဧ့, ခိၭနၪယဟိဝၩအလူအ",
			"21": "<sup>21</sup> ထၫဆံၭ.- ယဟိဝၩစံၭဘဲၫယီၩ, ထီးလၩ့နၥံၪအၥၭ တၭ,ဆၧအွံၪဆၧယိၭလၧမးၥံၫအနံၩနီၪ, ထီးဆိၬလ ဂ့ၩ.ဂဲၫဆိၬနုၬဆၧအွံၪဆၧယိၭ လၧယရုစလံၫ့အဖၧၩ့",
			"22": "<sup>22</sup> လဂ့ၩ.- ဒဲဆိၬထၪ့ခွံၬနၥံၪအဆၧအွံၪဆၧယိၭလၧနၥံၪ အဂံၪ့ဖၧၩ့, ဒဲမၩဆၧလၧမးၥံၫအနံၩနးမံၩ့လဂ့ၩ. အ့ၪ မွဲအီၪက့ၪဆံၫ့ဎံၪ မးၥံၫအနံၩဘဲၫယမၪလူၬနၥံၪအဖါ",
			"23": "<sup>23</sup> လဖၪအၥိၭနီၪဆံၭ.- မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪခိၭနၪအ့ၬ, ဒိၭအနါဆ့အ့ၬ. အ့ၪမွဲအဝ့ၫၥံၪမၩဆီၪ့အခိၬဘဲၫၥိၭ အထီးနါဂၧၫ့ဘၪလဂ့ၩ, ဒဲဘဲၫၥိၭအထီးဒိၭဘၪဆၧ ၥီၪ့လိၪနီၪလဂ့ၩလီၫ.",
			"24": "<sup>24</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, နၥံၪအ့ၪခိၭနၪတၡါယလူတၭ, လဂဲၫထၪ့ဆိၬဘၪဆၧအွံၪဆၧယိၭ လၧဒိၩ့ယီၩအတ ရၫ့ဖၧၩ့လၧမးၥံၫအနံၩ, ဒဲအ့ၪအီၪက့ၪဆံၫ့ဎံၪမးၥံၫအ နံၩဘဲၫၥိၭနၥံၪ ထီးမၩဆၧမၩလၧအဖၧၩ့လဂ့ၩတၭ,",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့ဆၧမိမၩအၥၭလၧစဎွၩလဖၪ, ဒဲၦဒိၪဖၭ ဒိၪလဖၪဆၧၫ့နၩ့ဝ့ၫ လၧစဒၫဝံၭအလးဆီၩ့ဆီအဖၫ့ခိၪ နီၪ,မိလ့ၩနုၬလၧဒိၩ့ယီၩအတရၫ့ဖၧၩ့, ထူၬလဲၪ့ကၥ့ၪ, ဒဲကၥ့ၪ,အဝ့ၫၥံၪဒဲအၦဒိၪဖၭဒိၪ, ယုဒၫအၦၡၩ, ဒဲၦ ယရုစလံၫ့ဖိၪ, ဒဲဒိၩ့ယီၩ မိအီၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ",
			"26": "<sup>26</sup> လီၫ.- တၭၦမိဂဲၫဝ့ၫလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့ဒဲလၧ ဆၧအလးလဖၪအီၪဝၬဖီၩ့ယရုစလံၫ့, ဒဲလၧစဘံၪ့ယ မံၫ့အခးဖၧၩ့, ဒဲလၧဆၧပျၩ့ဖၧၩ့နီၪ,ဒဲလၧခိၪလီၩ့ထိၩ့ ချိၬ,ဒဲလၧမုခံၫ့တၭ, ဂဲၫဆိၬဆၧလုမ့ၪၥံၪ, ဒဲဆၧလုၥံၪ ဒဲဆၧမၩဘိၪ့, ဒဲလီဘၫ့, ဒဲမိဂဲၫဆိၬဆၧလုစံၭထၪ့အၪ့",
			"27": "<sup>27</sup> အူၭလၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.- အ့ၪမွဲနၥံၪအ့ၪလခိၭ နၪဘၪယလူ ဘဲၫၥိၭနၥံၪမိအီၪက့ၪဆံၫ့ဎံၪမးၥံၫအနံၩ တၭ, နၥံၪဆိၬဆၧအွံၪဆၧယိၭ လၧမးၥံၫအနံၩတၭ, အ့ၪလ့ၩနုၬလၧယရုစလံၫ့အတရၫ့ဖၧၩ့ဒၪလ့ၬလၧမး ၥံၫအနံၩနီၪ, ထီးနီၪလဖၧၫ့ယမိဆူၭခဲၩမ့ၪလၧအတရၫ့ ၥံၪအဖၧၩ့တၭ, မိအၪ့ခွံၬယရုစလံၫ့အနီးလဖၪတၭ, လၩ့ဖံၬဘၪအ့ၬ."
		},
		"18": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫတၭ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- ဂဲထုၪ့တၭလ့ၩလၩ့လၧၦကၧၩ့န့ဖၧၩ့ၥံၪအဂံၪ့တၭ,",
			"3": "<sup>3</sup> ယမိဒုၭနါဂၧၫ့နၧၩလၧယလူထီးနီၪလီၫ.- တၭယလ့ၩ လၩ့လၧၦကၧၩ့န့ဖၧၩ့ၥံၪအဂံၪ့တၭ, ယိခွါ,ကၧၩ့န့ဖၧၩ့",
			"4": "<sup>4</sup> လၧနိၪချံးဖၫ့ခိၪလီၫ.- တၭဖၧၩ့လၧအကၧၩ့န့ဝ့ၫလၧဖံၬ နီၪဂၭဂီၩ့ဝ့ၫလၧၦကၧၩ့န့ဖၧၩ့အစူၪဖၧၩ့တၭ, မၩဒီၭဖၧၩ့ လဖျိၪ့ဘဲၫအဘၪၦကၧၩ့န့ဖၧၩ့ အၥၭလၧအမိမၩဝ့ၫ အၥိၭလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩ အလူလၩ့ဘၪယၧၩတၭ,",
			"6": "<sup>6</sup> စံၭဝ့ၫဒၪ,- အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမၩနၥံၪ ဘဲၫၦကၧၩ့န့ဖၧၩ့လဂၩအၥိၭနီၪၥ့ၪအ့ၬဧၪ, ယဟိဝၩစံၭ ဝ့ၫဒၪ.ယိခွါ,ဘဲၫကဖံၬအီၪဝ့ၫ လၧၦကၧၩ့န့ဖၧၩ့အစူၪ ဖၧၩ့အၥိၭနီၪ နၥံၪအီၪလၧယစူၪဖၧၩ့ဘဲၫနီၪၥိၭ, အံၫစ",
			"7": "<sup>7</sup> ရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့,- ယအ့ၪချဲၩ့ဆၧလဖၧၫ့လၧၦ ဆၨၩအဂဲး, လၧဆၧအဘၩ့အမုးအဂဲး, ဘဲၫၥိၭဆၧမိ",
			"8": "<sup>8</sup> ထ့ၭထၪ့ခွံၬ, ဒဲမၩလၩ့ဎီးဒဲမၩဂၭဂီၩ့ဝ့ၫနီၪး- တၭၦလ ဆၨၩလၧယချဲၩ့ဆၧလၧအဂဲးနီၪ, အ့ၪဂဲၫထဲၩ့ထဲၩ့လၧ အဆၧအၧၩ့တၭ, ယမိနီၫ့ယါလၩ့ထဲၩ့ယၥၭလၧဆၧ",
			"9": "<sup>9</sup> အၧၩ့လၧယကိၪ့ဝဲၩယမိမၩအဝ့ၫၥံၪလီၫ.- တၭယအ့ၪ ချဲၩ့ဆၧလဖၧၫ့လၧၦလဆၨၩအဂဲး ဆၧအဘၩ့အမုး",
			"10": "<sup>10</sup> အဂဲးလၧယမိမၩထၪ့ဝ့ၫ.- ဒဲၥုၪ့လၩ့ဝ့ၫနီၪတၭ,အ့ၪမၩ ဆၧအၧၩ့လၧယမ့ၬယၫ, ဒဲလခိၭနၪဘၪယလူတၭ,ယ မိနီၫ့ယါလၩ့ထဲၩ့ယၥၭ လၧဆၧဂ့ၩလၧယစံၭယမိမၩ ဝ့ၫနီၪလီၫ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩလ့ၩဘီၪ, ချဲၩ့ဆၧ လၧယုဒၫအၦၡၩဒဲၦယရုစလံၫ့ဖိၪတၭ, စံၭ, ယဟိဝၩ စံၭဘဲၫယီၩ, ယိခွါ,ယကိၪ့ဝဲၩဆၧအၧၩ့ထၫ့ဒၩနၥံၪ, ဒဲကိၪ့ဆၧကိၪ့ထၫ့ဒၩနၥံၪလီၫ. ဂဲၫထဲၩ့ထဲၩ့လဂၩဘၪ လဂၩလၧအဖၧၩ့ၥၭအၧၩ့ဆုၬဆုၬတၭ, မၩဂ့ၩထဲၩ့ နၥံၪအဖၧၩ့ၥၭ, ဒဲနၥံၪအဆၧမၩလဖၪဆံၭ.",
			"12": "<sup>12</sup> တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ယိလါဆၧအလးအီၪအ့ၬ. ပမိလ့ၩဖိၬ ပဆၧကိၪ့ဒၪပဝ့ၫအခဲၫ့တၭ,ပမိမၩဖိၬလ ဂၩအၥၭအၧၩ့ လဂၩအၥၭအၧၩ့ အဖၧၩ့ၥၭဒၪဝ့ၫဆုၬ",
			"13": "<sup>13</sup> ဆုၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဘဲၫယီၩ, အၪ့စၪ့ဆၧလၧၦဆၨၩလဖၪအကျၩ, မွဲပလၫနါဂၧၫ့ ဆၧဘဲၫနီၪၥိၭလဂၩလဲၪ. အံၫစရ့လၭအမုၪနၩ့မၩဆၧ",
			"14": "<sup>14</sup> အၧၩ့အဒိၪအယိၬလမံၩ့လီၫ.- မူၭခိၪဖီၫလၧလ့ၭဘ နၧၫ့အလိးလီၩ့နီၪ, မိစဲၪ့ဒၪဂၪ့ခိၪအဝၩ့ဆ့ဧၪ.ထံၫချံၫ့ လၧအယွၩလၩ့လၧ အယဲၩ့ယိၬနီၪမိလၩ့ၥံၭဆ့ဧၪ.",
			"15": "<sup>15</sup> မွဲလါနၫ့တၭယၡၩခမျၧးၥၭနၪ့ယူၭယၧၩ, ဆၧဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧဆၧပျီၩပျီၩအဂးတၭ, အခၪ့ဘၪထၧၩ့ လၧအဖၧၩ့ၥၭဖၧၩ့, လၧဖၧၩ့ၥၭလးလံၩ, လ့ၩဝ့ၫလၧ ဖၧၩ့ၥၭဖိၪ, ဖၧၩ့ၥၭလၧဆၧလမၩထၪ့ဘၪဝ့ၫတၭ,",
			"16": "<sup>16</sup> ဘဲၫၥိၭအမိအီၪက့ၪအခးလၧဆၧအီၪယူအလး, ဆၧဒုၪ ဒွ့ၪအလး လၩ့ဆိၩလၩ့ကၠၪလီၫ. ကယဲၦလၧအလဲး လီၩ့ဝ့ၫလဂၩလါလါနီၪ မိအီၪက့ၪအၥၭထီၫမံၫထီၫမၪ",
			"17": "<sup>17</sup> တၭ, ဂံၩဂုအခိၪလီၫ.- ယမိမၩလၩ့ပြံၩလၩ့ပၩဝ့ၫ လၧဆၧအဒုၪအဒၩအမ့ၬယၫ ဘဲၫလံၩလၧမုထၪ့လခီၫ အၥိၭနီၪလီၫ. လၧအဆၧၡၪ့ဆၧနၭ အမုနံၩနီၪ ယမိ ဒုၭနဲၪဝ့ၫလၧဆၧအချိၫ့တၭ, မွဲဆၧအမ့ၬအ့ၬ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ဂဲၫဘီၪ,မွဲပကိၪ့ၡီၩ့ ဆၧထၫ့ဒၩစယ့ၫရမဲအၫဆံၭ. အဂဲးဘဲၫယီၩဆၧၥီၪ့ ဆၧၥၫ့လလၩ့မါဘၪလၧၦလုဆၧ, ဒဲဆၧဒုၭကိၪ့နီၪလၧ ၦကိၪ့ဆၧၥ့ၪ, ဒဲဆၧအလူနီၪလၧမီၪလီၫ. ဂဲၫဘီၪ, မွဲပ ထးၡီၩ့အဝ့ၫလၧပဖျ့ၩဆံၭ. မွဲပထီးဒိၭပနါလၧအဆၧ ချဲၩ့နးထံၪလဂ့ၩ.",
			"19": "<sup>19</sup> ဒိၭနနါလၧယလူဆံၭး ယဟိဝၩဧ့ဒဲခိၭနၪၦလၧအ",
			"20": "<sup>20</sup> ဂဲးလိၬတ့ၭလိၬလၧယၧၩအလူဆံၭ.- ဆၧမိမၩဆၧၫ့ ဆၧအၧၩ့လၧဆၧဂ့ၩအဂးဆ့ဧၪး အဂဲးဘဲၫယီၩ ၦလ ဖၪနီၪခုၪ့လၩ့ဆၧဖၧၩ့ လၧယၥၭမၧၫ့အဂးလီၫ. ယ ဆၧၫ့ထုၪ့လၧနမ့ၬယၫ ဘဲၫၥိၭယမိချဲၩ့ဆၧဂ့ၩ လၧအ ဝ့ၫၥံၪအဂး, ဘဲၫၥိၭဆၧမိကၠၪခွံၬ နၥၭခဲၩထၪ့လၧအ",
			"21": "<sup>21</sup> အီၪနီၪနၪ့ထၪ့ထဲၩ့ဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ,ဖ့ၪလၫ့ ခွံၬအဝ့ၫၥံၪအဖိၪအလံၩ လၧဆၧၥၭဝံလၩ့ဒိၩတၭ, ဂါ လၩ့ခွံၬအၥွံၪလၧနၭ အနါဆံၭ. တၭမွဲအမၫလဖၪ ကဲၪထၪ့ၦမုၪမဲၫလၧအဖိၪၥံၫလူၬဆံၭ. တၭမွဲအၡၩ ခွၫဘၪဆၧမၩၥံၫဝ့ၫ, ဒဲမွဲအၡၩဖိၪၥၪခွၫဘၪဆၧမၩၥံၫ",
			"22": "<sup>22</sup> ဝ့ၫလၧနၭလၧဆၧဒုၭၥုၭအဖၧၩ့ဆံၭ.- ထီးနအ့ၪဒုၭဂဲၫ ထၪ့ၡုၭၦလဒီၪ့လၧအဝ့ၫၥံၪအဖၫ့ခိၪတၭ, မွဲဆၧအၥီၫ ဂၧၫ့ထၪ့လၧဂံၪ့ဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪခုၪ့ လၩ့ဆၧဖၧၩ့ ဘဲၫၥိၭအမိမၩန့ယၧၩတၭ, အီၪက့ၪၥူၪ",
			"23": "<sup>23</sup> ဖျံၩခွၩ့လဖၪလၧယခၪ့အဂးလီၫ.- တၭအဝ့ၫၥံၪကိၪ့ ထၪ့လၧအမိမၩၥံၫယၧၩအဂဲးအကၠီၪ့နီၪ, ယဟိဝၩဧ့, နၥ့ၪယၫထီးအလူၬလီၫ. ဖျါခွံၬအဆၧဒဲၩဘၭလဂ့ၩ, ဒဲထူၭခွံၬအဆၧမၪ လၧနမ့ၬယၫလဂ့ၩ. မွဲအဘၪဆၧ မၩလၩ့ချႃၬဝ့ၫလၧနမ့ၬယၫဆံၭ. လၧနၥၭထၪ့အထီ နီၪမၩဝ့ၫဆံၭ."
		},
		"19": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လ့ၩမၩန့ၦကၧၩ့ဖၧၩ့အတ ခီးနးဖျိၪ့တၭ, မၩန့ၦခမျၧးအၥၭၡါလနၩ့, ဒဲၦလုဆၧ",
			"2": "<sup>2</sup> အၥၭၡါလနၩ့,- တၭလ့ၩထၪ့လၧစဟံၪ့နၧၫ့အဖိၪခွၫ အခိၪလီၩ့ဆူၭ ထီးဆၧလ့ၩနုၬလၧၦကၧၩ့န့ဖၧၩ့အတ ရၫ့ဖၧၩ့တၭ, ကိၭထၪ့ဆၧချဲၩ့ လၧယမိလီၩဘၪနၧၩ",
			"3": "<sup>3</sup> ထီးနီၪတၭ,စံၭ,- ယုဒၫအစဎွၩလဖၪ,ဒဲၦယရုစလံၫ့ ဖိၪၥံၪဧ့, ခိၭနၪယဟိဝၩ အလူအထၫဆံၭ. ဆၧၥုၭမု ခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယိ ခွါ,ယမိဒုၭဂဲၫဆၧအၧၩ့ဘၪ လၧအလးထီးယီၩ,ထီး",
			"4": "<sup>4</sup> ၦလၧအနါဂၧၫ့ဝ့ၫလဂၩလါလါမိခံၭအနါၥံၪလီၫ.- အ ဂဲးဘဲၫယီၩ အဝ့ၫၥံၪစဲၪ့ဒၪယၧၩတၭ, အီၪက့ၪဆၧအ လးယီၩလၧၦလခီၫဘၩ့မုးဖိၪအလး, ဒဲဆူၭခဲၩဆၧ နၧၫ့မၧၫ့လၧအဖၧၩ့ လၧယွၩအဂူၫဂၩအဂး လၧအဝ့ၫ ၥံၪမွဲဂ့ၩ,အဖါၥံၪမွဲဂ့ၩ, ယုဒၫအစဎွၩၥံၪမွဲဂ့ၩ, ၥ့ၪယၫ ဝ့ၫအ့ၬးတၭမၩဎွ့ၩဆၧလၧအလးယီၩ လၧၦလၧအ",
			"5": "<sup>5</sup> ဆၧဒဲၩဘၭလအီၪဘၪအၥွံၪတၭး- အဝ့ၫၥံၪမၩထၪ့ ဆၧအလးထၪ့ထီၫလဖၪလၧဘၫအလၭအဂး, ဘဲၫၥိၭ အမိဆူၭထၪ့ခွံၬအဖိၪခွၫၥံၪ လၧမ့ၪလၧဆၧလုမ့ၪလၧ ဘၫအလၭအဂး လၧယလမၪလူၬဘၪ,ဒဲယလချဲၩ့ဘၪ",
			"6": "<sup>6</sup> လၧအဂဲးဒဲလအီၪထၪ့ဘၪလၧယၥၭခံဖၧၩ့လီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ,ယိခွါ,ယဟိဝၩစံၭဝ့ၫဒၪ,မုနံၩလဖၪဂဲၫ လၧအလကိၭလၧၩ့ဘၪလၧဆၧအလးယီၩ လၧထိဖ့ၭ မွဲဂ့ၩ, လၧစဟံၪ့နၧၫ့အဖိၪခွၫအခိၪလီၩ့ဆူၭမွဲဂ့ၩတၭ, ဆၧမိကိၭဝ့ၫ လၧဆၧမၩၥံၫဆၧအခိၪလီၩ့ဆူၭလီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩ ယမိမၩဂၭဂီၩ့ယုဒၫဒဲယရုစလံၫ့အဆၧ ကိၪ့လိၬအၥၭလၧဆၧအလးထီးယီၩတၭ, ယမိဒုၭ လၩ့ထံၩဖါဝ့ၫလၧနၭ လၧအဒုၪအဒၩ အမ့ၬယၫတၭ, ဒဲလၧၦလၧအအၪ့ဎၬ အၥၭမၧၫ့အစူၪဖၧၩ့တၭ, ယမိ ဖ့ၪလၫ့အစွၪလဖၪ လၧဆၧအၪ့လၧဆၧဖိၭဖၫ့အထိၪၥံၪ",
			"8": "<sup>8</sup> လံၪၥံၪ, ဒဲလၧဂၪ့ခိၪအဆၧဖိၪဆၧဎါအဂးလီၫ.- တၭ ယမိအီၪက့ၪဒိၩ့ယီၩလၧဆၧထီၫမံၫထီၫမၪအလး, ဒဲ ဆၧဒုၪဒွ့ၪအလးလီၫ. ကယဲၦလၧအလဲးလီၩ့နီၪမိအီၪ က့ၪအၥၭထီၫမံၫထီၫမၪ, ဒဲဒုၪဒွ့ၪအဆၧၡၪ့ဆၧနၭထီး",
			"9": "<sup>9</sup> အလူၬအကၠီၩ့လီၫ.- တၭယမိဒုၭအၪ့အဝ့ၫၥံၪလၧအ ဖိၪခွၫလဖၪအယၪ,ဒဲအဖိၪမုၪၥံၪအယၪတၭ, လၧဆၧ ခိဆၧဝီၩအဖၧၩ့ လၧအဒုၪအဒၩ ဝၩ့ထၬအဝ့ၫၥံၪအ ဘိၩ့ဘၭနီၪ, ဒဲအၪ့ဎၬအဝ့ၫၥံၪအၥၭမၧၫ့ အကၠီၩ့တၭ, အဝ့ၫၥံၪမိအၪ့လဂၩ အထံၩအၥိၭအယၪ, လဂၩအ ထံၩအၥိၭအယၪလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့နဘၪမၩထ့ဖၭခွံၬ တခီးလဖျိၪ့နီၪလၧ",
			"11": "<sup>11</sup> ၦလၧအလ့ၩဖိၬနခဲၫ့အမ့ၬယၫတၭ,- စံၭအဝ့ၫၥံၪဆၧ ၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩ, ယမိမၩခါမၩဂၭ ဂီၩ့ခွံၬၦခမျၧးယီၩ, ဒဲဒိၩ့လဖျိၪ့ယီၩ, ဘဲၫၦမၩထ့ဖၭ ခွံၬၦကၧၩ့န့ဆၧအဖၧၩ့ လၧအမၩထဲၩ့ဒီၭလၥ့ၪဘၪအ ၥိၭနီၪတၭ,ၦမိခုၪ့လၩ့ဘၧၩ့ခွံၬ ဆၧလၧထိဖ့ၭအဖၧၩ့ ထီၩ့လၧၦခုၪ့လၩ့ဘၧၩ့ခွံၬဆၧအလးလအီၪလၧၩ့ဘၪ",
			"12": "<sup>12</sup> နီၪလီၫ.- ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိမၩဆၧအလးထီး ယီၩဒဲၦအီၪဝ့ၫလၧအဖၧၩ့ဘဲၫနီၪၥိၭတၭ, ယမိမၩဒိၩ့",
			"13": "<sup>13</sup> လဒိၩ့ယီၩဘဲၫထိဖ့ၭအၥိၭ,- တၭယရုစလံၫ့အဂံၪ့, ဒဲ ယုဒၫအစဎွၩအဂံၪ့လဖၪ လၧအလဆံၫ့ဘၪနီၪမိမၩအ ၥၭဘဲၫထိဖ့ၭအၥိၭနီၪ, ဂံၪ့ထီးအလူၬလၧၦဆူၭခဲၩထၪ့ ယူၭဆၧနၧၫ့မၧၫ့လၧအခိၪအဖၫ့ခိၪ, လၧမူၭခိၪအၥုၭမု ထီးအလူၬအဂး, ဒဲလူၫလၩ့ဆၧလုအီၩလၧယွၩအဂူၫ ဂၩလဖၪအဂးလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့စယ့ၫရမဲအၫ ဂဲၫထဲၩ့လၧထိဖ့ၭအလး လၧယဟိဝၩအၪ့မၧၫ့လၩ့န့ဝ့ၫ ဘဲၫၥိၭအမိချဲၩ့ဆၧလၧ မီၪအချိၬနီၪတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧယဟိဝၩအဂံၪ့အဝၩ့",
			"15": "<sup>15</sup> ဖၧၩ့တၭ,စံၭၦခမျၧးထီးအလူၬး- ဆၧၥုၭမုခမျၧးအ ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယမိဒုၭဂဲၫ ဘၪဒိၩ့ယီၩ, ဒဲအဝၩ့ထီးအလူၬလၧကယဲဆၧအၧၩ့လၧ ယစံၭလၧအဂဲးလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩဆီၪ့အ ခိၬဘဲၫအထီးခိၭနၪဘၪယလူလဂ့ၩအၥိၭလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> တၭၦလုဆၧစအံမၧၫအဖိၪခွၫ, စပၭၡၧၫ,အဝ့ၫဒၪမွဲ ဆၧအခိၪပၧၩ့ဆၧလၧယဟိဝၩအဂံၪ့ဖၧၩ့, နါဂၧၫ့လၧ စယ့ၫရမဲအၫချဲၩ့ဆၧလၧမီၪအချိၬ လၧဆၧချဲၩ့လဖၪနီၪ",
			"2": "<sup>2</sup> လီၫ.- ထီးနီၪလဖၧၫ့စပၭၡၧၫထးမီၪစယ့ၫရမဲအၫတၭ, ၥံၫ့ထၬဝ့ၫလၧၥံၫ့အဖၧၩ့ လၧအအီၪဝ့ၫလၧစဘံၪ့ယမံၫ့ အတရၫ့ထီၫလၧအအီၪဝ့ၫလၧယဟိဝၩအဂံၪ့နဲၩ့ထံၭ",
			"3": "<sup>3</sup> လီၫ.- တၭဆၧမၩအၥၭလၧမုဆဲၪ့ထၪ့လနံၩနီၪ လၧ စပၭၡၧၫဖျါခွံၬ စယ့ၫရမဲအၫ လၧၥံၫ့အဖၧၩ့နီၪလီၫ. ထီးနီၪလဖၧၫ့ စယ့ၫရမဲအၫစံၭဝ့ၫ, ယဟိဝၩကိၭနမံၩ့",
			"4": "<sup>4</sup> လၧပၭၡၧၫမွဲအ့ၬး မွဲမ့ဂီၫမံၭစ့ဘံၭလီၫ.- အဂဲးဘဲၫ ယီၩ,ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိအီၪက့ၪနၧၩ လၧဆၧၥၭမဲၪအလးလၧနဂးဒၪနဝ့ၫ, ဒဲလၧနထံၩနၥိၭ ထီးအလူၬအဂးတၭ, အဝ့ၫၥံၪမိလၩ့ထံၩဖါလၧအဒုၪ အဒၩအနၭတၭ, နမ့ၬၥၪၥံၪမိဒၪဘၪဆ့တၭ, ယမိဖ့ၪ လၫ့ယုဒၫထီးအလူၬ လၧဘၭဘလၧၫ့အစဎွၩအစူၪ ဖၧၩ့တၭ, အဝ့ၫဒၪမိဆိၬအၪ့မၧၫ့ဎီးအဝ့ၫၥံၪလၧဘၭဘ",
			"5": "<sup>5</sup> လၧၫ့တၭ,မိမၩၥံၫအဝ့ၫၥံၪလၧနၭလီၫ.- တၭယမိဖ့ၪ လၫ့ဒိၩ့ယီၩအဂဲးအဘၭ, ဒဲအစူၪလးအခၪ့ခိၪထီးအ လူၬ,ဒဲအဆၧဖိၪဆၧလံၩ, ဒဲကယဲဆၧလၧယုဒၫအစဎွၩ အီၪက့ၪကီၪ့ဝ့ၫထီးအလူၬနီၪ, ယမိဖ့ၪလၫ့ခွံၬဝ့ၫလၧအ ဒုၪအဒၩအစူၪဖၧၩ့ လၧအမိအၪ့ဂူၬန့အဆၧဒဲဖီၪ့ထၬ",
			"6": "<sup>6</sup> ဝ့ၫဒဲဆိၬခွံၬဝ့ၫ, ထီးလၧဘၭဘလၧၫ့အဖၧၩ့လီၫ.- တၭ နဝ့ၫဒၪစပၭၡၧၫ ဒဲကယဲၦလၧအအီၪလၧနဂံၪ့ဖၧၩ့ထီး အလူၬၥံၪဧ့, နၥံၪမိဘၪလ့ၩကဲၪဎီး, ဒဲနၥံၪမိဘၪလ့ၩ ထီၩ့လၧဘၭဘလၧၫ့တၭ, နမိၥံၫထီးနီၪတၭ, ၦၡၩမိ ခုၪ့လၩ့ဘၧၩ့ခွံၬနၧၩထီးနီၪ, နဝ့ၫဒၪဒဲနထံၩနၥိၭထီးအ လူၬလၧနဆၧချဲၩ့ ၥီၪ့ထဲၩ့ဆၧအဘျံၭအဘျၪလၧမီၪအ ချိၬနီၪလီၫ.",
			"7": "<sup>7</sup> ယဟိဝၩဧ့,နအၪ့လွ့ၫယၧၩတၭ, ယဒိၭဆၧအၪ့လွ့ၫ ယၥၭ, နဆီၪ့နဲၪ့ယၧၩဒံၭ, နမၩနၧၩ့ဆၧလီၫ. ယဘၪ ဆၧဒုၪဒွ့ၪကိၭမုနံၩမုနၩဒ့ၭ, ၦမၩဒီၩ့ယၧၩကိၭဂၩဒ့ၭ",
			"8": "<sup>8</sup> လီၫ.- အဂဲးဘဲၫယီၩ ထီးဒၪယချဲၩ့ဆၧလဖၧၫ့ဖၧၫ့နီၪ ယကိၭၡၭထၪ့တၭ, ယကိၭထၪ့ဆၧအၪ့ဂူၬန့, ဒဲဆၧ မၩဂၭဂီၩ့လီၫ. အဂဲးဘဲၫယီၩမွဲယဟိဝၩအလူအထၫ ကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလး, ဒဲမၩကြၩ့ထမးအလးလၧ",
			"9": "<sup>9</sup> ကိၭမုနံၩမုနၩဒ့ၭလီၫ.- ထီးနီၪလဖၧၫ့ယစံၭ, ယချဲၩ့ လၧၩ့လၧအဂဲးအကၠီၪ့အ့ၬး တၭယချဲၩ့လၧၩ့ဆၧလၧ အမံၩ့ဆ့အ့ၬ. မွဲလါနၫ့တၭအဆၧချဲၩ့ကဲၪထၪ့လၧယ ၥၭခံဖၧၩ့ဘဲၫမ့ၪအၪ့ဆၧကၭဘံၭထၬအၥၭ လၧယဎွံၪ ဖၧၩ့အၥိၭနီၪတၭ, ယအွံၪၥၭဆၧၩ့နီၪ ဆၧပွံၭယၥၭ",
			"10": "<sup>10</sup> ယအီၪကဲၪအ့ၬ.- အဂဲးဘဲၫယီၩယနါဂၧၫ့ၦဒုၪဒွ့ၪဆၧ အၪဂၩ, ဆၧၥၭမဲၪအလးအီၪဝ့ၫ လၧကိၭစီၪ့ဒ့ၭလီၫ. ဒုၭနဲၪဆၧဆံၭ, အဝ့ၫၥံၪစံၭဝ့ၫဒၪး တၭပမိဒုၭနဲၪထဲၩ့ ဒီၭလီၫ.ကယဲၦအီၪအိၭလိၬလၧယၧၩ ထီးအလူၬနီၪ အီၪခိၭဆၧလၧယလၩ့ထံၩဖါလီၫ. စံၭဝ့ၫ, ဘၪလဘၪ အဝ့ၫဒၪမိဒိၭအၪ့လွ့ၫအၥၭတၭ, ပမိမၩစၪဝ့ၫတၭ,ပမိ",
			"11": "<sup>11</sup> မၩဆၧၫ့ဆၧအၧၩ့လၧအလီၩ့လီၫ.- မွဲလါနၫ့ယဟိဝၩ အီၪယူၭလၧယၥိၭ ဘဲၫၦအဆီၪ့လၧအစီၩ့ဒိၪအမၩ့ဒိၪ အၥိၭနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယဒုၪယဒၩအခၪ့ မိဘၪထၧၩ့တၭ, မၩစၪယၧၩအ့ၬ. မွဲအလမၩစၪဘၪ လကၭလၧၩ့, အမ့ၬမိမဲဒိၪမၬလီၫ. အမ့ၬမိမဲလၩ့ဆိၩ",
			"12": "<sup>12</sup> လၩ့ကၠၪတၭ, ဆၧၥၭနၪ့ဘၪဝ့ၫအ့ၬ.- ဆၧၥုၭမုခမျၧး အယဟိဝၩ, ဆၧမၩခွါၦတီၩၦလီၩ့, ၦလၧအဒၪဘၪ ၦၥုၪ့ခံၦၥၭလဲၫလဂၩဧ့, ဒုၭဒၪဘၪယၧၩလၧနမၩဆၧၫ့ ဆၧအၧၩ့လၧအဝ့ၫၥံၪအလီၩ့ဆံၭ. အဂဲးဘဲၫယီၩယဒုၭ နဲၪနၧၩလၧယခွးလီၫ.",
			"13": "<sup>13</sup> ၥံၫကျံၩထၪ့ယဟိဝၩ, စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၩဖီၩ့မၩဖျ့ၭၦၡၪ့ဖိၪအၥၭမၧၫ့ လၧၦလတီၩလလီၩ့ဘၪအစူၪဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> မုလနံၩလၧယအီၪဖျဲၪနီၪ, မွဲအဘၪဆိၪအၧၩ့ဆံၭ.မု လနံၩလၧယမိဆီၫ့အီၪန့ယၧၩနီၪ, မွဲအထီးဘၪဆိၪဂ့ၩ",
			"15": "<sup>15</sup> ဝ့ၫလဂ့ၩ.- ၦလၧအဂဲၫလီၩဘၪယဖါတၭစံၭ, ဖိၪခွၫ အီၪဖျဲၪလၧနဂးတၭ, ဆၧဒုၭၥၭထိၬအဝ့ၫဒၪဒိၪမၬနီၪ,",
			"16": "<sup>16</sup> မွဲၦလဂၩနီၪဘၪဆၧဆိၪအၧၩ့ဝ့ၫဆံၭ.- မွဲၦလဂၩနီၪ မၩအၥၭဘဲၫဒိၩ့လဖၪ လၧယဟိဝၩ မၩလၩ့ဎီးခွံၬဝ့ၫ တၭ,လနီၫ့ယါလၩ့ထဲၩ့ဘၪအၥၭအၥိၭနီၪဆံၭ. မွဲအ နါဂၧၫ့ဆၧကိၭ မၩၥၭမဲၪဆၧလၧမုဂီၩ, ဒဲဆၧကိၭၡၭ",
			"17": "<sup>17</sup> ထၪ့လၧမုထုၪ့ဆံၭ.- အဂဲးဘဲၫယီၩ အဝ့ၫမၩၥံၫယၧၩ ခီၫလၧဒၧၩ့လးဖၧၩ့အ့ၬး အ့ၪလမွဲဘၪဘဲၫနီၪတၭ,ယမိ ကဲၪလါယူၭ ယၥွၪခိၪယူၭတၭ, အဒၧၩ့လးဒိၪလါလၧ",
			"18": "<sup>18</sup> ယၧၩလၩ့ဆိၩလၩ့ကၠၪဆံၭ.- ယဂဲၫထၪ့လၧၦဒၧၩ့လး ဖၧၩ့ဘဲၫၥိၭယမိဒၪဘၪဆၧမၩခိမၩဝီၩ, ဒဲဆၧၥုၪ့အုၭ ၥၭအုၭ,ဒဲဘဲၫၥိၭယမုနံၩလဖၪ မိလူၬဝ့ၫလၧဆၧမ့ၬမဲ အဖၧၩ့နီၪမွဲဘၪလဲၪ."
		},
		"21": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪစယ့ၫရမဲအၫ, ထီးအ ထီလၧစဎွၩဇ့ၭဒကဲအၫ, အၪ့မၧၫ့လၩ့ စမ့ၫရခဲအၫအ ဖိၪခွၫစပၭၡၧၫဒဲၦလုဆၧစမ့ၫအစဲအၫ အဖိၪခွၫစဇ့ၭ",
			"2": "<sup>2</sup> ဖနဲအၫလၧအအီၪတၭ,စံၭဝ့ၫဒၪ.- အၪ့စၪ့လါယဟိ ဝၩလၧပဂးဆံၭ. အဂဲးဘဲၫယီၩ ဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫဒုၭဆၧထၫ့ဒၩပၧၩလီၫ. ဘၪလဘၪယ ဟိဝၩမိမၩပၧၩး ဘဲၫကယဲအဆၧမၩလၩ့လၭအၥိၭနီၪ တၭ,အဝ့ၫဒၪမိစဲၪ့ထၪ့ခွံၬလၧပအီၪလီၫ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့ စယ့ၫရမဲအၫစံၭဝ့ၫ, နၥံၪမိဘၪစံၭ",
			"4": "<sup>4</sup> စဇ့ၭဒကဲအၫဘဲၫယီၩ,- ယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဘဲၫယီၩ, ယိခွါ,ယမိဘိၭကၠၪကဒၩထဲၩ့နၥံၪအစူၪ ဝဲၩအီၪလၧနၥံၪအစူၪဖၧၩ့ လၧနၥံၪဒုၭဆၧထၫ့ဒၩဘၭ ဘလၧၫ့အစဎွၩ ဒဲၦခၫလဒံအၫဖိၪ လၧအဝၩ့ထၬနၥံၪ လၧဒိၩ့ခိၪဒၧၩ့တၭ, ယမိဒုၭအီၪကီၪ့အဝ့ၫၥံၪလၧဒိၩ့",
			"5": "<sup>5</sup> ယီၩအၥၭခံဖၧၩ့လီၫ.- တၭယဝ့ၫဒၪယနၫ့ဆါဒၪယဝ့ၫ ယမိဒုၭဆၧထၫ့ဒုၪဒၩနၥံၪ လၧယစူၪယၩ့ထၪ့အၥၭ တၭ,ယစူၪဒူၪဆီၪ့အီၪလၧၥၭထၪ့ဒဲၥၭခဲၩထၪ့, ဒဲၥၭခိ",
			"6": "<sup>6</sup> ဒိၪဒိၪလ့ၬလီၫ.- တၭယမိထးဆၧအီၪဝ့ၫလၧဒိၩ့ယီၩ အဖၧၩ့,ဒဲၦၡၩဒဲဆၧဖိၪဆၧဎါတၭ, မိၥံၫလၧဆၧၥံၫချဲၫ့",
			"7": "<sup>7</sup> ဖၭဒိၪလီၫ.- တၭယဟိဝၩစံၭဝ့ၫဒၪ, လၧဆၧနီၪလဖၪ အလးခဲၫ့နီၪယမိဖ့ၪလၫ့ခွံၬယုဒၫအစဎွၩဇ့ၭဒကဲအၫ ဒဲအခ့ၫအၡၩ,ဒဲၦခမျၧး, ၦအီၪလၩ့ထးလၧဆၧၥံၫချဲၫ့ ဒဲလၧနၭ,ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ လၧဒိၩ့ယီၩအဖၧၩ့, လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫအစူၪဖၧၩ့, ဒဲလၧအဒုၪအဒၩအစူၪဖၧၩ့, ဒဲၦလၧအအၪ့ဎၬအၥၭ မၧၫ့အစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမိကျီၪ့အဝ့ၫၥံၪလၧနၭအ နါတၭ,လမိလီၫ့ကီၩ့ဘၪဝ့ၫဒဲအၥၭလလၩ့ဘၪ, ဒဲယၫ့ ၥၭဘၪဝ့ၫဆ့အ့ၬ.",
			"8": "<sup>8</sup> တၭနမိဘၪစံၭၦခမျၧးယီၩ, ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယအီၪက့ၪဆၧမၧၫ့အဖၧၩ့ၥၭ, ဒဲဆၧၥံၫအဖၧၩ့",
			"9": "<sup>9</sup> ၥၭလၧနၥံၪအမ့ၬယၫလီၫ.- ၦလၧအအီၪလၧဒိၩ့ယီၩ အဖၧၩ့နီၪမိၥံၫလၧနၭ, ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩဒဲလၧဆၧ ၥံၫချဲၫ့နီၪလီၫ. အ့ၪမွဲၦလၧအစဲၪ့ထၪ့တၭ,ဖ့ၪလၫ့ဒၪ အၥၭလၧၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့ လၧအဝၩ့ထၬန့ နၥံၪနီၪမိမၧၫ့ဝ့ၫတၭ, အၥၭမၧၫ့နီၪမိကဲၪထၪ့ဝ့ၫလၧဆၧ",
			"10": "<sup>10</sup> အၪ့ဂူၬန့လီၫ.- အဂဲးဘဲၫယီၩယအီၪက့ၪယမ့ၬထၫ့ဒုၪ ဒၩဒိၩ့ယီၩလၧဆၧအၧၩ့အဂးတၭ, မွဲလၧဆၧဂ့ၩအဂး အ့ၬ,ယဟိဝၩစံၭဝ့ၫဒၪ. ဆၧမိဖ့ၪလၫ့ခွံၬဝ့ၫ လၧဘၭ ဘလၧၫ့အစဎွၩအစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမိဆူၭထၪ့ခွံၬ ဝ့ၫလၧမ့ၪလီၫ.",
			"11": "<sup>11</sup> တၭစံၭယုဒၫအစဎွၩအၡၩဂံၪ့ဖိၪနီၪ, ခိၭနၪယဟိဝၩ",
			"12": "<sup>12</sup> အလူဆံၭ.- စဒၫဝံၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, မၩဆၧစ့ၩရၫ့ ချဲၫ့ချဲၫ့,ဒဲမၩဖီၩ့မၩဖျ့ၭၦလၧအဘၪ ဆၧအၪ့ဂူၬန့ဝ့ၫလၧ ၦမၩအၧၩ့ဆၧအစူၪဖၧၩ့ဆံၭ. ယၥၭခဲၩထၪ့မိလ့ၩ ဘၪၡုၭဘဲၫမ့ၪအၥိၭ, အၪ့ခွံၬဆၧတၭ, ဆၧမၩလၩ့ဖံၬ ခွံၬဝ့ၫလအီၪဘၪ လၧနၥံၪမၩဆၧအၧၩ့အကၠီၩ့လီၫ.",
			"13": "<sup>13</sup> ယိခွါ,ယထၫ့ဒၩနၧၩ, ၦအီၪဝ့ၫလၧခိၪလီၩ့ဆူၭဖၧၩ့, ဒဲအီၪလၧဆၧပျၩ့အလဲၫ့ဖၧၩ့ၥံၪဧ့, ယဟိဝၩစံၭဝ့ၫဒၪ, ၦလၧအစံၭ, မွဲပလၫမိဂဲၫထၫ့ဒၩပၧၩလဖၪလဲၪတၭ,မွဲ",
			"14": "<sup>14</sup> ပလၫမိဂဲၫနုၬလၧပအီၪအလးလဖၪနီၪလဲၪ.- တၭယ ဟိဝၩစံၭဝ့ၫဒၪ, ယမိစ့ၩရၫ့စၪနၥံၪ ဘဲၫနၥံၪမၩဆၧအ ဆၧၥၪအၥိၭနီၪတၭ, ယမိဆူၭခဲၩမ့ၪ လၧအမံၩ့လၬ ကျၩတၭ,မိအၪ့ခွံၬကယဲဆၧအီၪဝၬဖီၩ့ဝ့ၫလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လ့ၩလၩ့လၧယုဒၫအစဎွၩ",
			"2": "<sup>2</sup> အဂံၪ့တၭ, ချဲၩ့ဆၧလၧဆၧချဲၩ့ယီၩ,- တၭစံၭ, ယုဒၫ အစဎွၩလၧအဆၧၫ့နၩ့ လၧစဒၫဝံၭအလးဆီၩ့ဆီအဖၫ့ ခိၪလဂၩဧ့, နဝ့ၫဒၪဒဲနခ့ၫနၡၩ, ဒဲနၡၩခမျၧးလၧအလ့ၩ နုၬလၧတရၫ့ယီၩလဖၪ အဖၧၩ့ၥံၪဧ့, ခိၭနၪယဟိဝၩ",
			"3": "<sup>3</sup> အလူအထၫဆံၭ.- ယဟိဝၩစံၭဘဲၫယီၩ, မၩဆၧစ့ၩ ရၫ့,ဒဲဆၧတီၩဆၧလီၩ့, ဒဲမၩဖီၩ့မၩဖျ့ၭၦလၧအဘၪ ဆၧအၪ့ဂူၬန့ဝ့ၫလၧ ၦမၩအၧၩ့ဆၧအစူၪဖၧၩ့ဆံၭ. တၭ ဆၧလတီၩဘၪမွဲဂ့ၩ,ဆၧမၩန့ဆီၪ့မွဲဂ့ၩ, မၩၦလခီၫ ဘၩ့မုးဖိၪ,ၦဖိၪဎွ့ၪ, ၦမုၪမဲၫနီၪမွဲဂ့ၩ, တၭလူၫလၩ့ဆၧ ၥွံၪလၧအဆၧဒဲၩဘၭလအီၪဘၪ လၧအလးထီးယီၩ",
			"4": "<sup>4</sup> လဂ့ၩ.- အဂဲးဘဲၫယီၩနၥံၪအ့ၪမၩတၡါဆၧလမံၩ့ယီၩ တၭ,ထီးနီၪလဖၧၫ့စဎွၩလဖၪမိဆၧၫ့နၩ့ လၧစဒၫဝံၭအ လးဆီၩ့ဆီအဖၫ့ခိၪ, ထူၬလဲၪ့ကၥ့ၪ, ဒဲထူၬကၥ့ၪ,ဂဲၫ နုၬလၧဂံၪ့ယီၩအတရၫ့အဖၧၩ့, အဝ့ၫဒၪဒဲအခ့ၫအၡၩ ခမျၧးလီၫ.",
			"5": "<sup>5</sup> အ့ၪမွဲနၥံၪအ့ၪလခိၭနၪဘၪဆၧချဲၩ့ယီၩ, ယဟိဝၩ စံၭဝ့ၫဒၪ, ယဆိၪလၩ့ယၥၭလၧယမ့ၬယၫဒၪယဝ့ၫလၧ",
			"6": "<sup>6</sup> ဂံၪ့လဖျိၪ့ယီၩမိကဲၪထၪ့ဆၧအီၪယူဝ့ၫလီၫ.- အဂဲးဘဲၫ ယီၩယဟိဝၩစံၭယုဒၫအစဎွၩ အၡၩဂံၪ့ဖိၪဘဲၫယီၩ, နမွဲဂံလအၭလၧယဂး, လ့ၭဘနၧၫ့အဒၩ့ခိၪလီၫ. မွဲလါ နၫ့ယမိမၩနၧၩလၧမံၩ့လၬကျၩ, ဒိၩ့ၥံၪလၧၦလအီၪဘၪ",
			"7": "<sup>7</sup> လၧအဖၧၩ့လီၫ.- တၭယမိတဲၩ့ဝဲၩၦမၩဂၭဂီၩ့ဆၧလ ဖၪ,လၧနဂး,လဂၩဒဲအစူၪဝဲၩ, လဂၩဒဲအစူၪဝဲၩတၭ, မိခူၬလၩ့နၥံၪ့ၡိၫအ့ရ့ၭ လၧအဂ့ၩထုၬလဖၪ, ဒဲဖျႃၭ",
			"8": "<sup>8</sup> လၩ့ခွံၬအဝ့ၫၥံၪ လၧမ့ၪဖၧၩ့လီၫ.- တၭၦအၪဆၨၩမိ လ့ၩဖီၩ့ခွံၬဒိၩ့လဖျိၪ့ယီၩတၭ, မိစံၭလိၬအၥၭလဂၩ ဒဲလဂၩနီၪ, ယဟိဝၩမၩဒိၩ့ဖၭဒိၪလၧဆၧယီၩမွဲဘၪ",
			"9": "<sup>9</sup> လဲၪ.- တၭၦမိစံၭဆၧၫ့ဆၧ, အဂဲးဘဲၫယီၩအဝ့ၫၥံၪစဲၪ့ ဒၪယဟိဝၩအယွၩအဆၧအုၩ့လၩ့တၭ, ဘိၪ့ထၪ့ဘၩ ထၪ့ယွၩဂူၫဂၩလဖၪ, ဒဲမၩအဝ့ၫၥံၪအဆၧလီၫ.",
			"10": "<sup>10</sup> ထီးဂၪ့လၧၦၥံၫအကၠီၩ့လဂ့ၩ, ဂၪ့ဆၧယၧၩ့ဆၧလၧ အကၠီၩ့လဂ့ၩး အ့ၪမွဲဂၪ့နၭနၭလ့ၬလၧၦလၧအစဲၪ့ထၪ့ ခွံၬအကၠီၩ့ဆံၭ. အဂဲးဘဲၫယီၩမွဲအဂဲၫထဲၩ့ဘၪလၧၩ့",
			"11": "<sup>11</sup> အ့ၬတၭ,ဒၪဘၪလၧၩ့အခးဒၪဝ့ၫအ့ၬး- အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭဆၧဘၪဆဲၫ့လၧယုဒၫအစဎွၩစယိၫစဲအၫ အဖိၪခွၫစၡၫလၧၫ့ လၧအကဲၪထၪ့စဎွၩလၧအဖါစယိၫ စဲအၫအလး, လၧအစဲၪ့ထၪ့ခွံၬလၧအလးယီၩဂဲၫထဲၩ့",
			"12": "<sup>12</sup> လၧၩ့ထီးယီၩအ့ၬ.- မွဲအမိၥံၫဝ့ၫထီးအလးလၧၦၡၩ အၪ့မၧၫ့ဎီးဝ့ၫ လၧအဖၧၩ့တၭ, ဒၪလၧၩ့ခးယီၩအ့ၬ.",
			"13": "<sup>13</sup> ၦလၧအမၩဂံၪ့လၧဆၧလတီၩလလီၩ့ဘၪ, ဒဲအဒူၭ လၧထၭလခီၫလဖၪလၧဆၧစ့ၩရၫ့လတီၩဘၪ, လၧဆၧ အၪ့မၧၫ့ၦလၧအနဲၩ့ထံၭမၩအဆၧတၭ, ဖ့ၪလၫ့အလံၩ့ အလဲၫအ့ၬး ဒဲလဖ့ၪလၫ့ဘၪဆၧ လၧၦမၩဆၧလၧအ",
			"14": "<sup>14</sup> ဂးနီၪ,- ၦလၧအစံၭယမိမၩဂံၪ့ဖၭဒိၪလၧယဂး,အီၪ လၧဒူၭဖၭလဲလဖၪတၭ, မၩတရၫ့လံၩဒဲမၩဒူၭၥံၪအ ခိၪလၧၥံၪ့ၡိၫအ့ရ့ၭတၭ, ဂုၪဝ့ၫလၧၥံၪထံၫဝီၩနီၪ, ဘၪ",
			"15": "<sup>15</sup> အၡၪ့လီၫ.- မွဲနထိၪဎီၩ့နၥၭလၧၦဂူၫဂၩလၧၥံၪ့ၡိၫအ့ ရ့ၭအဆၧမၩတၭ, နမိကဲၪစဎွၩဆ့ဧၪ. နဖါအၪ့ဆၧ, ဒဲ အီၩဆၧ, ဒဲစ့ၩရၫ့ဆၧ, ဒဲမၩဆၧတီၩဆၧလီၩ့မွဲအ့ၬဧၪ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ,မွဲအန့ဘၪဆၧအဂ့ၩလီၫ.- အဝ့ၫ ဒၪစ့ၩရၫ့ၦၡၪ့ဖိၪယၬဖိၪ, ဒဲၦဘၪၡၪ့ဘၪနၭအခွးလီၫ. ထီးနီၪလဖၧၫ့မွဲအန့ဆၧဂ့ၩလီၫ. ဆၧနီၪမွဲဆၧၥ့ၪယၫ",
			"17": "<sup>17</sup> ယၧၩမွဲအ့ၬဧၪ,ယဟိဝၩစံၭဝ့ၫဒၪ.- အ့ၪမွဲနမ့ၬၥၪဒဲနၥၭ အီၪန့ၫလၧနၥၭကွံၩဆၧအဂး, ဒဲလၧနမိလူၫလၩ့ဆၧၥွံၪ လၧအဆၧဒဲၩဘၭ လအီၪဘၪအဂး,ဒဲလၧနမၩအၧၩ့ ဆၧအဂး, ဒဲလၧနအၪ့ဂူၬန့ဆၧအဂးဘဲၫၥိၭနမိမၩဝ့ၫ",
			"18": "<sup>18</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩစံၭဘဲၫယီၩ, လၧ ယုဒၫအစဎွၩစယိၫစဲအၫအဖိၪခွၫစယဟီအကံၫ့အဂဲး, ၦဂၪ့လၧအကၠီၩ့တၭ,စံၭ, အၩလါ, ယထၧၫ့ဖုဝဲခွၫ, အ့ၪလမွဲဘၪ, အၩလါ, ယထၧၫ့ဖုဝဲမုၪနီၪမွဲအ့ၬ.အဝ့ၫ ၥံၪလဂၪ့ဘၪလၧအကၠီၩ့တၭ,စံၭ, အၩလါ, ကဆါဧ့ၬ",
			"19": "<sup>19</sup> အ့ၪလမွဲဘၪ,အၩလါ,အလၩအဖၩ့ဧ့ၬ- ၦၡၩမိခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫ လၧကၥ့ၪယီၩ့ အဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬနီၪမိ မီၩ့ဝ့ၫ,ဒဲခွံၬၡိၭခွံၬဝ့ၫ လၧယရုစလံၫ့အတရၫ့လၧခီၫ့ လီၫ.",
			"20": "<sup>20</sup> လ့ၩထၪ့ဘၭလၧလ့ၭဘနၧၫ့နီၪ,ကိၭထၪ့တၭ, ထုၭ ထၪ့နလူလၧဘၫၡၫ့အဖၧၩ့တၭ, ကိၭထၪ့ဆၧလၧအၭ ဘရံၫ့အလီၩ့ဆံၭ. အဂဲးဘဲၫယီၩၦလၧအအဲၪနၧၩထီး အလူၬနီၪထီၩ့ယူၭလၧဆၧဂၭဂီၩ့ယူၭ.",
			"21": "<sup>21</sup> ယချဲၩ့ဆၧလၧနၧၩ လၧနဘီၪထၪ့ယီၫထၪ့အဘိၩ့ဘၭ တၭ,နစံၭယခိၭနၪအ့ၬ. လၧနလခိၭနၪဘၪယလူနီၪ,",
			"22": "<sup>22</sup> မွဲနထူၫနရူၫခီၫလၧနမုၪနၩ့ထၪ့လီၫ.- လံၩမိမၩလူၬခွံၬ နၡၩယိဆၧထီးအလူၬ, ဒဲၦလၧအအဲၪနၧၩမိလ့ၩကဲၪဎီး လီၫ. မွဲမၬ,နမ့ၬမိမဲတၭ,မိအီၪက့ၪမဲနမ့ၬလၧနဆၧဒဲၩ",
			"23": "<sup>23</sup> ဘၭထီးအလူၬအကၠီၩ့လီၫ.- ၦအီၪဝ့ၫလၧလ့ၭဘနၧၫ့ အလီၩ့လၧအမၩအၥွံၫ လၧၥံၪ့ၡိၫအ့ရ့ၭ အခံၫလဂၩ ဧ့,ထီးဆၧဆၫဘၪနၧၩဘဲၫၦမုၪဘၪ ဆၧဂူၭဆၫအၥိၭ နီၪတၭ,နမိဘၪဆၧၡၪ့ဆၧနၭနီၪ, ဆၧနၭဆံၭဒိၪလဲၪၬ",
			"24": "<sup>24</sup> ယမၧၫ့ယဝ့ၫယဟိဝၩစံၭဝ့ၫဒၪ, တၭယုဒၫအစဎွၩ ယဟီအကံၫ့အဖိၪခွၫစကိၫနဲအၫနီၪ မွဲအစူၪၥံၭအဆၧ မၩနဲၪ့လၧယစူၪထွ့ၪအလီၩ့လါနၫ့နီၪ, ယမိထုၭန့ခွံၬ",
			"25": "<sup>25</sup> နၧၩလၧအလးထီးနီၪ,- တၭယမိဖ့ၪလၫ့နၧၩလၧၦလၧ အအၪ့ဎူၫအၪ့ဎၬနၥၭမၧၫ့အစူၪဖၧၩ့, ဒဲလၧၦလၧနၥၭ မဲၪဝ့ၫအစူၪဖၧၩ့, လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့",
			"26": "<sup>26</sup> ဇၫအစူၪဖၧၩ့ဒဲလၧၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့လီၫ.- ယ မိနၫ့ထၪ့ခွံၬနၧၩ,ဒဲနမိလၧအဆီၫ့အီၪန့နၧၩလၧခးအဂူၫ လဘံၪ့ထီးနၥံၪလအီၪဖျဲၪဘၪ လၧအဖၧၩ့တၭ, နၥံၪ",
			"27": "<sup>27</sup> မိၥံၫထီးနီၪလီၫ.- အ့ၪမွဲခးလၧအဝ့ၫၥံၪ ဆိၫ့ဂဲၫထဲၩ့",
			"28": "<sup>28</sup> ထီးအလးနီၪတၭ, အဝ့ၫၥံၪမိဂဲၫထဲၩ့ဘၪအ့ၬ.- စကိၫ နဲအၫလဂၩယီၩ မွဲဖၧၩ့လၧအထ့ဖၭလၧၦလယူၭယၪ့ ဘၪဝ့ၫဧၪ, မွဲဆၧအဎၧၩ့အဎီ လၧအလဘၪဘၪဆၧအ ၥၭဧၪ,ဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫ, အဝ့ၫဒၪ, ဒဲအချံၫအၥၪ တၭ,လၩ့ဘၪလၧခးလၧအလၥ့ၪယၫဘၪဝ့ၫ အဖၧၩ့နီၪ မွဲဘၪလဲၪ.",
			"29": "<sup>29</sup> ထံၫၥံၪခးၥံၪဧ့ၬထံၫၥံၪခးၥံၪဧ့ၬထံၫၥံၪခးၥံၪဧ့ၬ ခိၭ",
			"30": "<sup>30</sup> နၪယဟိဝၩအလူအထၫဆံၭ.- ယဟိဝၩစံၭဘဲၫယီၩ, ကွ့ၭန့လၧစဎွၩလဂၩယီၩ, မွဲၦထူၬဖိၪ, ၦလၧအလဘီၪ ထၪ့ယီၫထၪ့ဘၪ လဆိၩဒၪအၥၭနီၪဆံၭ. အဂဲးဘဲၫ ယီၩၦလၧအချံၫအၥၪအကျၩနီၪ ဘီၪထၪ့ယီၫထၪ့နး ဂၩအ့ၬး တၭဆၧၫ့နၩ့လၧစဒၫဝံၭ အလးဆီၩ့ဆီအဖၫ့ ခိၪအ့ၬဒဲပၧၩ့လၧၩ့ဆၧလၧယုဒၫအဖၧၩ့နးဂၩဆ့အ့ၬ."
		},
		"23": {
			"1": "<sup>1</sup> ၦယိၥိၪလဖၪလၧအမၩဂၭဂီၩ့, ဒဲမၩလၩ့ပြံၩလၩ့ ပၩယဆၧအၪ့အဆၪအလးလဖၪနီၪ, ဘၪအၡၪ့လီၫ.",
			"2": "<sup>2</sup> ယဟိဝၩစံၭဝ့ၫဒၪ,- မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩအံၫ စရ့လၭအယွၩစံၭ လၧၦယိၥိၪလဖၪလၧအယိယၡၩ ခမျၧးလဖၪအဂဲးအကၠီၪ့, နၥံၪမၩလၩ့ပြံၩလၩ့ပၩယ ၥိၪလဒီၪ့, ဒဲနၫ့ထၪ့ခွံၬဝ့ၫတၭ, အီၪၡီၩ့လၧၩ့အဝ့ၫၥံၪ အ့ၬ. ယိခွါ, ယမိစ့ၩရၫ့နၥံၪမၩဆၧအအၧၩ့အကၠီၩ့,",
			"3": "<sup>3</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- မွဲလါနၫ့တၭယမိအၪ့ထုၫ့ကီၪ့ယ ၥိၪလဒီၪ့အဆၧအီၪလၩ့ထးလၧကယဲ ခးလၧယနၫ့ထၪ့ ခွံၬဒုၭအီၪဝ့ၫလၧအဖၧၩ့တၭ, ယမိဒုၭဂဲၫထဲၩ့ဝ့ၫလၧ အဝ့ၫၥံၪအဖီၩ့ဖၧၩ့တၭ, အဝ့ၫၥံၪမိၥၪထၪ့ဒဲအၪထၪ့ဝ့ၫ",
			"4": "<sup>4</sup> ဒၪဆ့လီၫ.- တၭယမိအီၪက့ၪၦယိၥိၪလဖၪလၧအဖၫ့ ခိၪလၧအမိယိဒုၭအၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪၥၭမဲၪလၧၩ့ဆၧ အ့ၬ,ဒဲအၪ့ယိၪလၧၩ့ဆၧအ့ၬ, ဒဲလၩ့မါဘၪဆ့အ့ၬ,",
			"5": "<sup>5</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- ယိခွါ, ယဟိဝၩစံၭဝ့ၫဒၪ, မုနံၩ လဖၪမိဘၪလၧယမိဒုၭဂဲထုၪ့ဆၧတီၩဆၧလီၩ့အထဲၩ့ လၧစဒၫဝံၭအဂးတၭ, စဎွၩလဂၩမိပၧၩ့ဆၧတၭ, မိ ဘီၪထၪ့ယီၫထၪ့မိမၩဆၧစ့ၩရၫ့ ဒဲဆၧတီၩဆၧလီၩ့လၧ",
			"6": "<sup>6</sup> ဂၪ့ခိၪချိၫ့လီၫ.- ဆၧလၧမုနံၩလဖၪနီၪယုဒၫမိထီၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့တၭ, အံၫစရ့လၭမိအီၪလၧဆၧ ဒိၭနဲၩ့အၥၭအလးတၭ, ဆၧမိကိၭအဝ့ၫဒၪအမံၩ့ဘဲၫ",
			"7": "<sup>7</sup> ယီၩ,ယဟိဝၩပဆၧတီၩဆၧလီၩ့နီၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ,ယဟိဝၩစံၭဝ့ၫဒၪ,ယိခွါ, မုနံၩလဖၪဘၪ ဝ့ၫလၧၦလစံၭလၧၩ့ဘၪ ယဟိဝၩမၧၫ့ဝ့ၫလၧအဒုၭ",
			"8": "<sup>8</sup> စဲၪ့ထၪ့ခွံၬ ၦအံၫစရ့လၭဖိၪလၧခးအံဇံၭနီၪ,- အ့ၪမွဲ အမိစံၭ,ယဟိဝၩမၧၫ့ဝ့ၫလၧအဂဲၫဆိၬထၪ့ခွံၬ, ဒဲဒုၭ ဂဲၫထဲၩ့ထဲၩ့ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အချံၫအၥၪလၧ ခးလၧမုဖၩ, ဒဲလၧခးထီးအလူၬ လၧယနၫ့ထၪ့ခွံၬဒုၭ အီၪဝ့ၫလၧအဖၧၩ့တၭ, မိအီၪဝ့ၫလၧအခးဒၪဝ့ၫအဖၧၩ့ လီၫ.",
			"9": "<sup>9</sup> ယၥုၪ့ခါယၥၭလၩ့လၧယၥၭခံဖၧၩ့ လၧမီၪလဖၪအ ကၠီၩ့တၭ,ယဎွံၪထီးအလူၬဝၭထိၬ, ယမၩယၥၭဘဲၫ ၦအီၩမၧၩ့အၥၭအၥိၭနီၪတၭ, မၩအၥၭဘဲၫၦလၧစ ဘံၭထံၫမၩစၪဝ့ၫအၥိၭနီၪ လၧယဟိဝၩအကၠီၩ့, ဒဲလၧ",
			"10": "<sup>10</sup> အလူဆံၫ့ဎံၪအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩထံၫၥံၪခးၥံၪ နီၪဎွ့ၩဝ့ၫလၧၦမၩမၪၦမၫၦဝၩတၭ, ထံၫၥံၪခးၥံၪနီၪ ၥုၪ့အုၭၥၭအုၭလၧဆၧဆိၪအၧၩ့အကၠီၩ့လီၫ. ဆၧအၪ့ အဆၪအလး လၧမံၩ့လၬကျၩနီၪဎဲၫ့ထၪ့ခွံၬလီၫ. အ ဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဖၧၩ့ၥၭမွဲအမၩဆၧအၧၩ့တၭ,",
			"11": "<sup>11</sup> အဂဲးအဘၭတီၩအ့ၬ.- မွဲမၬ,မီၪမွဲဂ့ၩ, ၦလုဆၧမွဲဂ့ၩ, ယူၭယၪ့ဆၧအ့ၬ. တၭယဒၪန့အဆၧအၧၩ့လၧယဂံၪ့",
			"12": "<sup>12</sup> ဖၧၩ့ဒၪလ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအဖၧၩ့ၥၭမိကဲၪထၪ့ ဘဲၫဆၧအလးဖျ့ၫလၧ ဆၧခံၭကျၩအၥိၭလၧအဂးတၭ, ဆၧမိနၫ့ဆီၪ့အဝ့ၫၥံၪ တၭ,မိလၩ့ထံၩဖါဝ့ၫ လၧအဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫ ယီၩယမိဒုၭဘၪအဝ့ၫၥံၪလၧဆၧအၧၩ့ ထီးဆၧစ့ၩရၫ့",
			"13": "<sup>13</sup> ဝ့ၫအနံၪ့ဘၪဝ့ၫနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- ယဒၪဆၧဂီၩ့ ဆၧစၪလၧစမ့ရအၫအမီၪလဖၪအဖၧၩ့လီၫ. အဝ့ၫၥံၪ ချဲၩ့ဆၧလၧမီၪအချိၬလၧဘၫအလၭ, ဒဲဒုၭမၩမၪယ",
			"14": "<sup>14</sup> ၡၩခမျၧးအံၫစရ့လၭနီၪလီၫ.- ယဒၪယူၭဆ့ဆၧအၧၩ့ နၭမၬလၧယရုစလံၫ့အမီၪလဖၪအဖၧၩ့လီၫ. အဝ့ၫၥံၪ အဲၪဘိၩ့မၫ, အဲၪဘိၩ့ဝၩတၭ,လ့ၩဝ့ၫလၧဆၧအဘျံၭ အဘျၪအဖၧၩ့တၭ, ဒုၭဆီၪ့ထၪ့ၦလၧအမၩဆၧအၧၩ့ အစူၪ,ထီးၦလဂဲၫထဲၩ့ဘၪနးဂၩတၭ, အဝ့ၫၥံၪထီးအ လူၬနီၪအီၪဝ့ၫ လၧယမ့ၬယၫဘဲၫစီဒၧၫ့အၥိၭ ဒဲအၡၩ",
			"15": "<sup>15</sup> အီၪဝ့ၫနီၪဘဲၫဂမိရၫအၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭ လၧမီၪလဖၪအဂဲး အကၠီၪ့ဘဲၫယီၩ, ယိခွါ,ယမိဒုၭအၪ့အဝ့ၫၥံၪလၧရီးခ ၥီၫ,ဒဲဒုၭအီၩဝ့ၫလၧၥံၪခၪ အထံၫနီၪလီၫ. အဂဲးဘဲၫ ယီၩဆၧလယူၭလယၪ့ဘၪဆၧနီၪ စဲၪ့ထၪ့ခွံၬလၧယရု စလံၫ့အမီၪလဖၪအစူၪဖၧၩ့ ဖိးလၧခးထၧၫ့ဘံၪ့ယၫအ ဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩ, ထီးခိၭနၪ မီၪလဖၪအလူလၧအမိချဲၩ့ဆၧ လၧမီၪအချိၬလၧနၥံၪ အကျၩလဂ့ၩ, အဝ့ၫၥံၪအၪ့လီၫနၥံၪ လၧဆၧပျီၩပျီၩ တၭးချဲၩ့ဝ့ၫလၧဆၧဒၪလၧယၫလခီၫ, လၧအဂဲၫထၪ့ လၧအၥၭဒၪဝ့ၫအဖၧၩ့, မွဲဆၧလၧအထၪ့ဖျ့ၭလၧယဟိ",
			"17": "<sup>17</sup> ဝၩအနိၭအ့ၬ.- တၭအဝ့ၫၥံၪစံၭဒံၭ လၧၦလၧအလ ယူၭယၪ့ဘၪယၧၩလဖၪ, ယဟိဝၩစံၭယူၭဝ့ၫ, နၥံၪမိ အီၪလၧဆၧဘၪလိၬအိၭလိၬလီၫ. တၭစံၭကယဲၦလၧ အလ့ၩဖိၬအနါကဲၪ့အခဲၫ့နီၪ ဆၧအၧၩ့ဘၪနၥံၪ နးမံၩ့",
			"18": "<sup>18</sup> အ့ၬ.- အဂဲးဘဲၫယီၩမွဲပလၫဆၧၫ့ထုၪ့လၧယဟိဝၩ အဆၧအီၪၥူၪအဖၧၩ့တၭ, ဒၪဘၪဒဲနါဂၧၫ့ဘၪအလူ လဂၩလဲၪ. မွဲပလၫယိနဲၪ့ဝ့ၫတၭ,နါဂၧၫ့အဆၧချဲၩ့လ",
			"19": "<sup>19</sup> ဂၩလဲၪ.- ယိခွါ, လံၩၥဝံၭဘၪဆဲၫ့လၧယဟိဝၩလ့ၩ ထၪ့ဆၧဆီၪ့ဆီၪ့လ့ၬနီၪ, လံၩဆီၪ့ၥဝံၭအၥၭတၭး မွဲ",
			"20": "<sup>20</sup> အမိဘၪၦလတီၩဘၪ အခိၪဎွံၪနၭနၭလ့ၬလီၫ.- ယဟိ ဝၩအၥၭခဲၩထၪ့နီၪလကၠၪထဲၩ့ဘၪ, ထီးအမၩဆၧ, ဒဲ ထီးအမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဆၧ လၧအၥၭခံဖၧၩ့နီၪ လီၫ.လၧမုနံၩလၧယၫနီၪ နၥံၪမိနၪၥ့ၪဆၧလၩ့ထံးလၩ့",
			"21": "<sup>21</sup> ဆ့ၭလီၫ.- မီၪလဖၪယလအၪ့မၧၫ့ဘၪလါနၫ့နီၪစဲၪ့တ လဲးဝ့ၫယူၭး ယလမၪလူၬဘၪလါနၫ့တၭ, အဝ့ၫၥံၪချဲၩ့",
			"22": "<sup>22</sup> လၧမီၪအချိၬယူၭ.- အဝ့ၫၥံၪအ့ၪဆၧၫ့ထုၪ့လၧယဆၧ ကၩ့ကၩအဖၧၩ့တၭ, ဒဲဒုၭနါဂၧၫ့ယၡၩခမျၧးလၧယ ဆၧချဲၩ့းထီးနီၪလဖၧၫ့ မိဒုၭဂဲၫထဲၩ့အဝ့ၫၥံၪလၧအဖၧၩ့ ၥၭအၧၩ့, ဒဲလၧအမၩဆၧအၧၩ့အအီၪနီၪလီၫ.",
			"23": "<sup>23</sup> ယမွဲယွၩအီၪဘူၭဝ့ၫတၭ, မွဲယွၩအီၪယဲၩ့ဆ့အ့ၬဧၪ,",
			"24": "<sup>24</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- ၦၡၩလဂၩဂၩအီၪက့ၪၥူၪခွံၬအ ၥၭလၧဆၧအီၪၥူၪအလးလဖၪ ဘဲၫၥိၭယထီးဒၪဘၪ အဝ့ၫလဂ့ၩနီၪဘၪမိၥ့ၪဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယမၩ ဎွ့ၩဂၪ့ခိၪ ဒဲမူၭခိၪနီၪ,မွဲအ့ၬဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"25": "<sup>25</sup> မီၪလဖၪလၧအချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪ လၧယမံၩ့နီၪ,ယနါဂၧၫ့ယူၭဆၧလၧအစံၭယူၭဝ့ၫ, စံၭ,",
			"26": "<sup>26</sup> ယမံၫမးဆၧ,ယမံၫမးဆၧနီၪလီၫ.- ဆၧနီၪမိအီၪလၧ မီၪလၧအချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪအၥၭခံ ဖၧၩ့ဆံၭယံၬလဲၪ. မွဲဝ့ၫလၧအၪ့လီၫဆၧအမီၪလီၫ.",
			"27": "<sup>27</sup> ဆီၫ့မီၪ့ဝ့ၫလၧအမိဒုၭၥၭနၪ့ ယၡၩခမျၧးလၧယမံၩ့လၧ အမံၫမးဆၧလဖၪအကၠီၩ့, လၧအလီၩလၩ့လၬလၩ့ လဂၩလၧၦလၧအနဲၩ့ထံၭ, လဂၩလၧၦလၧအနဲၩ့ထံၭ, ဘဲၫအဖါၥံၪၥၭနၪ့ခွံၬယမံၩ့ လၧဘၫအလၭအကၠီၩ့အ",
			"28": "<sup>28</sup> ၥိၭနီၪလီၫ.- မီၪလၧအအီၪလၧဆၧမံၫမးနီၪမွဲအလီၩ လၩ့လၬလၩ့ဒၪဝ့ၫဆၧမံၫမးဆံၭ. တၭၦလၧအအီၪလၧ ယလူနီၪ, မွဲအလီၩလၩ့လၬလၩ့ ယလူတီၩတီၩဆံၭ. ဖ့ၫထိၪဎီၩ့လၧဂူၫဆၪနီၪ မွဲဆၧနီၪလမံၩ့လဲၪ, ယဟိဝၩ",
			"29": "<sup>29</sup> စံၭဝ့ၫဒၪ.- ယလူမၩအၥၭဘဲၫမ့ၪအၥိၭနီၪ, မွဲအ့ၬဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪး မၩအၥၭဘဲၫစၭခုၪ လၧအမၩခါ",
			"30": "<sup>30</sup> လၩ့ဘျ့ၭလိးၥံၪလဲၫ့ၥံၪအၥိၭနီၪ, မွဲအ့ၬဧၪ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယိခွါ,ယထၫ့ဒၩမီၪလဖၪလၧအအၪ့ဂူၬ န့ယလူ, လဂၩလၧၦလၧအနဲၩ့ထံၭ, လဂၩလၧၦလၧ",
			"31": "<sup>31</sup> အနဲၩ့ထံၭ,ယဟိဝၩစံၭဝ့ၫဒၪ.- ယိခွါ,ယဟိဝၩစံၭဝ့ၫ ဒၪ,ယထၫ့ဒၩမီၪလဖၪ လၧအမၩန့ၦၡၩၥံၪအဖျ့ၩတၭ,",
			"32": "<sup>32</sup> စံၭဝ့ၫ,အဝ့ၫဒၪစံၭဆၧး- ယိခွါ,ယဟိဝၩစံၭဝ့ၫဒၪ,ယ ထၫ့ဒၩ ၦလၧအချဲၩ့လၧမီၪအချိၬ လၧအမံၫမးဆၧအ ဘျံၭအဘျၪတၭ,လီၩလၩ့လၬလၩ့ဝ့ၫတၭ, ဒုၭလၩ့မၪ ယၡၩခမျၧးလၧအဆၧချဲၩ့အဘျံၭအဘျၪ, ဒဲလၧအ အီၪက့ၪဖိၫလိၫအၥၭနီၪလီၫ. တၭယအၪ့မၧၫ့လၩ့န့မွဲ အ့ၬ.မွဲယမၪလူၬဆၧလၧအဝ့ၫၥံၪဆ့အ့ၬ. မၩအၥၭ ဘဲၫနီၪတၭ, ၦၡၩခမျၧးယီၩဘၪခိးဘၪတၩလၧအဝ့ၫ ၥံၪနးမံၩ့အ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"33": "<sup>33</sup> တၭထီးၦခမျၧးယီၩမွဲဂ့ၩ, မီၪမွဲဂ့ၩ,ၦလုဆၧလဂၩ မွဲဂ့ၩ,အ့ၪအၪ့စၪ့နၧၩ,စံၭဝ့ၫ, ယဟိဝၩအဆၧအွံၪဆၧ ယိၭ,မွဲဆၧနီၪလဲၪတၭး နမိဘၪစံၭအဝ့ၫၥံၪ, မွဲဆၧအွံၪ ဆၧယိၭနီၪလဲၪ. ယမိခွံၬၡိၭနၥံၪ,ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"34": "<sup>34</sup> တၭမီၪလဂၩမွဲဂ့ၩ, ၦလုဆၧလဂၩမွဲဂ့ၩ,ၦခမျၧးမွဲဂ့ၩ, လၧအစံၭယဟိဝၩအဆၧအွံၪဆၧယိၭနီၪ, ယမိစ့ၩ",
			"35": "<sup>35</sup> ရၫ့စၪၦလဂၩနီၪ, ဒဲအၡၩဂံၪ့ဖိၪလီၫ.- နၥံၪမိဘၪစံၭ ဘဲၫယီၩ,လဂၩလၧၦအီၪလၧအနဲၩ့ထံၭ, လဂၩလၧ အထၧၫ့ဖုဝဲလဂၩနီၪ, ယဟိဝၩစံၭဆၧၫ့ဆၧဘဲၫၥ့ၪလဲၪ.",
			"36": "<sup>36</sup> တၭယဟိဝၩချဲၩ့ယူၭမွဲဆၧနီၪလမံၩ့လဲၪ.- တၭယဟိ ဝၩအဆၧအွံၪဆၧယိၭနီၪ,နၥံၪစံၭလၧၩ့အ့ၬ. အဂဲးဘဲၫ ယီၩၦၡၩလဂၩဂၩ အလူဒၪဝ့ၫနီၪမိကဲၪထၪ့အဆၧအွံၪ ဆၧယိၭဆုၬဆုၬလီၫ. အဂဲးဘဲၫယီၩ နၥံၪမၩကဒံၩ ကဒၩယွၩလၧအမၧၫ့ဝ့ၫအလူ, ဆၧၥုၭမုခမျၧးအယဟိ",
			"37": "<sup>37</sup> ဝၩပယွၩနီၪလီၫ.- နၥံၪမိဘၪစံၭမီၪ,ယဟိဝၩချဲၩ့ဆၧၫ့ နၧၩဘဲၫၥ့ၪလဲၪ.ဒဲ,ယဟိဝၩချဲၩ့ထၪ့ဆၧနီၪလမံၩ့လဲၪ.",
			"38": "<sup>38</sup> အ့ၪမွဲနၥံၪအ့ၪစံၭ, ယဟိဝၩအဆၧအွံၪဆၧယိၭနီၪတၭ, မွဲမၬယဟိဝၩစံၭဘဲၫယီၩ, မွဲနၥံၪစံၭဆၧချဲၩ့ယီၩ, ယ ဟိဝၩအဆၧအွံၪဆၧယိၭနီၪတၭ, ယအၪ့မၧၫ့လၩ့ဆၧ လၧနၥံၪအအီၪတၭစံၭ, နၥံၪလစံၭဘၪ,ယဟိဝၩအ",
			"39": "<sup>39</sup> ဆၧအွံၪဆၧယိၭနီၪတၭ,- မၩအၥၭဘဲၫနီၪတၭ,ယိခွါ, ယဝ့ၫဒၪယီၩ, ယၧၩဒၪလ့ၬမိၥၭနၪ့ခွံၬနၥံၪလူၬထူၬဆံၫ့ ဘၩ့တၭ,နၥံၪမွဲဂ့ၩ, ဒဲဒိၩ့လဖျိၪ့လၧယဖ့ၪလၫ့နၥံၪအ",
			"40": "<sup>40</sup> ဖါလဖၪမွဲဂ့ၩ, ယမိခွံၬၡိၭခွံၬလၧယမ့ၬယၫလီၫ.- တၭ ယမိအီၪက့ၪဆၧဒုၪဒွ့ၪအဆိၩအကၠၪ, ဒဲဆၧမ့ၬမဲလၩ့ ဆိၩလၩ့ကၠၪလၧဆၧလၥၭနၪ့ဘၪဝ့ၫ လၧနၥံၪအလီၩ့ လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ ဆိၬထၪ့ခွံၬ ယုဒၫအစဎွၩယ့ၭခနဲအၫ စယဟီအကံၫ့အဖိၪခွၫလဂၩ နီၪ,ဒဲယုဒၫအၦဒိၪဖၭဒိၪ, ဒဲၦလဲၬၥမါဖိၪ, ဒဲၦထမၬ ဖိၪလၧယရုစလံၫ့တၭ, ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလၧဘၭဘ လၧၫ့အလးခဲၫ့နီၪ, ယဟိဝၩဒုၭနဲၪယၧၩတၭ, ယိခွါ, ဒၩ့နံၫဖျိၪ့အီၪလၧချိၪ့ဒိၩ့ၥၪနီၪ ဘၪဆၧအီၪက့ၪဝ့ၫလၧ",
			"2": "<sup>2</sup> ယဟိဝၩအဆၧလုအဂံၪ့အမ့ၬယၫလီၫ.- ဒၩ့လဖျိၪ့အီၪ ဝ့ၫလၧချိၪ့ဒိၩ့အၥၪဂ့ၩမၬ, ဘဲၫချိၪ့ဒိၩ့ၥၪလၧအမံၫ့ဆိၫ ဝ့ၫအၥိၭနီၪလီၫ. တၭဒၩ့လဖျိၪ့ဒၪနီၪ အီၪလၧချိၪ့ဒိၩ့ ၥၪအၧၩ့နၭမၬတၭ, လၧအအၧၩ့ဝ့ၫအကၠီၩ့နီၪ ၦၡၩ",
			"3": "<sup>3</sup> အၪ့နၧၩ့အ့ၬ.- တၭယဟိဝၩစံၭယၧၩ, စယ့ၫရမဲအၫ ဧ့,နဒၪဘၪဆၧနီၪလဲၪ. တၭယစံၭချိၪ့ဒိၩ့ၥၪလီၫ. ချိၪ့ ဒိၩ့ၥၪအဂ့ၩနီၪ ဂ့ၩဒိၪမၬတၭ, ချိၪ့ဒိၩ့ၥၪအအၧၩ့နီၪ အၧၩ့ဒိၪမၬ,လၧအအၧၩ့အကၠီၩ့နီၪ, ၦအၪ့ဝ့ၫလကဲၪ ဘၪလီၫ.",
			"4": "<sup>4</sup> တၭယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ.",
			"5": "<sup>5</sup> ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ဘဲၫချိၪ့ဒိၩ့ ၥၪအဂ့ၩယီၩအၥိၭနီၪ, ယမိအီၪက့ၪၦလၧအဘၪဆၧ ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလၧယုဒၫအကျၩ, လၧယနၫ့ထၪ့ခွံၬ လၧအလးယီၩဒုၭလ့ၩဖိး လၧၦခၫလဒံအၫဖိၪ အခး",
			"6": "<sup>6</sup> ဖၧၩ့လၧအဆၧဂ့ၩအဂးလီၫ.- တၭယမိအီၪက့ၪယမ့ၬ ၥၪလၧအလီၩ့လၧဆၧဂ့ၩအဂးတၭ, ယမိဒုၭဂဲၫထဲၩ့ အဝ့ၫၥံၪလၧခးလဘံၪ့ယီၩ အဖၧၩ့တၭ, ယမိမၩထၪ့ မၩထီၫအဝ့ၫၥံၪတၭ, ယလမၩလၩ့ဎီးဘၪဝ့ၫတၭ, ယ",
			"7": "<sup>7</sup> မိၥုၪ့လၩ့အဝ့ၫၥံၪတၭ, ယထ့ၭထၪ့ခွံၬဝ့ၫအ့ၬ.- တၭ ယမိဖ့ၪလၫ့ အဝ့ၫၥံၪအၥၭလၧအမိၥ့ၪယၫယၧၩ, လၧ ယမွဲယဟိဝၩလီၫ. တၭအဝ့ၫၥံၪမိကဲၪထၪ့ယၡၩခမျၧး တၭ, ယဝ့ၫဒၪယီၩ ယမိကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိဂဲၫထဲၩ့ထဲၩ့ လၧယအီၪလၧ",
			"8": "<sup>8</sup> အၥၭထၧၫ့ဖျိၪ့ယၫလီၫ.- အ့ၪမွဲချိၪ့ဒိၩ့ၥၪအအၧၩ့, လၧ အအၧၩ့, ထီးၦအၪ့ဝ့ၫလကဲၪဘၪလၧအအၧၩ့အကၠီၩ့ နီၪ,မွဲမၬယဟိဝၩစံၭဘဲၫယီၩ, ယမိဖ့ၪလၫ့ခွံၬယုဒၫ အစဎွၩဇ့ၭဒကဲအၫ, ဒဲအၦဒိၪဖၭဒိၪလဖၪ, ဒဲၦယရု စလံၫ့ဖိၪအဆၧအီၪလၩ့ထး လၧအအီၪလၩ့ထးဝ့ၫလၧ ခးယီၩအဖၧၩ့, ဒဲၦလၧအအီၪဝ့ၫလၧခးအံဇံၭအဖၧၩ့",
			"9": "<sup>9</sup> နီၪး- ယမိဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧဆၧမၩခိမၩဝီၩ, ဒဲ လၧဆၧၡၪ့ဆၧနၭ လၧဂၪ့ခိၪအဘၩ့အမုး ထီးအလူၬ အဖၧၩ့, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလး ဒဲဆၧ ချဲၩ့ဒီၩ့အလး, ဒဲဆၧမၩကြၩ့ထမးအလး, ဒဲဆၧဆိၪ အၧၩ့အလး, လၧကယဲဆၧအလးဖၧၩ့ထီးယမိနၫ့ထၪ့",
			"10": "<sup>10</sup> ခွံၬအဝ့ၫၥံၪလီၫ.- တၭယမိအၪ့မၧၫ့လၩ့နၭၥံၪဖၩ့ၥံၪ, ဒဲဆၧၥၭဝံလၩ့ဒိၩ, ဒဲဆၧၥံၫချဲၫ့လၧအကျၩထီးအဝ့ၫၥံၪ မိလူၬခွံၬဝ့ၫလၧခးလဘံၪ့အဖၧၩ့, လၧယဖ့ၪလၫ့လၧ အဝ့ၫၥံၪအဖါလဖၪနီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩစယိၫစဲအၫ အဖိၪခွၫစယဟီအကံၫ့ အနံၪ့လံနံၪ့လနံၪ့နီၪ, မွဲဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭ န့ဇၫအခၪ့ထံၭလနံၪ့နီၪတၭ, ဆၧအလူလၧအလၩ့ဘၪ စယ့ၫရမဲအၫလၧယုဒၫ အၡၩခမျၧးထီးအလူၬအဂဲး,",
			"2": "<sup>2</sup> လၧမီၪစယ့ၫရမဲအၫချဲၩ့ဝ့ၫ လၧယုဒၫအၡၩခမျၧး ထီး အလူၬ, ဒဲၦယရုစလံၫ့ဖိၪထီးအလူၬတၭ, စံၭဝ့ၫဒၪ,",
			"3": "<sup>3</sup> လၧယုဒၫအစဎွၩ,ခီၫလၧစအၫမၧၫ့အဖိၪခွၫ စယိၫစဲ အၫအနံၪ့လဆံၫၥၧၫ့နံၪ့လနံၪ့နီၪ ထီၩ့လၩ့လၧမုဆၫလ နံၩယီၩ, အနံၪ့နံၫဆံၫၥၧၫ့နံၪ့အထးဖၧၩ့နီၪ, ယဟိဝၩ အလူလၩ့ဘၪယၧၩတၭ, ယချဲၩ့ဆၧလၧနၥံၪ,ယဂဲထုၪ့ ဂီၩဂီၩတၭ,ချဲၩ့ဆၧလါနၫ့တၭ, နၥံၪခိၭနၪနၥံၪဝ့ၫအ့ၬ.",
			"4": "<sup>4</sup> တၭယဟိဝၩအၪ့မၧၫ့လၩ့အခ့ၫအၡၩ မီၪၥံၪထီးအ လူၬလၧနၥံၪအအီၪ, ဂဲထုၪ့ဂီၩဂီၩလ့ၬတၭ, အၪ့မၧၫ့ လၩ့ဝ့ၫတၭ, နၥံၪခိၭနၪအ့ၬ. တၭနၥံၪဒိၭနၥံၪအနါဆ့",
			"5": "<sup>5</sup> အ့ၬ.- ၦလဖၪနီၪစံၭဝ့ၫဘဲၫၥိၭနၥံၪမိအီၪ လၧခးဖၧၩ့ လၧယဟိဝၩဖ့ၪလၫ့နၥံၪ, ဒဲနၥံၪအဖါလဖၪလၩ့ဆိၩ လၩ့ကၠၪနီၪ, ကၠၪခွံၬနၥံၪအၥၭလဂၩ လၧအဖၧၩ့ၥၭ",
			"6": "<sup>6</sup> အၧၩ့ဒၪဝ့ၫ,ဒဲလၧနၥံၪမၩဆၧအၧၩ့လဖၪဆံၭ.- တၭ ထီးလ့ၩဖိၬယွၩအဂူၫဂၩလဖၪအခဲၫ့, ဘဲၫၥိၭနၥံၪမိမၩ အဆၧ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလဂ့ၩ, ဒဲထိၪဂဲၩယၥၭ ထၪ့လၧနၥံၪအစူၪမၩဆၧလဂ့ၩတၭ, ယမၩအၧၩ့နၥံၪ",
			"7": "<sup>7</sup> နးမံၩ့အ့ၬ.- မွဲလါနၫ့တၭ,ယဟိဝၩစံၭဝ့ၫဒၪ,နၥံၪလခိၭ နၪဘၪယလူနီၪး ဘဲၫၥိၭနၥံၪ မိထိၪဂဲၩယၥၭထၪ့လၧ နၥံၪအစူၪမၩဆၧလၧနၥံၪ အဆၧအၧၩ့ဒၪနၥံၪဝ့ၫအဂး လီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭ",
			"9": "<sup>9</sup> ဝ့ၫဘဲၫယီၩ, မွဲနၥံၪလခိၭနၪဘၪယဆၧချဲၩ့တၭ,- ယိခွါ, ယမိအၪ့မၧၫ့လၩ့ဆၧတၭ,မၩန့ကယဲၦအဂံၪ့ဒီၪ့လၧမု ဖၩလခီၫ, ယဟိဝၩစံၭဝ့ၫဒၪ,ဒဲယခ့ၫယၡၩဘၭဘလၧၫ့ အစဎွၩန့ၭဘူၫခၭန့ဇၫဆ့တၭ, ယမိဒုၭဂဲၫအဝ့ၫၥံၪထၫ့ ဒၩခးလဘံၪ့ယီၩ, ဒဲထၫ့ဒၩၦအီၪဝ့ၫလၧအဖၧၩ့,ဒဲထၫ့ ဒၩၦဆၨၩလဖၪ အီၪဝၬဖီၩ့ဝ့ၫဝၬဝၬထီးအလူၬ, ယမိ မၩဂၭဂီၩ့ဝ့ၫထီးအလူၬ, ဒဲအီၪက့ၪအဝ့ၫၥံၪ လၧဆၧ ထီၫမံၫထီၫမၪအလး,ဒဲဆၧဒုၪဒွ့ၪအလး, ဒဲဆၧအီၪယူ",
			"10": "<sup>10</sup> အလးလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭယမိမၩလၩ့မါအ ဆၧၥုၪ့ဎွံၫၥၭယီၫအၥီၫ, ဒဲအဆၧၥုၪ့ထိၬၥၭထိၬအၥီၫ, ဒဲတလၭမူၭခွၫအလူ, ဒဲတလၭမူၭမုၪအလူ,ဆုၪ့ဂူၬလိး",
			"11": "<sup>11</sup> အၥီၫ, ဒဲမၩလၩ့ဖံၬခွံၬမ့ၪဒိၩ့အဆၧဖၩ့လီၫ.- တၭခး ထၧၫ့ဘံၪ့ယၫယီၩ မိကဲၪထၪ့ဆၧအီၪယူအလး, ဆၧ ထီၫမံၫထီၫမၪအလးတၭ, ၦဆၨၩလဖၪယီၩ မိမၩဘၭ ဘလၧၫ့အစဎွၩအဆၧအနံၪ့နွ့ၫဆံၫလီၫ.",
			"12": "<sup>12</sup> ထီးအနံၪ့နွ့ၫဆံၫနီၪ အ့ၪဎွ့ၩထၪ့တၭ,ဆၧမိမၩအ ၥၭလၧယမိစ့ၩရၫ့ဘၭဘလၧၫ့အစဎွၩ, ဒဲၦလဆၨၩနီၪ, ၦခၫလဒံအၫဖိၪအခး လၧအဆၧဒဲၩဘၭအကၠီၩ့တၭ, ယမိမၩယူဝ့ၫအလးလၩ့ဆိၩလၩ့ကၠၪလီၫ. ယဟိဝၩ",
			"13": "<sup>13</sup> စံၭဝ့ၫဒၪ,- တၭယမိဒုၭဘၪခးလဘံၪ့နီၪ, လၧယဆၧ ချဲၩ့ထီးအလူၬ လၧယချဲၩ့ထၫ့ဒၩဝ့ၫ, ကယဲဆၧလၧ အကွ့ၭအၥၭလၧလံၬယီၩအဖၧၩ့, လၧစယ့ၫရမဲအၫချဲၩ့",
			"14": "<sup>14</sup> ဆၧလၧမီၪအချိၬထၫ့ဒၩၦဆၨၩထီးအလူၬလီၫ.- အဂဲး ဘဲၫယီၩၦအၪဆၨၩ, ဒဲစဎွၩဖၭဒိၪလဖၪမိဒုၭမၩအဝ့ၫ ၥံၪလၧအဆၧတၭ, ယမိမၩဆၧၩ့ဝ့ၫ ဘဲၫအမၩဆၧအ ၥိၭနီၪ,ဒဲဘဲၫအစူၪမၩဆၧအၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩယဟိဝၩ, အံၫစရ့လၭအယွၩစံၭယၧၩ ဘဲၫယီၩ, လိၫ့စဘံၭထံၫလဖျိၪ့ဘၪဆဲၫ့ လၧယၥၭခဲၩ ထၪ့နီၪမၩန့လၧယစူၪဖၧၩ့တၭ, ဒုၭအီၩၦဆၨၩၥံၪထီး အလူၬလၧယမိအၪ့မၧၫ့လၩ့န့နၧၩ လၧအအီၪဆံၭ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪမိအီၩဝ့ၫတၭ, မိလ့ၩဆၧခံၫ့ခံၫ့ပၪပၪ,ဒဲဖျႃထၪ့ လၧနၭလၧယမိအၪ့မၧၫ့လၩ့လၧအကျၩလဘံၪ့အကၠီၩ့ နီၪလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ယမၩန့လိၫ့လဖျိၪ့နီၪ လၧယဟိဝၩအ စူၪဖၧၩ့တၭ, ယဒုၭအီၩၦဆၨၩ ထီးအလူၬနီၪလၧယ",
			"18": "<sup>18</sup> ဟိဝၩအၪ့မၧၫ့လၩ့ယၧၩလၧအအီၪ,- ယရုစလံၫ့ဒဲယု ဒၫအဒိၩ့လဖၪ, ဒဲအစဎွၩလဖၪ, ဒဲအၦဒိၪဖၭဒိၪလဖၪ, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧအီၪယူ ဒဲဆၧထီၫမံၫထီၫမၪအ လး,ဆၧဒုၪဒွ့ၪအလး, ဘဲၫလၧမုဆၫလနံၩယီၩအၥိၭ",
			"19": "<sup>19</sup> နီၪ,- အံဇံၭအစဎွၩဖၫရိၫ, ဒဲအခ့ၫအၡၩ, ဒဲအၦဒိၪဖၭ",
			"20": "<sup>20</sup> ဒိၪလဖၪဒဲအၡၩခမျၧးထီးအလူၬ,- ဒဲကယဲၦကျီၪမွံၩ အၥၭ, ဒဲခးအၧဇၭ အစဎွၩလဖၪ ထီးအလူၬနီၪး ဒဲၦ ဖလံၡၫဖိၪအခးအစဎွၩၥံၪထီးအလူၬ, ဒဲအၭၡကံလၫ့ ဒဲအၭဇၫ, ဒဲအ့ကြၧၫ့, ဒဲၦအီၪလၩ့ထးဘၪဆဲၫ့လၧအၭ",
			"21": "<sup>21</sup> ၡဒီၭ,- အံဒၧၫ့, ဒဲမိအၭ, ဒဲစအၫမၧၫ့ အဖိၪအလံၩ,",
			"22": "<sup>22</sup> ဒဲတဲအၫအစဎွၩၥံၪထီးအလူၬ, ဒဲဇဲဒၧၫ့အစဎွၩၥံၪထီး အလူၬ, ဒဲကျိၩ့ၥံၪလၧမၫဆမံၭ ဝါလခီၫ အစဎွၩလ",
			"23": "<sup>23</sup> ဖၪ,- ဒံဒၫဒဲတံမၫ, ဒဲဘၧဇၭ,ဒဲၦအီၪလၧနိၪ့ထုၬလဖၪ",
			"24": "<sup>24</sup> ထီးအလူၬ,- ဒဲအရ့ဘၠၫအစဎွၩၥံၪထီးအလူၬ,ဒဲၦကျီၪ မွံၩလဖၪ အီၪလၧမံၩ့လၬၥီၪ့ကျၩ အစဎွၩၥံၪ ထီးအ",
			"25": "<sup>25</sup> လူၬ,- ဒဲဇံမရဲၫအစဎွၩၥံၪထီးအလူၬ,ဒဲအံလၫ့အစဎွၩ ၥံၪထီးအလူၬ, ဒဲၦမံဒအၫ့ဖိၪလဖၪအစဎွၩၥံၪထီးအ",
			"26": "<sup>26</sup> လူၬ,ဒဲကယဲစဎွၩလၧမုဖၩလခီၫ,- ၦအီၪဘူၭဒဲၦအီၪ ယဲၩ့လဂၩဒဲလဂၩ, ဒဲကယဲဂၪ့ခိၪအဘၩ့အမုးလၧအ အီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့ထီးအလူၬ, ဒဲၡံၡၭအစဎွၩမိအီၩ ဝ့ၫလၧနၥံၪအလးခဲၫ့လီၫ.",
			"27": "<sup>27</sup> မၩအၥၭဘဲၫနီၪတၭ,နမိဘၪစံၭအဝ့ၫၥံၪ, ဆၧၥုၭမု ခမျၧးအယဟိဝၩအံၫစရ့လၭ အယွၩစံၭဘဲၫယီၩ, အီၩနၥံၪဝ့ၫ, အီၩမၧၩ့နၥံၪအၥၭ, ပၠိၭထၪ့ဆၧ, ဒဲလၩ့ ထံၩဖါဘီၪး ထီးဂဲထုၪ့လၧၩ့လဂ့ၩဧီၪး မွဲလၧနၭလၧ ယမိအၪ့မၧၫ့လၩ့လၧနၥံၪအကျၩ လဘံၪ့အကၠီၩ့နီၪ",
			"28": "<sup>28</sup> လီၫ.- တၭအဝ့ၫၥံၪအ့ၪလမၩန့ဘၪထွ့ၫလဖျိၪ့နီၪလၧ နစူၪဖၧၩ့, ဒဲလအီၩဘၪနီၪ, ထီးနီၪလဖၧၫ့, ဆၧမိမၩ အၥၭလၧနမိဘၪစံၭအဝ့ၫၥံၪ, ဆၧၥုၭမုခမျၧးအယဟိ",
			"29": "<sup>29</sup> ဝၩစံၭဘဲၫယီၩ နၥံၪမိဘၪအီၩဆၧတၡါလီၫ.- အဂဲး ဘဲၫယီၩ, ယိခွါ,ယမိဒုၭဂဲၫၥၫ့ဆၧအၧၩ့လၧဒိၩ့လၧဆၧ ကိၭဝ့ၫလၧယမံၩ့တၭ, နၥံၪမိဘၪထိးဆၧဒဲၩဘၭနးဆံၭ အ့ၬဧၪ.နၥံၪလထိးဘၪဆၧဒဲၩဘၭတၭ, နၥံၪအီၪဘၪ အ့ၬ.အဂဲးဘဲၫယီၩယကိၭန့နၭလဘံၪ့ထၪ့ဒၩ ၦဂၪ့ ခိၪဖိၪထီးအလူၬ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ.",
			"30": "<sup>30</sup> အခိးမွဲဘဲၫနီၪတၭ, ချဲၩ့ဆၧလၧမီၪအချိၬလၧဆၧချဲၩ့ ထီးအလူၬယီၩ ထၫ့ဒၩအဝ့ၫၥံၪတၭ,စံၭယဟိဝၩကိၭ ၡၭထၪ့လၧဆၧထၪ့ထီၫတၭ, မွဲအကိၭၡၭထၪ့အလူ လၧအအီၪအလးဆံၫ့ဎံၪ, အဝ့ၫဒၪမိကိၭၡၭထၪ့လၧအ လးဖၫ့ခိၪနီၪး မိကိၭထၪ့ထၫ့ဒၩ ၦဂၪ့ခိၪဖိၪထီးအလူၬ ဘဲၫၦလၧအယဲး စဘံၭၥၪအၥိၭလီၫ. ဆၧအၥီၫဂၧၫ့",
			"31": "<sup>31</sup> ထၪ့ဖိးလၧဂၪ့ခိၪအထုၬလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩ ချဲၩ့ခွးလၧၦဆၨၩလဖၪ အလးအီၪဝ့ၫတၭ,မွဲအမိစ့ၩ ရၫ့ဆၧဖံၭဆၧယၪထီးအလူၬလီၫ. အဝ့ၫဒၪမိဖ့ၪလၫ့ ၦလတီၩလလီၩ့ဘၪလၧနၭအစူၪဖၧၩ့, ယဟိဝၩစံၭဝ့ၫ",
			"32": "<sup>32</sup> ဒၪ.- ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ, ဆၧ အၧၩ့မိစဲၪ့ထၪ့လၧ ၦလဆၨၩဖိးလၧၦလဆၨၩဒၪတၭ, လံၩၥဝံၭဖၭဒိၪ မိထၪ့ဘၭလၧမူၭခိၪထုၬအနဲၩ့ထံၭလ",
			"33": "<sup>33</sup> ဖၪနီၪလီၫ.- တၭလၧမုဆၫလနံၩယီၩ ၦဘၪၥံၫလၧယ ဟိဝၩအစူၪဖၧၩ့ မိအီၪလၧဂၪ့ခိၪအထုၬလခီၫ ဖိးလၧ ဂၪ့ခိၪအထုၬလခီၫဒၪလီၫ. တၭၦဂၪ့ဝ့ၫလၧအဝ့ၫၥံၪအ ကၠီၩ့အ့ၬ. ဒဲၦအၪ့ထုၫ့ကီၪ့ဝ့ၫအ့ၬ,ဒဲၦခုၪ့လၩ့ဘၧၩ့ခွံၬ ဝ့ၫဆ့အ့ၬ. အဝ့ၫၥံၪမိကဲၪထၪ့ဆၧအ့ၪလၧဂၪ့ခိၪအဖၫ့",
			"34": "<sup>34</sup> ခိၪလီၫ.- ၦယိၥိၪၥံၪဧ့,အိၩ့ယိၩ့တၭ, ၥိၪလဒီၪ့အခိၪ ၥံၪဧ့,လွၫလၩ့နၥံၪအၥၭလၧဂၪ့ခိၪအမုၬဆံၭ. အဂဲး ဘဲၫယီၩနၥံၪဘၪဆၧမၩၥံၫနၥံၪတၭ, နၥံၪလၩ့မုလၩ့ ဖၭအမုနံၩလဖၪနီၪဘၪယူၭ နၥံၪမိလၩ့ထံၩဖါဘဲၫထွ့ၫ",
			"35": "<sup>35</sup> ဖျီၪဂ့ၩအၥိၭနီၪလီၫ.- တၭၦယိၥိၪၥံၪစဲၪ့ဖျိၭနီၪအဖၧၩ့ ၥၭအီၪအ့ၬ. ဒဲၥိၪလဒီၪ့အခိၪလဖၪ ဖီၩ့ဖျ့ၭဆၧနီၪဖၧၩ့",
			"36": "<sup>36</sup> ၥၭအီၪအ့ၬ.- ၦယိၥိၪလဖၪအဆၧကိၭၡၭထၪ့အၥီၫ, ဒဲၥိၪလဒီၪ့အခိၪလဖၪဂၪ့အိၩ့ယိၩ့ၥီၫထၪ့ဝ့ၫလီၫ.အဂဲး ဘဲၫယီၩယဟိဝၩမၩဂၭဂီၩ့ၥိၪလဖၪ အၪ့အဆၪအလး",
			"37": "<sup>37</sup> နီၪလီၫ.- မွဲမၬ,ၥိၪဖီၩ့မုၬလဖၪနီၪဂၭဂီၩ့ဝ့ၫလၧယဟိ",
			"38": "<sup>38</sup> ဝၩအၥၭခဲၩထၪ့အကၠီၩ့လီၫ.- အဝ့ၫစဲၪ့ဒၪအအီၪက ဒုၩအလးဘဲၫဆၬလၥၧၫ့အၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအခးအီၪယူလၧနၭမၩအၧၩ့ဆၧအကၠီၩ့, ဒဲလၧ အၥၭခဲၩထၪ့အကၠီၩ့လီၫ."
		},
		"26": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩစယိၫစဲအၫအဖိၪခွၫ စယဟီအ ကံၫ့ကဲၪၥၫ့စဎွၩနီၪ, ဆၧချဲၩ့ယီၩဂဲၫလၩ့လၧယဟိဝၩစံၭ",
			"2": "<sup>2</sup> ဝ့ၫဒၪ,- ယဟိဝၩစံၭဘဲၫယီၩး ဆၧၫ့ထုၪ့လၧယဟိဝၩ အဂံၪ့ဝၩ့ဖၧၩ့တၭ, လီၩဆၧလၧကယဲယုဒၫအဒိၩ့ထီး အလူၬ လၧအဂဲၫဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧယဟိဝၩအ ဂံၪ့, လၧကယဲဆၧချဲၩ့လၧယမၪလူၬနၧၩလီၩဘၪအဝ့ၫ",
			"3": "<sup>3</sup> ၥံၪဆံၭ. အီၪက့ၪလၩ့ထးနးထံၪလဂ့ၩ.- ဘၪလဘၪအ ဝ့ၫၥံၪမိခိၭနၪဝ့ၫတၭ, မိကၠၪခွံၬအၥၭလဂၩလၧအဖၧၩ့ ၥၭအၧၩ့ဒၪဝ့ၫ, လဂၩလၧအဖၧၩ့ၥၭ အၧၩ့ဒၪဝ့ၫ ဆုၬ ဆုၬ,ဘဲၫၥိၭယမိနီၫ့ယါလၩ့ထဲၩ့ယၥၭ လၧဆၧအၧၩ့ လၧယဆီၫ့မီၪ့လၧယမိဒုၭဘၪအဝ့ၫၥံၪ လၧအမၩဆၧ",
			"4": "<sup>4</sup> အၧၩ့အကၠီၩ့နီၪလီၫ.- တၭနမိဘၪစံၭအဝ့ၫၥံၪ, ယဟိ ဝၩစံၭဘဲၫယီၩ, နၥံၪအ့ၪလခိၭနၪဘၪယလူ ဘဲၫၥိၭ နၥံၪမိလ့ၩလၧယဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, လၧယအီၪ",
			"5": "<sup>5</sup> က့ၪလၩ့လၧနၥံၪအမ့ၬယၫ,- နၥံၪအ့ၪလခိၭနၪဘၪယ ခ့ၫယၡၩမီၪလဖၪအလူ လၧယအၪ့မၧၫ့လၩ့လၧနၥံၪ အအီၪတၭ, ယဂဲထုၪ့ဂီၩဂီၩအၪ့မၧၫ့လၩ့ဝ့ၫတၭ, နၥံၪ",
			"6": "<sup>6</sup> ခိၭနၪအ့ၬ.- ထီးနီၪလဖၧၫ့ ယမိမၩဂံၪ့ယီၩ ဘဲၫၡဲလိၫ အၥိၭ,ဒဲမၩဒိၩ့လဖျိၪ့ယီၩ လၧဆၧဆိၪအၧၩ့အလးလၧ ဂၪ့ခိၪအဆၨၩထီးအလူၬအဂးလီၫ.",
			"7": "<sup>7</sup> တၭၦလုဆၧလဖၪ ဒဲမီၪလဖၪဒဲၦခမျၧးထီးအလူၬ နီၪနါဂၧၫ့စယ့ၫရမဲအၫ ချဲၩ့ဆၧချဲၩ့လဖၪနီၪလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ထီးစယ့ၫရမဲအၫချဲၩ့ဂီၩ့ ကယဲဆၧလၧယဟိဝၩမၪ လူၬဝ့ၫလၧအမိဘၪချဲၩ့လၧၦခမျၧးထီးအလူၬတၭ, ဆၧ မၩအၥၭလၧၦလုဆၧလဖၪ, ဒဲၦခမျၧးထီးအလူၬဖီၪ့",
			"9": "<sup>9</sup> ထၬဝ့ၫတၭ, စံၭဝ့ၫဒၪနမိဘၪၥံၫတၡါလီၫ.- နချဲၩ့ဆၧ လၧမီၪအချိၬလၧယဟိဝၩအမံၩ့တၭ, စံၭဂံၪ့လဖျိၪ့ ယီၩမိမၩအၥၭဘဲၫၡဲလိၫအၥိၭတၭ, ဒိၩ့လဖျိၪ့ယီၩမိ အီၪယူဝ့ၫ,ၦလအီၪဘၪလၧအဖၧၩ့နီၪ,မွဲဘၪလဲၪ. တၭ ၦခမျၧးထီးအလူၬ အီၪကိၩ့အီၪကီၪ့ထၫ့ဒၩ စယ့ၫရမဲ အၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> ထီးယုဒၫအၦဒိၪဖၭဒိၪလဖၪ နါဂၧၫ့ဆၧလဖၪနီၪ တၭ,ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪဂဲၫထၪ့ခွံၬ လၧစဎွၩအဂံၪ့ ဖၧၩ့နုၬလၧယဟိဝၩအဂံၪ့ဖၧၩ့တၭ, ဆၧၫ့နၩ့လၧအ လးၦနုၬဝ့ၫလစီၪ့လၧယဟိဝၩအဂံၪ့အတရၫ့အၥၫ့ဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.- ထီးနီၪလဖၧၫ့ၦလုဆၧလဖၪ,ဒဲမီၪလဖၪလီၩဘၪ ၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦခမျၧးထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, ၦ လဂၩယီၩကြၨၭဘၪဆၧစ့ၩရၫ့ၥံၫလီၫ. အဂဲးဘဲၫယီၩ မွဲအချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩဒိၩ့လဖျိၪ့ယီၩ ဘဲၫန ၥံၪနါဂၧၫ့လၧနၥံၪအနါအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> စယ့ၫရမဲအၫချဲၩ့ဆၧလၧၦဒိၪဖၭဒိၪထီးအလူၬ,ဒဲၦ ခမျၧးထီးအလူၬတၭ,စံၭဝ့ၫဒၪ.ယဟိဝၩအၪ့မၧၫ့လၩ့ ယချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩဂံၪ့လဖျိၪ့ယီၩ, ဒဲဒိၩ့လ",
			"13": "<sup>13</sup> ဖျိၪ့ယီၩလၧကယဲဆၧချဲၩ့လၧနၥံၪနါဂၧၫ့လီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, မၩဂ့ၩထၪ့နၥံၪအဖၧၩ့ၥၭ, ဒဲနၥံၪမၩဆၧတၭ, ခိၭနၪယဟိဝၩ နၥံၪအယွၩ အလူ ဆံၭ.တၭယဟိဝၩမိနီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧကယဲ",
			"14": "<sup>14</sup> ဆၧအၧၩ့လၧအချဲၩ့ဆၧလၧနၥံၪအဂဲးလီၫ.- အ့ၪမွဲယ ဝ့ၫဒၪယီၩ, ယိခွါယအီၪလၧနၥံၪအစူၪဖၧၩ့တၭ, မၩ ယၧၩဘဲၫအဂ့ၩ ဒဲဆၧအလီၩ့ဝ့ၫလၧနၥံၪအမ့ၬယၫဆံၭ. မွဲလါနၫ့ဘိၩ့, နၥံၪအ့ၪမၩၥံၫယၧၩတၭ, နၥံၪမိဒုၭဂဲၫ ဘၪနၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫ, ဒဲဒိၩ့လဖျိၪ့ယီၩ ဒဲဒိၩ့ဖိၪ လဖၪလၧဆၧၥွံၪလၧဆၧဒဲၩဘၭ လအီၪဘၪနီၪ, ၥ့ၪ",
			"15": "<sup>15</sup> ယၫတၡါနၥံၪဝ့ၫဆံၭ.- အဂဲးဘဲၫယီၩ ဘဲၫဆၧမွဲဆၧ တီၩအၥိၭနီၪ ယဟိဝၩအၪ့မၧၫ့လၩ့န့ယၧၩလၧနၥံၪအ အီၪ,ဘဲၫၥိၭယမိချဲၩ့ဆၧချဲၩ့ထီးအလူၬယီၩလၧနၥံၪ အနါဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> ထီးနီၪလဖၧၫ့ၦဒိၪဖၭဒိၪလဖၪ ဒဲၦခမျၧးထီးအလူၬ စံၭၦလုဆၧလဖၪ, ဒဲမီၪလဖၪနီၪ, ၦလဂၩယီၩကြၨၭ ဘၪဆၧစ့ၩရၫ့ၥံၫအ့ၬ. အဂဲးဘဲၫယီၩမွဲအချဲၩ့ဆၧလၧ",
			"17": "<sup>17</sup> ပၧၩလၧယဟိဝၩပယွၩအမံၩ့လီၫ.- ထီးနီၪလဖၧၫ့ခး အၥၭၡါလနၩ့ဂဲထုၪ့တၭ, လီၩဘၪၦခမျၧးအဆၧအီၪ",
			"18": "<sup>18</sup> ကီၪ့တၭ,စံၭဝ့ၫဒၪ,- ၦမိၫရၥဲၭဖိၪစမဲခၫချဲၩ့ဆၧလၧ မီၪအချိၬလၧယုဒၫအစဎွၩဟ့ၭဇကဲအၫအမုနံၩလဖၪ တၭ,ချဲၩ့ဆၧလၧယုဒၫအၡၩခမျၧး ထီးအလူၬတၭ, စံၭဝ့ၫဒၪ,ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ, ၦမိထဲၫ ဇံအိၫ့ဘဲၫဂၪ့ခိၪလဝၩ့အၥိၭတၭ, ယရုစလံၫ့မိကဲၪထၪ့ ဆၧအပိၩ့လဖၪတၭ, ဂံၪ့အခိၪလီၩ့နီၪမိကဲၪထၪ့ဆၧ",
			"19": "<sup>19</sup> အလးထီၫလၧမံၩ့လၬကျၩလီၫ.- ယုဒၫအစဎွၩဟ့ၭဇ ကဲအၫ,ဒဲယုဒၫထီးအလူၬနီၪ, မွဲအမၩၥံၫအဝ့ၫဒၪလ ဂၩဆ့ဧၪ. အဝ့ၫၥၭမဲၪယဟိဝၩတၭ,အၪ့ကံၩ့ယွၩအ ခိးအတၩနီၪ,ဒဲယဟိဝၩနီၫ့ယါလၩ့ထဲၩ့အၥၭလၧဆၧ ၡၪ့ဆၧနၭလၧအစံၭမိမၩဝ့ၫနီၪ, မွဲအ့ၬဧၪ. တၭပမိမၩ လၩ့ပၥၭလၧဆၧအၧၩ့ဖၭဒိၪယီၩဆ့ဧၪ.",
			"20": "<sup>20</sup> တၭၦလၧအချဲၩ့ဆၧ လၧယဟိဝၩအမံၩ့အီၪဝ့ၫလ ဂၩ,စၡ့ၫမအဲအၫ အဖိၪခွၫစယုၫရဲဇၫ ဘၪဆဲၫ့လၧ ကၧၫယၭယံအရံၫ့နီၪ, ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩဒိၩ့ ယီၩ,ဒဲထၫ့ဒၩခးလဘံၪ့ယီၩ ဘဲၫစယ့ၫရမဲအၫချဲၩ့ဆၧ",
			"21": "<sup>21</sup> ထီးအလူၬအၥိၭနီၪလီၫ.- ထီးစဎွၩယဟီအကံၫ့ဒဲအ ၡၩဂဲးဆီၪ့ထီးအလူၬ, ဒဲအၦဒိၪဖၭဒိၪထီးအလူၬနီၪ နါဂၧၫ့အဆၧချဲၩ့တၭ,စဎွၩအၪ့ဎၬမၩၥံၫဝ့ၫလီၫ. အ့ၪ မွဲစယုၫရဲဇၫနါဂၧၫ့ဝ့ၫတၭ, ၥၭမဲၪဆၧနီၪစဲၪ့ဖျိၭတၭ,",
			"22": "<sup>22</sup> လ့ၩလၩ့လၧအံဇံၭအဖၧၩ့လီၫ.- တၭစဎွၩယဟီအ ကံၫ့အၪ့မၧၫ့လၩ့ၦၡၩလၧအံဇံၭအဖၧၩ့, စအၭဘီၫအ ဖိၪခွၫစအ့ၫလန့ၥၫ့, ဒဲၦလၧအအီၪလၧအဝ့ၫၥံၪအၥိၭ",
			"23": "<sup>23</sup> လၧအံဇံၭအဖၧၩ့လီၫ.- အဝ့ၫၥံၪ ဂဲၫထဲၩ့ဆိၬထၪ့ခွံၬ စယုၫရဲဇၫလၧအံဇံၭအဖၧၩ့တၭ, ဂဲၫဆိၬဝ့ၫထီၩ့လၧ စဎွၩယဟီအကံၫ့အအီၪတၭ, အဝ့ၫဒၪမၩၥံၫဝ့ၫလၧနၭ တၭ,အၪ့မၧၫ့ၦခွံၬၡိၭခွံၬအစွၪ လၧၦၡၪ့ဖိၪယၬဖိၪအ ၥွၪခိၪဖၧၩ့လီၫ.",
			"24": "<sup>24</sup> မွဲလါနၫ့တၭ, စၡၫဖၫ့အဖိၪခွၫစအဟဲကၫ့အစူၪနီၪ အီၪဝ့ၫလၧစယ့ၫရမဲအၫအၥိၭ, ဘဲၫၥိၭၦထီးဖ့ၪလၫ့ခွံၬ အဝ့ၫဒၪလၧၦခမျၧးအစူၪဖၧၩ့, လၧအမိမၩၥံၫဝ့ၫလ ဂ့ၩလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ယုဒၫအစဎွၩ စယိၫစဲအၫအဖိၪခွၫစယဟီအကံၫ့ ကဲၪၥၫ့စဎွၩနီၪ, ဆၧအလူယီၩဂဲၫလၧယဟိဝၩ လၩ့",
			"2": "<sup>2</sup> ဘၪစယ့ၫရမဲအၫတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩစံၭယၧၩ ဘဲၫယီၩ,မၩဆၧစၧၩ့ထၬအဖျံၩ, ဒဲနိၪယိၭဘီၩ့ၥံၪတၭ,",
			"3": "<sup>3</sup> အီၪက့ၪလၧနခိၬလီၩ့,- ဒဲဖ့ၪလၫ့အဝ့ၫၥံၪလၧအံဒၧၫ့အ စဎွၩ,ဒဲမိအၭအစဎွၩ, ဒဲၦအၫမၧၫ့ဖိၪၥံၪအစဎွၩ, ဒဲတဲ အၫအစဎွၩ,ဒဲဇဲဒၧၫ့အစဎွၩလၧအၥီၫ့လဖၪအစူၪဖၧၩ့ လၧအဂဲၫထီၩ့လၧယရုစလံၫ့, ဖိးလၧယုဒၫအစဎွၩဇ့ၭ",
			"4": "<sup>4</sup> ဒကဲအၫအအီၪနီၪဆံၭ.- တၭမၪလူၬအဝ့ၫၥံၪလၧအမိ ဘၪစံၭအကဆါလဖၪနီၪ, ဆၧၥုၭမုခမျၧးအယဟိဝၩ",
			"5": "<sup>5</sup> အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ,- နၥံၪမိဘၪစံၭနၥံၪအ ကဆါလဖၪဘဲၫယီၩ, ယတဲၩ့လၩ့ယူၭဂၪ့ခိၪ, ၦၡၩ, ဒဲဆၧဖိၪဆၧဎါ လၧအအီၪလၧဂၪ့ခိၪအဖၫ့ခိၪ လၧယ စီၩ့ဒိၪယမၩ့ထီၫနီၪ, ဒဲလၧယစူၪယူၬထၪ့အၥၭတၭ, ယဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪ လၧကယဲၦလၧအဘၪယၥၭ",
			"6": "<sup>6</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယဖ့ၪလၫ့ခးထီးအလူၬယီၩ လၧယခ့ၫယၡၩဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫ အစူၪဖၧၩ့တၭ, ယဖ့ၪလၫ့ဆ့လၧဆၧဖိၪဆၧဎါလၧမံၩ့ လၬကျၩဘဲၫၥိၭအဝ့ၫၥံၪ မိမၩအဝ့ၫဒၪအဆၧလီၫ.",
			"7": "<sup>7</sup> တၭၦဆၨၩၥံၪထီးအလူၬမိမၩအဆၧ,အဖိၪခွၫ, ဒဲအ ဖိၪခွၫအဖိၪခွၫမၩဆ့ ထီးအခးအဆၧၫ့အထီဘၪလီၫ. ထီးနီၪလဖၧၫ့ ၦအၪဆၨၩဒဲစဎွၩဖၭဒိၪလဖၪနီၪ မိဒုၭ",
			"8": "<sup>8</sup> မၩအဝ့ၫဒၪလၧအဝ့ၫၥံၪအဆၧလီၫ.- ဆၧမိမၩအၥၭ လၧၦလဆၨၩ ဒဲဆၧအဘၩ့မုးလဘၩ့မုးလၧအလမၩ ဘၪဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၩခၭန့ဇၫအဆၧနီၪ, ဒဲ လအီၪက့ၪဘၪအခိၬ လၧဘၭဘလၧၫ့အစဎွၩ အနိၪ ယိၭဘီၩ့အဖၫ့လၬနီၪ, ယမိစ့ၩရၫ့ၦလဆၨၩနီၪလၧနၭ ၥံၪဖၩ့ၥံၪ,ဒဲဆၧၥၭဝံလၩ့ဒိၩ, ဒဲဆၧၥံၫချဲၫ့ထီးယမၩ လူၬခွံၬဝ့ၫလၧအဝ့ၫဒၪအစူၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးခိၭနၪနၥံၪအမီၪလဖၪလ ဂ့ၩ,ဒဲနၥံၪအၡၩဖၭဆၧ, ဒဲနၥံၪအၡၩမံၫမးဆၧ, ဒဲနၥံၪ အၡၩယိဆၧအုၪ့, ဒဲနၥံၪအၡၩမၩကဒၩ ၦမ့ၬလၧအ စံၭနၥံၪတၭ, စံၭဝ့ၫနၥံၪမိမၩဘၪဘၭဘလၧၫ့အစဎွၩ",
			"10": "<sup>10</sup> အဆၧအ့ၬ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအ ချိၬလၧဆၧအဘျံၭအဘျၪလၧနၥံၪ, ဘဲၫၥိၭနၥံၪမိစဲၪ့ ထၪ့ယဲၩ့လၧနၥံၪအထံၫအခး, ဘဲၫၥိၭယမိနၫ့ထၪ့ခွံၬ, နၥံၪလၧအဖၧၩ့တၭ, နၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့လီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲၦဆၨၩလဖၪ လၧအမိအီၪက့ၪအခိၬလၧဘၭဘ လၧၫ့အစဎွၩအနိၪယိၭဘီၩ့အဖၫ့လၬ, ဒဲမၩအဆၧနီၪ ယမိဒုၭအီၪလၩ့ထး အဝ့ၫၥံၪလၧအခးဒၪဝ့ၫအဖၧၩ့, ယဟိဝၩစံၭဝ့ၫဒၪ. တၭအဝ့ၫၥံၪမိမၩကၩလၧဂၪ့ခိၪ, ဒဲအီၪလၧခးနီၪအဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ယချဲၩ့ဆၧဆ့လၧယုဒၫအစဎွၩဇ့ၭဒကဲအၫဘဲၫဆၧ ချဲၩ့ယီၩထီးအလူၬအၥိၭနီၪတၭ, ယစံၭအီၪက့ၪနၥံၪ အခိၬလၧဘၭဘလၧၫ့အစဎွၩ အနိၪယိၭဘီၩ့အဖၫ့လၬ",
			"13": "<sup>13</sup> ဒဲမၩအဆၧ, ဒဲအၡၩခမျၧးအဆၧတၭ,မၧၫ့ဆံၭ.- နၥံၪ မိၥံၫနီၪအဂဲးဘဲၫၥ့ၪလဲၪ. နဝ့ၫဒၪဒဲနၡၩခမျၧး, လၧနၭ ၥံၪဖၩ့ၥံၪ,ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧဆၧၥံၫချဲၫ့ဘဲၫ ယဟိဝၩချဲၩ့ဆၧထၫ့ဒၩ ၦလဆၨၩလၧအလမၩဘၪ",
			"14": "<sup>14</sup> ဘၭဘလၧၫ့အစဎွၩအဆၧအၥိၭနီၪ, မွဲဘၪလဲၪ.- မၩ အၥၭဘဲၫနီၪတၭ, မီၪလဖၪလၧအချဲၩ့နၥံၪတၭ, စံၭ, န ၥံၪလမၩဘၪဘၭဘလၧၫ့အစဎွၩအဆၧနီၪ, ထီးခိၭနၪ လဂ့ၩ, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪချဲၩ့ဆၧ လၧမီၪအချိၬ",
			"15": "<sup>15</sup> လၧဆၧအဘျံၭအဘျၪလၧနၥံၪလီၫ.- အဂဲးဘဲၫယီၩယ အၪ့မၧၫ့လၩ့န့အဝ့ၫၥံၪအ့ၬး ယဟိဝၩစံၭဝ့ၫဒၪ. မွဲလါ နၫ့တၭ, အဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအချိၬလၧဆၧအဘျံၭ အဘျၪလၧယမံၩ့ဘဲၫၥိၭယမိနၫ့ထၪ့ခွံၬနၥံၪ, ဘဲၫၥိၭန ၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့, နၥံၪဝ့ၫ, ဒဲမီၪလဖၪလၧအချဲၩ့ ဆၧလၧမီၪအချိၬလၧနၥံၪဆ့လီၫ.",
			"16": "<sup>16</sup> ယချဲၩ့ဆၧလၧၦလုဆၧၥံၪ,ဒဲၦခမျၧးထီးအလူၬယီၩ တၭ,ယစံၭ, ယဟိဝၩစံၭဘဲၫယီၩး မီၪလဖၪလၧအ ချဲၩ့ဆၧလၧမီၪအချိၬလၧနၥံၪတၭ, စံၭ, ယိခွါ, ယဟိ ဝၩအဂံၪ့အဎၧၩ့အဎီနီၪ ၦၡၩမိဂဲၫထဲၩ့ဆိၬဝ့ၫ ချဲၫ့ချဲၫ့ လၧဘၭဘလၧၫ့အဖၧၩ့နီၪ, ထီးခိၭနၪအလူလဂ့ၩ.အ ဂဲးဘဲၫယီၩ မွဲအချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪ",
			"17": "<sup>17</sup> လၧနၥံၪလီၫ.- ခိၭနၪအဝ့ၫၥံၪအလူလဂ့ၩး မၩဘၭဘ လၧၫ့အစဎွၩအဆၧတၭ, မၧၫ့ဆံၭ. ဒိၩ့လဖျိၪ့ယီၩမိ",
			"18": "<sup>18</sup> ဘၪဆၧမၩယူမွဲဘၪလဲၪ.- မွဲလါနၫ့တၭ,အဝ့ၫၥံၪအ့ၪ မွဲမီၪလဖၪ, ယဟိဝၩအလူအ့ၪအီၪလၧအဝ့ၫၥံၪတၭ, မွဲအအၪ့ကံၩ့အၪ့ယၫ ဆၧၥုၭမုခမျၧးအယဟိဝၩဘဲၫ ၥိၭဆၧအဎၧၩ့အဎီ လၧအအီၪလၩ့ထးလဖၪ လၧယ ဟိဝၩအဂံၪ့ဖၧၩ့ ဒဲလၧယုဒၫအစဎွၩအဂံၪ့ဖၧၩ့, ဒဲလၧ",
			"19": "<sup>19</sup> ယရုစလံၫ့အဖၧၩ့နီၪ,လ့ၩလၧဘၭဘလၧၫ့လဂ့ၩ.- အ ဂဲးဘဲၫယီၩယဟိဝၩစံၭ, လၧထုၪ့လဖၪအဂဲး,ဒဲလၧက မၫအဂဲး,ဒဲကမၫအခၪ့ထံၭအဂဲး, ဒဲလၧဆၧအဎၧၩ့အ ဎီလၧအအီၪလၩ့ထး လၧဒိၩ့ လဖျိၪ့ယီၩအဖၧၩ့အ",
			"20": "<sup>20</sup> ဂဲး,- လၧဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫလဆိၬ ထၪ့ဘၪထီးအထီ လၧအဆိၬထၪ့အၪ့မၧၫ့ဎီးယုဒၫအ စဎွၩယဟီအကံၫ့အဖိၪခွၫ စယ့ၭကနဲအၫလၧယရုစ လံၫ့ဖိးလၧဘၭဘလၧၫ့အအီၪ, ဒဲယုဒၫဒဲယရုစလံၫ့အ",
			"21": "<sup>21</sup> ၦဒိၪဖၭဒိၪထီးအလူၬနီၪ ဘဲၫယီၩ,- မွဲမၬ, ဆၧၥုၭမု ခမျၧးအယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, လၧ ဆၧအဎၧၩ့အဎီ လၧအအီၪလၩ့ထး လၧယဟိဝၩအ ဂံၪ့ဖၧၩ့, ဒဲလၧယုဒၫအစဎွၩအဂံၪ့ဖၧၩ့,ဒဲလၧယရုစလံၫ့",
			"22": "<sup>22</sup> အဖၧၩ့အဂဲးနီၪ,- ၦလဖၪနီၪမိဆိၬထၪ့ခွံၬဝ့ၫထီၩ့လၧ ဘၭဘလၧၫ့တၭ, မိအီၪထီးမုလနံၩ လၧယစ့ၩရၫ့အ ဝ့ၫၥံၪလီၫ. ယဟိဝၩစံၭဝ့ၫဒၪ. ထီးနီၪလဖၧၫ့ယမိဂဲၫ ထဲၩ့ဆိၬဝ့ၫ, ဒဲအီၪက့ၪအဝ့ၫၥံၪ လၧအလးထီးယီၩ လီၫ."
		},
		"28": {
			"1": "<sup>1</sup> တၭလၧလနံၪ့ဎး, လၧယုဒၫအစဎွၩဇ့ၭဒကဲၫအၫ ကဲၪၥၫ့စဎွၩ အနံၪ့လံနံၪ့လနံၪ့ လၧလၩယဲဘံၪ့လဘံၪ့နီၪ ဆၧမၩအၥၭလၧမီၪစအၭဇၧၫအဖိၪခွၫစဟၪ့အနဲအၫ ဘၪဆဲၫ့လၧဂံဘအၧၫ့နီၪ, ချဲၩ့ဆၧလၧယၧၩလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့လၧၦလုဆၧလဖၪ, ဒဲလၧၦခမျၧးထီးအ",
			"2": "<sup>2</sup> လူၬၥံၪအမ့ၬယၫတၭ,စံၭဝ့ၫဒၪ,- ဆၧၥုၭမုခမျၧးအယ ဟိဝၩအံၫစရ့လၭအယွၩချဲၩ့ဆၧဘဲၫယီၩတၭ, စံၭဝ့ၫ ဒၪ,ယမၩခါယူၭ ဘၭဘလၧၫ့ အစဎွၩအနိၪယိၭဘီၩ့",
			"3": "<sup>3</sup> ယူၭ.- လၧနံၫနံၪ့အထးဖၧၩ့ ယမိဒုၭဂဲၫထဲၩ့ဒီၭထီၩ့ လၧအလးထီးယီၩ ယဟိဝၩအဂံၪ့အဎၧၩ့အဎီထီးအ လူၬလၧဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫဆိၬထၪ့ ခွံၬဝ့ၫလၧအလးထီးယီၩ ထီၩ့လၧဘၭဘလၧၫ့တၭ,",
			"4": "<sup>4</sup> ယမိဒုၭဂဲၫထဲၩ့ ယုဒၫအစဎွၩ ယဟီအကံၫ့ အဖိၪခွၫ စယ့ၭကနဲအၫ, ဒဲကယဲၦယုဒၫဖိၪလၧအကဲၪဎီးဒဲလ့ၩ လၧဘၭဘလၧၫ့နီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ. အဂဲးဘဲၫယီၩ ယမိမၩခါဘၭဘလၧၫ့အစဎွၩ အနိၪယိၭဘီၩ့နီၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့မီၪစယ့ၫရမဲအၫစံၭ မီၪစဟၪ့အနဲအၫ လၧၦလုဆၧလဖၪအမ့ၬယၫ, ဒဲလၧၦခမျၧးထီးအလူၬ လၧအဆၧၫ့ထုၪ့လၧယဟိဝၩအဂံၪ့ဖၧၩ့အမ့ၬယၫ,",
			"6": "<sup>6</sup> မီၪစယ့ၫရမဲအၫဒၪလ့ၬစံၭဝ့ၫဒၪ, အၩမံၩ့, မွဲယဟိဝၩ မၩဘဲၫနီၪၥိၭဆံၭ. မွဲယဟိဝၩမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ နဆၧချဲၩ့လၧမီၪအချိၬ ဘဲၫၥိၭအမိဒုၭဂဲၫထဲၩ့ဆိၬ ယ ဟိဝၩအဂံၪ့အဎၧၩ့အဎီ, ဒဲကယဲၦလၧဆၧဆိၬအၪ့ မၧၫ့ဎီးဝ့ၫလၧဘၭဘလၧၫ့နီၪ ထီၩ့ထဲၩ့ဒီၭလၧဆၧအ",
			"7": "<sup>7</sup> လးထီးယီၩဆံၭ.- မွဲလါနၫ့ဘဲၫနီၪတၭ,ခိၭနၪဆၧချဲၩ့ လထံၪယီၩလၧယမိချဲၩ့ဆၧ လၧနနါဖၧၩ့ဒဲလၧၦခမျၧး",
			"8": "<sup>8</sup> ယီၩအနါဖၧၩ့ဆံၭ.- မီၪၥံၪလၧအအီၪခီၫလၧဖျိၩ့လၧ အချဲၩ့ဆၧလၧမီၪအချိၬ လၧယလချႃၭချဲၩ့ဒံၭဘၪ, ဒဲ လၧနလချႃၭချဲၩ့ဒံၭဘၪလဖၪနီၪ ချဲၩ့ဆၧလၧမီၪအချိၬ ဆ့,ထၫ့ဒၩထံၫၥံၪခးၥံၪအၪဘံၪ့, ဒဲထၫ့ဒၩဘၩ့ၥံၪမုးၥံၪ အဒိၪအထီၫလၧဆၧဒုၭၥုၭအဂဲး, ဒဲလၧဆၧၡၪ့ဆၧနၭ",
			"9": "<sup>9</sup> အဂဲး,ဒဲလၧဆၧၥံၫချဲၫ့အဂဲးလီၫ.- မီၪလၧအချဲၩ့ဆၧ လၧမီၪအချိၬ လၧဆၧဘၪလိၬအိၭလိၬလဂၩ, ထီးမီၪ အလူနီၪအ့ၪလၧၫ့ထၪ့ဎွ့ၩထၪ့တၭ, ၦၡၩမိၥ့ၪယၫလၧ ယဟိဝၩအၪ့မၧၫ့လၩ့တၡါယူၭမီၪလဂၩနီၪအခဲၫ့လီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့မီၪစဟၪ့အနဲအၫ မၩန့ထၪ့ခွံၬနိၪယိၭ ဘီၩ့လၧမီၪစယ့ၫရမဲအၫအခိၬလီၩ့တၭ, မၩခါခွံၬဝ့ၫ",
			"11": "<sup>11</sup> ဒၪလီၫ.- တၭစဟၪ့အနဲအၫ ချဲၩ့ဆၧလၧၦခမျၧးထီး အလူၬအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪယဟိဝၩစံၭဘဲၫယီၩ, ယမိမၩခါခွံၬ ဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫအ နိၪယိၭဘီၩ့ လၧၦကိၭဆၨၩဒ့ၭအခိၬလီၩ့ ဘဲၫနီၪၥိၭ လၧနံၫနံၪ့အမုနံၩလဖၪအထးဖၧၩ့လီၫ. တၭမီၪစယ့ၫ ရမဲအၫစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့မီၪစဟၪ့အနဲအၫ မၩခွါခွံၬနိၪယိၭဘီၩ့ လၧမီၪစယ့ၫရမဲအၫအလးခဲၫ့နီၪ, ယဟိဝၩအလူလၩ့",
			"13": "<sup>13</sup> ဘၪစယ့ၫရမဲအၫတၭ,စံၭဝ့ၫဒၪ,- လ့ၩလီၩဘၪစဟၪ့ အနဲအၫတၭ,စံၭ, ယဟိဝၩစံၭဘဲၫယီၩ, နမၩခါယူၭ နိၪယူၭဘီၩ့ၥံၪ့လဖၪယူၭတၭ, နမိဘၪမၩနိၪယိၭဘီၩ့",
			"14": "<sup>14</sup> ထၭၥံၪလၧအဝ့ၫၥံၪအလးလီၫ.- အဂဲးဘဲၫယီၩဆၧၥုၭ မုခမျၧးအယဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, ယအီၪက့ၪလၩ့ယူၭ နိၪယိၭဘီၩ့ထၭလၧၦဆၨၩထီးအ လူၬယီၩအလီၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪမိမၩဘၭဘလၧၫ့အ စဎွၩန့ၭဘူၫခၭန့ဇၫအဆၧ, အဝ့ၫၥံၪဘၪမၩအဆၧ တၭ,ယဖ့ၪလၫ့ဆ့အဝ့ၫဒၪ လၧဆၧဖိၪဆၧဎါလၧမံၩ့ လၬကျၩလီၫ.",
			"15": "<sup>15</sup> တၭမီၪစယ့ၫရမဲၫအၫ စံၭမီၪစဟၪ့အနဲအၫ,ခိၭနၪ လါဆံၭး စဟၪ့အနဲအၫဧ့, ယဟိဝၩအၪ့မၧၫ့လၩ့န့ နၧၩအ့ၬးမွဲနဒုၭဒိၭနဲၩ့ ၦခမျၧးယီၩအၥၭလၧဆၧချဲၩ့",
			"16": "<sup>16</sup> အဘျံၭအဘျၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩ စံၭဘဲၫယီၩ, ယိခွါ, ယမိခွံၬၡိၭခွံၬနၧၩ လၧဂၪ့ခိၪချိၫ့ လီၫ.အဂဲးဘဲၫယီၩ အယီၩလနံၪ့ယီၩနမိၥံၫလီၫ. အ ဂဲးဘဲၫယီၩနချဲၩ့ဆၧဒုၭပိၩ့ထၪ့ ထၫ့ဒၩယဟိဝၩလီၫ.",
			"17": "<sup>17</sup> အခိးမွဲစဟၪ့အနဲအၫၥံၫဝ့ၫလၧနံၪ့လနံၪ့ဎးနီၪလၧလၩ နွ့ၫဘံၪ့လဘံၪ့အဖၧၩ့လီၫ."
		},
		"29": {
			"1": "<sup>1</sup> တၭအယီၩမွဲလံၬဖ့ၪယုအဆၧချဲၩ့ လၧမီၪစယ့ၫရမဲ အၫဖ့ၪယု လၧယရုစလံၫ့အၥုၪ့က့ၭၥၭၡါ လၧအအီၪ လၩ့ထးလၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအကျၩ, ဒဲလၧၦလုဆၧ လဖၪ, ဒဲလၧၦခမျၧးထီးအလူၬ လၧစန့ၭဘူၫခၭန့ဇၫ ဆိၬထၪ့ခွံၬ လၧယရုစလံၫ့နီၪ, အၪ့မၧၫ့ဎီးဝ့ၫလၧဘၭ",
			"2": "<sup>2</sup> ဘလၧၫ့အဖၧၩ့လီၫ.- (လၧစဎွၩယ့ၭကနဲအၫ,ဒဲနးဎွၩ မုၪဒဲၦဖၫဆွံၪလဖၪ, ဒဲယုဒၫဒဲယရုစလံၫ့အၦဒိၪဖၭဒိၪ လဖၪ,ဒဲၦလဲၬၥမါ, ဒဲၦထမၬဖိၪၥံၪစဲၪ့ထၪ့ခွံၬလၧယရု",
			"3": "<sup>3</sup> လံၫ့အလးခဲၫ့နီၪ,)- လၧစၡၫဖၫ့အဖိၪခွၫစအ့လစၫ, ဒဲစဟံၫလကဲအၫအဖိၪခွၫစဂ့ၭမရဲအၫအစူၪဖၧၩ့(လၧ ယုဒၫအစဎွၩဇ့ၭဒကဲအၫ အၪ့မၧၫ့လၩ့န့ဝ့ၫလၧဘၭဘ လၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫအအီၪ) တၭစံၭဝ့ၫဒၪ,",
			"4": "<sup>4</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫစရ့လၭအယွၩ စံၭ, ကယဲၦလၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫလၧယဒုၭဆိၬထၪ့ခွံၬဝ့ၫ လၧယရုစလံၫ့ထီၩ့လၧဘၭဘလၧၫ့, ထီးအလူၬၥံၪဧ့,",
			"5": "<sup>5</sup> မၩထၪ့နၥံၪအဂံၪ့တၭ, အီၪလၧအဖၧၩ့ဒဲၥုၪ့ဆၧၥၪအ",
			"6": "<sup>6</sup> လးတၭ,အၪ့ဆၧၥၪဆံၭ.- န့ဖိၪန့မၫတၭထၪ့ဖိၪ, ဖိၪ ခွၫၥံၪဒဲဖိၪမုၪၥံၪတၭ, မၩန့မၫလၧနၥံၪအဖိၪခွၫၥံၪအ ဂးတၭ,ဖ့ၪလၫ့နၥံၪအဖိၪမုၪလၧအဝၩ ဘဲၫၥိၭအမိဆီၫ့ အီၪန့ဖိၪခွၫၥံၪဒဲဖိၪမုၪၥံၪ, ဘဲၫၥိၭနၥံၪ မိအၪထၪ့ထီး",
			"7": "<sup>7</sup> နီၪတၭ,ၡၩလၩ့အ့ၬ.- တၭဒိၩ့လၧယအၪ့မၧၫ့နၥံၪလ့ၩ ကဲၪဎီးနီၪ, အၪ့ဎူၫအၪ့ဎၬအဆၧဘၪလိၬအိၭလိၬ, ဘၩ ဆိၪဖၪန့အဂး လၧယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩလၧ အဝ့ၫနီၪအဆၧဘၪလိၬအိၭလိၬအဖၧၩ့နီၪ နၥံၪမိန့ဘၪ ဆၧဘၪလိၬအိၭလိၬဆ့လီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧး အယဟိဝၩအံၫစရ့ လၭအယွၩ စံၭဘဲၫယီၩ, ဒုၭအၪ့လီၫန့နၥံၪအၥၭ လၧ နၥံၪအမီၪ, ဒဲနၥံၪအၡၩဖၭဆၧလၧအအီၪဝ့ၫလၧနၥံၪ အကျၩလဂ့ၩ. တၭခိၭနၪဆၧမံၫမး လၧနၥံၪဒုၭမံၫမး",
			"9": "<sup>9</sup> လဂ့ၩ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအချိၬ အဘျံၭအဘျၪလၧယမံၩ့လီၫ. ယအၪ့မၧၫ့လၩ့န့နၥံၪ",
			"10": "<sup>10</sup> အ့ၬ.ယဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭ ဘဲၫယီၩ, အနံၪ့နွ့ၫဆံၫဎွ့ၩထၪ့ လၧဘၭဘလၧၫ့အဖၧၩ့ လၧယၫလခီၫနီၪ ယမိအီၪၡီၩ့နၥံၪတၭ, မၩလၧၫ့ထၪ့ ဎွ့ၩထၪ့ယဆၧချဲၩ့ဂ့ၩလၧနၥံၪနီၪ, ဒဲအၪ့မၧၫ့နၥံၪဂဲၫ",
			"11": "<sup>11</sup> ထဲၩ့ထဲၩ့လၧဆၧအလးယီၩလီၫ.- အဂဲးဘဲၫယီၩယၥ့ၪ ယၫဆၧကိၪ့လၧယကိၪ့ထၪ့လၧနၥံၪအဂး, ယဟိဝၩစံၭ ဝ့ၫဒၪ,ဆၧကိၪ့ဘၪဆဲၫ့လၧဆၧဘၪလိၬအိၭလိၬ ဘၪဆဲၫ့ လၧဆၧအၧၩ့မွဲအ့ၬ, ဘဲၫၥိၭယမိဖ့ၪလၫ့နၥံၪအဆၧအီၪ",
			"12": "<sup>12</sup> လၧဆၧယိလါလီၫ.- ထီးနီၪလဖၧၫ့နၥံၪမိကိၭထၪ့ယၧၩ တၭ, နၥံၪမိလ့ၩဘၩထၪ့ယၧၩတၭ,ဒဲယမိခိၭနၪနၥံၪ",
			"13": "<sup>13</sup> အလူလီၫ.- တၭနၥံၪမိအၪ့ဎၬယၧၩ, ထီးနၥံၪအၪ့ဎၬ ယၧၩလၧနၥံၪအၥၭထၧၫ့ဖျိၪ့ယၫတၭ, နၥံၪမိဒၪန့ယၧၩ",
			"14": "<sup>14</sup> လီၫ.- တၭယဟိဝၩစံၭဝ့ၫဒၪ, နၥံၪမိဒၪန့ယၧၩတၭ,ယ မိဒုၭဂဲၫထဲၩ့နၥံၪလၧနၥံၪလ့ၩကဲၪဎီးအလးတၭ, ယမိ အၪ့ထုၫ့ကီၪ့နၥံၪလၧကယဲၦဆၨၩအကျၩ, ဒဲလၧကယဲ ဆၧအလးထီးယနၫ့ထၪ့ခွံၬနၥံၪနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ နၥံၪလၧဆၧအလးထီးယအၪ့မၧၫ့ ဆၧဆိၬထၪ့ခွံၬအၪ့မၧၫ့ဎီးနၥံၪလီၫ.",
			"15": "<sup>15</sup> မွဲလၧနၥံၪစံၭယူၭ, ယဟိဝၩဒုၭအီၪထးန့ပၧၩလၧ မီၪလဖၪလၧဘၭဘလၧၫ့အဖၧၩ့ယူၭ အကၠီၩ့နီၪတၭ,",
			"16": "<sup>16</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧစဎွၩလၧအဆၧၫ့နၩ့လၧစဒၫ ဝံၭအလးဆီၩ့ဆီအဖၫ့ခိၪအဂဲး, ဒဲလၧကယဲၦခမျၧး လၧအအီၪဝ့ၫလၧဒိၩ့ယီၩအဖၧၩ့အဂဲး, လၧနၥံၪအထၧၫ့",
			"17": "<sup>17</sup> ဖုဝဲလၧအလ့ၩကဲၪဎီးအဂဲး,- ဆၧၥုၭမုခမျၧးအယဟိ ဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယမိအၪ့မၧၫ့လၩ့နၭၥံၪဖၩ့ၥံၪ, ဒဲဆၧၥၭဝံလၩ့ဒိၩ,ဒဲဆၧၥံၫချဲၫ့လၧအကျၩတၭ, ယမိ အီၪက့ၪဝ့ၫဘဲၫချိၪ့ဒိၩ့ၥၪအအၧၩ့အၥိၭ, လၧအအၧၩ့ဝ့ၫ",
			"18": "<sup>18</sup> ထီးၦအၪ့ဝ့ၫလကဲၪဘၪအၥိၭနီၪလီၫ.- တၭယမိမၩခိ မၩဝီၩအဝ့ၫၥံၪလၧနၭၥံၪဖၩ့ၥံၪ ဒဲဆၧၥၭဝံလၩ့ဒိၩ,ဒဲ ဆၧၥံၫချဲၫ့တၭ, ယမိဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧဆၧမၩ အၧၩ့ဝ့ၫလၧကယဲဘၩ့မုးလၧဂၪ့ခိၪချိၫ့ ထီးအလူၬအ ကျၩ,ဘဲၫၥိၭအမိကဲၪထၪ့ ဆၧဆိၪအၧၩ့အလး, ဒဲဆၧ ထီၫမံၫထီၫမၪအလး, ဆၧပယွ့ၫအလးဒဲဆၧဒုၪဒွ့ၪအ လးလၧကယဲၦဆၨၩအကျၩ ထီးအလူၬထီးအလးလၧ",
			"19": "<sup>19</sup> ယနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭ ဝ့ၫ,လၧယအၪ့မၧၫ့လၩ့ ယခ့ၫယၡၩမီၪလဖၪ လၧအ အီၪနီၪတၭ, အဝ့ၫၥံၪခိၭနၪယလူအ့ၬ, ယဂဲထုၪ့ဂီၩဂီၩ တၭ,အၪ့မၧၫ့လၩ့အဝ့ၫၥံၪတၭ, နၥံၪခိၭနၪအ့ၬး ယဟိ ဝၩစံၭဒၪ.",
			"20": "<sup>20</sup> တၭနၥံၪဝ့ၫဒၪယီၩ ကယဲၦလၧအလ့ၩကဲၪဎီးလၧယ အၪ့မၧၫ့လၩ့ခွံၬလၧယရုစလံၫ့နီၪ ထီၩ့လၧဘၭဘလၧၫ့",
			"21": "<sup>21</sup> ၥံၪဧ့,ခိၭနၪယဟိဝၩအလူဆံၭ.- ဆၧၥုၭမုခမျၧးအ ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, လၧစကီၫလဲ အၫအဖိၪခွၫ စအၫဟၭအဂဲးနီၪ, ဒဲလၧစမၫအစဲအၫ အဖိၪခွၫစဇ့ၭဒကဲအၫအဂဲးနီၪ, လၧအချဲၩ့ဆၧလၧမီၪ အချိၬအဘျံၭအဘျၪလၧယမံၩ့း ယိခွါ, ယမိဖ့ၪလၫ့ခွံၬ ဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫအစူၪဖၧၩ့ တၭ,အဝ့ၫဒၪမိမၩၥံၫအဝ့ၫၥံၪ လၧနၥံၪအမ့ၬယၫလီၫ.",
			"22": "<sup>22</sup> တၭၦယုဒၫဖိၪ လၧအကဲၪဎီးလၧဘၭလၧၫ့အဖၧၩ့ ထီးအလူၬမိအီၪက့ၪအဝ့ၫၥံၪ လၧဆၧဆိၪအၧၩ့အလး တၭ,မိစံၭ, မွဲယဟိဝၩအီၪက့ၪနၧၩ ဘဲၫစဇ့ၭဒကဲအၫ, ဒဲဘဲၫစအၫဟၭ လၧဘၭဘလၧၫ့အစဎွၩ ဆူၭထၪ့ခွံၬ",
			"23": "<sup>23</sup> ဝ့ၫလၧမ့ၪဖၧၩ့အၥိၭနီၪဆံၭ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ မၩဆၧအၧၩ့လၧအံၫစရ့လၭအကျၩ, မၩမၪၦလၧအ နဲၩ့ထံၭအမၫတၭ, ချဲၩ့ဆၧအဘျံၭအဘျၪလၧယမံၩ့, လၧယလမၪလူၬဘၪအဝ့ၫၥံၪ, ယၥ့ၪယၫယဝ့ၫတၭ, ယမွဲၦထိးအၥၭလီၫ.ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"24": "<sup>24</sup> တၭနဘၪလီၩဘၪ ၦနဟ့လမဲၭဖိၪစၡ့ၫမအဲအၫတၭ,",
			"25": "<sup>25</sup> စံၭအဝ့ၫ,- ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫစရ့လၭအ ယွၩစံၭဘဲၫယီၩ, စံၭဝ့ၫဒၪ, မွဲနဖ့ၪယူလံၬလၧနမံၩ့လၧ ကယဲၦလၧအအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့, ဒဲလၧၦလု ဆၧစမၫအစဲအၫအဖိၪခွၫစဇ့ၭဖနဲအၫ, ဒဲလၧၦလုဆၧ",
			"26": "<sup>26</sup> ထီးအလူၬတၭ,နစံၭ,- ယဟိဝၩအီၪက့ၪနၧၩလၧၦလု ဆၧ,လၧၦလုဆၧစယဟီအဒၫအလးနီၪ, ဘဲၫၥိၭနၥံၪ မိကဲၪၦဒိၪလဖၪ မိအီၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့လၧက ယဲၦလၧအဖျႃဝ့ၫအဖၫ့ခိၪ, ဒဲလၧၦလၧအအီၪက့ၪအ ၥၭလၧမီၪလဂၩဂၩအဖၫ့ခိၪနီၪတၭ, ဘဲၫၥိၭနမိဒုၭနုၬ အဝ့ၫဒၪလၧထီၫ့ဖၧၩ့ ဒဲၥံၫ့ထၬဝ့ၫလၧၥံၫ့လဖၪအဖၧၩ့",
			"27": "<sup>27</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, နလအၪ့ၥီၪ့ဘၪၦအၫ့အၥီၭ ဖိၪစယ့ၫရမဲအၫ လၧအအီၪက့ၪအၥၭလၧမီၪလဂၩလၧ",
			"28": "<sup>28</sup> နၥံၪအဂးမွဲဘၪလဲၪ.- အဂဲးဘဲၫယီၩမွဲအဖ့ၪယုဆၧ လၧပၧၩလၧဘၭဘလၧၫ့အဖၧၩ့ဘဲၫယီၩတၭ, စံၭဝ့ၫ ဒၪ,အယီၩမွဲအလံၬ, မၩထၪ့ဂံၪ့ၥံၪဎၫ့ၥံၪ လၧနၥံၪအ ဂးတၭ,အီၪလၧအဖၧၩ့နီၪ, ၥုၪ့ဆၧၥၪအလးတၭ, အၪ့",
			"29": "<sup>29</sup> ဆၧၥၪဆံၭ.- တၭၦလုဆၧစဇ့ၭဖနဲအၫ ဖီထၪ့လံၬလ",
			"30": "<sup>30</sup> ဘံၪ့နီၪလၧမီၪစယ့ၫရမဲအၫအနါဖၧၩ့နီၪလီၫ.- ထီးနီၪလ ဖၧၫ့ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫတၭ, စံၭဝ့ၫ",
			"31": "<sup>31</sup> ဒၪ,- ဖ့ၪယုဆၧလၧကယဲၦကဲၪဎီးတၭ, စံၭ, ယဟိဝၩ စံၭဘဲၫယီၩလၧၦနဟ့လမဲၭဖိၪ စၡ့ၫမအဲအၫအဂဲးအ ကၠီၪ့း လၧစၡ့ၫမအဲအၫချဲၩ့ဆၧ လၧမီၪအချိၬလၧနၥံၪ လၧယလအၪ့မၧၫ့လၩ့န့ဘၪအဝ့ၫ, ဒဲဒုၭဒိၭနဲၩ့နၥံၪအ",
			"32": "<sup>32</sup> ၥၭလၧဆၧချဲၩ့အဘျံၭအဘျၪအကၠီၩ့း- မၩအၥၭဘဲၫ နီၪတၭ, ယဟိဝၩစံၭဘဲၫယီၩး ယိခွါ, ယမိစ့ၩရၫ့စၪၦန ဟ့လမဲၭဖိၪစၡ့ၫမအဲအၫနီၪ, ဒဲအချံၫအၥၪဆ့လီၫ. ၦ လၧအမိအီၪ လၧၦခမျၧးအကျၩနီၪ အီၪလၧအဝ့ၫနး ဂၩအ့ၬ, တၭမွဲအမိဒၪဘၪဆၧဂ့ၩလၧယမိမၩယၡၩ ခမျၧးယီၩဆ့အ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪး အဂဲးဘဲၫယီၩ မွဲအချဲၩ့ဆၧဒုၭပိၩ့ထၪ့ယဟိဝၩလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> ဆၧချဲၩ့လၧအလၩ့ဘၪ စယ့ၫရမဲအၫလၧယဟိဝၩ",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- ယဟိဝၩအံၫစရ့လၭအယွၩ ချဲၩ့ဘဲၫယီၩ တၭစံၭဝ့ၫဒၪ, ကယဲဆၧချဲၩ့လၧယချဲၩ့ယူၭ လၧနၧၩ",
			"3": "<sup>3</sup> ထီးအလူၬနီၪကွ့ၭလၧလံၬဖၧၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ, ယိခွါ,မုနံၩလဖၪမိဘၪဝ့ၫ,ယဟိဝၩစံၭဝ့ၫဒၪ, လၧယ မိဒုၭထဲၩ့ထဲၩ့ ၦလ့ၩကဲၪဎီး ယၡၩခမျၧးအံၫစရ့လၭ ဒဲယုဒၫ,ယဟိဝၩစံၭဝ့ၫဒၪတၭး ယမိဒုၭဂဲၫထဲၩ့ဝ့ၫထီၩ့ လၧခးလဘံၪ့ လၧယဖ့ၪလၫ့လၧအဝ့ၫၥံၪအဖါလဖၪ",
			"4": "<sup>4</sup> တၭ,အဝ့ၫၥံၪမိန့ဘၪၥၫဝ့ၫလီၫ.- တၭအယီၩမွဲဆၧ ချဲၩ့လၧယဟိဝၩချဲၩ့ဝ့ၫ လၧအံၫစရ့လၭအဂဲး, ဒဲလၧ ယုဒၫအဂဲးလီၫ.",
			"5": "<sup>5</sup> မွဲမၬ,ယဟိဝၩစံၭဝ့ၫဒၪ, ဆၧမၩဝၭထိၬအၥီၫနီၪပ နါဂၧၫ့ယူၭ, ဆၧၥၭမဲၪအီၪ, ဆၧဘၪလိၬအိၭလိၬအီၪ",
			"6": "<sup>6</sup> အ့ၬ.- အၪ့စၪ့ဆၧတၭ,ဒဲယိခွါနီၪ, မွဲၦခွၫဘၪဆၧဂူၭ ဆၫလၧအဆီၫ့အီၪန့အဖိၪဆ့ဧၪ. ယဒၪဘၪၦခွၫကိၭ ဂၩဒ့ၭအစူၪအီၪဝ့ၫလၧအယးဒံၩ့လီၩ့ ဘဲၫၦမုၪဘၪဆၧ ဂူၭဆၫအၥိၭနီၪ, ဒဲကယဲၦအမ့ၬလၩ့ၡါနီၪမွဲအဘၪဆၧ",
			"7": "<sup>7</sup> နီၪလဲၪ.- အၩလါၬဆၧလၧမုလနံၩနီၪ မွဲအဒိၪထီးဆၧ ထိၪဎီၩ့အီၪအ့ၬး မွဲစယၫကူၭအဆၧခိဆၧဝီၩ အထီ လီၫ.မွဲလါနၫ့တၭ,ဆၧမၩဖီၩ့မၩဖျ့ၭအဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ,လၧမုနံၩနီၪဆၧ မိမၩအၥၭလၧယမိမၩခါအနိၪယိၭဘီၩ့လၧအခိၬလီၩ့ တၭ,ယမိထ့ၬခွံၬနဖျံၩစၧၩ့ထၬတၭ, ၦလခီၫဘၩ့မုးဖိၪ",
			"9": "<sup>9</sup> ဒုၭမၩအဝ့ၫၥံၪလၧအဆၧအ့ၬ.- မွဲအဝ့ၫၥံၪမိမၩယဟိ ဝၩအဝ့ၫၥံၪအယွၩအဆၧ, ဒဲစဒၫဝံၭ, အဝ့ၫၥံၪအစဎွၩ",
			"10": "<sup>10</sup> အဆၧလၧယမိဒုၭဂဲထုၪ့လၧအဝ့ၫၥံၪအဂးလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, နဝ့ၫဒၪယခ့ၫယၡၩစယၫကူၭဧ့, ထီး ၥၭမဲၪဆၧလဂ့ၩ, ယဟိဝၩစံၭဝ့ၫဒၪ, ထီးအၪ့ယိၪဆၧ လဂ့ၩ,အံၫစရ့လၭဧ့, အဂဲးဘဲၫယီၩ,ယိခွါ, ယမိထိး ထဲၩ့တၩ့ထဲၩ့နၧၩ အီၪလၧအယဲၩ့, ဒဲနချံၫနၥၪလၧအ ကဲၪဎီးအခးဖၧၩ့တၭ, စယၫကူၭမိဂဲၫထဲၩ့ထဲၩ့, မိအီၪ ပွံၭ,ဒဲမိအီၪမုၬတၭ, ဆၧမၩၥၭမဲၪဝ့ၫအီၪနးဂ့ၩအ့ၬ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ ယမိအီၪလၧနၥိၭဘဲၫၥိၭယမိထိးထဲၩ့ တၩ့ထဲၩ့နၧၩလီၫ. ယဟိဝၩစံၭဝ့ၫဒၪ,ယမိမၩဂၭဂီၩ့ ကယဲၦဆၨၩ ထီးယမၩလၩ့ပြံၩလၩ့ပၩနၧၩလၧအ ကျၩလါနၫ့တၭ, ယမိမၩဂၭဂီၩ့လူၬခွံၬနၧၩအ့ၬး ယမိ အၪ့ၥီၪ့နၧၩဘဲၫဆၧကြၨၭအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ ယလအၪ့ၥီၪ့ဘၪနၧၩနးဆံၭတၭ,ယအီၪအ့ၬ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, နဖၧၩ့လးဘျၪ",
			"13": "<sup>13</sup> ၥ့ၪအ့ၬ, နဆၧဆၫအလးနီၪ ဆၫနၭမၬလီၫ.- ၦဘၠၩ့ ထဲၩ့နဆၧဆၫအီၪအ့ၬ. ၥံၪ့ဎွံၪဎၥံၪၭနီၪၦၡၩဖ့ၪလၫ့နၧၩ",
			"14": "<sup>14</sup> အ့ၬ.- ကယဲၦလၧအအဲၪနၧၩထီးအလူၬနီၪ ၥၭနၪ့ယူၭ နၧၩယူၭး အၪ့ဎၬနၧၩအ့ၬ. အဂဲးဘဲၫယီၩယဆ့ၭနၧၩ လၧဆၧအဒုၪအဒၩအဆၧဆ့ၭနီၪ, လၧၦလယၫ့ၥၭဘၪ ဆၧအဆၧအၪ့ၥီၪ့လၧနဆၧအၧၩ့ဒိၪအကၠီၩ့ လၧနဆၧ",
			"15": "<sup>15</sup> ဒဲၩဘၭအၪထၪ့အကၠီၩ့လီၫ.- နဂၪ့လၧနဖၧၩ့လးအ ကၠီၩ့နီၪမွဲဘၪလဲၪ. နဆၧဆိၭက့ၭဘျၪၥ့ၪအ့ၬ. ယမၩ နၧၩလၧဆၧနီၪလဖၪလၧဆၧအၧၩ့ဒိၪအကၠီၩ့, ဒဲလၧန ဆၧဒဲၩဘၭအၪထၪ့ဝ့ၫအကၠီၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ, ကယဲၦလၧအအၪ့နၧၩဆၧမိ အၪ့ထဲၩ့အဝ့ၫၥံၪး ကယဲနဒုၪနဒၩကိၭဂၩဒ့ၭနီၪ မိဘၪ လ့ၩကဲၪဎီး, ဒဲၦလၧအမၩန့ဆီၪ့နလး,ဒဲကယဲၦလၧအ အၪ့ဂူၬန့ဆီၪ့နဆၧထီးအလူၬနီၪ, ယမိအီၪက့ၪအဝ့ၫ",
			"17": "<sup>17</sup> ၥံၪလၧဆၧအၪ့ဂူၬဆီၪ့အလးလီၫ.- အဂဲးဘဲၫယီၩယ ဒုၭအီၪဆီၪ့အီၪချဲၫ့နၧၩတၭ, ယမိမၩဘျၪထဲၩ့ နဖၧၩ့ လးယဟိဝၩစံၭဝ့ၫဒၪး အဂဲးဘဲၫယီၩၦကိၭနၧၩလၧၦ ဘၪနၫ့ထၪ့ခွံၬဝ့ၫ, ဇံအိၫ့လၧၦလအၪ့ဎၬဘၪဝ့ၫနးဂၩ လီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိဂဲၫဆိၬဒီၭစယၫ ကူၭအတဲၩလဖၪလၧဆၧကဲၪဎီးအဖၧၩ့တၭ, ယမိယၫ့ ၥၭအအီၪအလးၦၡၩမိမၩထၪ့ထဲၩ့ဒိၩ့နီၪ လၧဆၧစီၩ့ ခိၪဒၪဝ့ၫအဖၫ့ခိၪတၭ, ၦၡၩမိအီၪဝ့ၫလၧနီးၥံၪအဖၧၩ့",
			"19": "<sup>19</sup> ဘဲၫဆၧစ့ၩရၫ့အၥိၭလီၫ.- ဆၧစံၭထၪ့အၪ့အူၭ,ဒဲၦနံ ၥီၫနီၪမိၥီၫထၪ့လၧအဖၧၩ့လီၫ. ယမိမၩအၪထၪ့အ ဝ့ၫၥံၪတၭ,အီၪၡၩဂၩအ့ၬ. ယမိမၩလၩဖၩ့အဝ့ၫၥံၪ",
			"20": "<sup>20</sup> တၭ,အီၪဆံၭခိၬနီၪဆ့အ့ၬ.- အဖိၪအလံၩမိအီၪဘဲၫ လၧဖျိၩ့လၧၥၫ့အၥိၭနီၪတၭ, အဝ့ၫၥံၪအဆၧအီၪကီၪ့ မိအီၪဂုးအီၪခၧၫ့လၧယမ့ၬယၫ, ဒဲယမိစ့ၩရၫ့ကယဲၦ",
			"21": "<sup>21</sup> လၧအမၩအၧၩ့ဝ့ၫလီၫ.- တၭအၡၩအီၪလၧဆၧလၩ ဖၩ့လဂၩနီၪမိကဲၪထၪ့လၧအကျၩ ဒဲၦအခိၪလဂၩနီၪမိ ဂဲၫလၧအၥၭကျၩလီၫ. တၭယမိဒုၭၥုၭဘူၭအၥၭတၭ, မိၥုၭဘူၭအၥၭလၧယအီၪလီၫ. မွဲပလၫမိမၩဒူၩအၥၭ လၧအမိၥုၭဘူၭအၥၭလၧယအီၪလဂၩလဲၪ, ယဟိဝၩ",
			"22": "<sup>22</sup> စံၭဝ့ၫဒၪ.- နၥံၪမိကဲၪထၪ့ယၡၩခမျၧးတၭ, ယမိကဲၪ ထၪ့နၥံၪအယွၩလီၫ.",
			"23": "<sup>23</sup> ယိခွါ, လံၩၥဝံၭဘၪဆဲၫ့လၧယဟိဝၩ လ့ၩထၪ့ဆီၪ့ ဆီၪ့လ့ၬ,လံၩဆီၪ့မိဘၪ ၦလတီၩဘၪအခိၪဎွံၪနၭနၭ",
			"24": "<sup>24</sup> လ့ၬလီၫ.- ဆၧလၧအကိၪ့ထၪ့လၧအၥၭခံဖၧၩ့နီၪ,ထီး အလမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဒံၭဘၪ, ဒဲအလမၩဂီၩ့ဒံၭ ဘၪဆၧဘဲၫနီၪတၭ, ယဟိဝၩအၥၭခဲၩထၪ့နီၪမိကၠၪ ကဒၩထဲၩ့အၥၭအ့ၬ. လၧမုနံၩလၧယၫနီၪ နၥံၪမိနၪ ဆၧၥ့ၪလၩ့ထံးလၩ့ဆ့ၭလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, ဆၧလၧအထီထီးနီၪယမိကဲၪ ထၪ့အံၫစရ့လၭအဂံၪ့ဒီၪ့လဖၪ ထီးအလူၬအယွၩတၭ,",
			"2": "<sup>2</sup> အဝ့ၫၥံၪမိကဲၪထၪ့ယၡၩခမျၧးလီၫ.- ယဟိဝၩစံၭဘဲၫ ယီၩ,ၦခမျၧးလၧအဖျ့ၭနၭၥံၪဖၩ့ၥံၪနီၪ ဘၪခိးဘၪတၩ လၧမံၩ့လၬကျၩး အံၫစရ့လၭဒၪလ့ၬ, လၧယမိဒုၭအီၪ",
			"3": "<sup>3</sup> ပွံၭဝ့ၫလီၫ.- ယဟိဝၩနဲၪဖျီၪအၥၭလၧယမ့ၬယၫလၧ ဖျိၩ့စံၭဝ့ၫ, မွဲမၬ, ယအဲၪယူၭနၧၩလၧဆၧအဲၪအဆိၩ အကၠၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယဒုၭဘၪနၧၩလၧ",
			"4": "<sup>4</sup> ဆၧအဲၪအခိးအတၩယံၬယံၬလ့ၬလီၫ.- မၩဒီၭယမိ မၩထၪ့ထဲၩ့ဒီၭနၧၩတၭ, နမိဘၪဆၧအီၪမၩထၪ့နၥၭ နီၪ,အံၫစရ့လၭအၡၩမုၪနၩ့ဧ့, နမိကယၧၩ့ကယီၫဒီၭ နၥၭလၧနဒိၩ့ဖိၪတၭ, လ့ၩဂဲထုၪ့လံလၧၦလိၬကွ့ၩအ",
			"5": "<sup>5</sup> ၥိၭလီၫ.- နမိၥုၪ့ဒီၭနစဘံၭမုအလးလၧစမ့ရအၫအခိၪ လီၩ့,ၦၥုၪ့ဆၧနီၪမိၥုၪ့လၩ့ဆၧတၭ, မိအၪ့ဝ့ၫအဆၧၥၪ",
			"6": "<sup>6</sup> လီၫ.- အဂဲးဘဲၫယီၩမုလနံၩမိဘၪ လၧၦခိၭဆၧအခိၪ လီၩ့အံဖြံၫ့အလီၩ့,မိကိၭထၪ့ဝ့ၫ, ဂဲထုၪ့ဘီၪ, မွဲပလ့ၩ ၡီၩ့လၧဇံအိၫ့, လၧယဟိဝၩပယွၩအအီၪဆံၭ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, ၥံၫကျံၩဆၧလၧ ဆၧၥၭထိၬလၧစယၫကူၭအကၠီၩ့တၭ, ဒုၭကိၭၡၭထၪ့ လၧၦဆၨၩလဖၪအခိၪအကျၩ, ဒုၭနါဂၧၫ့ဆၧ,စံၭထၪ့ အၪ့အူၭတၭ,စံၭ, ယဟိဝၩဧ့, ထိးထဲၩ့တၩ့ထဲၩ့နၡၩ",
			"8": "<sup>8</sup> ခမျၧး,အံၫစရ့လၭအၡၩအီၪလၩ့ထးနီၪဆံၭ.- ယိခွါ, ယမိဂဲၫဆိၬထဲၩ့အဝ့ၫၥံၪ လၧခးလၧမုဖၩတၭ, မိအၪ့ ထုၫ့ကီၪ့အဝ့ၫၥံၪ လၧဂၪ့ခိၪအလီၩ့ ၦမ့ၬဘျီၪဒဲၦခၪ့ ဂၭဂီၩ့အီၪလၧအဝ့ၫၥံၪ, ၦမုၪလၧအဒၧၩ့ဒဲၦမုၪလၧအ ဘၪဆၧဂူၭဆၫလစီၪ့ဎးလီၫ. ၦလဒီၪ့ဖၭဒိၪမိဂဲၫထဲၩ့",
			"9": "<sup>9</sup> ထီးယီၩလီၫ.- မိဂဲၫဝ့ၫလၧအမ့ၬထံၫလၩ့တၭ, ယမိၥိၫ့ ဝ့ၫလၧဆၧအၪ့ကံၩ့အၪ့ယၫတၭ, ယမိၥိၫ့အဝ့ၫၥံၪလၧ ထံၫချိၬအနဲၩ့လၧဖၧၩ့ၥၭလီၩ့အဖၧၩ့ ထီးၦအခၪ့လ ဘၪထၧၩ့ဘၪ, အဂဲးဘဲၫယီၩ ယမွဲဖါလၧအံၫစရ့လၭ အဂးတၭ,အံဖြံၫ့မွဲယဖိၪဝဲၡါလီၫ.",
			"10": "<sup>10</sup> ခိၭနၪယဟိဝၩအလူဆံၭ, ၦဆၨၩၥံၪဧ့းတၭလီၩ လၩ့လၬလၩ့ဝ့ၫလၧမၫဆမံၭနဲၩ့အခးလဖၪ အီၪဝ့ၫလၧ အယဲၩ့ဆံၭး စံၭ,ၦလၧအမၩလၩ့ပြံၩလၩ့ပၩအံၫစရ့ လၭလဂၩနီၪ မိအၪ့ထုၫ့ကီၪ့ထဲၩ့ဝ့ၫ ဒဲယိဝ့ၫဘဲၫၦယိ",
			"11": "<sup>11</sup> ၥိၪနီၪယိအၥိၪလဒီၪ့အၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩယ ဟိဝၩဎွ့ၩန့ထဲၩ့ယူၭစယၫကူၭ, ဒဲမၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧ",
			"12": "<sup>12</sup> ၦလၧအဆီၪ့နဲၪ့အဝ့ၫအစူၪဖၧၩ့လီၫ.- အခိးမွဲအဝ့ၫၥံၪ မိဂဲၫဝ့ၫ, ဒဲၥံၫကျံၩဆၧလၧဇံအိၫ့အလးထၪ့ထီၫနီၪတၭ, မိယွၩလၩ့ဝ့ၫစီၪ့ဎး လၧယဟိဝၩအဆၧဂ့ၩအဖၧၩ့, လၧဘုၪကၠိၩ့အဂး, ဒဲလၧစဘံၭထံၫအၥၫ့အဂး,ဒဲလၧ ၥိၪၥံၪချၫၥံၪအဂး,ဒဲလၧၥိၪဒဲဘ့ၪအဂး, ဒဲလၧချီၥံၪအ ဂးလီၫ.တၭအၥၭမိမၩအၥၭ ဘဲၫဆၧၥၪအလးလၧၦ ၡီၫ့ထံၫလၧအဖၧၩ့ ဂ့ၩဘၪစဲၪအၥိၭနီၪတၭ, အဝ့ၫၥံၪ",
			"13": "<sup>13</sup> ၥၭအုၭလၧၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ၦမုၪနၩ့မိၥၭထိၬလၧ ဆၧဂဲထုၪ့လံအဖၧၩ့, ဒဲၦဖိၪၥၪခွၫဒဲၦၥၭၡါလစီၪ့ဎး လီၫ.အဂဲးဘဲၫယီၩ ယမိအၪ့လဲၩခွံၬအၥၭအုၭ လၧ အၥၭထိၬအဂး, ဒဲယမိမၩမုၬထၪ့ထဲၩ့အဝ့ၫၥံၪဒုၭၥၭ ထိၬထဲၩ့အဝ့ၫၥံၪလၧဆၧၥၭအုၭအလးနီၪလီၫ.",
			"14": "<sup>14</sup> တၭယမိဒုၭဘျဲၩအၪ့ယၡၩလုဆၧအၥၭလၧဆၧၥိၪး ဒဲယခ့ၫယၡၩခမျၧးၥံၪ မိမံၫ့ၥုၪ့မံၫ့ၥၭလၧယဆၧဂ့ၩဆၧ ဘွၩနီၪး ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ယဟိဝၩစံၭဘဲၫယီၩဆၧအၥီၫဂၧၫ့ထၪ့ဝ့ၫ လၧရၫမၫ အဖၧၩ့ဂၪ့ဆၧယၧၩ့ဆၧ, ဒဲဂၪ့ကိၭၡၭထၪ့ဆၧတၭ,နး ရၫခ့လၭဂၪ့ဝ့ၫလၧအဖိၪလဖၪအကၠီၩ့တၭ, ဒိၭဆၧမၩ မုၬထၪ့ထဲၩ့နီၪ အၥၭအီၪအ့ၬ. မွဲအဖိၪလအီၪဘၪအ",
			"16": "<sup>16</sup> ကၠီၩ့လီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ, ထုၭထဲၩ့နလူလၧဂၪ့ ကိၭဂၪ့ၡၭဆၧ, ဒဲနမ့ၬၥၪလၧအမ့ၬထံၫလၩ့နီၪဆံၭ. အ ဂဲးဘဲၫယီၩနမၩဆၧမိအီၪလၧအလံၩ့အလဲၫနီၪ, ယဟိ ဝၩစံၭဝ့ၫဒၪ. အဝ့ၫၥံၪမိဂဲၫထဲၩ့ထဲၩ့လၧဆၧအဒုၪအ",
			"17": "<sup>17</sup> ဒၩအခးဖၧၩ့လီၫ.- နဖိၪလဖၪမိဂဲၫထဲၩ့ထဲၩ့လၧအခး ဒၪဝ့ၫအနဲၩ့ထံၭနီၪ, ဆၧယိလါအီၪဝ့ၫလၧနဂးလၧယၫ လခီၫနီၪ,ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"18": "<sup>18</sup> မွဲမၬ,ယနါဂၧၫ့အံဖြံၫ့ဘၪမီၪ့ဘၪမၭတၭ, စံၭဝ့ၫဒၪ, နအၪ့ၥီၪ့ယၧၩတၭ, ယဒိၭဆၧအၪ့ၥီၪ့ဘဲၫချီဖိၪလၧအ လမၩလိၪဘၪဆၧအၥိၭနီၪလီၫ. ကၠၪထဲၩ့နၥၭလၧယ အီၪဘဲၫၥိၭယမိကၠၪယၥၭဆံၭ. အဂဲးဘဲၫယီၩနမွဲယ",
			"19": "<sup>19</sup> ဟိဝၩယယွၩလီၫ.- မွဲမၬ,လၧယကၠၪယၥၭအလးခဲၫ့ နီၪ,ယနီၫ့ယါလၩ့ထဲၩ့ယၥၭတၭ, ယဘၪဆၧၥီၪ့လိၪ ယၧၩအလးခဲၫ့နီၪ, ယဒိၪလၩ့ယကံၪဒူၪလီၫ. ယမ့ၬ မဲတၭ,မွဲမၬ,ယၥၭဘံၪဘူၪအဂဲးဘဲၫယီၩ, ယထိးယ",
			"20": "<sup>20</sup> ၥၭဘၪ့အဆၧဒုၪဒွ့ၪလီၫ.- အံဖြံၫ့ မွဲယဖိၪခွၫၥၭဘီၩ့ ဧၪးမွဲဖိၪၥၪလၧအဘၪယၥၭဧၪ. အဂဲးဘဲၫယီၩ လၧ ယချဲၩ့ဆၧထၫ့ဒၩအဝ့ၫအလးခဲၫ့နီၪ ယနၪ့ထၪ့ထဲၩ့ဒံၭ တၡါဒံၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယၥၭဘၪခိဘၪ ဝီၩလၧအဂးတၭ,ယမိယၫ့ၥၭတၡါအဝ့ၫ, ယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"21": "<sup>21</sup> အီၪက့ၪထၪ့ဖၧၩ့ၥၭအဆၧမၩနဲၪ့လၧနဂး, ဘီၩ့ထၪ့ ထုၪ့လဖၪလၧနဂး, အီၪက့ၪနၥၭလၧဖၧၩ့ၥၭမု,လၧနဂဲၫ ထဲၩ့ဖိၬဒၪလ့ၬနီၪးဂဲၫထဲၩ့ဒီၭ, အံၫစရ့လၭအမုၪနၩ့ဧ့,",
			"22": "<sup>22</sup> ဂဲၫထဲၩ့ဒီၭလၧနဒိၩ့လဖၪယီၩဆံၭ.- နမိစဲၪ့ဝံၩ့ဝၩ့ဆၧ ဆံၭယံၬလဲၪ. ဖိၪမုၪလၧအဂုၩ့ထဲၩ့အၥၭလဂၩဧ့း အ ဂဲးဘဲၫယီၩယဟိဝၩတဲၩ့လၩ့ ဆၧအၥၫ့လမံၩ့လၧဂၪ့ခိၪ ချိၫ့, ၦမုၪအီၪဖီၩ့ၦခွၫလီၫ.",
			"23": "<sup>23</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩစံၭ ဘဲၫယီၩ,ထီးယအ့ၪဒုၭဂဲၫထဲၩ့ ၦလၧအကဲၪဎီးတၭ, ၦမိစံၭဒီၭလၧယုဒၫအခးဖၧၩ့, ဒဲလၧအဒိၩ့လဖၪအ ဖၧၩ့,မွဲယဟိဝၩဆိၪဂ့ၩနၧၩဆံၭ. ဆၧတီၩအီၪအလး,",
			"24": "<sup>24</sup> ဆၧဆံၫ့ဎံၪအခိၪလီၩ့ဧ့,- ၦမၩကၩဂၪ့ခိၪလဖၪ,ဒဲၦလၧ အစဲၪ့ထၪ့လၧၥိၪလၧဘ့ၪလဖၪ, မိအီၪလၧယုဒၫအဖၧၩ့ ဒၪဝ့ၫ,ဒဲလၧအဒိၩ့ထီးအလူၬလဖၪအဖၧၩ့စီၪ့ဎးလီၫ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩ လၧဆၧပွံၭအၥၭအကၠီၩ့ ယမိဒုၭခၧၫ့ ထၪ့ၦအၥၭတၭ, ယမိဒုၭဘျဲၩအၪ့ကယဲ ၦလၧအၥၭ",
			"26": "<sup>26</sup> လၩ့ဘဲၩထီးအလူၬလီၫ.- အနီၪတၭ,ယနၪ့ထၪ့ယၥၭ တၭ,ယမံၫမုၬဒိၪမၬလီၫ.",
			"27": "<sup>27</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ,မုနံၩလဖၪဘၪဝ့ၫလၧယ မိဎွံၪလၩ့ၦၡၩအချံၫ, ဒဲဆၧဖိၪဆၧဎါအချံၫလၧအံၫစရ့",
			"28": "<sup>28</sup> လၭအဂံၪ့ဖၧၩ့, ဒဲလၧယုဒၫအဂံၪ့ဖၧၩ့လီၫ.- ဆၧမိမၩ အၥၭ,ဘဲၫယယိယူၭအဝ့ၫၥံၪနီၪ, ဘဲၫၥိၭအမိထ့ၭထၪ့ ခွံၬ,ဒဲမၩဂၭဂီၩ့, ဒဲမၩၡၪ့မၩနၭအၥိၭနီၪး ဆၧမိမၩအ ၥၭလၧယမိယိထဲၩ့အဝ့ၫၥံၪ ဘဲၫၥိၭယမိမၩထၪ့, ဒဲၥုၪ့",
			"29": "<sup>29</sup> လၩ့ဝ့ၫဘဲၫနီၪအၥိၭ, ယဟိဝၩစံၭဝ့ၫဒၪ.- ဆၧလၧမုနံၩ လဖၪနီၪ, ဖါလဖၪအၪ့စဘံၭၥၪဆဲၪ့, ဒဲဖိၪၥၪလဖၪအ",
			"30": "<sup>30</sup> ၥွၫဎံၩ့နီၪ,ၦစံၭလၧၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲၦမိၥံၫလၧအဆၧ ဒဲၩဘၭဒၪဝ့ၫအကၠီၩ့ ကိၭဂၩဒ့ၭလီၫ. ကယဲၦလၧအ အၪ့စဘံၭၥၪဆဲၪ့ လဂၩလါလါနီၪ, အၥွၫဒၪဝ့ၫမိဎံၩ့ လီၫ.",
			"31": "<sup>31</sup> ယိခွါ,ယဟိဝၩစံၭဝ့ၫဒၪ, မုနံၩလဖၪမိဘၪဝ့ၫလၧ ယမိအုၩ့လၩ့ဆၧအၥၫ့ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ,",
			"32": "<sup>32</sup> ဒဲယုဒၫအၡၩဂံၪ့ဖိၪလီၫ.- မွဲဘဲၫဆၧအုၩ့လၩ့လၧယ အုၩ့လၩ့လၧအဝ့ၫၥံၪအဖါလဖၪ, မုလနံၩလၧယဖီၪ့ ထၬအစူၪဘဲၫၥိၭယဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧခးအံဇံၭအ ဖၧၩ့အၥိၭနီၪအ့ၬ. ဆၧအုၩ့လၩ့နီၪမွဲအဝ့ၫၥံၪမၩဂၭ ဂီၩ့လီၫ.ယခွံၬၡိၭယူၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"33": "<sup>33</sup> အ့ၪမွဲအယီၩမွဲဆၧအုၩ့လၩ့လၧယမိအုၩ့လၩ့လၧအံၫ စရ့လၭအၡၩဂံၪ့ဖိၪ, ဆၧလၧမုနံၩလဖၪနီၪအလးခဲၫ့ တၭ,ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိအီၪက့ၪဆၧၥီၪ့ဆၧၥၫ့ လၧအဝ့ၫၥံၪအၥၭခံဖၧၩ့တၭ, ယမိကွ့ၭလၧအၥၭအ လီၩ့တၭ, ယမိကဲၪထၪ့အယွၩတၭ, အဝ့ၫၥံၪမိကဲၪထၪ့",
			"34": "<sup>34</sup> ယခ့ၫယၡၩလီၫ.- တၭအဝ့ၫၥံၪလမိၥီၪ့လိၪလၧၩ့ဘၪ ၦလၧအနဲၩ့ထံၭ, ဒဲအထၧၫ့ဖုဝဲလဂၩဘၪလဂၩလဂၩ ဘၪလဂၩနီၪ,စံၭ,ၥ့ၪယၫယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩ ၦမိၥ့ၪယၫယၧၩထီးအလူၬ, လၧအဆံၭထုၬထီၩ့လၧ အဒိၪထုၬ, ယဟိဝၩစံၭဝ့ၫဒၪး အဂဲးဘဲၫယီၩယမိဖျါ ခွံၬအဆၧမၪတၭ,ယနၪ့ထၪ့ထဲၩ့လၧၩ့အဆၧဒဲၩဘၭ အ့ၬ.",
			"35": "<sup>35</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ၦလၧအအီၪက့ၪၦမ့ၬလၧဆၧ ဖၩ့လၧမုဆၫအဂး, လၧအဒုၭအီၪထၪ့လၩဒဲၡၪၥံၪလၧ ဆၧဖၩ့ လၧမုနၩအဂး, လၧအမၩဂုးဖုး မၫဆမံၭလၧ အလပီၩၥီၫထၪ့ဝ့ၫနီၪ, ဆၧၥုၭမုခမျၧး အယဟိဝၩမွဲ",
			"36": "<sup>36</sup> အမံၩ့လီၫ.- ယဟိဝၩစံၭဝ့ၫဒၪ,ၥနိၫလဖၪယီၩအ့ၪစဲၪ့ ထၪ့ခွံၬလၧယမ့ၬယၫတၭ, အံၫစရ့လၭအချံၫအၥၪလ ကဲၪလၧၩ့ဘၪၦဆၨၩလၧယမ့ၬယၫ အဆိၩဆိၩအကၠၪ",
			"37": "<sup>37</sup> ကၠၪလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ,ၦထိၪမူၭခိၪလၧထၭ လခီၫ,ဒဲအၪ့ဎၬန့ဂၪ့ခိၪအခၪ့ထံၭ လၧလၬလခီၫနီၪအ့ၪ ၥ့ၪတၭ,ထီးနီၪလဖၧၫ့ယမိခွံၬၡိၭခွံၬ အံၫစရ့လၭအချံၫ အၥၫထီးအလူၬ လၧအမၩဆၧထီးအလူၬအကၠီၩ့နီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"38": "<sup>38</sup> ယိခွါ,ယဟိဝၩစံၭဝ့ၫဒၪ,မုနံၩလဖၪဘၪဝ့ၫလၧၦမိ တဲၩ့ဒိၩ့လၧယဟိဝၩအဂး, လၧဟၫနၫအ့လၭအထိၬ",
			"39": "<sup>39</sup> ထီၫဖိးလၧတရၫ့အနိၪ့လီၫ.- တၭနိၪထိၪဖျံၩမိလ့ၩထၪ့ အီၪဆဲၫဎၩ့ဝ့ၫ လၧဆၧစီၩ့ခိၪဂ့ရ့ၭတၭ, မိလ့ၩဎဲၪ့ဆၧ",
			"40": "<sup>40</sup> လၧဂိအၭလီၫ.- ၦစွၪအခိၪလီၩ့ဆူၭ ထၧၫ့ဆူၭယၫ, ဒဲ ဖံၫ့ချၪ,ဒဲဂၪ့ခိၪအဝၩ့လဖၪ ထီးအလူၬ ဖိးလၧထံၫချိၬ ကံၭဒၧၫ့,ဖိးလၧတရၫ့ကၥ့ၪအနိၪ့ လၧမုထၪ့လခီၫနီၪ, မိဆံၫ့ဎံၪထၪ့လၧယဟိဝၩအဂးတၭး ဆၧထ့ၭခွံၬလၧၩ့ အဝ့ၫၥံၪအ့ၬး ဆၧလမၩလၩ့ဎီးလၧၩ့ဘၪအဆိၩဆိၩ အကၠၪကၠၪလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩဇ့ၭဒကဲအၫ အနံၪ့ဆံၫနံၪ့လနံၪ့နီၪ, အဝ့ၫနီၪမွဲစန့ၭဘူၫခၭန့ဇၫ အနံၪ့လဆံၫဎိၭနံၪ့လနံၪ့",
			"2": "<sup>2</sup> နီၪယဟိဝၩအလူလၩ့ဘၪ စယ့ၫရမဲအၫလီၫ.- အထီ ထီးနီၪဘၭဘလၧၫ့အစဎွၩအၥုၭမုခမျၧးလဖၪဝၩ့ထၬ ယရုစလံၫ့တၭ,မီၪစယ့ၫရမဲအၫဘၪဆၧကၭဘံၭထၬ ဝ့ၫလၧထီၫ့အဝၩ့ဖၧၩ့ လၧအအီၪဝ့ၫလၧယုဒၫအစဎွၩ",
			"3": "<sup>3</sup> အဂံၪ့ဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩယုဒၫအစဎွၩဇ့ၭဒကဲ အၫကၭဘံၭထၬအဝ့ၫတၭ,စံၭဝ့ၫဒၪ, နချဲၩ့ဆၧလၧမီၪ အချိၬတၭ,နစံၭ,ယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယမိဖ့ၪ လၫ့ခွံၬဒိၩ့လဖျိၪ့ယီၩ လၧဘၭဘလၧၫ့အစဎွၩအစူၪ",
			"4": "<sup>4</sup> ဖၧၩ့တၭ,အဝ့ၫဒၪမိမၩန့ဝ့ၫလီၫ.- တၭယုဒၫအစဎွၩ ဇ့ၭဒကဲအၫဖီၩ့ဖျ့ၭ လၧၦခၫလဒံအၫအစူၪဖၧၩ့အ့ၬး မွဲ ဆၧမိဖ့ၪလၫ့ခွံၬဝ့ၫတၡါ လၧဘၭဘလၧၫ့အစဎွၩအစူၪ ဖၧၩ့တၭ,မိချဲၩ့လိၬအၥၭလၧအနိၭခီၫနိၭ, ဒဲအမ့ၬၥၪ",
			"5": "<sup>5</sup> မိဒၪဘၪအဝ့ၫဒၪအမ့ၬၥၪလီၫ.- မွဲအမိၥိၫ့စဇ့ၭဒကဲအၫ လၧဘၭဘလၧၫ့တၭ, အဝ့ၫဒၪမိအီၪထီးနီၪထီးယစ့ၩ ရၫ့အဝ့ၫ, ယဟိဝၩစံၭဝ့ၫဒၪး နၥံၪအ့ၪဒုၭၥုၭလၧၦခၫ လဒံအၫဖိၪလါနၫ့တၭ, နၥံၪမိဘီၪထၪ့ယီၫထၪ့အ့ၬ.",
			"6": "<sup>6</sup> စယ့ၫရမဲအၫစံၭဝ့ၫဒၪ, ယဟိဝၩအလူလၩ့ဘၪယၧၩ",
			"7": "<sup>7</sup> တၭ,စံၭဝ့ၫဒၪ.- ယိခွါ, နမၩ့စၡၫလၧၫ့အဖိၪခွၫစဟၫ နၫမ့ၫလၭမိဂဲၫလၧနအီၪတၭစံၭ, ဎွ့ၩန့ယဂၪ့ခိၪလဝၩ့ လၧအအီၪ လၧအၫ့အၥီၭအဖၧၩ့ လၧနဂးဒၪနဝ့ၫဆံၭၬ အဂဲးဘဲၫယီၩဆၧစ့ၩရၫ့န့ၥၫ အဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪ",
			"8": "<sup>8</sup> အီၪဝ့ၫလၧနစူၪဖၧၩ့လီၫ.- တၭယမၩ့အဖိၪခွၫစဟၫနၫ မ့လၭဂဲၫဝ့ၫလၧယအီၪလၧထီၫ့အဝၩ့ဖၧၩ့ဘဲၫယဟိဝၩ အလူအၥိၭနီၪတၭ,စံၭယၧၩ, ဎွ့ၩန့ယဂၪ့ခိၪလဝၩ့လၧ အအီၪဝ့ၫလၧအၫ့အၥီၭ လၧဘံၪ့ယမံၫ့အခးဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩဆၧစ့ၩရၫ့န့ၥၫ အဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪ အီၪလၧနစူၪဖၧၩ့လီၫ. ဎွ့ၩန့ဝ့ၫလၧနဂး ဒၪနဝ့ၫဆံၭ. ထီးနီၪလဖၧၫ့ ယၥ့ၪယၫ လၧအနီၪမွဲယဟိဝၩ အလူ လီၫ.",
			"9": "<sup>9</sup> တၭယဎွ့ၩန့ဂၪ့ခိၪလဝၩ့ လၧအအီၪဝ့ၫလၧအၫ့အ ၥီၭအဖၧၩ့လၧယမၩ့အဖိၪခွၫစဟၫနၫမ့လၭအစူၪဖၧၩ့ တၭ,ယခံၫ့စ့ၩၡက့လၭလဆံၫနွ့ၫဘံၪ့ လၧအဂးလီၫ.",
			"10": "<sup>10</sup> တၭယကွ့ၭဆၧလၧလံၬဖၧၩ့, ဒဲစဲၩနဲၪ့ထၬဒဲမၩန့ၦထိး",
			"11": "<sup>11</sup> အၥၭလဖၪတၭ, ခံၫ့စ့ၩလၧခံၫ့အဖၧၩ့လီၫ.- တၭယမၩ န့ဎွ့ၩဆၧအလံၬ အီၪစဲၩနဲၪ့ထၬ ဘဲၫဆၧအထူၫအရူၫ",
			"12": "<sup>12</sup> အၥိၭ,ဒဲလံၬလၧအအီၪဖျီၪလဘံၪ့လီၫ.- ယဖ့ၪလၫ့ဎွ့ၩ ဆၧအလံၬလဘံၪ့နီၪ, လၧစမၫအစဲအၫအဖိၪခွၫစနံၫ ရဲအၫနီၪအဖိၪခွၫ စဘၫရၧၭလၧယမၩ့အဖိၪခွၫ စဟၫ နၫမ့လၭအမ့ၬယၫဒဲလၧၦထိးအၥၭလၧအကွ့ၭအမံၩ့ လၧလံၬဎွ့ၩဆၧအလီၩ့လဖၪအမ့ၬယၫ, ဒဲလၧကယဲၦ ယုဒၫဖိၪလၧအဆၧၫ့နၩ့ လၧထီၫ့အဝၩ့ဖၧၩ့အမ့ၬယၫ",
			"13": "<sup>13</sup> ထီးအလူၬလီၫ.- ယမၪလူၬစဘၫရၧၭလၧအဝ့ၫၥံၪအ",
			"14": "<sup>14</sup> မ့ၬယၫတၭ,ယစံၭ,- ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫ စရ့လၭအယွၩ,စံၭဘဲၫယီၩ, မၩန့လံၬလဖၪယီၩဆံၭး ဎွ့ၩဆၧလၧအလံၬဘၪစဲၩနဲၪ့ထၬအၥၭလဘံၪ့, ဒဲလံၬ အီၪဖျီၪနီၪနံၫဘံၪ့လူၬတၭ, အီၪက့ၪဝ့ၫလၧဖၧၩ့ဂၪ့ခိၪ အဖၧၩ့,ဘဲၫၥိၭ အမိအီၪအၪနံၩအၪၥၫ့အဂဲးနီၪဆံၭ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭ အယွၩစံၭဘဲၫယီၩ, ဂံၪ့ၥံၪဎၫ့ၥံၪဒဲဂၪ့ခိၪအဝၩ့,ဒဲစဘံၭ ၥၪအလးနီၪ ၦမိဎွ့ၩန့ဒံၭဝ့ၫ လၧခးလဘံၪ့ယီၩအဖၧၩ့ လီၫ.",
			"16": "<sup>16</sup> တၭလၧယဖ့ၪလၫ့ဎွ့ၩဆၧအလံၬ လၧစနံၫရဲအၫအ ဖိၪခွၫစဘၫရၧၭအစူၪဖၧၩ့အလးခဲၫ့နီၪ, ယဘၩဆိၪဖၪ",
			"17": "<sup>17</sup> ယဟိဝၩတၭ,ယစံၭ,- ကဆါယဟိဝၩဧ့,ယိခွါ,နတဲၩ့ လၩ့ဂၪ့ခိၪဒဲမူၭခိၪလၧနစီၩ့ဒိၪနမၩ့ထီၫ,ဒဲနစူၪယူၬထၪ့",
			"18": "<sup>18</sup> အၥၭလီၫ.ဆၧကၪလၨၪအီၪလၧနဂးနးမံၩ့အ့ၬ.- နဒုၭ နဲၪဆၧအဲၪအခိးအတၩလၧၦအထီၫ့လဖၪ, ဒဲနမၩဆၧၫ့ ထဲၩ့ဖါလဖၪအဆၧအၧၩ့လၧအဖိၪလဖၪလၧအလးခဲၫ့ နီၪအၥၭနၫၡါအဖၧၩ့လီၫ. ဆၧအဒိၪ, ဆၧဆီၪ့ယွၩ,",
			"19": "<sup>19</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩနီၪး မွဲအမံၩ့တၭ.- ဒိၪဝ့ၫ လၧဆၧကိၪ့လိၬအဖၧၩ့, ဒဲဆၧစီၩ့ဆၧမၩ့အီၪလၧမၩ ဆၧအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ နမ့ၬၥၪအီၪဝဲထၪ့အ ၥၭ,လၧၦၡၩၥံၪအဖၧၩ့ၥၭထီးအလူၬအလီၩ့း ဘဲၫၥိၭ နမိဖ့ၪလၫ့ ၦကိၭဂၩဒ့ၭဆုၬဆုၬ ဘဲၫအဖၧၩ့ၥၭအၥိၭ,",
			"20": "<sup>20</sup> ဒဲဘဲၫအမၩဆၧအဆၧၥၪအၥိၭနီၪ,- နအီၪက့ၪဆၧမၩ နဲၪ့ဒဲဆၧလၩ့လၭလဖၪ လၧခးအံဇံၭအဖၧၩ့ထီးမုဆၫ လနံၩယီၩ,ဒဲလၧအံၫစရ့လၭအကျၩ, ဒဲလၧၦၡၩအဂူၫ ဂၩလဖၪအကျၩ, ဒဲအီၪက့ၪထၪ့နမံၩ့ ထီးမုဆၫလနံၩ",
			"21": "<sup>21</sup> ယီၩလီၫ.- အဂဲးဘဲၫယီၩ နဒုၭစဲၪ့ထၪ့နၡၩခမျၧးအံၫ စရ့လၭအီၪလၧခးအံဇံၭအဖၧၩ့ အီၪလၧဆၧမၩနဲၪ့ ဒဲဆၧလၩ့လၭလဖၪလၧနစူၪဆီၪ့, ဒဲနစူၪယူၬထၪ့အၥၭ,",
			"22": "<sup>22</sup> ဒဲဆၧမၩၥၭမဲၪအလးဖၭဒိၪလီၫ.- တၭနဖ့ၪလၫ့ယူၭ အဝ့ၫၥံၪလၧခးလဘံၪ့ယီၩ လၧနဆိၪလၩ့နၥၭလၧအဝ့ၫ ၥံၪအဖါလဖၪလၧနမိဖ့ၪလၫ့အဝ့ၫၥံၪ လၧခးလဘံၪ့လၧ",
			"23": "<sup>23</sup> အယွၩလၩ့ဝ့ၫလၧဆၧနူထံၫဒဲန့ၫစၩ့လီၫ.- တၭအဝ့ၫ ၥံၪဂဲၫနုၬန့ၥၫဝ့ၫလီၫ. မွဲလါနၫ့တၭ, လခိၭနၪဘၪနလူ ဒဲလ့ၩလၧနဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ၥၭဖၧၩ့နီၪဆ့အ့ၬး က ယဲဆၧလၧနမၪလူၬဝ့ၫလၧအမိဘၪမၩနီၪ, အဝ့ၫၥံၪမၩ နးမံၩ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ,နဒုၭဘၪအဝ့ၫၥံၪလၧ",
			"24": "<sup>24</sup> ဆၧအၧၩ့ယီၩထီးအလူၬလီၫ.- ယိခွါ, ဆၧစီၩ့ခိၪပဒၩ့ ဘီၪ,အဝ့ၫၥံၪဂဲၫထီၩ့လၧဒိၩ့ဘဲၫၥိၭ အမိမၩန့ဝ့ၫတၭ, ဆၧဖ့ၪလၫ့ဒိၩ့ လၧၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့ လၧအ ဒုၭဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧ ဆၧၥံၫချဲၫ့လီၫ. ဆၧလၧနချဲၩ့ယူၭနီၪ, ဆၧမၩကဲၪထၪ့",
			"25": "<sup>25</sup> ယူၭအၥၭတၭ,ယိခွါ, နဒၪဘၪနဝ့ၫလီၫ.- မွဲလါနၫ့, ကဆါယဟိဝၩဧ့,နစံၭယူၭယၧၩ, ဎွ့ၩန့ဂၪ့ခိၪအဝၩ့ လဘံၪ့ယီၩလၧစ့ၩတၭ, မၩၦထိးအၥၭဆံၭ.မွဲလါနၫ့ ဘဲၫနီၪတၭ, ဆၧဖ့ၪလၫ့ခွံၬဒိၩ့ လၧၦခၫလဒံအၫဖိၪအ စူၪဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫ",
			"27": "<sup>27</sup> တၭ,စံၭဝ့ၫဒၪ,- ယိခွါ,ယၧၩယဟိဝၩယီၩ,ယမွဲဆၧ ဖံၭဆၧယၪ ထီးအလူၬအယွၩတၭ, ဆၧကၪလၨၪလ",
			"28": "<sup>28</sup> မံၩ့မံၩ့အီၪလၧယဂးဘၪမိၥ့ၪဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိဖ့ၪလၫ့ခွံၬဒိၩ့လဒိၩ့ ယီၩလၧၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့, ဒဲလၧဘၭဘလၧၫ့ အစဎွၩန့ၭဘူၫခၭန့ဇၫအစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမိမၩ",
			"29": "<sup>29</sup> န့ဝ့ၫလီၫ.- တၭၦခၫလဒံအၫဖိၪ လၧအမိဒုၭဆၧထၫ့ဒၩ ဒိၩ့ယီၩ,မိဂဲၫဆူၭခဲၩထၪ့ဒိၩ့ယီၩလၧမ့ၪတၭ, ဆူၭထၪ့ ခွံၬဝ့ၫ,ဒဲဂံၪ့လဖၪလၧၦဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧဘၫအ လၭအဂးနီၪ, ဒဲလူၫလၩ့ဆၧလုအီၩ လၧယွၩအဂူၫဂၩ အဂးလၧအခိၪအလီၩ့ ဘဲၫၥိၭအမိထိၪဂဲၩယၥၭထၪ့",
			"30": "<sup>30</sup> လီၫ.- အဂဲးဘဲၫယီၩၦအံၫစရ့လၭဖိၪ,ဒဲၦယုဒၫဖိၪမၩ န့ဆၧအၧၩ့လၧယမ့ၬယၫခီၫ လၧအဖိၪၥၪခွၫထၪ့လီၫ. အဂဲးဘဲၫယီၩၦအံၫစရ့လၭဖိၪမၩန့ ဆၧထိၪဂဲၩယၥၭ ထၪ့လၧအစူၪမၩဆၧအကၠီၩ့လီၫ. ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"31": "<sup>31</sup> အဂဲးဘဲၫယီၩဒိၩ့လဖျိၪ့ယီၩ မွဲလၧယၥၭထၪ့ဘၪအ လး,ဒဲယၥၭခဲၩထၪ့ဘၪအလး ခီၫလၧမုလနံၩ လၧၦ တဲၩ့ဝ့ၫ ထီးမုဆၫလနံၩယီၩး ဘဲၫၥိၭ ယမိၥုၭခွံၬဝ့ၫ,",
			"32": "<sup>32</sup> လၧယမ့ၬယၫ,- လၧၦအံၫစရ့လၭဖိၪ,ဒဲၦယုဒၫဖိၪအ ဆၧအၧၩ့ထီးအလူၬအကၠီၩ့, လၧအမၩဝ့ၫဘဲၫၥိၭအမိ ထိၪဂဲၩယၥၭထၪ့, အဝ့ၫၥံၪဒဲအစဎွၩၥံၪ အၦဒိၪဖၭ ဒိၩၥံၪဒဲအၡၩလုဆၧလဖၪ, ဒဲအမီၪလဖၪ, ဒဲယုဒၫအၡၩ ၥံၪဒဲၦယရုစလံၫ့ဖိၪလဖၪနီၪလီၫ.",
			"33": "<sup>33</sup> အဂဲးဘဲၫယီၩအဝ့ၫၥံၪကၠၪဒိၭချိၫ့အၥၭ လၧယမ့ၬ ယၫတၭ,မွဲအကၠၪအမ့ၬလၧယအီၪအ့ၬ. ယၥီၪ့လိၪအ ဝ့ၫၥံၪ,ယဂဲထုၪ့ဂီၩဂီၩ,ယၥီၪ့လိၪလါနၫ့တၭ,မွဲအခိၭ",
			"34": "<sup>34</sup> နၪဝ့ၫဘဲၫယၥီၪ့လိၪဆၧအၥိၭနီၪအ့ၬ.- မွဲအအီၪက့ၪအ ဝ့ၫၥံၪအဆၧၥၭလိၪလဖၪ လၧဂံၪ့ဖၧၩ့လၧဆၧကိၭဝ့ၫ",
			"35": "<sup>35</sup> လၧယမံၩ့ဘဲၫၥိၭအမိမၩစံၪစၪဝ့ၫလီၫ.- တၭအဝ့ၫၥံၪ မၩထၪ့ဘၫအလၭထၪ့ထီၫ လၧစဟံၪ့နၧၫ့အဖိၪခွၫအ ခိၪလီၩ့ဆူၭဖၧၩ့နီၪ, ဘဲၫၥိၭအမိဒုၭခၫ့ဂၬအဖိၪမုၪၥံၪ, ဒဲအဖိၪခွၫၥံၪလၧမ့ၪလၧမိလ့ၭအဂး,လၧယလမၪလူၬ ဘၪအဝ့ၫၥံၪ, ဒဲလအီၪထၪ့ဘၪလၧယၥၭခံဖၧၩ့တၭ, မၩဝ့ၫလၧဆၧၥၭလိၪလမံၩ့နီၪ ဘဲၫၥိၭအမိဒုၭမၩမၪၦ ယုဒၫဖိၪလီၫ.",
			"36": "<sup>36</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩအံၫစ ရ့လၭအယွၩစံၭဆၧလၧဒိၩ့ လဖျိၪ့ယီၩ လၧနၥံၪစံၭ, ဆၧမိဖ့ၪလၫ့ခွံၬဝ့ၫ လၧဘၭဘလၧၫ့အစဎွၩအစူၪဖၧၩ့ လၧနၭၥံၪဖၩ့ၥံၪ, ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧဆၧၥံၫ",
			"37": "<sup>37</sup> ချဲၫ့အဂးနီၪ, အဂဲးအကၠီၪ့ဘဲၫယီၩ,- ယိခွါ,ယမိအၪ့ ထုၫ့ကီၪ့ဒိၩ့ဖိၪ လၧခးထီးအလူၬအဖၧၩ့ လၧယနၫ့ထၪ့ ဒုၭအီၪအဝ့ၫၥံၪလၧယၥၭထၪ့, ဒဲယၥၭခဲၩထၪ့, ဒဲယ ၥၭခိလူၬတၭ,ယမိဒုၭဂဲၫထဲၩ့ဒီၭအဝ့ၫၥံၪ လၧဆၧအ လးထီးယီၩတၭ, ယမိဒုၭအီၪဂုးခၧၫ့အဝ့ၫၥံၪလၧဆၧ",
			"38": "<sup>38</sup> န့ၥၫအလးလီၫ.- အဝ့ၫၥံၪမိကဲၪထၪ့ယၡၩခမျၧးတၭ,",
			"39": "<sup>39</sup> ယမိကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ.- ယမိဖ့ၪလၫ့အဝ့ၫ ၥံၪအၥၭလဖျိၪ့ဎး ဒဲအဖၧၩ့ၥၭလဘီၩ့ဎး, ဘဲၫၥိၭအမိ ၥၭမဲၪယၧၩလၩ့ဆိၩလၩ့ကၠၪ လၧအဆၧဂ့ၩအဂးဒဲလၧ",
			"40": "<sup>40</sup> အဖိၪၥံၪလၧခဲၫ့အဂးလီၫ.- တၭယမိအုၩ့လၩ့အဆိၩ အကၠၪလၧအဝ့ၫၥံၪ, ဒဲမၩအဝ့ၫၥံၪလၧဆၧဂ့ၩနီၪ, ယ ကၠၪခွံၬယၥၭ လၧအအီၪအ့ၬ. တၭယမိအီၪက့ၪဆၧ ၥၭမဲၪလၧအဝ့ၫၥံၪအၥၭခံဖၧၩ့ ဘဲၫၥိၭအထီးစဲၪ့ဖၭ",
			"41": "<sup>41</sup> လၧယၧၩလဂ့ၩး- မွဲမၬယမိၥၭထိၬလၧအဖၫ့ခိၪဘဲၫ ၥိၭယမိမၩဂ့ၩအဝ့ၫၥံၪ, ယမိၥုၪ့လၩ့ဝ့ၫလၧခးလဘံၪ့ ယီၩအဖၧၩ့တၡါလ့ၬ, လၧယၥၭထၧၫ့ဖျိၪ့ယၫ ဒဲလၧ ယၥၭၡီၩ့ထီးအလူၬလီၫ.",
			"42": "<sup>42</sup> အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၫယဒုၭဘၪ ၦခမျၧးယီၩ လၧဆၧအၧၩ့ဖၭဒိၪထီးအလူၬအၥိၭနီၪ, ယမိဒုၭဘၪအဝ့ၫၥံၪလၧကယဲဆၧဂ့ၩ လၧယလီၩဘၪ",
			"43": "<sup>43</sup> ဝဲၩအဝ့ၫၥံၪဘဲၫနီၪၥိၭထီးအလူၬဆ့လီၫ.- တၭၦမိဎွ့ၩ န့ဂၪ့ခိၪအဝၩ့လဖၪ လၧခးလဘံၪ့ယီၩအဖၧၩ့လၧနၥံၪ စံၭလၧအဂဲး, ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, လအီၪ ဘၪလၧအဖၧၩ့ဒဲအအီၪယူဝ့ၫနီၪ, ဆၧဖ့ၪလၫ့ခွံၬဝ့ၫလၧ",
			"44": "<sup>44</sup> ၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့နီၪလီၫ.- တၭၦဎွ့ၩန့ဂၪ့ခိၪ အဝၩ့လဖၪလၧစ့ၩ, ဒဲကွ့ၭအမံၩ့လၧလံၬဖၧၩ့ဒဲစဲၩနဲၪ့ ထၬဝ့ၫ,ဒဲမၩန့ၦထိးအၥၭ လၧစဘံၪ့ယမံၫ့အခးဖၧၩ့, ဒဲလၧဆၧအလးအီၪဝၬဖီၩ့ ယရုစလံၫ့လၧခီၫ့, ဒဲလၧ ယုဒၫအဒိၩ့လဖၪအဖၧၩ့, ဒဲလၧခိၪလီၩ့ထိၩ့ချိၬအဒိၩ့ လဖၪအဖၧၩ့,ဒဲလၧခိၪလီၩ့ဆူၭအဒိၩ့လဖၪအဖၧၩ့, ဒဲ လၧမုခံၫ့အဒိၩ့လဖၪအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩယမိ ဒုၭဂဲၫထဲၩ့ထဲၩ့အဝ့ၫၥံၪ အဆၧအၪ့မၧၫ့ဎီးဝ့ၫ, ယဟိ ဝၩစံၭဝ့ၫဒၪ."
		},
		"33": {
			"1": "<sup>1</sup> မၩဒီၭလဖၧၫ့ လၧစယ့ၫရမဲအၫအီၪကၭဘံၭထၬဒံၭ အၥၭလၧထီၫ့အဝၩ့ဖၧၩ့နီၪ, ယဟိဝၩအလူလၩ့ဘၪအ",
			"2": "<sup>2</sup> ဝ့ၫနံၫဖၧၫ့လဖၧၫ့တၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩလၧအမၩ ဆၧဘဲၫယီၩ, ယဟိဝၩလၧအမၩကဲၪထၪ့ဝ့ၫ ဘဲၫၥိၭအ",
			"3": "<sup>3</sup> မိဒုၭအီၪခၧၫ့ဝ့ၫး ယဟိဝၩမွဲအမံၩ့လီၫ.- ကိၭထၪ့ ယၧၩဆံၭ,ယမိစံၭဆၧၫ့နၧၩတၭ, ယမိဒုၭနဲၪနၧၩလၧ ဆၧအဒိၪအထီၫ, ဒဲဆၧလၩ့လၭလဖၪ, လၧနလၥ့ၪ",
			"4": "<sup>4</sup> ယၫဘၪလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩအံၫစရ့လၭအ ယွၩစံၭဘဲၫယီၩ, လၧဒိၩ့ယီၩအဂံၪ့လဖၪအဂဲး, ဒဲလၧ ယုဒၫအစဎွၩလဖၪအဂံၪ့အဂဲး လၧအဘၪဆၧမၩဂၭ",
			"5": "<sup>5</sup> ဂီၩ့ခွံၬဝ့ၫလၧဆၧစီၩ့ခိၪပဒၩ့ၥံၪ, ဒဲလၧနၭနီၪး- ၦဂဲၫဒုၭ ဆၧလၧၦခၫလဒံအၫဖိၪအၥိၭ ဘဲၫၥိၭအမိမၩဎွ့ၩဆၧ လၧၦၡၩအစွၪလၧယမၩၥံၫဝ့ၫ လၧယၥၭထၪ့, ဒဲလၧ ယၥၭခဲၩထၪ့လီၫ. အဂဲးဘဲၫယီၩ မွဲလၧၦထီးအလူၬ အဆၧဒဲၩဘၭအကၠီၩ့တၭ, ယအီၪက့ၪၥူၪယမ့ၬလၧ",
			"6": "<sup>6</sup> ဒိၩ့ယီၩလီၫ.- ယိခွါ, ယမိဒုၭအီၪဆီၪ့အီၪချဲၫ့အဝ့ၫၥံၪ, ယမိမၩဘျၪထဲၩ့အဝ့ၫၥံၪ, ယမိမၩဖျီၪထၪ့ဆၧဘၪလိၬ အိၭလိၬ, ဒဲဆၧမွဲဆၧတီၩအၪအၪလ့ၬ လၧအမ့ၬယၫ",
			"7": "<sup>7</sup> လီၫ.- တၭယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ၦယုဒၫအဆၧအၪ့မၧၫ့ ဎီးဝ့ၫးဒဲအံၫစရ့လၭလၧအဆၧအၪ့မၧၫ့ဎီးဝ့ၫတၭ, ယ",
			"8": "<sup>8</sup> မိမၩထၪ့အဝ့ၫၥံၪဘဲၫအခၪ့ထံၭအၥိၭနီၪ,- ယမိၥူၫဝၭ ဆံၫ့ဆၧမၪလၧအလီၩ့, ထီးအလူၬလၧအမၩမၪဘၪ ယၧၩတၭ,ယမိဖျါခွံၬအဆၧဒဲၩဘၭထီးအလူၬ, လၧ",
			"9": "<sup>9</sup> အမၩမၪဘၪယၧၩ,ဒဲလၧအပိၩ့ထၪ့ယၧၩလီၫ.- တၭ ဆၧမိကဲၪထၪ့ဆၧၥုၪ့ဎွံၫၥၭယီၫအမံၩ့လၧယဂး, ဆၧ စံၭထၪ့အၪ့အူၭအလး, ဒဲဆၧလၩဖၩ့အလး, လၧၦ ဆၨၩလၧဂၪ့ခိၪချိၫ့ ထီးအလူၬအမ့ၬယၫ, လၧအနါ ဂၧၫ့ကယဲဆၧဂ့ၩ လၧယမၩအဝ့ၫၥံၪလီၫ. တၭအဝ့ၫ ၥံၪမိၥၭမဲၪဝ့ၫ, ဒဲဝၭထိၬဝ့ၫလၧဆၧဂ့ၩ ထီးအလူၬအ ကၠီၩ့,ဒဲလၧဆၧဘီၪဆၧယီၫထီးအလူၬအကၠီၩ့, လၧယ ဒုၭဘၪအဝ့ၫၥံၪလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧအလးယီၩလၧနၥံၪစံၭလၧ အဂဲး, ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, အီၪလၧအဖၧၩ့ အ့ၬ. အီၪယူဝ့ၫနီၪ လၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့, ဒဲ လၧယရုစလံၫ့အဖၧၩ့ၥၭလဖၪအဖၧၩ့ထီးၦၡၩလအီၪ ဘၪ,ထီးၦအီၪဝ့ၫမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ လအီၪ",
			"11": "<sup>11</sup> ဘၪ,အီၪယူဝ့ၫနီၪ, ဆၧမိနါဂၧၫ့ဒီၭလၧအဖၧၩ့,- ဆၧၥုၪ့ ဎွံၫၥၭယီၫအၥီၫ,ဒဲတလၭမူၭမုၪအလူ,ဒဲတလၭမူၭခွၫ အလူ, ၦအလူလၧအစံၭ, စံၭထၪ့အၪ့အူၭဆၧၥုၭမု ခမျၧးအယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩမွဲယဟိဝၩဂ့ၩ ဝ့ၫလီၫ.မွဲအခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪအဂဲး လီၫ.ၦအလူဒၪလ့ၬ လၧအဂဲၫဆိၬဆၧလုစံၭထၪ့အၪ့ အူၭလၧယဟိဝၩအဂံၪ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩယ မိဒုၭဂဲၫထဲၩ့ၦခးဖိၪလၧအလ့ၩကဲၪဎီး, ဘဲၫလၧအခၪ့",
			"12": "<sup>12</sup> ထံၭအၥိၭနီၪးယဟိဝၩစံၭဝ့ၫဒၪ.- ဆၧၥုၭမုခမျၧးအ ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧအလးထီးယီၩလၧၦၡၩမွဲ ဂ့ၩ,ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, လအီၪဘၪတၭ,အီၪယူဝ့ၫနီၪ, ၦယိၥိၪလၧအဒုၭခိၬလၩ့အၥိၪ, အဘ့ၪလဖၪအအီၪ အလးနီၪ, မိအီၪဒီၭဝ့ၫလၧအဒိၩ့လဖၪထီးအလူၬအ",
			"13": "<sup>13</sup> ဖၧၩ့နီၪလီၫ.- လၧခိၪလီၩ့ထိၩ့ချိၬအဒိၩ့လဖၪ, လၧဆၧ ပျၩ့ဖၧၩ့အဒိၩ့လဖၪ, ဒဲလၧမုခံၫ့အဒိၩ့လဖၪ, ဒဲလၧ စဘံၪ့ယမံၫ့အခးဖၧၩ့, ဒဲလၧဆၧအလးအီၪဝၬဖီၩ့ယ ရုစလံၫ့လၧခီၫ့ဒဲလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့နီၪ, ၥိၪဒဲ ဘ့ၪလဖၪမိလ့ၩဒီၭလၧၦလၧအဝံထၪ့နၬထၪ့ဝ့ၫ အစူၪ ဖၫ့လၬနီၪးယဟိဝၩစံၭဝ့ၫဒၪ.",
			"14": "<sup>14</sup> ယဟိဝၩစံၭဝ့ၫဒၪ,ယိခွါ, မုနံၩလဖၪမိဘၪဝ့ၫလၧ ယမိမၩဆၧဂ့ၩလမံၩ့လၧယစံၭဝဲၩၦအံၫစရ့လၭဖိၪ, ဒဲ",
			"15": "<sup>15</sup> ၦယုဒၫဖိၪလီၫ.- ဆၧလၧမုနံၩလဖၪ,ဒဲဆၧလၧအဆၧၫ့ အထီနီၪ, ယမိဒုၭမဲၪထၪ့ဆၧတီၩအထဲၩ့လထဲၩ့လၧ စဒၫဝံၭတၭ, အဝ့ၫဒၪမိမၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့",
			"16": "<sup>16</sup> လၧဂၪ့ခိၪချိၫ့လီၫ.- လၧမုနံၩလဖၪနီၪယုဒၫမိထီၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫတၭ, ယရုစလံၫ့မိအီၪလၧဒိၭ နဲၩ့အၥၭအလးတၭ, အယီၩဆၧမိကိၭဝ့ၫယဟိဝၩပ",
			"17": "<sup>17</sup> ဆၧတီၩဆၧလီၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭ ဘဲၫယီၩ, စဒၫဝံၭအၦၡၩလၧအမိဆၧၫ့နၩ့လၧအံၫစရ့ လၭအဂံၪ့အလးဆီၩ့ဆီအဖၫ့ခိၪနီၪမိအီၪဝ့ၫအဆိၩအ",
			"18": "<sup>18</sup> ကၠၪလီၫ.- ၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫဖိၪၥံၪလၧအလုထၪ့ ဆၧလုမ့ၪ, ဒဲဆူၭခဲၩဆၧမၩဘိၪ့ကိၪမုၬ,ဒဲလုထၪ့ဆၧ ကိၭမုနံၩဒ့ၭနီၪ, မိအီၪဝ့ၫလၧယမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> ယဟိဝၩအလူလၩ့ဘၪ စယ့ၫရမဲအၫတၭ,စံၭဝ့ၫ",
			"20": "<sup>20</sup> ဒၪ,- ယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪမၩဂၭဂီၩ့ယဆၧအုၩ့ လၩ့လၧမုဆၫဆၫ, ဒဲယဆၧအုၩ့လၩ့လၧမုနၩနၩ,ထီး မုနံၩဒဲမုနၩလအီၪဘၪ လၧအဆၧၫ့အထီနီၪအ့ၪၥ့ၪ",
			"21": "<sup>21</sup> တၭ,- ထီးနီၪလဖၧၫ့ယဆၧအုၩ့လၩ့ လၧယခ့ၫယၡၩ စဒၫဝံၭအဖိၪခွၫလကဲၪဘၪစဎွၩ လၧအလးဆီၩ့ဆီအ ဖၫ့ခိၪးဒဲယဆၧအုၩ့လၩ့လၧယခ့ၫယၡၩ ၦလံဝဲၫဖိၪ ၥံၪဒဲၦလုဆၧနီၪဂၭဂီၩ့မိၥ့ၪဆ့လီၫ.",
			"22": "<sup>22</sup> ဘဲၫၦဝံထၪ့နၬထၪ့မူၭခိၪအၥုၭမုခမျၧး လၥ့ၪဘၪအ ၥိၭနီၪ, ဒဲဘဲၫမၫဆမံၭအမ့ၭၦတိၪ့ဝ့ၫလၥ့ၪဘၪအၥိၭ, ယမိမၩအၪထၪ့ယခ့ၫယၡၩ စဒၫဝံၭအချံၫအၥၪ ဒဲၦ လံဝဲၫဖိၪလၧအမၩယဆၧဘဲၫနီၪၥိၭလီၫ.",
			"23": "<sup>23</sup> မၩဒီၭလဖၧၫ့ယဟိဝၩအလူလၩ့ဘၪ စယ့ၫရမဲအၫ",
			"24": "<sup>24</sup> တၭ,စံၭဝ့ၫဒၪ,- ဆၧလၧၦခမျၧးယီၩချဲၩ့ဆၧ, ဒဲစံၭၦ နံၫဒီၪ့လၧယဟိဝၩရွံန့ဝ့ၫတၭ, ဆၧခွံၬၡိၭခွံၬယူၭနီၪး နဆီၫ့မီၪ့အ့ၬဧၪ. တၭအဝ့ၫၥံၪမၩကြၩ့ထမး ယၡၩ ခမျၧးဘဲၫအလမွဲလၧၩ့ဘၪ ၦဆၨၩလၧအမ့ၬယၫအ",
			"25": "<sup>25</sup> ၥိၭနီၪလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ, ယဆၧအုၩ့လၩ့လၧ မုဆၫဆၫဒဲလၧမုနၩနၩ, အ့ၪလအီၪလၧၩ့ဘၪယအ့ၪ",
			"26": "<sup>26</sup> လအီၪက့ၪဘၪမူၭခိၪဒဲဂၪ့ခိၪအၥနိၫလဖၪတၭ,- ထီး နီၪလဖၧၫ့ ယမိခွံၬၡိၭစယၫကူၭအချံၫအၥၪ, ဒဲယခ့ၫ ယၡၩစဒၫဝံၭ, ဘဲၫၥိၭယမိမၩန့အချံၫအၥၪ, လၧၦ ပၧၩ့စအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭအချံၫအၥၪ အဂးနီၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩယမိဒုၭဂဲၫထဲၩ့ထဲၩ့အ ဆၧအၪ့မၧၫ့ဎီးဝ့ၫတၭ, ယမိယၫ့ၥုၪ့ယၫ့ၥၭအဝ့ၫၥံၪ လီၫ."
		},
		"34": {
			"1": "<sup>1</sup> ထီးဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ, ဒဲအၥုၭမု ထီးအလူၬ, ဒဲဂၪ့ခိၪအဘၩ့အမုးလၧအပၧၩ့ဝ့ၫထီးအ လူၬ,ဒဲၦဆၨၩလဖၪထီးအလူၬ, ဒုၭဆၧထၫ့ဒၩယရုစ လံၫ့,ဒဲအဒိၩ့လဖၪတၭ,ယဟိဝၩအလူလၩ့ဘၪစယ့ၫ",
			"2": "<sup>2</sup> ရမဲအၫတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဘဲၫယီၩ, လ့ၩချဲၩ့ဆၧလၧယုဒၫအစဎွၩ,စဇ့ၭဒကဲ အၫတၭ,စံၭဝ့ၫ, ယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ,ယမိဖ့ၪ လၫ့ဒိၩ့ယီၩ လၧဘၭဘလၧၫ့အစဎွၩ အစူၪဖၧၩ့တၭ,",
			"3": "<sup>3</sup> အဝ့ၫဒၪမိဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪ,- နဖီၩ့ဖျ့ၭဘၪလၧအ စူၪဖၧၩ့အ့ၬ. ဆၧမိဖီၪ့န့နၧၩတၡါ, ဒဲမိဖ့ၪလၫ့ခွံၬနၧၩ လၧအစူၪဖၧၩ့တၭ, နမ့ၬၥၪမိဒၪဘၪဘၭဘလၧၫ့စဎွၩ အမ့ၬၥၪ,ဒဲအဝ့ၫဒၪအနိၭမိချဲၩ့ဆၧလၧနနိၭတၭ, နမိ",
			"4": "<sup>4</sup> ဘၪလ့ၩထီၩ့လၧဘၭဘလၧၫ့နီၪလီၫ.- မွဲလါနၫ့ခိၭနၪ ယဟိဝၩအလူ, ယုဒၫအစဎွၩဇ့ၭဒကဲအၫဧ့,ယဟိ",
			"5": "<sup>5</sup> ဝၩစံၭလၧနဂဲးဘဲၫယီၩ, နမိၥံၫဘၪလၧနၭအ့ၬ.- နမိၥံၫ လၧဆၧမုၬဆၧဎၩ့အဖၧၩ့တၭ, ဘဲၫလၧနဖါလဖၪ,စဎွၩ ၥံၪလၧဖျိၩ့အၥိၭနီၪ, လၧအအီၪဝ့ၫလၧနလချႃၭအီၪဒံၭ ဘၪဆၧဆူၭခဲၩနၧၫ့မၧၫ့နီၪ ၦမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့ဘဲၫ နီၪၥိၭလၧနဂး,မိဂၪ့ဝ့ၫလၧနကၠီၩ့တၭ, စံၭဝ့ၫ,အၩလါ, ကဆါဧ့ၬနီၪလီၫ. မွဲမၬ,ယချဲၩ့ယူၭဆၧချဲၩ့ယူၭ, ယ ဟိဝၩစံၭဝ့ၫဒၪ.",
			"6": "<sup>6</sup> ထီးဘၭဘလၧၫ့ အစဎွၩအၥုၭမုခမျၧးဒုၭဆၧထၫ့ ဒၩယရုစလံၫ့,ဒဲယုဒၫအဒိၩ့ထီးအလူၬ လၧအအီၪလၩ့",
			"7": "<sup>7</sup> ထးလၧလၫခ့ၭ, ဒဲအဇံကၫတၭ,- ထီးနီၪလဖၧၫ့မီၪစ ယ့ၫရမဲအၫလီၩဘၪ ယုဒၫအစဎွၩဇ့ၭဒကဲအၫလၧဆၧ ချဲၩ့ထီးအလူၬနီၪ လၧယရုစလံၫ့အဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩဒိၩ့လဖၪနီၪ အီၪဝ့ၫလၧအခိၪဒၧၩ့နီၪအီၪလၩ့ ထးဝ့ၫလၧယုဒၫအဒိၩ့အကျၩလီၫ.",
			"8": "<sup>8</sup> လၧစဎွၩဇ့ၭဒကဲအၫအုၩ့လၩ့ ဆၧလၧၦခမျၧးထီးအ လူၬအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ဘဲၫၥိၭအမိကိၭထၪ့",
			"9": "<sup>9</sup> ဆၧမၩဖီၩ့ဖျ့ၭဝ့ၫး- ၦကိၭဂၩဒ့ၭမိဖျါခွံၬလဂၩ အဎီး ခွၫ,ဒဲလဂၩအဎီးမုၪ, လၧအမွဲၦဟံဘြူၫဖိၪခွၫဂ့ၩ, ၦဟံဘြူၫဖိၪမုၪဂ့ၩ, ဘဲၫၥိၭၦဟံဘြူၫဖိၪၥံၪထီးအၪ့ မၧၫ့ဎီးအထၧၫ့ဖုဝဲလဂ့ၩ, အလးခဲၫ့နီၪယဟိဝၩအလူ",
			"10": "<sup>10</sup> လၩ့ဘၪစယ့ၫရမဲအၫး- တၭထီးၦဒိၪဖၭဒိၪ, ဒဲၦခမျၧး ထီးအလူၬလၧအအုၩ့လၩ့ဆၧနီၪနါဂၧၫ့ဝ့ၫ လၧၦကိၭ ဂၩဒ့ၭဘၪဖျါခွံၬအဎီးခွၫ, ဒဲအဎီးမုၪလၧအလမိအၪ့ မၧၫ့ဎီးလၧၩ့ဘၪဝ့ၫတၭ, အဝ့ၫၥံၪခိၭနၪဝ့ၫတၭ, ဖျါခွံၬ",
			"11": "<sup>11</sup> ဝ့ၫလီၫ.- အ့ၪမွဲလၧခဲၫ့ထဲၩ့နီၪကၠၪအၥၭတၭ, ဒုၭဂဲၫ ထဲၩ့ထဲၩ့အဎီးခွၫ, ဒဲအဎီးမုၪ လၧအဖျါခွံၬဝ့ၫတၭ,",
			"12": "<sup>12</sup> အၪ့မၧၫ့အကဲၪဎီးခွၫဒဲဎီးမုၪလီၫ.- အခိးမွဲယဟိဝၩ",
			"13": "<sup>13</sup> အလူလၩ့ဘၪစယ့ၫရမဲအၫတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယအုၩ့လၩ့ဆၧလၧန ၥံၪအဖါလဖၪလၧမုနံၩလနံၩ လၧယဒုၭစဲၪ့ထၪ့အဝ့ၫၥံၪ",
			"14": "<sup>14</sup> လၧအံဇံၭ, လၧၦဎီးဖိၪအဂံၪ့ဖၧၩ့တၭ,ယစံၭ,- နွ့ၫနံၪ့ အထုၬနီၪနၥံၪဝ့ၫကိၭဂၩဒ့ၭ, ဘၪဖျါခွံၬနၥံၪအထၧၫ့ဖု ဝဲ,ၦဟံဘြူၫဖိၪလၧ ၦအၪ့ဆၫခွံၬဝ့ၫလၧနစူၪဖၧၩ့တၭ, ထီးအမၩနဆၧဎူၫနံၪ့တၭ, နမိဘၪဖျါခွံၬဝ့ၫလၧနအီၪ လီၫ.မွဲလါနၫ့ဘိၩနၥံၪအဖါလဖၪခိၭနၪယလူအ့ၬ, ဒိၭ",
			"15": "<sup>15</sup> အနါဆ့အ့ၬ.- တၭလၧမုလနံၩယီၩနၥံၪကၠၪစိၩနၥံၪအ ၥၭ,ဒဲမၩဆၧလီၩ့လၧယမ့ၬယၫ, ဒဲကိၭထၪ့ဆၧဖီၩ့ဖျ့ၭ လဂၩဘၪလဂၩလၧၦအီၪလၧအနဲၩ့ထံၭ, ဒဲနၥံၪအုၩ့ လၩ့ဆၧလၧယမ့ၬယၫလၧဂံၪ့ဖၧၩ့ လၧဆၧကိၭဝ့ၫလၧ",
			"16": "<sup>16</sup> ယမံၩ့လီၫ.- မွဲလါနၫ့တၭ,နၥံၪကၠၪကဒၩထဲၩ့နၥံၪအ ၥၭတၭ,မၩဘၪၥၭလိၪယမံၩ့တၭ, နၥံၪဒုၭဂဲၫထဲၩ့ထဲၩ့ အၪ့မၧၫ့ဎီးလဂၩအဎီးခွၫ, လဂၩအဎီးမုၪဆုၬဆုၬလၧ နၥံၪဖျါခွံၬ လ့ၩမၩဆၧထီးဒၪအၥၭနီၪ, ဘဲၫၥိၭအဝ့ၫ ၥံၪမိကဲၪထၪ့ထဲၩ့ဒီၭ ဎီးမုၪၥံၪဒဲဎီးခွၫၥံၪ လၧနၥံၪအဂး လီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪခိၭ နၪယလူတၭ, ကိၭထၪ့ဆၧဖီၩ့ဖျ့ၭ, လဂၩလၧအထၧၫ့ ဖုဝဲ,လဂၩလၧၦလၧအနဲၩ့ထံၭနီၪအ့ၬ. ယိခွါ, ယကိၭ ထၪ့ဆၧဖီၩ့ဖျ့ၭလၧနၥံၪအဂး, ယဟိဝၩစံၭဝ့ၫဒၪ, လၧ နၭၥံၪဖၩ့ၥံၪ, ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ ဒဲလၧဆၧၥံၫချဲၫ့ တၭ,ယမိဒုၭဘၪနၥံၪ လၧဆၧခိဆၧဝီၩ လၧဂၪ့ခိၪအ ဘၩ့အမုးထီးအလူၬအဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> တၭၦလၧအလၨၪခၫ့ဖၬ ယဆၧအုၩ့လၩ့လၧအလ ထီးန့ဘၪဆၧအုၩ့လၩ့အလူလၧအအုၩ့လၩ့လၧယမ့ၬ ယၫထီးအဒၪ့ထ့ၬခွံၬ ချီဖိၪနံၫခီၫတၭ, လ့ၩဝ့ၫလၧနံၫခီၫ",
			"19": "<sup>19</sup> အဘိၩ့ဆၧၩ့,- ယုဒၫအၦဒိၪဖၭဒိၪ, ဒဲယရုစလံၫ့အၦ ဒိၪဖၭဒိၪၥံၪ, ၦဖၫဆွံၪၥံၪ,ဒဲၦလုဆၧလဖၪ, ဒဲထံၫၥံၪခး ၥံၪအၦၡၩထီးအလူၬ လၧအလ့ၩဆၧလၧချီဖိၪနံၫခီၫ",
			"20": "<sup>20</sup> အဘိၩ့ဆၧၩ့နီၪ,- ယမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧအဒုၪအဒၩ အစူၪဖၧၩ့, ဒဲၦလၧအအၪ့ဎၬ အၥၭမၧၫ့လဖၪအစူၪ ဖၧၩ့တၭ,အစွၪနီၪမိကဲၪဆၧအၪ့လၧဆၧဖိၭဖၫ့အထိၪ အလံၪအဂး, ဒဲလၧဂၪ့ခိၪအဆၧဖိၪဆၧဎါအဂးလီၫ.",
			"21": "<sup>21</sup> တၭယုဒၫအစဎွၩဇ့ၭဒကဲအၫ, ဒဲအၦဒိၪဖၭဒိၪလဖၪ နီၪ,ယမိဖ့ၪလၫ့ခွံၬလၧအဒုၪအဒၩအစူၪဖၧၩ့, ဒဲၦလၧ အအၪ့ဎူၫအၪ့ဎၬ အၥၭမၧၫ့အစူၪဖၧၩ့, ဒဲဘၭဘလၧၫ့ အစဎွၩအၥုၭမုခမျၧးအစူၪဖၧၩ့ လၧအစဲၪ့ထၪ့ခွံၬလၧ",
			"22": "<sup>22</sup> နၥံၪအအီၪလီၫ.- ယိခွါ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိမၪ လူၬဆၧ, ဒဲဒုၭဂဲၫထဲၩ့ထဲၩ့အဝ့ၫၥံၪလၧဒိၩ့ယီၩတၭ, အဝ့ၫၥံၪမိဒုၭထၫ့ဒၩ ဒဲမၩန့ဝ့ၫဒဲဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪ တၭ,ယမိအီၪက့ၪယုဒၫအဒိၩ့လဖၪ လၧဆၧအီၪယူ, လၧၦၡၩအီၪဝ့ၫလၧအဖၧၩ့နးဂၩအ့ၬ."
		},
		"35": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪ စယ့ၫရမဲအၫလၧယု ဒၫအစဎွၩစယိၫစဲအၫအဖိၪခွၫ စယဟီအကံၫ့အမုနံၩ",
			"2": "<sup>2</sup> လဖၪနီၪတၭ,စံၭဝ့ၫဒၪ,- လ့ၩလၧၦရံခၭဖိၪအဂံၪ့ဖၧၩ့, ချဲၩ့ဆၧလၧအဝ့ၫၥံၪတၭ, ဒုၭဂဲၫဝ့ၫလၧယဟိဝၩအ ဂံၪ့အဒူၭလဖျိၪ့အဖၧၩ့တၭ, ဖ့ၪအီၩဝ့ၫလၧစဘံၭထံၫ",
			"3": "<sup>3</sup> ဆံၭ.- ထီးနီၪလဖၧၫ့ ယမၩန့စဟၭဘဇံၫနဲအၫအဖိၪ ခွၫစယ့ၫရမဲအၫအဖိၪခွၫစယၭဇနဲအၫ, ဒဲအထၧၫ့ဖုဝဲ, ဒဲအဖိၪခွၫ ထီးအလူၬ ဒဲစရံခၭအၡၩဂံၪ့ဖိၪ ထီးအ",
			"4": "<sup>4</sup> လူၬး- တၭယဒုၭဂဲၫနုၬအဝ့ၫၥံၪ လၧယဟိဝၩအဂံၪ့ ဖၧၩ့လၧယွၩအၡၩစအံၭဂဒ့ၫလဲအၫအဖိၪခွၫစဟၫနၫ့ အဖိၪခွၫလဖၪအဒူၭဖၧၩ့, လၧအအီၪဝ့ၫလၧၦဒိၪဖၭဒိၪ လဖၪအဒူၭနဲၩ့ထံၭ, လၧအအီၪဝ့ၫလၧၦပၧၩ့တရၫ့ စၡၫလၧၫ့အဖိၪခွၫ စမၫအစဲအၫ အဒူၭအဖၫ့ခိၪနီၪ",
			"5": "<sup>5</sup> လီၫ.- တၭယအီၪက့ၪဖၧၩ့ၥံၪဎွ့ၩလၧစဘံၭထံၫ,ဒဲလိၫ့ အဖျိၪ့လဖၪတၭ, ယစံၭအဝ့ၫၥံၪ, အီၩစဘံၭထံၫဘီၪ.",
			"6": "<sup>6</sup> မွဲလါနၫ့တၭ,အဝ့ၫၥံၪနီၪစံၭဝ့ၫဒၪ, ပအီၩစဘံၭထံၫ အ့ၬ.အဂဲးဘဲၫယီၩပဖါစရံခၭအဖိၪခွၫ စယီနဒၭနီၪ မၪလူၬပၧၩတၭ,စံၭဝ့ၫဒၪ, နၥံၪထီးအီၩစဘံၭထံၫလ ဂ့ၩ,နၥံၪဝ့ၫ, ဒဲနၥံၪအဖိၪခွၫလဖၪလၩ့ဆိၩလၩ့ကၠၪနီၪ,",
			"7": "<sup>7</sup> အီၩလဂ့ၩ.- နၥံၪထီးၥုၪ့ဂံၪ့လဂ့ၩ, ထီးဎွံၪဆၧချံၫလ ဂ့ၩ,ထီးၥုၪ့စဘံၭအလးလဂ့ၩ, အီၪလၧဆၧနီၪလ ဂ့ၩ.အီၪနၥံၪဝ့ၫလၧတဲၩဖၧၩ့ လဆိၩဒၪနၥံၪအၥၭ, ဘဲၫ ၥိၭနၥံၪမိမၧၫ့ အၪနံၩအၪၥၫ့လၧခးဖၧၩ့ ထီးအလးလၧ",
			"8": "<sup>8</sup> နၥံၪမွဲၦမွံၩနီၪဆံၭ.- တၭပခိၭနၪပဖါစရံခၭအဖိၪခွၫ စယီနဒၭနီၪအလူလၧကယဲဆၧလၧအမၪလူၬပၧၩထီး အလူၬ,ဘဲၫၥိၭပထီးအီၩစဘံၭထံၫလဆိၩဒၪပၧၩ, ပ",
			"9": "<sup>9</sup> ဝ့ၫဒၪ,ဒဲပမၫဒဲပဖိၪခွၫ ဒဲပဖိၪမုၪလဂ့ၩ.- တၭဘဲၫၥိၭ ပထီးၥုၪ့ဂံၪ့လၧပမိအီၪလၧအဖၧၩ့လဂ့ၩ, ဒဲစဘံၭမုအ လးမွဲဂ့ၩ, ဂၪ့ခိၪအဝၩ့မွဲဂ့ၩ, ဆၧအချံၫအၥၪမွဲဂ့ၩ,အီၪ",
			"10": "<sup>10</sup> ဘၪလၧပၧၩအ့ၬ.- မွဲပအီၪယူၭလၧတဲၩဖၧၩ့, ဒဲပခိၭနၪ ယူၭ,ဒဲပမၩယူၭကယဲဆၧလၧပဖါစယီနဒၭနီၪမၪလူၬ",
			"11": "<sup>11</sup> ပၧၩအၥိၭနီၪလီၫ.- ထီးဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭ န့ဇၫဂဲၫထၪ့လၧခးဖၧၩ့တၭး ဆၧမၩအၥၭလၧပစံၭ, ဂဲၫဘီၪ,မွဲပလ့ၩၡီၩ့လၧယရုစလံၫ့အဖၧၩ့ဆံၭး လၧ ဆၧၥၭမဲၪၦခၫလဒံအၫဖိၪၥံၪ အၥုၭမုခမျၧးလဖၪ အ ကၠီၩ့းဒဲၦစံရအၫဖိၪ အၥုၭမုခမျၧးလဖၪ အဆၧၥၭမဲၪ အကၠီၩ့နီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ပအီၪလၧယရု စလံၫ့အဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫ",
			"13": "<sup>13</sup> တၭ,စံၭဝ့ၫဒၪ,- ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့ လၭအယွၩစံၭဘဲၫယီၩ, လ့ၩစံၭယုဒၫအၦၡၩ,ဒဲၦယရု စလံၫ့ဖိၪလဖၪ, နၥံၪဒိၭဆၧၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဘဲၫၥိၭနၥံၪ",
			"14": "<sup>14</sup> မိခိၭနၪယလူအ့ၬဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- စရံခၭအ ဖိၪခွၫစယီနဒၭအဆၧချဲၩ့ လၧအမၪလူၬအဖိၪခွၫလဖၪ ဘဲၫၥိၭအထီးအီၩစဘံၭထံၫလဂ့ၩနီၪ, ၦထီးန့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလအီၩဘၪဝ့ၫထီးမုဆၫလနံၩ ယီၩတၭ,ထီးန့အဖါအလူလီၫ. မွဲလါနၫ့တၭ, ယချဲၩ့ ဆၧလၧနၥံၪ,ယဂဲထုၪ့ဂီၩဂီၩ, ယချဲၩ့ဆၧလါနၫ့တၭ,",
			"15": "<sup>15</sup> နၥံၪခိၭနၪယလူအ့ၬ.- ယအၪ့မၧၫ့လၩ့ဆ့ယခ့ၫယၡၩ ထီးအလူၬ, မီၪလဖၪလၧနၥံၪအအီၪ, ယဂဲထုၪ့ဂီၩဂီၩ ဒဲအၪ့မၧၫ့လၩ့အဝ့ၫၥံၪတၭ, စံၭ, ကၠၪခွံၬနၥံၪအၥၭလ ဂၩလၧအဖၧၩ့ၥၭအၧၩ့ဒၪဝ့ၫ, လဂၩလၧအဖၧၩ့ၥၭ အၧၩ့ဒၪဝ့ၫတၭ, မၩဂ့ၩထၪ့နၥံၪအဆၧမၩဆံၭ. တၭ ထီးလ့ၩဖိၬယွၩအဂူၫဂၩလဖၪအခဲၫ့, ဘဲၫနၥံၪမိမၩအ ဆၧလဂ့ၩး နၥံၪမိအီၪလၧခးအဖၧၩ့ လၧအဖ့ၪလၫ့နၥံၪ ဒဲနၥံၪအဖါလဖၪလီၫ. မွဲလါနၫ့နၥံၪဒိၭနၥံၪအနါအ့ၬး",
			"16": "<sup>16</sup> နၥံၪခိၭနၪယလူအ့ၬ.- မွဲလၧစရံခၭအဖိၪခွၫ စယီနဒၭ နီၪအဖိၪခွၫလဖၪထီးန့အဖါအဆၧမၪလူၬ လၧအမၪ",
			"17": "<sup>17</sup> လူၬဝ့ၫလီၫ. အ့ၪမွဲၦခမျၧးယီၩခိၭနၪယလူအ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ, ယွၩဆၧၥုၭမုခမျၧးအယဟိဝၩ,အံၫ စရ့လၭအယွၩနီၪစံၭဘဲၫယီၩ, ယိခွါ, ယမိဒုၭဂဲၫဘၪ ၦယုဒၫဖိၪဒဲယရုစလံၫ့ဖိၪလဖၪ လၧကယဲဆၧအၧၩ့လၧ ယချဲၩ့ဆၧထၫ့ဒၩဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယချဲၩ့ယူၭ ဆၧတၭ,အဝ့ၫၥံၪခိၭနၪဝ့ၫအ့ၬ. ယကိၭယူၭအဝ့ၫၥံၪ တၭ,အဝ့ၫၥံၪစံၭဆၧၫ့ဆၧအ့ၬ.",
			"18": "<sup>18</sup> စယ့ၫရမဲအၫစံၭစရံခၭအၡၩဂံၪ့ဖိၪ, ဆၧၥုၭမုခမျၧး အယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, မွဲနၥံၪခိၭ နၪနၥံၪအဖါစယီနဒၭနီၪအဆၧမၪလူၬ,ဒဲထီးန့အဆၧ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ထီးအလူၬ, ဒဲမၩဘဲၫကယဲဆၧလၧအ",
			"19": "<sup>19</sup> မၪလူၬနၥံၪအၥိၭနီၪတၭ,- အခိးမွဲဆၧၥုၭမုခမျၧးအ ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, စရံခၭအဖိၪ ခွၫစယီနဒၭနီၪမိအီၪလၧၦၡၩ လၧအမိဆၧၫ့ထုၪ့လၧ ယမ့ၬယၫလၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧယုဒၫအစဎွၩ စယိၫစဲအၫအဖိၪခွၫ စယဟီအကံၫ့အနံၪ့လံနံၪ့လနံၪ့နီၪ, ယဟိဝၩအလူလၩ့",
			"2": "<sup>2</sup> ဘၪစယ့ၫရမဲအၫတၭ,စံၭဝ့ၫဒၪ,- မၩန့လံၬလထူၫတၭ ကယဲဆၧချဲၩ့လၧယချဲၩ့ထၫ့ဒၩယူၭ အံၫစရ့လၭ,ဒဲထၫ့ ဒၩယုဒၫ, ဒဲထၫ့ဒၩၦဆၨၩထီးအလူၬ, ခီၫလၧမုလနံၩ လၧယချဲၩ့ဆၧလၧနၧၩ လၧစယိစဲအၫအမုနံၩလဖၪ ထီးမုဆၫလနံၩယီၩကွ့ၭလၩ့လၧအဖၧၩ့ဆံၭ.",
			"3": "<sup>3</sup> ဘၪလဘၪယုဒၫအၡၩဂံၪ့ဖိၪ မိနါဂၧၫ့ကယဲဆၧအၧၩ့ လၧယကၩ့ကၩယမိမၩဝ့ၫ ဘဲၫၥိၭအဝ့ၫၥံၪမိကၠၪခွံၬအ ၥၭ,လဂၩလၧအဖၧၩ့ၥၭအၧၩ့ဒၪဝ့ၫ, လဂၩလၧအဖၧၩ့ ၥၭအၧၩ့ဒၪဝ့ၫနီၪ, ဘဲၫၥိၭယမိဖျါခွံၬ အဝ့ၫၥံၪအဆၧ အၧၩ့ဒဲအဆၧဒဲၩဘၭနီၪလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ စယ့ၫရမဲအၫကိၭန့စနံၫရဲအၫအဖိၪ ခွၫစဘၫရၧၭတၭ, စဘၫရၧၭနီၪ ကွ့ၭယဟိဝၩအလူ ထီးအလူၬ လၧအချဲၩ့ဆၧလၧစယ့ၫရမဲအၫအနိၭလၧ",
			"5": "<sup>5</sup> လံၬလထူၫအဖၧၩ့လီၫ.- စယ့ၫရမဲအၫမၪလူၬ စဘၫ ရၧၭတၭ,စံၭဝ့ၫဒၪ, ယဘၪဆၧကၭဘံၭထၬယူၭယၧၩ",
			"6": "<sup>6</sup> တၭးယလ့ၩထၪ့လၧယဟိဝၩအဂံၪ့ဖၧၩ့ၥ့ၪအ့ၬ.- အခိး မွဲလ့ၩထၪ့နဝ့ၫဒၪတၭ, ဖီယဟိဝၩအလူလၧလံၬလထူၫ အဖၧၩ့လၧနကွ့ၭလၧယနိၭနီၪ, လၧၦၡၩခမျၧးအနါ ဖၧၩ့,လၧယဟိဝၩအဂံၪ့ဖၧၩ့း ထီးဆၧဒုၪဆၧအၪ့ဆၧ အီၩအနံၩလနံၩနီၪဆံၭ. တၭနမိဘၪဖီဆ့အဝ့ၫလၧၦ ယုဒၫဖိၪလၧအဂဲၫထၪ့ လၧအဒိၩ့လဖၪအနါဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ဘၪလဘၪအဝ့ၫၥံၪမိအၪ့ကံၩ့အၪ့ယၫ ဆၧလၧယဟိ ဝၩအမ့ၬယၫတၭ,မိကၠၪခွံၬအၥၭ, လဂၩလၧအဖၧၩ့ ၥၭအၧၩ့ဒၪဝ့ၫ, လဂၩလၧအဖၧၩ့ၥၭအၧၩ့ဒၪဝ့ၫနီၪလီၫ. အဂဲးဘဲၫယီၩဆၧၥၭထၪ့ ဒဲဆၧၥၭခဲၩထၪ့လၧယဟိ ဝၩလီၩဘၪထၫ့ဒၩယူၭ ၦခမျၧးယီၩမွဲအဒိၪမၬလီၫ.",
			"8": "<sup>8</sup> တၭစနံၫရဲအၫအဖိၪခွၫစဘၫရၧၭနီၪ မၩဝ့ၫဘဲၫက ယဲဆၧချဲၩ့ လၧမီၪစယ့ၫရမဲအၫမၪလူၬဝ့ၫနီၪ, ဒဲဖီဘၪ ဝ့ၫယဟိဝၩအလူလၧလံၬဖၧၩ့ လၧယဟိဝၩအဂံၪ့ဖၧၩ့ လီၫ.",
			"9": "<sup>9</sup> တၭဆၧမၩအၥၭ လၧယုဒၫအစဎွၩစယိၫစဲအၫအ ဖိၪခွၫစယဟီအကံၫ့အနံၪ့ယဲနံၪ့လနံၪ့လၩခွံၫဘံၪ့လ ဘံၪ့နီၪ, ၦခမျၧးလၧယရုစလံၫ့အဖၧၩ့ထီးအလူၬ,ဒဲက ယဲၦလၧအဂဲၫဝ့ၫ လၧယုဒၫအဒိၩ့ထီၩ့လၧယရုစလံၫ့ အဖၧၩ့ထီးအလူၬနီၪ, ကိၭထၪ့ဆၧဒုၪဆၧအၪ့ဆၧအီၩ",
			"10": "<sup>10</sup> လၧယဟိဝၩအမ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့စဘၫရၧၭ ဖီထၪ့စယ့ၫရမဲအၫအဆၧချဲၩ့လၧလံၬဖၧၩ့ လၧယဟိ ဝၩအဂံၪ့ဖၧၩ့, လၧၦကွ့ၭလံၬစၡၫဖၫ့အဖိၪခွၫစဂ့ၫမရဲ အၫအဒူၭဖၧၩ့ လၧဆၧဝၩ့ထၪ့ထီၫလစီၪ့, ထီးဆၧလ့ၩ နုၬလၧယဟိဝၩအဂံၪ့တရၫ့အၥၫ့နီၪ လၧၦခမျၧးထီး အလူၬအနါဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> ထီးစၡၫဖၫ့အဖိၪခွၫ စဂ့ၫမရဲအၫအဖိၪခွၫစမံၫခ့ယၫ",
			"12": "<sup>12</sup> နါဂၧၫ့ယဟိဝၩအလူထီးအလူၬလၧလံၬဖၧၩ့နီၪ,- ထီး နီၪလဖၧၫ့မွဲအလ့ၩလၩ့ဝ့ၫလၧစဎွၩအဂံၪ့, လၧၦကွ့ၭ လံၬအဒူၭဖၧၩ့တၭ, ယိခွါ,ၦဒိၪဖၭဒိၪထီးအလူၬဆၧၫ့ နၩ့ထီးနီၪ, ၦကွ့ၭလံၬ စအံၫလံၭၡမၫ, ဒဲစၡ့ၫမအဲအၫ အဖိၪခွၫစဒ့ၫလအဲအၫ ဒဲစအၭဘီၫအဖိၪခွၫစအ့လနၫ ၥၫ့,ဒဲစၡၫဖၫ့အဖိၪခွၫစဂ့ၫမရဲအၫ, စဟၪ့အနဲအၫ အဖိၪခွၫစဇ့ၭဒကဲအၫ, ဒဲၦဒိၪဖၭဒိၪထီးအလူၬလဖၪ",
			"13": "<sup>13</sup> လီၫ.- ထီးနီၪလဖၧၫ့စမံၫခ့ယၫလီၩလၩ့လၬလၩ့အဝ့ၫ ၥံၪလၧကယဲဆၧချဲၩ့လၧအနါဂၧၫ့ဝ့ၫ လၧစဘၫရၧၭဖီ",
			"14": "<sup>14</sup> လံၬလၧၦခမျၧးအနါဖၧၩ့အဘိၩ့ဘၭနီၪလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ၦဒိၪဖၭဒိၪထီးအလူၬ အၪ့မၧၫ့လၩ့စယ ဟုဒဲၫလဂၩ စန့ၭၥနဲအၫအဖိၪခွၫ စၡ့ၫလမဲအၫအဖိၪ ခွၫ,စကုၡဲၫအဖိၪခွၫ, ထီၩ့လၧစဘၫရၧၭအအီၪတၭ, စံၭဝ့ၫဒၪ,မၩန့လံၬလထူၫလၧနဖီဆၧလၧအဖၧၩ့ လၧၦ ခမျၧးအနါဖၧၩ့နီၪ လၧနစူၪဖၧၩ့တၭ, ဂဲၫဘီၪ. အခိးမွဲ စနံၫရဲအၫအဖိၪခွၫ စဘၫရၧၭနီၪ မၪန့လံၬလထူၫနီၪ",
			"15": "<sup>15</sup> လၧအစူၪဖၧၩ့တၭ, ဂဲၫလၧအဝ့ၫၥံၪအအီၪလီၫ.- တၭ အဝ့ၫၥံၪနီၪစံၭအဝ့ၫ, ဆၧၫ့နၩ့တၭဖီလၧပနါဖၧၩ့ဆံၭ. အခိးမွဲစဘၫရၧၭဖီထၪ့ဝ့ၫ လၧအဝ့ၫၥံၪအနါဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> ထီးအဝ့ၫၥံၪနါဂၧၫ့ဆၧချဲၩ့ထီးအလူၬတၭ, ဆၧမၩအ ၥၭလၧအၥၭမဲၪဝ့ၫ လဂၩဒဲလဂၩတၭ, စံၭစဘၫရၧၭ နီၪ,ပမိလီၩဘၪစဎွၩလၧဆၧချဲၩ့ယီၩ ထီးအလူၬတၡါ",
			"17": "<sup>17</sup> လီၫ.- တၭအဝ့ၫၥံၪအၪ့စၪ့စဘၫရၧၭတၭ,စံၭဝ့ၫ, လီၩ ဘၪပၧၩဘီၪ. နကွ့ၭဆၧချဲၩ့ယီၩ ထီးအလူၬလၧအနိၭ",
			"18": "<sup>18</sup> ဘဲၫၥ့ၪလဲၪ.- ထီးနီၪလဖၧၫ့စဘၫရၧၭစံၭဆၧၫ့အဝ့ၫၥံၪ, အဝ့ၫဒၪချဲၩ့ဆၧလၧယၧၩ လၧအနိၭတၭ, ယကွ့ၭလၧ",
			"19": "<sup>19</sup> ၥံၪထံၫလၧလံၬဖၧၩ့လီၫ.- တၭၦဒိၪဖၭဒိၪလဖၪ စံၭ စဘၫရၧၭနီၪ, လ့ၩအီၪက့ၪၥူၪနၥၭ,နဝ့ၫဒၪ, ဒဲစယ့ၫရမဲ အၫဆံၭ. ထီးနၥံၪအီၪအလးနီၪ, ဒုၭၥ့ၪယၫၦၡၩနးဂၩ လဂ့ၩ,ဧီၪ.",
			"20": "<sup>20</sup> အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫ လၧစဎွၩအအီၪအဝၩ့ဖၧၩ့တၭ, အီၪက့ၪလံၬလထူၫလၧ ၦကွ့ၭလံၬစအံၫလ့ၭၡမၫအဒူၭ ဖၧၩ့တၭ,လီၩဘၪဆၧချဲၩ့ထီးအလူၬ လၧစဎွၩအနါ ဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> အခိးမွဲစဎွၩအၪ့မၧၫ့လၩ့ စယဟုဒဲၫဘဲၫၥိၭအမိဂဲၫ ဆိၬလံၬလထူၫနီၪတၭ, အဝ့ၫဒၪမၩန့ဝ့ၫလၧၦကွ့ၭလံၬ စအံၫလ့ၭၡမၫအဒူၭဖၧၩ့လီၫ. တၭစယဟုဒဲၫဖီထၪ့ ဝ့ၫလၧစဎွၩအနါဖၧၩ့, ဒဲလၧၦဒိၪဖၭဒိၪၥံၪ လၧအဆၧၫ့ ထုၪ့လၧစဎွၩအနဲၩ့ထံၭလဖၪအနါဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭစဎွၩဆၧၫ့နၩ့ဝ့ၫလၧဆၧဂီးအထီအဂံၪ့ဖၧၩ့, လၧ လၩဎွ့ၩထၪ့ခွံၫဘံၪ့လဘံၪ့အဖၧၩ့တၭ, မ့ၪခဲၩထၪ့လၧ",
			"23": "<sup>23</sup> ဖံၫ့ချၪဖၧၩ့ လၧအမ့ၬယၫလီၫ.- တၭထီးစယဟုဒဲၫဖီ လံၬၥၧၫ့ဆၫ့လံဆၫ့တၭ, ဆၧမၩအၥၭလၧစဎွၩကူၭခွံၬ လံၬလၧၦကွ့ၭလံၬအဒီၩလဘံၪ့တၭ, ဖျႃၭလၩ့ခွံၬဝ့ၫ လၧမ့ၪဖၧၩ့ အီၪလၧဖံၫ့ချၪဖၧၩ့ ထီးလံၬလထူၫလူၬဝ့ၫ",
			"24": "<sup>24</sup> လီၫ.- တၭၦလၧအနါဂၧၫ့ဆၧချဲၩ့နီၪ, စဎွၩမွဲဂ့ၩ,အခ့ၫ အၡၩမွဲဂ့ၩ, ၥၭမဲၪဝ့ၫအ့ၬ. ၡၫ့ခွံၬအကီၩ့အၥိၭနးဂၩ",
			"25": "<sup>25</sup> ဆ့အ့ၬ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, စအ့ၫလနၫၥၫ့, ဒဲစဒ့ၫ လအဲအၫ, ဒဲစဂ့ၫမရဲအၫလဖၪနီၪအၪ့ကံၩ့အၪ့ယၫယူၭ စဎွၩဘဲၫၥိၭအထီးဆူၭထၪ့ခွံၬ လံၬလထူၫနီၪလဂ့ၩလါ",
			"26": "<sup>26</sup> နၫ့တၭ,မွဲအခိၭနၪအဝ့ၫၥံၪအလူအ့ၬ.- အ့ၪမွဲစဎွၩမၪ လူၬစဟၫမလ့ၭအဖိၪခွၫစယ့ၫရမံၫအ့လၭ, ဒဲစအၭ ဇ့ၫအ့လၭအဖိၪခွၫစစံၫရအဲအၫ, ဒဲစအၭဘဒံၫအ့လၭ အဖိၪခွၫစၡ့ၫလမဲအၫနီၪ, ဘဲၫၥိၭအမိဖီၪ့န့ၦကွ့ၭလံၬ စဘၫရၧၭနီၪ ဒဲမီၪစယ့ၫရမဲအၫဆ့လါနၫ့တၭ, ယဟိ ဝၩအီၪက့ၪၥူၪခွံၬယူၭအဝ့ၫၥံၪလီၫ.",
			"27": "<sup>27</sup> တၭလၧစဎွၩဆူၭထၪ့ခွံၬလံၬလထူၫ, ဒဲဆၧချဲၩ့လၧ စဘၫရၧၭကွ့ၭဝ့ၫ လၧစယ့ၫရမဲအၫအနိၭအလးခဲၫ့နီၪ,",
			"28": "<sup>28</sup> ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫတၭ,- စံၭဝ့ၫဒၪ, မၩန့ဒီၭလံၬထူၫလထူၫဒၪတၭ, ကွ့ၭကယဲဆၧချဲၩ့လၧ အခၪ့ထံၭလၧအဖၧၩ့ လၧအအီၪဝ့ၫလၧလံၬလထူၫလၧ အခၪ့ထံၭအဖၧၩ့, လၧယုဒၫအစဎွၩယဟီအကံၫ့ဆူၭ",
			"29": "<sup>29</sup> ထၪ့ခွံၬနီၪဆံၭ.- တၭနမိဘၪစံၭယုဒၫအစဎွၩယဟီ အကံၫ့နီၪ, ယဟိဝၩစံၭဘဲၫယီၩ,နဆူၭထၪ့ခွံၬယူၭလံၬ လထူၫယီၩတၭ,နစံၭ, နကွ့ၭလၧအဖၧၩ့လၧဘၭဘလၧၫ့ အစဎွၩမိဂဲၫတၡါ, မၩဂၭဂီၩ့ခးလဘံၪ့ယီၩဒဲမိမၩဂၭ ဂီၩ့ၦၡၩဒဲဆၧဖိၪဆၧဎါလၧအဖၧၩ့နီၪမွဲဘၪလဲၪ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭလၧယုဒၫအစဎွၩ ယဟီအကံၫ့အဂဲးအကၠီၪ, မွဲအမိအီၪဘၪလၧၦလၧအ မိဆၧၫ့နၩ့လၧစဒၫဝံၭအလးဆီၩ့ဆီအဖၫ့ခိၪအ့ၬ. တၭ ၦမိခွံၬၡိၭခွံၬအစွၪ ဘဲၫၥိၭအမိဘၪဆၧခိလၧမုဆၫလ",
			"31": "<sup>31</sup> ခီၫ,ဒဲဆၧဂီးလၧမုနၩလခီၫလီၫ.- တၭယမိစ့ၩရၫ့အဝ့ၫ ဒၪ,ဒဲအချံၫအၥၪ, ဒဲအခ့ၫအၡၩ လၧအဆၧအၧၩ့အ ကၠီၩ့တၭ,ယမိဒုၭဘၪအဝ့ၫဒၪ, ဒဲၦယရုစလံၫ့ဖိၪ,ဒဲယု ဒၫအၦၡၩလၧကယဲဆၧအၧၩ့လၧယချဲၩ့ ဆၧလၧအဝ့ၫ ၥံၪအဂဲးတၭ, အဝ့ၫၥံၪခိၭနၪဝ့ၫအ့ၬ.",
			"32": "<sup>32</sup> ထီးနီၪလဖၧၫ့စယ့ၫရမဲအၫ မၩန့လံၬထူၫလထူၫဒၪ တၭ,ဖ့ၪလၫ့ဝ့ၫလၧၦကွ့ၭလံၬစဘၫရၧၭ, လၧအမွဲစနံၫ ရဲအၫအဖိၪခွၫတၭ, အဝ့ၫဒၪကွ့ၭဝ့ၫကယဲဆၧချဲၩ့လၧ စယ့ၫရမဲအၫအနိၭ လၧယုဒၫအစဎွၩယဟီအကံၫ့ဆူၭ ထၪ့ခွံၬဝ့ၫလၧမ့ၪဖၧၩ့နီၪ, လၧအဖၧၩ့တၭ, အီၪက့ၪဝ့ၫ လၧဆၧချဲၩ့ဘဲၫအဝ့ၫၥံၪအၥိၭနီၪ အၪထံၪလၧအဖၫ့ခိၪ လီၫ."
		},
		"37": {
			"1": "<sup>1</sup> တၭစယိၫစဲအၫ အဖိၪခွၫစဇ့ၭဒကဲအၫ ကဲၪစဎွၩ လၧစယဟီအကံၫ့အဖိၪခွၫစကိၫနဲအၫအလးလၧဘၭ ဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ အီၪက့ၪစဎွၩလၧခးယု",
			"2": "<sup>2</sup> ဒၫအဖၧၩ့လီၫ.- မွဲလါနၫ့တၭအဝ့ၫဒၪမွဲဂ့ၩ, အခ့ၫအ ၡၩမွဲဂ့ၩ, ခိၭနၪယဟိဝၩအလူအထၫလၧအချဲၩ့ဝ့ၫလၧ",
			"3": "<sup>3</sup> မီၪစယ့ၫရမဲအၫအစူၪဖၧၩ့နီၪအ့ၬ.- တၭစဎွၩဇ့ၭဒကဲ အၫအၪ့မၧၫ့လၩ့စၡ့ၫလမဲအၫအဖိၪခွၫစယဟုကလၭ, ဒဲၦလုဆၧစမၫအစဲအၫ အဖိၪခွၫစဇ့ၭဖနဲအၫလၧမီၪ စယ့ၫရမဲအၫအအီၪတၭ, စံၭဝ့ၫဒၪ, ဘၩဆိၪဖၪန့ပဂး",
			"4": "<sup>4</sup> လၧယဟိဝၩပယွၩဆံၭ.- တၭစယ့ၫရမဲအၫဂဲၫနုၬ, ဒဲစဲၪ့ထၪ့လၧၦခမျၧးအကျၩလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫ",
			"5": "<sup>5</sup> ၥံၪဒုၭနုၬဒံၭအဝ့ၫ လၧထီၫ့ဖၧၩ့ဒံၭအ့ၬ.- ထီးနီၪလ ဖၧၫ့ဖၫရိၫအၥုၭမုခမျၧးစဲၪ့ထၪ့ယူၭ လၧခးအံဇံၭအ ဖၧၩ့တၭ,ၦခၫလဒံအၫဖိၪ လၧအဝၩ့ထၬ ယရုစလံၫ့ နီၪနါဂၧၫ့အပရၧၫ့တၭ, စဲၪ့ဒၪခွံၬဝ့ၫလၧယရုစလံၫ့နီၪ လီၫ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪမီၪစယ့ၫရမဲ",
			"7": "<sup>7</sup> အၫတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩအံၫစရ့လၭအယွၩစံၭ ဘဲၫယီၩ, နၥံၪမိဘၪစံၭ ၦလၧအအၪ့မၧၫ့လၩ့နဂဲၫအၪ့ စၪ့ဆၧလၧယၧၩ, ယုဒၫအစဎွၩနီၪ, ယိခွါ,ဖၫရိၫအၥုၭ မုခမျၧးလၧအဂဲၫထၪ့မၩဆၧၩ့နၥံၪယီၩ, မိထဲၩ့ထဲၩ့လၧ",
			"8": "<sup>8</sup> အံဇံၭလၧအခးဒၪဝ့ၫအဖၧၩ့လီၫ.- တၭၦခၫလဒံအၫ ဖိၪမိဂဲၫထဲၩ့ဒီၭဒုၭဆၧထၫ့ဒၩဒိၩ့ယီၩတၭ, မိမၩန့ဝ့ၫ",
			"9": "<sup>9</sup> ဒဲဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- ယဟိဝၩ စံၭဘဲၫယီၩ, ထီးအၪ့လီၫလၩ့နၥံၪအၥၭလဂ့ၩ, စံၭဝ့ၫၦခၫလဒံအၫ ဖိၪမိစဲၪ့ထၪ့ခွံၬလၧပအီၪတၡါနီၪတၭး အဂဲးဘဲၫယီၩ",
			"10": "<sup>10</sup> အဝ့ၫၥံၪမိစဲၪ့ထၪ့ဘၪအ့ၬ.-အဂဲးဘဲၫယီၩ နၥံၪအ့ၪ ကျီၪ့ၦခၫလဒံအၫဖိၪ အၥုၭမုခမျၧးထီးအလူၬ လၧအ ဒုၭဆၧထၫ့ဒၩနၥံၪတၭ, အီၪလၩ့ထးဝ့ၫန့ၫၦလၧအဘၪ ၦဘၪဆ့ၭလဖၪ လၧအကျၩလါနၫ့တၭ,မွဲအမိဂဲထုၪ့ လဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအတဲၩဒၪဝ့ၫတၭ, မိဆူၭထၪ့ခွံၬဒိၩ့ယီၩလၧမ့ၪလီၫ.",
			"11": "<sup>11</sup> ထီးၦခၫလဒံအၫဖိၪ အၥုၭမုခမျၧးစဲၪ့ထၪ့ခွံၬလၧ",
			"12": "<sup>12</sup> ယရုစလံၫ့လၧဖၫရိၫအၥုၭမုခမျၧးအကၠီၩ့တၭ,- ထီး နီၪလဖၧၫ့စယ့ၫရမဲအၫ စဲၪ့ထၪ့ခွံၬလၧယရုစလံၫ့တၭ, လ့ၩလၧၦခမျၧးအကျၩဘဲၫၥိၭ အမိဖီၩ့ဖျ့ၭထီၩ့လၧခး",
			"13": "<sup>13</sup> ဘံၪ့ယမံၫ့အဖၧၩ့လီၫ.- မွဲအအီၪဝ့ၫလၧစဘံၪ့ယမံၫ့အ တရၫ့အဘိၩ့ဘၭတၭ, ၦခိၭဆၧဖိၪအခိၪလဂၩအီၪဝ့ၫ ထီးနီၪအမံၩ့မွဲစအရဲယၫ လၧအမွဲစၡ့ၫလမဲအၫအဖိၪ ခွၫလၧအမွဲစဟၪ့အနဲအၫအဖိၪခွၫတၭ, အဝ့ၫဒၪဖီၪ့ ထၬမီၪစယ့ၫရမဲအၫတၭ, စံၭဝ့ၫဒၪ, နလ့ၩလၩ့လၧၦခၫ လဒံအၫဖိၪအအီၪလခီၫလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့စယ့ၫရမဲအၫစံၭဝ့ၫဒၪ, ဆၧချဲၩ့ဘျံၭ ချဲၩ့ဘျၪလီၫ. ယလ့ၩထၪ့လၧၦခၫလဒံအၫဖိၪအအီၪ လခီၫအ့ၬ. တၭအ့ၪမွဲအဝ့ၫဒၪခိၭနၪအလူအ့ၬ. အခိးမွဲ စအရဲယၫဖီၪ့ထၬ စယ့ၫရမဲအၫတၭ, ဂဲၫဆိၬဝ့ၫလၧၦ",
			"15": "<sup>15</sup> ဒိၪဖၭဒိၪၥံၪအအီၪလီၫ.- တၭၦဒိၪဖၭဒိၪလဖၪနီၪၥၭ ထၪ့ဘၪစယ့ၫရမဲအၫတၭ, ထးဝ့ၫတၭ, ဒုၭနုၬဝ့ၫလၧ ထီၫ့ဖၧၩ့လၧၦကွ့ၭလံၬစစၪ့နၥၧၫ့အဂံၪ့ဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩမွဲအဒုၭကဲၪထၪ့ဆၧအလးနီၪလၧထီၫ့လီၫ.",
			"16": "<sup>16</sup> တၭထီးစယ့ၫရမဲအၫလ့ၩနုၬ လၧဂံၪ့အဆၧဖၧၩ့လၧ အဆံၭဒဲလၧဆၧဆူၭဖၧၩ့တၭ,စယ့ၫရမဲအၫအီၪဝ့ၫထီး",
			"17": "<sup>17</sup> နီၪအၪနံၩအၪၥၫ့လီၫ.- ထီးနီၪလဖၧၫ့စဎွၩဇ့ၭဒကဲအၫ အၪ့မၧၫ့လၩ့ဆၧတၭ, ထုၭထၪ့ထဲၩ့ဝ့ၫတၭ, စဎွၩအၪ့ စၪ့ၥူၪဝ့ၫလၧအဂံၪ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဆၧအလူလၧ ယဟိဝၩနီၪအီၪဆ့ဧၪ. တၭစယ့ၫရမဲအၫ စံၭဝ့ၫဒၪ, အီၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ, စံၭဝ့ၫဒၪ, ဆၧမိဖ့ၪလၫ့ခွံၬ နၧၩလၧဘၭဘလၧၫ့အစဎွၩအစူၪဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> တၭစယ့ၫရမဲအၫ စံၭစဎွၩဇ့ၭဒကဲအၫ, နၧၩမွဲဂ့ၩ, နခ့ၫနၡၩမွဲဂ့ၩ, နၡၩခမျၧးမွဲဂ့ၩ,ယမၩမၪဘၪနၥံၪလၧ နၥံၪဒုၭနုၬယၧၩ လၧထီၫ့ဖၧၩ့ယီၩ, မွဲဆၧနီၪလမံၩ့",
			"19": "<sup>19</sup> လဲၪ.- မီၪလဖၪလၧအချဲၩ့ဆၧလၧမီၪအချိၬ လၧနၥံၪ တၭ,စံၭဝ့ၫ,ဘၭဘလၧၫ့အစဎွၩလဂဲၫထၫ့ဒၩဘၪနၥံၪ",
			"20": "<sup>20</sup> ဒဲလဂဲၫထၫ့ဒၩဘၪခးယီၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪ.- မၩ အၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ကဆါစဎွၩဧ့, ခိၭနၪ လါဆံၭ.ယအၪ့ကံၩ့အၪ့ယၫဆၧ, မွဲအဘၪလါနၥၭ ဘဲၫၥိၭနထီၩ့ဒုၭထဲၩ့ထဲၩ့ယၧၩ လၧၦကွ့ၭလံၬစစၪ့န ၥၧၫ့အဂံၪ့ဖၧၩ့လဂ့ၩ,ယမိၥံၫဘၪခိၬထီးနီၪလီၫ.",
			"21": "<sup>21</sup> တၭစဎွၩဇ့ၭဒကဲအၫ မၪလူၬဝ့ၫ, လၧၦၡၩမိအီၪ က့ၪစယ့ၫရမဲအၫ လၧထီၫ့အဝၩ့ဖၧၩ့တၭ, ၦၡၩဘၪ ဖ့ၪလၫ့ဝ့ၫအကိၪလလီၪ့ လၧၦၡၩမၩကိၪအဖၧၩ့ၥၭဖၧၩ့ ကိၭမုနံၩဒ့ၭ ထီးကိၪလၧဒိၩ့ဖၧၩ့ မိလူၬဝ့ၫလီၫ. တၭ စယ့ၫရမဲအၫအီၪဝ့ၫလၧထီၫ့အဝၩ့ဖၧၩ့လီၫ."
		},
		"38": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စမၭတၫ့အဖိၪခွၫစၡ့ၭဖတဲအၫ, ဒဲပၭ ၡၧၫအဖိၪခွၫစဂ့ၭဒလဲအၫ, ဒဲစၡံၫလမဲအၫ အဖိၪခွၫ စယူကလၭ,ဒဲစမၫလခဲအၫအဖိၪခွၫစပၭၡၧၫ နါဂၧၫ့ ဆၧချဲၩ့လၧစယ့ၫရမဲအၫချဲၩ့ဝ့ၫ လၧၦခမျၧးလၧအစံၭ",
			"2": "<sup>2</sup> ဝ့ၫ,- ယဟိဝၩစံၭဘဲၫယီၩ, ၦလၧအအီၪဝ့ၫလၧဒိၩ့ဖၧၩ့ နီၪမိၥံၫဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪ, လၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲ လၧဆၧၥံၫချဲၫ့လီၫ. အ့ၪမွဲၦလၧအစဲၪ့ထၪ့လၧၦခၫလ ဒံအၫဖိၪအအီၪနီၪ မိမၧၫ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩမိန့ ဘၪအၥၭမၧၫ့ဘဲၫဆၧအၪ့ဂူၬန့ဆီၪ့အၥိၭတၭ, မိမၧၫ့",
			"3": "<sup>3</sup> ဝ့ၫလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧမိဖ့ၪလၫ့ခွံၬတၡါ ဒိၩ့ယီၩလၧဘၭဘလၧၫ့အစဎွၩ ၥုၭမုခမျၧးအစူၪဖၧၩ့ တၭ,အဝ့ၫဒၪမိမၩန့ဝ့ၫလီၫ.",
			"4": "<sup>4</sup> တၭၦဒိၪဖၭဒိၪလဖၪစံၭစဎွၩ, မွဲၦလဂၩယီၩဘၪ ဆၧမၩၥံၫလါဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩမွဲအမၩလၩ့ဆါ ၦၥုၭဖိၪလၧအအီၪလၩ့ထး လၧဒိၩ့ဖၧၩ့လဖၪအစူၪ, ဒဲၦခမျၧးထီးအလူၬအစူၪလီၫ. ချဲၩ့ဆၧလၧအဝ့ၫၥံၪ ဘဲၫဆၧချဲၩ့လဖၪနီၪအၥိၭလီၫ. အဂဲးဘဲၫယီၩၦလဂၩ ယီၩမွဲအအၪ့ဎၬ ၦခမျၧးယီၩ အဆၧဘၪလိၭအိၭလိၬ အ့ၬ,မွဲဆၧမၩဂၭဂီၩ့ဝ့ၫလခီၫလီၫ.",
			"5": "<sup>5</sup> တၭစဎွၩဇ့ၭဒကဲအၫစံၭဝ့ၫဒၪ, ယိခွါ,အဝ့ၫဒၪအီၪ ဝ့ၫလၧနၥံၪအစူၪဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩစဎွၩမၩဆၧ",
			"6": "<sup>6</sup> ထၫ့ဒၩနၥံၪၥ့ၪနးမံၩ့အ့ၬ.- တၭအဝ့ၫၥံၪဖီၪ့ထၬစယ့ၫ ရမဲအၫတၭ, ဒုၭနုၬဝ့ၫလၧစဟၫမလ့ၭအဖိၪခွၫ စမၫ လကဲအၫအဆၧဖၧၩ့လၧအအီၪဝ့ၫ လၧထီၫ့အဝၩ့ဖၧၩ့ တၭ,ဆဲၩလၩ့စယ့ၫရမဲအၫလၧဖျံၩလဖၪလီၫ. တၭ ထံၫအီၪလၧအဖၧၩ့အ့ၬ. အီၪန့ၫဖံၬတၭ, စယ့ၫရမဲအၫ လၩ့လၧၩ့လၧဖံၬကျၩလီၫ.",
			"7": "<sup>7</sup> တၭၦအံၫၥအိပၠၫဖိၪစအံၫဘ့ၭမလ့ၭ, ၦဖၫဆွံၪလၧ အအီၪဝ့ၫလၧစဎွၩအဂံၪ့ဖၧၩ့လဂၩ နါဂၧၫ့ဝ့ၫလၧၦဒုၭ နုၬစယ့ၫရမဲအၫလၧဆၧဖၧၩ့လီၫ. စဎွၩဆၧၫ့နၩ့အီၪ",
			"8": "<sup>8</sup> ဝ့ၫလၧဘံၪ့ယမံၫ့အတရၫ့အဖၧၩ့လီၫ.- စအံၫဘ့ၭမ လ့ၭနီၪစဲၪ့ထၪ့လၧစဎွၩအဂံၪ့ဖၧၩ့တၭ, ချဲၩ့ဆၧဒဲစဎွၩ",
			"9": "<sup>9</sup> တၭ,စံၭဝ့ၫဒၪ,- ယကဆါစဎွၩဧ့,ၦလဖၪနီၪကယဲအ ဝ့ၫၥံၪမၩမီၪစယ့ၫရမဲအၫနီၪမွဲဆၧအၧၩ့, အဝ့ၫၥံၪခွံၬ လၩ့ဝ့ၫလၧဆၧဖၧၩ့တၭ,မိၥံၫဝ့ၫလၧဆၧၥၭဝံအၥၭအ ကၠီၩ့လၧဆၧအလးထီးအအီၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ကိၪလၧဒိၩ့ဖၧၩ့အီၪလၧၩ့အ့ၬ.",
			"10": "<sup>10</sup> တၭစဎွၩမၪလူၬ ၦအံၫၥအိပၠၫဖိၪစအံၫဘ့ၭမလ့ၭ, စံၭဝ့ၫဒၪ, မၩန့ၦထီးယီၩၥၧၫ့ဆံၫလၧနၥိၭတၭ, အၪ့ မၩန့ထၪ့ထဲၩ့မီၪစယ့ၫရမဲအၫလၧဆၧဖၧၩ့ လၧအလ ချႃၭၥံၫဒံၭဘၪနီၪဆံၭ.",
			"11": "<sup>11</sup> တၭစအံၫဘ့ၭမလ့ၭမၩန့ၦၡၩလဖၪလၧအၥိၭ, လ့ၩ နုၬလၧစဎွၩအဂံၪ့ လၧဆၧအီၪက့ၪကီၪ့စ့ၩအဖၫ့လၬ တၭ,မၩန့ထၪ့ဆၧကဲၩ့ယၬအလးလံၩ ဒဲဆၧအကီၩ့အ ၥိၭအလးလံၩတၭ, ဆဲၩလၩ့ဝ့ၫလၧဖျံၩလၧစယ့ၫရမဲ",
			"12": "<sup>12</sup> အၫအအီၪလၧဆၧဖၧၩ့နီၪလီၫ.- တၭၦအံၫၥအိပၠၫဖိၪ စအံၫဘ့ၭမလ့ၭ စံၭစယ့ၫရမဲအၫ, အီၪက့ၪဆၧကဲၩ့ ယၬ,ဒဲဆၧကီၩ့ဆၧၥိၭအလံၩ လၧနကံၪလၬဖၧၩ့လၧ ဖျံၩအဖၫ့လၬဆံၭ. တၭစယ့ၫရမဲအၫ မၩဝ့ၫဘဲၫနီၪ",
			"13": "<sup>13</sup> လီၫ.- အခိးမွဲၦထုၭထၪ့စယ့ၫရမဲအၫလၧဖျံၩလဖၪ, မၩန့ထၪ့ခွံၬဝ့ၫလၧဆၧဖၧၩ့တၭ, စယ့ၫရမဲအၫအီၪဝ့ၫ လၧထီၫ့အဝၩ့ဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့စဎွၩဇ့ၭဒကဲအၫ အၪ့မၧၫ့လၩ့ဆၧတၭ, အၪ့မၩန့စယ့ၫရမဲအၫလၧအအီၪ လၧဆၧလ့ၩနုၬလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့ၥၧၫ့စီၪ့လစီၪ့တၭ, စဎွၩစံၭစယ့ၫရ မဲအၫ,ယမိအၪ့စၪ့နၧၩလၧဆၧနးမံၩ့း ထီးအီၪက့ၪၥူၪ ခွံၬလၧယၧၩဆၧနးမံၩ့လဂ့ၩ,ဧီၪ.",
			"15": "<sup>15</sup> တၭစယ့ၫရမဲအၫစံၭစဇ့ၭဒကဲအၫ, ယအ့ၪလီၩဘၪ နၧၩတၭ, နမိမၩၥံၫတၡါယၧၩ မွဲအ့ၬဧၪ. ယအ့ၪဒုၭ",
			"16": "<sup>16</sup> ကိၪ့နၧၩတၭ,နခိၭနၪယလူအ့ၬ.- စဎွၩဇ့ၭဒကဲအၫဆိၪ လၩ့ၥူၪအၥၭလၧစယ့ၫရမဲအၫတၭ,စံၭဝ့ၫဒၪ, ယဟိ ဝၩမၧၫ့ဝ့ၫလၧအဖ့ၪလၫ့ၦလၧၦၥၭမၧၫ့ယီၩ, ယမၩၥံၫ နၧၩအ့ၬ. ယမိဖ့ၪလၫ့ခွံၬနၧၩလၧၦလၧအအၪ့ဎၬနၥၭ မၧၫ့အစူၪဖၧၩ့ဆ့အ့ၬ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့စယ့ၫရမဲအၫစံၭစဇ့ၭဒကဲအၫ, ဆၧ ၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩ, စံၭဘဲၫ ယီၩ,နအ့ၪလ့ၩထီၩ့လၧဘၭဘလၧၫ့ အစဎွၩအၦဒိၪ ဖၭဒိၪၥံၪအအီၪတၭ, နၥၭမိမၧၫ့ဝ့ၫ ၦဆူၭထၪ့ခွံၬဒိၩ့ လဖျိၪ့ယီၩလၧမ့ၪအ့ၬ. တၭနမိမၧၫ့ဒဲနၡၩဂံၪ့ဖိၪလီၫ.",
			"18": "<sup>18</sup> အ့ၪမွဲနအ့ၪလလ့ၩထၪ့ဘၪလၧဘၭဘလၧၫ့ အစဎွၩအ ၦဒိၪဖၭဒိၪၥံၪအအီၪတၭ, ဆၧမိဖ့ၪလၫ့ခွံၬ ဒိၩ့လဖျိၪ့ ယီၩလၧၦခၫလဒံအၫဖိၪအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪမိဆူၭ ထၪ့ခွံၬဝ့ၫလၧမ့ၪ, တၭနမိဖီၩ့ဖျ့ၭလၧအစူၪဖၧၩ့အ့ၬ.",
			"19": "<sup>19</sup> တၭစဎွၩဇ့ၭဒကဲအၫစံၭ စယ့ၫရမဲအၫ, ယၥၭမဲၪၦ ယုဒၫဖိၪလၧအလ့ၩယူၭ လၧၦခၫလဒံအၫဖိၪ လခီၫ တၭး မိဖ့ၪလၫ့ခွံၬဘၪခိၬ ယၧၩလၧအဝ့ၫၥံၪအစူၪဖၧၩ့ တၭ,အဝ့ၫၥံၪမိမၩကြၩ့ထမးယၧၩလီၫ.",
			"20": "<sup>20</sup> တၭစယ့ၫရမဲအၫစံၭဝ့ၫဒၪ,မိဖ့ၪလၫ့ခွံၬနၧၩအ့ၬ. ခိၭ နၪလါယဟိဝၩအလူလၧယချဲၩ့ဆၧလၧနၧၩဆံၭ. တၭ",
			"21": "<sup>21</sup> ဆၧမိဂ့ၩလၧနဂးတၭ, နၥၭမိမၧၫ့ဝ့ၫလီၫ.- အ့ၪမွဲနအ့ၪ လလ့ၩထၪ့ဘၪတၭ, အယီၩမွဲဆၧချဲၩ့ လၧယဟိဝၩ",
			"22": "<sup>22</sup> ဒုၭနဲၪယၧၩ,- ယိခွါ,ကယဲၦမုၪလၧအအီၪလၩ့ထးလၧ ယုဒၫအစဎွၩအဂံၪ့ဖၧၩ့ထီးအလူၬနီၪ, မိဘၪဆၧဆိၬ ထၪ့ဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩ အၦဒိၪဖၭဒိၪလဖၪအ အီၪတၭ,အဝ့ၫၥံၪမိစံၭ, နထံၩနၥိၭထိၪဂဲၩနၧၩ, ဒဲမၩ စၪနၧၩလီၫ. နခၪ့လၩ့လၧၩ့ လၧဖံၬကျၩ လါနၫ့တၭ,",
			"23": "<sup>23</sup> ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- ၦမိဂဲၫဆိၬနမၫထီးအလူၬ ဒဲနဖိၪန လံၩလၧၦခၫလဒံအၫဖိၪအအီၪတၭ, နမိဖီၩ့ဖျ့ၭလၧအ စူၪဖၧၩ့အ့ၬ. ဘၭဘလၧၫ့အစဎွၩမိဖီၪ့ထၬနၧၩတၭ, မိ ဆူၭထၪ့ခွံၬဒိၩ့ယီၩလၧမ့ၪလီၫ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့စဇ့ၭဒကဲအၫ,စံၭစယ့ၫရမဲအၫ, ဒုၭၥ့ၪ ယၫၦၡၩလၧဆၧချဲၩ့လဖၪယီၩ နးဂၩလဂ့ၩတၭ,နမိ",
			"25": "<sup>25</sup> ၥံၫဘၪအ့ၬ.- တၭၦဒိၪဖၭဒိၪလဖၪနီၪ အ့ၪနါဂၧၫ့ဝ့ၫလၧ ယချဲၩ့ဆၧလၧနၧၩ, အ့ၪဂဲၫလၧနအီၪတၭ,စံၭနၧၩ, လီၩ ဘၪပၧၩလၧဆၧလၧနစံၭစဎွၩဆံၭ, အီၪက့ၪၥူၪလၧ ပၧၩလဂ့ၩ, ဒဲကယဲဆၧချဲၩ့လၧစဎွၩစံၭနၧၩတၭ, ပမိ",
			"26": "<sup>26</sup> မၩၥံၫနၧၩအ့ၬ.- နမိဘၪစံၭအဝ့ၫၥံၪ, ယအၪ့ကံၩ့အၪ့ ယၫစဎွၩဘဲၫၥိၭ အထီးဒုၭထဲၩ့ထဲၩ့ယၧၩ လၧစစၪ့န ၥၧၫ့အဂံၪ့ဖၧၩ့ဘဲၫၥိၭယထီးၥံၫထီးနီၪလဂ့ၩလီၫ.",
			"27": "<sup>27</sup> တၭၦဒိၪဖၭဒိၪထီးအလူၬနီၪ, ဂဲၫဝ့ၫလၧစယ့ၫရမဲ အၫအအီၪတၭ,အၪ့စၪ့ဝ့ၫတၭ, အဝ့ၫဒၪလီၩဘၪအဝ့ၫ ၥံၪကယဲဆၧချဲၩ့ဘဲၫစဎွၩ မၪလူၬဝ့ၫအၥိၭလီၫ. တၭ အဝ့ၫၥံၪအီၪလၩ့မါပံၭတၭ စဲၪ့ထၪ့ခွံၬလၧအအီၪလီၫ. အဂဲးဘဲၫယီၩၥ့ၪယၫအဂဲးအကၠီၪ့နီၪအ့ၬ.",
			"28": "<sup>28</sup> တၭစယ့ၫရမဲအၫအီၪဝ့ၫလၧထီၫ့အဝၩ့ဖၧၩ့ ထီးမုလ နံၩလၧၦမၩန့ယရုစလံၫ့တၭ, ထီးၦမၩန့ယရုစလံၫ့ နီၪ,အီၪဝ့ၫလၧအဖၧၩ့လီၫ."
		},
		"39": {
			"1": "<sup>1</sup> ယုဒၫအစဎွၩဇ့ၭဒကဲအၫ အနံၪ့ခွံၫနံၪ့လနံၪ့လၩဆံၫ ဘံၪ့လဘံၪ့နီၪ ဘၭဘလၧၫ့ အစဎွၩ န့ၭဘူၫခၭန့ဇၫ, ဒဲအၥုၭမုခမျၧးထီးအလူၬ ဂဲၫထၪ့လၧယရုစလံၫ့တၭ,",
			"2": "<sup>2</sup> ဝၩ့ထၬဝ့ၫလီၫ.- တၭလၧစဇ့ၭဒကဲအၫအနံၪ့လဆံၫလ နံၪ့,လၩလံဘံၪ့လဘံၪ့, လၩထၪ့ခွံၫနံၩလနံၩနီၪ ဒိၩ့",
			"3": "<sup>3</sup> ဘၪဆၧဘုၪ့ဖိးဝ့ၫလီၫ.- ဘၭဘလၧၫ့အစဎွၩအၦဒိၪ ဖၭဒိၪထီးအလူၬဂဲၫနုၬဝ့ၫတၭ, ဆၧၫ့နၩ့လၧတရၫ့အ ၥၭကျၩနီၪ, စနၧဂလၭၡၫရံဇၧၫ,စၡၫ့မဂၫနံဘိၫ, ၦဖၫ ဆွံၪအခိၪစစၫစံၫကံၫ့, ၦမၫကူၭအခိၪ,စနၧဂလၭၡၫရံ ဇၧၫ,ဒဲဘၭဘလၧၫ့အစဎွၩ အၦဒိၪၥံၪလၧအအီၪလၩ့ ထးလဖၪထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> တၭထီးယုဒၫအစဎွၩဇ့ၭဒကဲအၫ, ဒဲၦၥုၭဖိၪထီးအ လူၬနီၪဒၪဘၪဝ့ၫတၭ, စဲၪ့ဖျိၭတၭ, စဲၪ့ထၪ့ခွံၬလၧဒိၩ့ ဖၧၩ့လၧမုနၩလခီၫ လၧစဎွၩအကျိၭအဖၧၩ့ၥၭလၧတ ရၫ့အီၪလၧခိၪဒၧၩ့ နံၫထၧၫ့အဘိၩ့ဆၧၩ့တၭ, စဲၪ့ထၪ့",
			"5": "<sup>5</sup> ဝ့ၫလၧဆၧပျၩ့ဖၧၩ့ အဖၧၩ့ၥၭလီၫ.- အ့ၪမွဲၦခၫလဒံ အၫအၥုၭမုခမျၧးလီၩ့ဆီးဝ့ၫတၭ, ချႃၭန့စဇ့ၭဒကဲအၫ လၧယ့ၫရခိၫ အဆၧပျၩ့ဖၧၩ့တၭ, ဖီၪ့န့ဝ့ၫတၭ, ဆိၬ ထၪ့ဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫအအီၪ လၧရံဘလၫလၧခးဟၫမၭအဖၧၩ့တၭ, အဝ့ၫဒၪစ့ၩရၫ့",
			"6": "<sup>6</sup> အဝ့ၫလီၫ.- တၭဘၭဘလၧၫ့အစဎွၩမၩၥံၫစဇ့ၭဒကဲ အၫအဖိၪခွၫလဖၪ လၧအမ့ၬယၫလၧရံဘလၫအဖၧၩ့ တၭ,ဘၭဘလၧၫ့အစဎွၩမၩၥံၫ ခးယုဒၫအၦဒိၪဖၭဒိၪ",
			"7": "<sup>7</sup> ထီးအလူၬလီၫ.- အီၩ့ခွ့ၭထၪ့ခွံၬစဇ့ၭဒကဲအၫအမ့ၬ ၥၪတၭစၧၩ့ထၬဝ့ၫလၧၥွ့ၫထၭဘဲၫၥိၭ အမိဆိၬထၪ့ခွံၬ",
			"8": "<sup>8</sup> အဝ့ၫဖိးလၧဘၭဘလၧၫ့လီၫ.- တၭၦခၫလဒံအၫဖိၪ ဆူၭထၪ့ခွံၬစဎွၩအနီး, ဒဲၦခမျၧးအဂံၪ့လဖၪ လၧမ့ၪ တၭ,မၩလၩ့ဎီးခွံၬယရုစလံၫ့အခိၪဒၧၩ့လီၫ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ၦခိၭဆၧအခိၪ စန့ၭဘူၫဇၫရဒၫ့ဆိၬ အၪ့မၧၫ့ဎီးၦခမျၧး လၧအအီၪလၩ့ထးလၧဒိၩ့ဖၧၩ့ ဒဲၦ လၧအလ့ၩယူၭဝ့ၫ လၧအအီၪလခီၫ, ဒဲၦခမျၧးလၧအ",
			"10": "<sup>10</sup> အီၪလၩ့ထးလဖၪနီၪထီးလၧဘၭဘလၧၫ့လီၫ.- တၭ ၦခိၭဆၧအခိၪ စန့ၭဘူၫဇၫရဒၫ့ အီၪက့ၪလၩ့ထးၦၡၪ့ ဖိၪယၬဖိၪလနၩ့ လၧအဆၧလအီၪဘၪလၧခးယုဒၫအ ဖၧၩ့,ဒဲဖ့ၪလၫ့အဝ့ၫၥံၪ လၧစဘံၭကျိၭလဖၪ, ဒဲဂၪ့ခိၪ အဝၩ့လဖၪလၧမုလနံၩနီၪလီၫ.",
			"11": "<sup>11</sup> ဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ မၪလူၬၦခိၭဆၧ အခိၪစန့ၭဘူၫဇၫရဒၫ့ လၧစယ့ၫရမဲအၫအဂဲးအကၠီၪ့",
			"12": "<sup>12</sup> တၭ,စံၭဝ့ၫဒၪ,- မၩန့ဝ့ၫတၭ,ယိထဲၩ့ခွါထဲၩ့ဂ့ၩဘၪစဲၪ တၭ,မၩအၧၩ့အဝ့ၫလၧဆၧနးမံၩ့လဂ့ၩ မွဲဘဲၫအချဲၩ့",
			"13": "<sup>13</sup> ဆၧလၧနၧၩအၥိၭနီၪ မၩအဝ့ၫဘဲၫနီၪအၥိၭဆံၭ.- တၭ ၦခိၭဆၧအခိၪ စန့ၭဘူၫဇၫရဒၫ့, ဒဲၦဖၫဆွံၪဖိၪအခိၪ စန့ၭဘၡၫစဘၫ့, ဒဲၦမၫကူၭအခိၪစနၧဂလၭၡၫရံဇၧၫ,",
			"14": "<sup>14</sup> ဒဲဘၭဘလၧၫ့အစဎွၩအၦဒိၪဖၭဒိၪထီးအလူၬ,- အၪ့ မၧၫ့လၩ့ဆၧမၩန့ထၪ့ထဲၩ့ စယ့ၫရမဲအၫလၧထီၫ့အဝၩ့ ဖၧၩ့တၭ, ဖ့ၪလၫ့အဝ့ၫလၧစၡၫဖၫ့အဖိၪခွၫစအဟဲအ ကံၫ့အဖိၪခွၫစဂ့ၭဒလဲအၫအစူၪဖၧၩ့ ဘဲၫၥိၭအမိဆိၬ ထၪ့အဝ့ၫလၧအဂံၪ့ဖၧၩ့လီၫ. တၭအီၪလၧၦခမျၧးအ ကျၩလီၫ.",
			"15": "<sup>15</sup> တၭလၧစယ့ၫရမဲအၫ အီၪကၭဘံၭထၬအၥၭလၧ ထီၫ့အဝၩ့ဖၧၩ့အဘိၩ့ဘၭနီၪ, ယဟိဝၩအလူလၩ့ဘၪ",
			"16": "<sup>16</sup> အဝ့ၫတၭ,စံၭဝ့ၫဒၪ,- လ့ၩချဲၩ့ဆၧလၧၦအံၫၥအိပၠၫဖိၪ စအံၫဘ့ၭမလ့ၭတၭ, စံၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိမၩလၧၫ့ ထၪ့ဎွ့ၩထၪ့ယဆၧချဲၩ့လၧဒိၩ့ယီၩ အဂဲးအကၠီၪ့လၧ ဆၧအၧၩ့အဂး, လမွဲဘၪလၧဆၧဂ့ၩအဂးတၭ, ဆၧ",
			"17": "<sup>17</sup> လၧမုလနံၩနီၪမိမၩအၥၭလၧနမ့ၬယၫလီၫ.- မွဲလါနၫ့ တၭ, ယမိမၩဖီၩ့မၩဖျ့ၭနၧၩလၧမုလနံၩနီၪ, ယဟိဝၩ စံၭဝ့ၫဒၪး တၭဆၧမိဖ့ၪလၫ့ခွံၬနၧၩ လၧၦလၧနၥၭမဲၪဝ့ၫ",
			"18": "<sup>18</sup> အစူၪဖၧၩ့အ့ၬ.- အဂဲးဘဲၫယီၩယမိမၩဖီၩ့မၩဖျ့ၭတၡါ နၧၩတၭ, နမိလၩ့ထံၩဖါဘၪလၧနၭအ့ၬ. အ့ၪမွဲနၥၭ မၧၫ့မိကဲၪထၪ့ဆၧအၪ့ဂူၬန့လၧနဂးလီၫ. အဂဲးဘဲၫယီၩ နဒိၭနဲၩ့နၥၭလၧယၧၩ, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"40": {
			"1": "<sup>1</sup> လၧၦခိၭဆၧအခိၪစန့ၭဘူၫဇၫရဒၫ့ဖျါခွံၬစယ့ၫရမဲ အၫလၧရၫမၫအလးခဲၫ့နီၪ ယဟိဝၩအလူလၩ့ဘၪ စယ့ၫရမဲအၫလီၫ. အဂဲးဘဲၫယီၩလၧစန့ၭဘူၫဇၫရဒၫ့, မၩန့ယူၭအဝ့ၫနီၪ, အီၪစၧၩ့ထၬဝ့ၫလၧၥွ့ၫထၭ လၧၦ လၧအဘၪဆၧဆိၬထၪ့ခွံၬ လၧယရုစလံၫ့ဒဲယုဒၫနီၪ, အၪ့မၧၫ့ဎီးဝ့ၫလဖၪအကျၩ လၧအဘၪဆၧဆိၬခွံၬအၪ့ မၧၫ့ဎီးဝ့ၫလၧဘၭဘလၧၫ့နီၪလီၫ.",
			"2": "<sup>2</sup> ၦခိၭဆၧအခိၪမၩန့စယ့ၫရမဲအၫတၭ, စံၭအဝ့ၫ,ယ ဟိဝၩနယွၩချဲၩ့ဝဲၩဆၧအၧၩ့ယီၩ လၧအလးယီၩအဂဲး",
			"3": "<sup>3</sup> လီၫ.- ယဟိဝၩဒုၭဘၪအဝ့ၫတၭ, မၩဝ့ၫဘဲၫကယဲဆၧ လၧအစံၭဝ့ၫအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩနၥံၪမၩမၪ ဘၪယဟိဝၩတၭ, ခိၭနၪအလူအ့ၬ. မၩအၥၭဘဲၫနီၪ",
			"4": "<sup>4</sup> တၭ,ဆၧယီၩလမံၩ့ဘၪနၥံၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ယမၩဂၭဖျ့ၭနၧၩလၧၥွ့ၫထၭ လၧအအီၪဝ့ၫလၧ နစူၪလီၩ့လီၫ. နဂဲၫလၧယၥိၭလၧဘၭဘလၧၫ့နီၪ, အ့ၪ ဂ့ၩလၧနမ့ၬယၫတၭ, ဂဲၫဘီၪ. တၭယမိအီၪက့ၪယမ့ၬ လၧနလီၩ့လၧဆၧဂ့ၩအဂးလီၫ. တၭဂဲၫလၧယၥိၭလၧ ဘၭဘလၧၫ့နီၪအ့ၪအၧၩ့လၧနမ့ၬယၫတၭ, အီၪဒၪနဝ့ၫ ဆံၭ.ယိခွါ, ခးလဘံၪ့အီၪလၧနမ့ၬယၫလီၫ. ထီးဒၪ အလးဂ့ၩ, ဒဲလီၩ့လၧနမ့ၬယၫနီၪ, လ့ၩလၧနီၪဘီၪ.",
			"5": "<sup>5</sup> တၭလထဲၩ့ထဲၩ့ဒံၭဘၪအဘိၩ့ဘၭနီၪ, အဝ့ၫဒၪစံၭ, ထဲၩ့ထဲၩ့လၧစၡၫဖၫ့အဖိၪခွၫ စအဟဲကၫ့အဖိၪခွၫစဂ့ၭ ဒလဲအၫအအီၪ, လၧဘၭဘလၧၫ့အစဎွၩအီၪက့ၪလၩ့ ၦအခိၪလၧယုဒၫအဒိၩ့လဖၪအဖၫ့ခိၪတၭ, အီၪလၧအ ဝ့ၫအၥိၭလၧၦခမျၧးအကျၩဘီၪ. အ့ၪလမွဲဘၪဘဲၫနီၪ တၭ,ထီးဒၪအလးဂ့ၩဒဲလီၩ့လၧနမ့ၬယၫနီၪ, လ့ၩလၧ နီၪဘီၪ. တၭၦခိၭဆၧအခိၪနီၪ, ဖ့ၪလၫ့အဝ့ၫလၧဆၧ အၪ့လၧဖၧၩ့ၥၭအဂး,ဒဲဆၧဖ့ၪလၫ့အဂးတၭ ဖျါခွံၬဝ့ၫ လီၫ.",
			"6": "<sup>6</sup> တၭစယ့ၫရမဲအၫလ့ၩဝ့ၫလၧစအဟဲကၫ့ အဖိၪခွၫ စဂ့ၭဒလဲအၫအီၪလၧမံဇဖၫအဖၧၩ့တၭ, အီၪဝ့ၫလၧအ ၥိၭလၧၦခမျၧး လၧအအီၪလၩ့ထးလၧခးဖၧၩ့အကျၩ လီၫ.",
			"7": "<sup>7</sup> တၭထီးၦၥုၭဖိၪအခိၪလၧအအီၪဝ့ၫ လၧမံၩ့လၬကျၩ ထီးအလူၬ, အဝ့ၫၥံၪဒဲအၦၡၩနါဂၧၫ့ဝ့ၫလၧဘၭဘလၧၫ့ အစဎွၩအီၪက့ၪစအဟဲကၫ့အဖိၪခွၫ စဂ့ၭဒလဲအၫနီၪ လၧခးအဖၫ့ခိၪတၭ, အီၪက့ၪလၩ့ၦခွၫဒဲၦမုၪ, ဒဲဖိၪဒံၩ ဖိၪၥၪ,ဒဲခးအၦၡၪ့ဖိၪယၬဖိၪလနၩ့ လၧအစူၪဖၧၩ့, ၦ လၧဆၧလဆိၬအၪ့မၧၫ့ဎီးဘၪဝ့ၫ လၧဘၭဘလၧၫ့အ",
			"8": "<sup>8</sup> ဖၧၩ့တၭ,- အဝ့ၫၥံၪဂဲၫလၧမံဇဖၫထီးစဂ့ၭဒလဲအၫအ အီၪနီၪ, စန့ၭၥနဲအၫအဖိၪခွၫဒၪလ့ၬ စအံၡမၫအ့လၭ, ဒဲစကရံအၫ အဖိၪခွၫၥံၪ, စယိၫဟၫနၫ့ဒဲစစၪ့နၥၧၫ့,ဒဲ စဟၫဟုမ့ၭအဖိၪခွၫ, စစံၫရအဲအၫ, ဒဲနတီၭဖၭဖိၪစအ့ ဖဲၫအဖိၪခွၫၥံၪ, ဒဲၦမၫအကၭဖိၪလဂၩ အဖိၪခွၫစယ့ၫ ဇနဲအၫ,အဝ့ၫၥံၪဒဲၦၡၩဘၪဆဲၫ့လၧအဝ့ၫၥံၪဆ့လီၫ.",
			"9": "<sup>9</sup> တၭစၡၫဖၫ့အဖိၪခွၫစအဟဲကၫ့အဖိၪခွၫ, စဂ့ၭဒလဲ အၫဆိၪလၩ့အၥၭလၧအဝ့ၫၥံၪ, ဒဲလၧအၦၡၩလဖၪ တၭ,စံၭဝ့ၫဒၪ,ၥၭမဲၪဆၧလဂ့ၩ, မၩၦခၫလဒံအၫဖိၪအ ဆၧဆံၭ.အီၪလၧခးဖၧၩ့တၭ, မၩဘၭဘလၧၫ့အစဎွၩ အဆၧဆံၭ. တၭဆၧမိဂ့ၩထၪ့ လၧနၥံၪအဂးလီၫ.",
			"10": "<sup>10</sup> အ့ၪမွဲဆၧလၧယၧၩယီၩ, ယိခွါ, ယအီၪလၧမံဇဖၫဘဲၫ ၥိၭယမိမၩ ၦခၫလဒံအၫဖိၪ လၧအမိဂဲၫလၧပအီၪအ ဆၧလီၫ. အ့ၪမွဲနၥံၪဝ့ၫအီၪက့ၪကီၪ့စဘံၭထံၫ, ဒဲဆၧခိ အထီအဆၧၥၪ, ဒဲၥိၪၥံၪချၫၥံၪ, ဒဲဒုၭလၩ့ဝ့ၫလၧနၥံၪအ ဆၧဖၧၩ့တၭ,အီၪလၧဒိၩ့လဖၪ လၧနၥံၪမၩန့ဝ့ၫဆံၭ.",
			"11": "<sup>11</sup> တၭထီးၦယုဒၫဖိၪထီးအလူၬ လၧအအီၪဝ့ၫလၧမိ အၭအဖၧၩ့, ဒဲလၧၦအၫမၧၫ့ဖိၪအကျၩ, ဒဲလၧအံဒၧၫ့ အဖၧၩ့,ဒဲၦလၧအအီၪဝ့ၫ လၧခးထီးအလူၬအဖၧၩ့နီၪ, နါဂၧၫ့ဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩ အီၪက့ၪလၩ့ထးၦ လၧၦယုဒၫဖိၪအကျၩတၭ, အီၪက့ၪစၡၫဖၫ့အဖိၪခွၫ စအဟဲကၫ့အဖိၪခွၫစဂ့ၭဒလဲအၫ လၧအဖၫ့ခိၪတၭ,",
			"12": "<sup>12</sup> ၦယုဒၫဖိၪထီးအလူၬ, ဂဲၫထဲၩ့ဝ့ၫလၧအလးထီးဆၧနၫ့ ထၪ့ဒုၭအီၪဝ့ၫလၧအဖၧၩ့တၭ, ဂဲၫထီၩ့လၧခးယုဒၫလၧ စဂ့ၭဒလဲအၫအအီၪ လၧမံဇဖၫအဖၧၩ့တၭ, အီၪက့ၪ ကီၪ့စဘံၭထံၫ, ဒဲဆၧခိအထီအဆၧၥၪအၪအၪလ့ၬလီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့စကရံအၫအဖိၪခွၫစယိဟၫနၫ့ဒဲၦၥုၭ ဖိၪအခိၪလၧအအီၪဝ့ၫလၧမံၩ့လၬကျၩ ထီးအလူၬဂဲၫ",
			"14": "<sup>14</sup> ဝ့ၫလၧစဂ့ၭဒလဲအၫအအီၪ လၧမံဇဖၫအဖၧၩ့,- တၭ စံၭအဝ့ၫၦအၫမၧၫ့ဖိၪ အစဎွၩစဘၫအလံၭအၪ့မၧၫ့ လၩ့စန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫအ့လၭဘဲၫၥိၭ အမိ မၩၥံၫနၧၩနီၪ, မွဲနၥ့ၪယၫတၡါဆ့ဧၪ. တၭစအဟဲကၫ့",
			"15": "<sup>15</sup> အဖိၪခွၫစဂ့ၭဒလဲအၫနဲၩဝ့ၫအ့ၬး- ထီးနီၪလဖၧၫ့စက ရံအၫအဖိၪခွၫ စယိၫဟၫနၫ့ချဲၩ့ၥူၪဆၧ လၧစဂ့ၭဒလဲ အၫလၧမံဇဖၫအဖၧၩ့တၭ,စံၭဝ့ၫဒၪ, ဒုၭလ့ၩလါယၧၩ ဆံၭ.တၭယမိမၩၥံၫစန့ၭၥနဲအၫအဖိၪခွၫစအံၡမၫအ့ လၭတၭ,ၦမိၥ့ၪယၫဘၪနးဂၩအ့ၬ. မွဲအမိမၩၥံၫနၧၩ တၭ,ဒဲၦယုဒၫဖိၪလၧအအီၪကီၪ့လၧနအီၪထီးအလူၬ, မိလၩ့ပြံၩလၩ့ပၩ, ဒဲၦအီၪလၩ့ထးလၧယုဒၫလဖၪမိ ဂၭဂီၩ့ဂၭစၪနီၪမွဲဘၪလဲၪ.",
			"16": "<sup>16</sup> စအဟဲကၫ့အဖိၪခွၫစဂ့ၭဒလဲအၫ စံၭစကရံအၫအ ဖိၪခွၫစယိၫဟၫနၫ့နီၪ, ထီးမၩဆၧနီၪလမံၩ့လဂ့ၩး အ ဂဲးဘဲၫယီၩ နချဲၩ့ဘျံၭချဲၩ့ဘျၪလၧစအံၡမၫအ့လၭအ ဂဲးနီၪလီၫ."
		},
		"41": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭ လၧလၩနွ့ၫဘံၪ့လဘံၪ့နီၪ စအံၫ လံၭၡမၫ အဖိၪခွၫ စန့ၭၥနဲအၫ အဖိၪခွၫ စအံၡမၫအ့ လၭ,ဘၪဆဲၫ့လၧစဎွၩအဆၨၩအဆၬလဂၩ, ဒဲစဎွၩ အၦဒိၪဖၭဒိၪလဖၪ, ဒဲၦဆံၫဂၩ အီၪလၧအၥိၭနီၪဂဲၫ ဝ့ၫလၧစအဟဲကၫ့အဖိၪခွၫစဂ့ၭဒလဲအၫအအီၪ, လၧ မံဇဖၫအဖၧၩ့တၭ, အၪ့ကိၪလစီၪ့ဎးလၧမံဇဖၫအဖၧၩ့ လီၫ.",
			"2": "<sup>2</sup> တၭစန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫအ့လၭဒဲၦဆံၫ ဂၩလၧအအီၪလၧအၥိၭ ဂဲထုၪ့ကျီၪ့ခွံၬ စၡၫဖၫ့အဖိၪ ခွၫစအဟဲကၫ့အဖိၪခွၫ, စဂ့ၭဒလဲအၫလၧနၭတၭ, မၩ ၥံၫၦလၧဘၭဘလၧၫ့အစဎွၩအီၪက့ၪလၩ့လၧခးအဖၫ့",
			"3": "<sup>3</sup> ခိၪလီၫ.- တၭစအံၡမၫအ့လၭမၩၥံၫဆ့ကယဲၦယုဒၫဖိၪ လၧအအီၪဝ့ၫလၧစဂ့ၭဒလဲအၫအၥိၭ လၧမံဇဖၫအဖၧၩ့ ထီးအလူၬ, ဒဲၦခၫလဒံအၫဖိၪအၡၩၥုၭဖိၪလၧအအီၪ ထီးနီၪလီၫ.",
			"4": "<sup>4</sup> တၭလၧအမၩၥံၫ စဂ့ၭဒလဲအၫအလးခဲၫ့နံၫနံၩလ",
			"5": "<sup>5</sup> နံၩ,လၧၦလၥ့ၪယၫဘၪနးဂၩနီၪ,- ဆၧမၩအၥၭလၧ ၦဎိၭဆံၫဂဲၫဝ့ၫလၧၡံကံၫ့, လၧၡဲလိၫ, ဒဲလၧစမ့ရအၫ လၧအခၪလၬဆီၪ့လိၩ့ခွံၬယူၭ, လၧအကီၩ့အၥိၭယၬ, လၧအဂ့ၬလၩ့ဒၪအၥၭယူၭတၭ, အီၪဝ့ၫလၧဆၧမၩ ဘိၪ့,ဒဲလီဘၫ့လၧအစူၪဖၧၩ့ဘဲၫၥိၭ မိဂဲၫဆိၬဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> စန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫအ့လၭ လ့ၩလၧခီၫ့ ဘဲၫၥိၭအမိအၪ့ဂၬဝ့ၫတၭ, လ့ၩလခီၫ ဂၪ့လခီၫတၭ, ထီးအထီၩ့လၧအအီၪနီၪ, ဆၧမၩအၥၭလၧအစံၭအ ဝ့ၫၥံၪ,ဂဲၫလၧစအဟဲကၫ့အဖိၪခွၫ စဂ့ၭဒလဲအၫအအီၪ",
			"7": "<sup>7</sup> ဆံၭ.- တၭထီးအဝ့ၫၥံၪဂဲၫနုၬ လၧဒိၩ့အၥၭကျၩတၭ, ဆၧမၩအၥၭ လၧစန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫအ့ လၭမၩၥံၫအဝ့ၫၥံၪတၭ, ခွံၬၡိၭခွံၬဝ့ၫ လၧဆၧဖၧၩ့အ ၥၭကျၩ,အဝ့ၫဒၪ ဒဲၦၡၩလၧအအီၪလၧအၥိၭလဖၪ",
			"8": "<sup>8</sup> မၩဝ့ၫလီၫ.- လါနၫ့ၦၡၩဆံၫဂၩအီၪဝ့ၫလၧအကျၩလၧ အစံၭစအံၡမၫအ့လၭနီၪ ထီးမၩၥံၫပၧၩလဂ့ၩ. အဂဲး ဘဲၫယီၩပအီၪလၧဘုၪကၠိၩ့, ဒဲဘုၪမုယီၩဒဲၥိၪၥံၪချၫၥံၪ, ဒဲန့ၫစၩ့အီၪက့ၪကီၪ့အၥၭလၧမံၩ့လၬကျၩလီၫ. အခိး မွဲအအွံၪၥၭဆၧၩ့အဝ့ၫၥံၪတၭ, မၩၥံၫဝ့ၫလၧအထၧၫ့ဖု ဝဲအကျၩအ့ၬ.",
			"9": "<sup>9</sup> တၭဆၧဖၧၩ့လၧစအံၡမၫအ့လၭခွံၬၡိၭခွံၬ ၦၡၩလၧ အမၩၥံၫဝ့ၫအစွၪ လၧအအီၪဝ့ၫ လၧစဂ့ၭဒလဲအၫအ ၥိၭအကၠီၩ့နီၪ, မွဲဆၧဖၧၩ့လၧစဎွၩအၫစၫ ခုၪ့လၩ့ဝ့ၫ လၧအၥၭမဲၪ ၦအံၫစရ့လၭအစဎွၩ ဘၫအၡၫအကၠီၩ့ လီၫ. စန့ၭၥနဲအၫအဖိၪခွၫစအံၡမၫအ့လၭနီၪ မၩဎွ့ၩ ဝ့ၫလၧၦဘၪဆၧမၩၥံၫဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့စအံၡမၫအ့လၭ ဆိၬအၪ့မၧၫ့ဎီးကယဲ ၦခမျၧးလၧအအီၪလၩ့ထးလၧမံဇဖၫအဖၧၩ့, စဎွၩအ ဖိၪမုၪလဖၪဒၪလ့ၬ, ဒဲကယဲၦခမျၧးလၧအအီၪလၩ့ထး လၧမံဇဖၫလၧၦခိၭဆၧအခိၪ စန့ၭဘူၫဇၫရဒၫ့အီၪက့ၪ လၩ့ဝ့ၫလၧစအဟဲကၫ့ အဖိၪခွၫ စဂ့ၭဒလဲအၫအစူၪ ဖၧၩ့လီၫ. တၭစန့ၭၥနဲအၫ အဖိၪခွၫစအံၡမၫအ့လၭ ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫတၭ, လ့ၩဝ့ၫဘဲၫၥိၭအမိလ့ၩထၪ့လၧ ၦအၫမၧၫ့ဖိၪအအီၪလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲထီးစကရံအၫအဖိၪခွၫ စယိၫဟၫနၫ့ဒဲၦၥုၭဖိၪ အခိၪလၧအအီၪဝ့ၫ လၧအၥိၭထီးအလူၬနီၪ နါဂၧၫ့ဝ့ၫ လၧကယဲဆၧအၧၩ့လၧစန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫ",
			"12": "<sup>12</sup> အ့လၭမၩဝ့ၫတၭ,- မၩန့ၦၡၩထီးအလူၬတၭ,လ့ၩဒုၭ ဆၧလၧစန့ၭၥနဲအၫအဖိၪခွၫစအံၡမၫအ့လၭတၭ, ဒၪ န့ဝ့ၫလၧထံၫဖၭဒိၪအနဲၩ့အီၪဝ့ၫ လၧဂံဘအၧၫ့အဖၧၩ့",
			"13": "<sup>13</sup> လီၫ.- တၭထီးၦခမျၧးလၧအအီၪဝ့ၫ လၧစအံၡမၫအ့ လၭအၥိၭထီးအလူၬနီၪ ဒၪဘၪစကရံအၫအဖိၪခွၫ စယိၫဟၫနၫ့ဒဲၦၥုၭခိၪလဖၪလၧအအီၪလၧအၥိၭထီး အလူၬတၭ, ဆၧမၩအၥၭ လၧအၥုၪ့ထိၬ ၥၭထိၬဝ့ၫ",
			"14": "<sup>14</sup> လီၫ.- တၭကယဲၦလၧအံၡမၫအ့လၭဆိၬထၪ့ခွံၬလၧမံ ဇဖၫနီၪအၪ့မၧၫ့ဎီးဝ့ၫထီးအလူၬတၭ, အဝ့ၫၥံၪကၠၪက ဒၩထဲၩ့အၥၭတၭ,ဂဲၫထဲၩ့ထဲၩ့တၭ,လ့ၩဝ့ၫလၧစကရံ",
			"15": "<sup>15</sup> အၫအဖိၪခွၫစယိၫဟၫနၫ့အအီၪလီၫ.- အ့ၪမွဲစန့ၭၥနဲ အၫအဖိၪခွၫစအံၡမၫအ့လၭ ဒဲၦဎိၭဂၩနီၪ ဖီၩ့ဖျ့ၭဝ့ၫ လၧစယိၫဟၫနၫ့တၭ, လ့ၩဝ့ၫလၧၦအၫမၧၫ့ဖိၪအအီၪ လီၫ.",
			"16": "<sup>16</sup> ထီးနီၪလဖၧၫ့စကရံအၫအဖိၪခွၫ စယိၫဟၫနၫ့ဒဲၦ ၥုၭဖိၪအခိၪလၧအအီၪဝ့ၫ လၧအၥိၭထီးအလူၬနီၪမၩ န့ၦခမျၧးလၧအအီၪလၩ့ထး လၧအမၩန့ထဲၩ့ဝ့ၫလၧ မံဇဖၫအဖၧၩ့ လၧစန့ၭၥနဲအၫအဖိၪခွၫ စအံၡမၫအ့ လၭအစူၪဖၧၩ့လၧအမၩၥံၫစအဟဲကၫ့ အဖိၪခွၫစဂ့ၭ ဒလဲအၫအလးခဲၫ့နီၪ, ၦၥုၭဖိၪအီၪလၧဂဲးဆီၪ့ဘၭဆီၪ့ ဒဲၦမုၪဒဲဖိၪဒံၩဖိၪၥၪ, ဒဲၦဖၫဆွံၪလၧအဝ့ၫဒၪ ဂဲၫထဲၩ့",
			"17": "<sup>17</sup> ဆိၬလၧဂံဘအၧၫ့း- တၭအဝ့ၫၥံၪထဲၩ့ဝ့ၫတၭ, အီၪဝ့ၫ လၧခံၫမဟၫ့အဆၧအီၪအလးလၧအအီၪဝ့ၫ လၧဘ့ၭ ၥလံဟံၫ့အနဲၩ့ထံၭ, ဘဲၫၥိၭအမိလ့ၩနုၬ လၧအံဇံၭအ",
			"18": "<sup>18</sup> ဖၧၩ့,လၧၦခၫလဒံအၫဖိၪအကၠီၩ့နီၪလီၫ.- မွဲလၧအၥၭ မဲၪအဝ့ၫၥံၪအကၠီၩ့နီၪ, အဂဲးဘဲၫယီၩ စန့ၭၥနဲအၫအ ဖိၪခွၫစအံၡမၫအ့လၭမၩၥံၫယူၭ စအဟဲကၫ့အဖိၪခွၫ စဂ့ၭဒလဲအၫလၧဘၭဘလၧၫ့အစဎွၩ အီၪက့ၪလၩ့ဝ့ၫ လၧခးအဖၫ့ခိၪလီၫ."
		},
		"42": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦၥုၭဖိၪအခိၪထီးအလူၬ, ဒဲစကရံအၫ အဖိၪခွၫစယိၫဟၫနၫ့, ဒဲစဟီၭၡအဲအၫအဖိၪခွၫစယ့ၫ ဇနဲအၫ, ဒဲၦခမျၧးလၧအဆံၭထုၬဖိးလၧအဒိၪထုၬထီး",
			"2": "<sup>2</sup> အလူၬနီၪၥုၭဘူၭအၥၭး- စံၭမီၪစယ့ၫရမဲအၫမွဲပအၪ့ ကံၩ့အၪ့ယၫဆၧယီၩ ကဲၪထၪ့လါဆၧအဂ့ၩ လၧနမ့ၬ ယၫတၭ,ဘၩဆိၪဖၪန့ပဂးလၧယဟိဝၩနယွၩ, လၧၦ အီၪလၩ့ထးထီးအလူၬယီၩအဂး, (အဂဲးဘဲၫယီၩ ၦ အီၪလၩ့ထးၡၩဂၩ လၧၦအၪဂၩအကျၩဘဲၫနမ့ၬၥၪဒၪ",
			"3": "<sup>3</sup> ဘၪပၧၩအၥိၭနီၪ,) - ဘဲၫၥိၭယဟိဝၩနယွၩ မိဒုၭနဲၪ လၧပမ့ၬယၫဖၧၩ့ၥၭလၧပမိဖိၬ, ဒဲဆၧလၧပမိဘၪမၩ နီၪဆံၭ.",
			"4": "<sup>4</sup> တၭမီၪစယ့ၫရမဲအၫစံၭဝ့ၫး ယနါဂၧၫ့ယူၭ,ယိခွါ, ယမိဘၩဆိၪဖၪ ယဟိဝၩနၥံၪအယွၩ ဘဲၫနၥံၪအဆၧ ချဲၩ့အၥိၭနီၪ, ထီးဒၪယဟိဝၩမိစံၭဆၧၫ့နၥံၪလမံၩ့မံၩ့ နီၪ,ဆၧမၩအၥၭလၧယမိလီၩဘၪနၥံၪလီၫ. ယအီၪ က့ၪၥူၪခွံၬဆၧလၧနၥံၪနးမံၩ့အ့ၬ.",
			"5": "<sup>5</sup> တၭအဝ့ၫၥံၪစံၭစယ့ၫရမဲအၫ, ပမိမၩဘဲၫကယဲဆၧ လၧယဟိဝၩနယွၩအၪ့မၧၫ့လၩ့နၧၩ လၧပအီၪလၧအ ဂးအၥိၭနီၪလီၫ. မွဲယဟိဝၩကဲၪထၪ့ၦထိးအၥၭအမွဲ",
			"6": "<sup>6</sup> အတီၩလၧပဘိၩ့ဆၧၩ့ဆံၭ.- အဂ့ၩမွဲဂ့ၩ, အအၧၩ့မွဲ ဂ့ၩပမိခိၭနၪယဟိဝၩပယွၩ လၧပအၪ့မၧၫ့လၩ့န့နၧၩ လၧအအီၪလဂၩအလူ, ဘဲၫၥိၭထီးပအ့ၪခိၭနၪယဟိ ဝၩပယွၩအလူတၭ,ဆၧမိဂ့ၩဝ့ၫလၧပဂးလီၫ.",
			"7": "<sup>7</sup> တၭလၧဆံၫနံၩအလးခဲၫ့နီၪဆၧမၩအၥၭလၧယဟိ",
			"8": "<sup>8</sup> ဝၩအလူလၩ့ဘၪ စယ့ၫရမဲအၫလီၫ.- တၭအဝ့ၫဒၪ ကိၭန့စကရံအၫ အဖိၪခွၫစယိၫဟၫနၫ့, ဒဲၦၥုၭခိၪထီး အလူၬလၧအအီၪလၧအၥိၭ, ဒဲၦခမျၧးလၧအဆံၭထုၬ",
			"9": "<sup>9</sup> ဖိးလၧအဒိၪထုၬထီးအလူၬ,- တၭစံၭအဝ့ၫၥံၪ,ယဟိ ဝၩအံၫစရ့လၭအယွၩ, လၧနၥံၪအၪ့မၧၫ့လၩ့န့ယၧၩ ဘဲၫၥိၭယမိအီၪက့ၪနၥံၪ အဆၧအၪ့ကံၩ့အၪ့ယၫလၧ",
			"10": "<sup>10</sup> အမ့ၬယၫနီၪစံၭဝ့ၫဘဲၫယီၩး- နၥံၪအ့ၪအီၪဒံၭလၧခး ယီၩအဖၧၩ့တၭ, ယမိမၩကဲၪထၪ့နၥံၪတၭ,ယမၩလၩ့ ဎီးနၥံၪအ့ၬ, ယမိၥုၪ့လၩ့ဖျၭလၩ့နၥံၪတၭ, ယထ့ၭထၪ့ ခွံၬနၥံၪအ့ၬ. အဂဲးဘဲၫယီၩယနီၫ့ယါလၩ့ထဲၩ့ယၥၭ",
			"11": "<sup>11</sup> လၧဆၧအၧၩ့လၧယမၩယူၭနၥံၪနီၪလီၫ.- ဘၭဘလၧၫ့ အစဎွၩလၧနၥံၪၥၭမဲၪနီၪ, ၥၭမဲၩလၧၩ့ အဝ့ၫလဂ့ၩ, ယဟိဝၩစံၭဝ့ၫဒၪ. ၥၭမဲၪအဝ့ၫလဂ့ၩ, အဂဲးဘဲၫယီၩ ယအီၪလၧနၥံၪအၥိၭ, ယထိးထဲၩ့တၩ့ထဲၩ့နၥံၪ, ဒဲမၩ",
			"12": "<sup>12</sup> ဖီၩ့မၩဖျ့ၭနၥံၪလၧအစူၪဖၧၩ့လီၫ.- တၭယမိဒုၭနဲၪဆၧ ယၫ့ၥၭလဖၪလၧနၥံၪ, ဘဲၫၥိၭအဝ့ၫဒၪမိယၫ့ၥၭနၥံၪ, ဒဲမိအၪ့မၧၫ့နၥံၪထဲၩ့ထဲၩ့ လၧနၥံၪအခးဒၪနၥံၪဝ့ၫအ",
			"13": "<sup>13</sup> ဖၧၩ့လီၫ.- အ့ၪမွဲနၥံၪအ့ၪစံၭ, ပအီၪလၧခးယီၩအဖၧၩ့ အ့ၬ.ပခိၭနၪယဟိဝၩနၥံၪအယွၩအလူအ့ၬး နၥံၪအ့ၪ",
			"14": "<sup>14</sup> စံၭ,မွဲအ့ၬ.- ပမိလ့ၩလၧခးအံဇံၭအဖၧၩ့, ထီးပလဒၪ လၧၩ့ဘၪဆၧဒုၭၥုၭ, ဒဲလနါဂၧၫ့လၧၩ့ဘၪ ခွ့ၩအၥီၫ, ဒဲဆၧလၥၭဝံလၧၩ့ဘၪပၥၭ လၧကိၪတၭ, ပမိအီၪထီး",
			"15": "<sup>15</sup> နီၪလီၫ.- ဘိၩ့နဲၪ့ယီၩယုဒၫအၡၩ အီၪလၩ့ထးၥံၪဧ့, ခိၭနၪယဟိဝၩအလူဆံၭ. ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, နၥံၪအ့ၪအီၪက့ၪနၥံၪ အမ့ၬဘဲၫၥိၭနၥံၪမိလ့ၩနုၬ လၧအံဇံၭအဖၧၩ့, ဒဲလ့ၩ",
			"16": "<sup>16</sup> အီၪထီးနီၪတၭ,- ဆၧမိမၩအၥၭလၧနၭလၧနၥံၪၥၭမဲၪ ဝ့ၫနီၪမိချႃၭန့နၥံၪ ထီးအံဇံၭအခးဖၧၩ့နီၪတၭ, ဆၧၥၭ ဝံလၩ့ဒိၩလၧနၥံၪၥၭမဲၪဝ့ၫနီၪ မိလီၩ့ဆီးချႃၭန့နၥံၪလၧ",
			"17": "<sup>17</sup> အံဇံၭအဖၧၩ့တၭ, နၥံၪမိၥံၫထီးနီၪလီၫ.- မွဲမၬကယဲ ၦၡၩလၧအအီၪက့ၪအမ့ၬ လၧအမိလ့ၩနုၬလၧအံဇံၭ အဖၧၩ့ဘဲၫၥိၭအမိအီၪထီးနီၪ, မိၥံၫဝ့ၫလၧနၭၥံၪဖၩ့ ၥံၪ,ဒဲလၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧဆၧၥံၫချဲၫ့လီၫ. တၭ ၦအီၪလၩ့ထးအ့ၬး ၦဖီၩ့ဖျ့ၭဒဲဆၧအၧၩ့ လၧဆၧဒုၭ ဂဲၫဘၪအဝ့ၫၥံၪနီၪနးဂၩအ့ၬ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫစရ့ လၭအယွၩနီၪစံၭဘဲၫယီၩ, ဘဲၫယၥၭထၪ့ဒဲယၥၭခဲၩထၪ့ လူၫလၩ့အၥၭ လၧၦယရုစလံၫ့ဖိၪ အဖၫ့ခိၪအၥိၭနီၪ, ထီးနၥံၪအ့ၪလ့ၩနုၬလၧအံဇံၭအဖၧၩ့နီၪ, ယၥၭထၪ့မိ လူၫလၩ့အၥၭလၧနၥံၪအဖၫ့ခိၪဘဲၫနီၪၥိၭတၭ, နၥံၪမိ ကဲၪထၪ့ဆၧၥၭလိၪအလး ဒဲဆၧထီၫမံၫထီၫမၪအလး, ဒဲဆၧဆိၪအၧၩ့အလး, ဒဲဆၧဒုၪဒွ့ၪအလးတၭ, နၥံၪ မိဒၪလၧၩ့ဆၧအလးယီၩအ့ၬ.",
			"19": "<sup>19</sup> ၦအီၪလၩ့ထး လၧယုဒၫၥံၪဧ့, ယဟိဝၩစံၭနၥံၪ, လ့ၩလၧအံဇံၭအဖၧၩ့လဂ့ၩ. ၥ့ၪယၫတၡါလၧယထိး ယၥၭလၧနၥံၪအမ့ၬယၫ လၧမုဆၫလနံၩယီၩဆံၭ.",
			"20": "<sup>20</sup> မွဲမၬနၥံၪမၩမၪဘၪနၥံၪအၥၭဒၪနၥံၪဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩ,နၥံၪအၪ့မၧၫ့လၩ့ယၧၩလၧယဟိဝၩနၥံၪအယွၩ အအီၪတၭ,နၥံၪစံၭ, ဘၩဆိၪဖၪန့ပဂးလၧယဟိဝၩ ပယွၩဆံၭ. ဘဲၫကယဲဆၧလၧယဟိဝၩပယွၩစံၭအၥိၭ",
			"21": "<sup>21</sup> နီၪလီၩဘၪထဲၩ့ပၧၩဆံၭ. တၭပမိမၩဝ့ၫလီၫ.- ဘိၩ့နဲၪ့ ယီၩယလီၩဘၪယူၭဆၧနီၪ လၧနၥံၪလၧမုဆၫလနံၩ ယီၩလီၫ. မွဲလါနၫ့နၥံၪခိၭနၪယဟိဝၩ နၥံၪအယွၩအ လူအ့ၬ,ဒဲလၧအအၪ့မၧၫ့လၩ့န့ယၧၩ လၧနၥံၪအအီၪ",
			"22": "<sup>22</sup> လၧအကၠီၩ့နၥံၪခိၭနၪဆၧနးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,ဘိၩ့နဲၪ့ယီၩၥ့ၪယၫတၡါ လၧနၥံၪမိၥံၫလၧနၭၥံၪ ဖၩ့ၥံၪ,လၧဆၧၥၭဝံလၩ့ဒိၩ, လၧဆၧၥံၫချဲၫ့လၧဆၧအ လးလၧအဘၪနၥံၪအၥၭ လၧနၥံၪမိလ့ၩနုၬအီၪလၧအ ဖၧၩ့လီၫ."
		},
		"43": {
			"1": "<sup>1</sup> ထီးစယ့ၫရမဲအၫချဲၩ့ဆၧလၧၦၡၩ ထီးအလူၬလၧ ယဟိဝၩအဝ့ၫၥံၪအယွၩ အလူထီးအလူၬ လၧယဟိ ဝၩအဝ့ၫၥံၪအယွၩအၪ့မၧၫ့လၩ့န့အဝ့ၫ လၧအဝ့ၫၥံၪအ",
			"2": "<sup>2</sup> အီၪလၧဆၧချဲၩ့ထီးအလူၬနီၪ,- တၭဆၧမၩအၥၭလၧ စဟီၭၡအဲအၫအဖိၪခွၫစအၭစရဲၫ, ဒဲစကရံအၫအဖိၪ ခွၫစယိၫဟၫနၫ့, ဒဲၦအအီၪက့ၪထၪ့ထီၫအၥၭ ထီးအ လူၬချဲၩ့ထၪ့ဆၧတၭ, စံၭစယ့ၫရမဲအၫ နချဲၩ့ဘျံၭချဲၩ့ ဘျၪဆၧလီၫ. ယဟိဝၩပယွၩအၪ့မၧၫ့လၩ့န့နၧၩဘဲၫ နစံၭလ့ၩအီၪလၧအံဇံၭအဖၧၩ့လဂ့ၩ အၥိၭနီၪအ့ၬ.",
			"3": "<sup>3</sup> အ့ၪမွဲစနံၫရဲအၫအဖိၪခွၫ စဘၫရၧၭထိၪဂဲၩနၥၭထၫ့ဒၩ ပၧၩဘဲၫၥိၭအမိဖ့ၪလၫ့ခွံၬပၧၩ လၧၦခၫလဒံအၫဖိၪအ စူၪဖၧၩ့လၧအမိမၩၥံၫပၧၩ, ဒဲဆိၬအၪ့မၧၫ့ဎီးပၧၩလၧ",
			"4": "<sup>4</sup> ဘၭဘလၧၫ့အဖၧၩ့နီၪလီၫ.- တၭစကရံအၫအဖိၪခွၫ စယိၫဟၫနၫ့, ဒဲၦၥုၭဖိၪအခိၪထီးအလူၬ,ဒဲၦခမျၧးထီး အလူၬနီၪခိၭနၪယဟိဝၩအလူ လၧအဘၪအီၪဝ့ၫလၧ ခးယုဒၫအဖၧၩ့အ့ၬ.",
			"5": "<sup>5</sup> တၭစကရံအၫအဖိၪခွၫစယိၫဟၫနၫ့, ဒဲၦၥုၭဖိၪအခိၪ ထီးအလူၬနီၪမၩန့ယုဒၫအၡၩ အီၪလၩ့ထးထီးအလူၬ လၧအဂဲၫထဲၩ့ထဲၩ့ လၧၦဆၨၩထီးအလူၬအကျၩထီး ဆၧနၫ့ထၪ့ဒုၭအီၪဝ့ၫအလးလစီၪ့လါလါနီၪ ဘဲၫၥိၭအ",
			"6": "<sup>6</sup> မိအီၪလၧခးယုဒၫအဖၧၩ့,- ဒဲၦခွၫ,ဒဲၦမုၪ,ဒဲဖိၪဒံၩဖိၪ ၥၪ,ဒဲစဎွၩအဖိၪမုၪလဖၪ, ဒဲကယဲၦလၧအပၧၩ့ ၦခိၭ ဆၧစန့ၭဘူၫဇၫရဒၫ့အီၪက့ၪလၩ့ထး လၧစၡၫဖၫ့အဖိၪ ခွၫ,စအဟဲကၫ့အဖိၪခွၫ, စဂ့ၭဒလဲအၫအစူၪဖၧၩ့,ဒဲမီၪ စယ့ၫရမဲအၫ, ဒဲစနံၫရဲအၫအဖိၪခွၫစဘၫရၧၭလီၫ.",
			"7": "<sup>7</sup> တၭအဝ့ၫၥံၪဂဲၫဝ့ၫလၧခးအံဇံၭအဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪခိၭနၪယဟိဝၩအလူအ့ၬး တၭဂဲၫဝ့ၫလၧ တၫဖၫ့ဟ့ၭလီၫ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪစယ့ၫရမဲအၫ",
			"9": "<sup>9</sup> လၧတၫဖၫ့ဟ့ၭအဖၧၩ့တၭ,စံၭဝ့ၫဒၪ,- မၩန့လိးဖၭဒိၪ လဖၪလၧနစူၪဖၧၩ့တၭ,အီၪက့ၪၥူၪဝ့ၫလၧကဖံၬကျၩ လၧၦဎူအၩ့ကတဲၩအလးလၧအဆၧလ့ၩနုၬ လၧဖၫရိၫ အဂံၪ့လၧတၫဖၫ့ဟ့ၭအဖၧၩ့ လၧယုဒၫအၦၡၩအမ့ၬ",
			"10": "<sup>10</sup> ယၫ,- တၭ,စံၭအဝ့ၫၥံၪ,ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩ စံၭဝ့ၫဘဲၫယီၩ, ယိခွါ,ယမိအၪ့ မၧၫ့လၩ့ဆၧ, ဒဲမၩန့ယခ့ၫယၡၩဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫတၭ, မိအီၪက့ၪအလးဆီၩ့ဆီလၧလိး လၧယအီၪက့ၪၥူၪလဖၪအဖၫ့ခိၪလီၫ. တၭအဝ့ၫဒၪမိ ပၠၪထၪ့အစဎွၩအတဲၩလၧအဖၫ့ခိၪလီၫ.",
			"11": "<sup>11</sup> ထီးအဝ့ၫဒၪအ့ၪဂဲၫဝ့ၫတၭ, မိကျီၪ့ခးအံဇံၭလီၫ.ၦ လၧအအီၪဝ့ၫလၧဆၧၥံၫအဂးနီၪမိၥံၫ, ဒဲၦလၧအအီၪ ဝ့ၫလၧကဲၪဎီးအဂးနီၪ မိကဲၪဎီး, ဒဲၦလၧအအီၪဝ့ၫလၧ",
			"12": "<sup>12</sup> နၭအဂးနီၪ,မိဘၪဆၧလၧနၭလီၫ.- ယမိဆူၭခဲၩမ့ၪလၧ အံဇံၭအယွၩလဖၪအဂံၪ့ဖၧၩ့တၭး အဝ့ၫဒၪမိဆူၭထၪ့ ခွံၬဝ့ၫ,ဒဲမိဆိၬအၪ့မၧၫ့ဎီးဝ့ၫတၭ, မိကီၩ့ထၪ့အံဇံၭအ ခးဘဲၫၦယိၥိၪကီၩ့ထၪ့ဖၬဘဲၩ့အၥိၭတၭ, မိစဲၪ့ထၪ့ခွံၬ ထီးနီၪလၧဆၧဘၪလိၬအိၭလိၬအဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> တၭအဝ့ၫဒၪမိမၩဂၭဂီၩ့ခွံၬဆ့ဘ့ၭၥၡံမ့ၭအဆၧဂၩ့ လဖၪလၧအအီၪဝ့ၫလၧခးအံဇံၭအဖၧၩ့, လၧအံဇံၭဖိၪ အယွၩၥံၪအဂံၪ့လဖၪနီၪ, အဝ့ၫဒၪမိဆူၭထၪ့ခွံၬလၧမ့ၪ လီၫ."
		},
		"44": {
			"1": "<sup>1</sup> ဆၧအလူလၩ့ဘၪစယ့ၫရမဲအၫ လၧယုဒၫဖိၪလၧအ အီၪဝ့ၫ,လၧအံဇံၭအဖၧၩ့, လၧအအီၪဝ့ၫလၧမံဂဒီၫလၭ အဖၧၩ့,ဒဲလၧတၫဖၫ့ဟ့ၭအဖၧၩ့, ဒဲလၧနီၫဖၭအဖၧၩ့, ဒဲလၧခးဖၭၥြီၭအဖၧၩ့ ထီးအလူၬအဂးတၭ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- ဆၧၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩ စံၭဘဲၫယီၩ, နၥံၪဒၪဘၪကယဲဆၧအၧၩ့လၧယဒုၭဂဲၫ ဘၪယရုစလံၫ့, ဒဲယုဒၫအဒိၩ့ထီးအလူၬတၭ,ယိခွါ, ဆၧလၧမုဆၫလနံၩယီၩ အီၪယူဝ့ၫတၭ,ၦအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> အဖၧၩ့နးဂၩအ့ၬ.- မွဲဝ့ၫလၧအဆၧအၧၩ့လၧအမၩဝ့ၫ အကၠီၩ့, လၧအဝ့ၫၥံၪလ့ၩဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့တၭ, မၩယွၩအဂူၫဂၩလဖၪ လၧအလၥ့ၪယၫဘၪဝ့ၫအဆၧ အကၠီၩ့နီၪ, လၧအဝ့ၫၥံၪမွဲဂ့ၩ,ဒဲနၥံၪဝ့ၫမွဲဂ့ၩ, ဒဲနၥံၪအ ဖါလဖၪလၥ့ၪယၫဘၪတၭ, ထိၪဂဲၩယၥၭထၪ့လီၫ.",
			"4": "<sup>4</sup> တၭယအၪ့မၧၫ့လၩ့ယခ့ၫယၡၩထီးအလူၬ မီၪလဖၪ, ယဂဲထုၪ့ဂီၩဂီၩတၭ,အၪ့မၧၫ့လၩ့အဝ့ၫၥံၪတၭ, ယစံၭ, မွဲနၥံၪထီးမၩဆၧၥၭလိၪ လမံၩ့ယီၩ လၧယၥၭဂဲၫ့ဝ့ၫ",
			"5": "<sup>5</sup> လဂ့ၩ.- မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪလခိၭနၪဘၪ, ဒဲလဒိၭ ဘၪအနါဘဲၫၥိၭအမိကၠၪခွံၬအၥၭ လၧဆၧအၧၩ့, ဘဲၫ ၥိၭအထီးဆူၭခဲၩဘၪဆၧနၧၫ့မၧၫ့ လၧယွၩအဂူၫဂၩလ",
			"6": "<sup>6</sup> ဖၪအဂးလဂ့ၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယၥၭထၪ့ ဒဲယၥၭခဲၩထၪ့လူၫလၩ့အၥၭ, ဒဲအၪ့ဆၧလၧယုဒၫအ ဒိၩ့လဖၪအဖၧၩ့, ဒဲလၧယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့း ဒဲ အီၪလၧဆၧဂၭဂီၩ့, ဒဲအီၪယူဝ့ၫ,ထီၩ့လၩ့လၧမုဆၫလ နံၩယီၩလီၫ.",
			"7": "<sup>7</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫ စရ့လၭအယွၩစံၭဘဲၫယီၩ, နၥံၪမၩဆၧအၧၩ့ဖၭဒိၪ ယီၩထၫ့ဒၩနၥံၪအၥၭဒၪနၥံၪဝ့ၫ, ဘဲၫၥိၭနၥံၪမိဒၪ့ထ့ၬ ခွံၬၦခွၫ,ဒဲၦမုၪ, ဖိၪၥၪဒဲၦအၪ့နူလၧယုဒၫအဖၧၩ့တၭ,",
			"8": "<sup>8</sup> လအီၪက့ၪလၩ့ထးဘၪနးဂၩနီၪမွဲဘၪလဲၪ.- နၥံၪမၩ ဆၧလၧနၥံၪ အစူၪတၭ, နၥံၪထိၪဂဲၩ ယၥၭထၪ့လီၫ. နၥံၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧယွၩအဂူၫဂၩအဂးလၧခး အံဇံၭအဖၧၩ့ ထီးနၥံၪလ့ၩအီၪဝ့ၫဘဲၫၥိၭနၥံၪမိဒၪ့ထ့ၬ ခွံၬနၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫတၭ, နၥံၪမိကဲၪထၪ့ဆၧဆိၪ အၧၩ့အလး,ဒဲဆၧဒုၪဒွ့ၪအလးလၧဂၪ့ခိၪအဆၨၩထီး",
			"9": "<sup>9</sup> အလူၬအကျၩနီၪမွဲဘၪလဲၪ.- နၥံၪအဖါလဖၪအဆၧ မၩအၧၩ့, ဒဲယုဒၫအစဎွၩလဖၪအဆၧမၩအၧၩ့, ဒဲအ မၫလဖၪအဆၧမၩအၧၩ့ ဒဲနၥံၪမၩဒၪနၥံၪအဆၧအၧၩ့ ဒၪနၥံၪဝ့ၫ, ဒဲနၥံၪအမၫအဆၧမၩလၧအမၩဝ့ၫလၧယု ဒၫအဖၧၩ့, ဒဲလၧယရုစလံၫ့အဖၧၩ့ၥၭနီၪ,မွဲနၥံၪၥၭနၪ့",
			"10": "<sup>10</sup> ယူၭဧၪ.- အဝ့ၫၥံၪလဆၪ့လၩ့ဘၪအၥၭထီးမုဆၫလနံၩ ယီၩ,လၥၭမဲၪဘၪဆၧတၭ,လလ့ၩဘၪဘဲၫယဆၧၥီၪ့ ဆၧၥၫ့ဒဲလၧယဆၧမၪလူၬအဖၧၩ့, လၧယအီၪက့ၪလၩ့ လၧနၥံၪအဖါလဖၪအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩအံၫ စရ့လၭအယွၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိအီၪက့ၪယမ့ၬ ထၫ့ဒုၪဒၩနၥံၪလၧဆၧအၧၩ့အဂး, ဒဲဘဲၫယဒၪ့ထ့ၬခွံၬ",
			"12": "<sup>12</sup> ယုဒၫထီးအလူၬအၥိၭ,- တၭယမိမၩန့ၦအီၪလၩ့ထး လၧယုဒၫလၧအအီၪက့ၪအမ့ၬ, ဘဲၫၥိၭအမိလ့ၩအီၪဝ့ၫ လၧခးအံဇံၭအဖၧၩ့တၭ, အဝ့ၫၥံၪမိလူၬခွံၬဝ့ၫလၧခး အံဇံၭအဖၧၩ့, မိလၩ့ထံၩဖါဝ့ၫလၧဖၩ့ၥံၪနၭၥံၪ, လၧ ဆၧၥၭဝံလၩ့ဒိၩတၭ, မိလူၬခွံၬဝ့ၫလၧအဆံၭထုၬ ဖိး လၧအဒိၪထုၬလီၫ. မိၥံၫဝ့ၫလၧဖၩ့ၥံၪနၭၥံၪ, ဒဲလၧဆၧ ၥၭဝံလၩ့ဒိၩတၭ, မိကဲၪထၪ့ဆၧၥၭလိၪအလး, ဒဲဆၧ ထီၫမံၫထီၫမၪအလး, ဒဲဆၧဆိၪအၧၩ့အလး, ဒဲဆၧဒုၪ",
			"13": "<sup>13</sup> ဒွ့ၪအလးလီၫ.- ယမိစ့ၩရၫ့ၦလၧအအီၪဝ့ၫလၧခးအံ ဇံၭအဖၧၩ့ဘဲၫယစ့ၩရၫ့ယရုစလံၫ့အၥိၭနီၪ, အီၪလၧ",
			"14": "<sup>14</sup> နၭၥံၪဖၩ့ၥံၪ, ဒဲဆၧၥၭဝံလၩ့ဒိၩဒဲဆၧၥံၫချဲၫ့လီၫ.- တၭ ၦအီၪလၩ့ထးလၧၦယုဒၫဖိၪအကျၩ လၧအလ့ၩအီၪ လၧခးအံဇံၭအဖၧၩ့နီၪ, ဖီၩ့ဖျ့ၭအ့ၬ. ဘဲၫၥိၭအမိထဲၩ့ ထဲၩ့လၧခးယုဒၫအဖၧၩ့, ထီးအဆိၫ့ထဲၩ့ထဲၩ့အီၪဝ့ၫအ လးနီၪ,မိအီၪလၩ့ထးနးဂၩအ့ၬ. တၭမိထဲၩ့ထဲၩ့န့ၦ လၧအစဲၪ့ဖီၩ့ဖျ့ၭဝ့ၫလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့ၦၡၩလၧအၥ့ၪယၫ လၧအမၫၥံၪဆူၭ ခဲၩဆၧနၧၫ့မၧၫ့လၧယွၩဂူၫဂၩအဂးထီးအလူၬ, ဒဲၦမုၪ လၧအဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭ ထီးအလူၬ, ဆၧအီၪ ကီၪ့ဖၭဒိၪ, ဒဲကယဲၦလၧအအီၪဝ့ၫလၧခးအံဇံၭလၧဖၭ",
			"16": "<sup>16</sup> ၥြီၭအဖၧၩ့, စံၭဆၧၫ့စယ့ၫရမဲအၫတၭ, စံၭဝ့ၫဒၪ.- ဆၧ ချဲၩ့လၧနလီၩဘၪပၧၩ လၧယဟိဝၩအမံၩ့နီၪ ပခိၭနၪ",
			"17": "<sup>17</sup> အ့ၬ.- အ့ၪမွဲပမိမၩ ထီးဒၪဆၧလၧအထၪ့ဖျ့ၭလၧပနိၭ လၩ့ထံးလၩ့ဆ့ၭနီၪ ဘဲၫၥိၭပမိဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့ လၧမူၭခိၪအနးဎွၩမုၪအဂး, ဒဲလူၫလၩ့ဆၧလုအီၩလၧ ပဂးဘဲၫပမၩဝဲၩယူၭအၥိၭ, ပဝ့ၫဒၪ, ဒဲပဖါၥံၪ,ပစဎွၩ ၥံၪ,ဒဲပၦဒိၪဖၭဒိၪၥံၪလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့, ဒဲ လၧယရုစလံၫ့ အဖၧၩ့ၥၭဖၧၩ့နီၪလီၫ. ပအၪ့ကိၪဘျဲၩ",
			"18": "<sup>18</sup> အၪ့,ဒဲၦအီၪမုၬတၭ,ပဒၪဘၪဆၧအၧၩ့နးမံၩ့အ့ၬ.- အ့ၪ မွဲခီၫလၧပအီၪထီခွံၬ လၧပဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့လၧ မူၭခိၪအနးဎွၩမုၪအဂး, ဒဲလူၫလၩ့ဆၧလုအီၩ လၧအ ဂးနီၪ,ပဆၧအီၪနးမံၩ့အ့ၬ. ပလူၬခွံၬလၧဖၩ့ၥံၪနၭၥံၪ",
			"19": "<sup>19</sup> ဒဲဆၧၥၭဝံလၩ့ဒိၩလီၫ.- လၧပဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧ မူၭခိၪအနးဎွၩမုၪအဂး ဒဲလူၫလၩ့ဆၧလုအီၩလၧအဂး, ပဝၩလဖၪ လအီၪဘၪတၭ, မွဲပမၩကိၪပၪပဲၪလၧပမိ ဘၩဝ့ၫဒဲလူၫလၩ့ ဆၧလုအီၩလၧအဂးဆ့ဧၪ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့စယ့ၫရမဲအၫစံၭ ၦခမျၧးထီးအလူၬ, ၦခွၫၥံၪ,ဒဲၦမုၪၥံၪ,ဒဲကယဲၦခမျၧးထီးအလူၬ လၧအစံၭ",
			"21": "<sup>21</sup> ဆၧၫ့အဝ့ၫဒၪလၧဆၧချဲၩ့နီၪတၭ,စံၭဝ့ၫဒၪ,- ဆၧနၧၫ့ မၧၫ့လၧနၥံၪဆူၭခဲၩလၧယုဒၫအဒိၩ့လဖၪအဖၧၩ့ ဒဲလၧ ယရုစလံၫ့အဖၧၩ့ၥၭဖၧၩ့, နၥံၪဝ့ၫ, ဒဲနၥံၪအဖါလဖၪ, နၥံၪအစဎွၩလဖၪ, ဒဲနၥံၪအၦဒိၪဖၭဒိၪလဖၪ, ဒဲခးအ ၡၩခမျၧးနီၪ, ယဟိဝၩနၪ့ထၪ့ထဲၩ့ဝ့ၫအ့ၬဧၪ. မွဲအနုၬ",
			"22": "<sup>22</sup> ထၪ့လၧအၥၭဖၧၩ့အ့ၬဧၪ.- ယဟိဝၩအီၪဒၪအဆၧလၧ နၥံၪမၩဆၧအၧၩ့အကၠီၩ့, ဒဲလၧဆၧၥၭလိၪလၧနၥံၪမၩ အကၠီၩ့နီၪကဲၪလၧၩ့အ့ၬ. အခိးမွဲနၥံၪအခးအီၪယူတၭ, ကဲၪထၪ့ဆၧထီၫမံၫထီၫမၪအလး, ဒဲဆၧဆိၪအၧၩ့အ လးလီၫ. ၦအီၪဝ့ၫလၧအဖၧၩ့နးဂၩအ့ၬ, ဘဲၫလၧမုဆၫ",
			"23": "<sup>23</sup> လနံၩယီၩအၥိၭနီၪလီၫ.- မွဲနၥံၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့ ဒဲနၥံၪမၩမၪဘၪယဟိဝၩ, ဒဲလခိၭနၪဘၪယဟိဝၩအ လူ,ဒဲလလ့ၩဘၪလၧအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, ဒဲလၧအ ဆၧမၪလူၬအဖၧၩ့, ဒဲလၧအဆၧထိးအၥၭအဖၧၩ့တၭ, ဆၧအၧၩ့ယီၩလၩ့ဘၪနၥံၪ ဘဲၫလၧမုဆၫလနံၩယီၩ အၥိၭနီၪလီၫ.",
			"24": "<sup>24</sup> မၩဒီၭလဖၧၫ့ စယ့ၫရမဲအၫစံၭၦခမျၧးထီးအလူၬ, ဒဲၦမုၪထီးအလူၬနီၪ, ခိၭနၪယဟိဝၩအလူဆံၭ. ၦယု",
			"25": "<sup>25</sup> ဒၫဖိၪလၧခးအံဇံၭအဖၧၩ့ထီးအလူၬၥံၪဧ့,- ဆၧၥုၭမု ခမျၧးအယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, နၥံၪ ဝ့ၫဒဲနၥံၪအမၫၥံၪချဲၩ့ယူၭဆၧလၧနၥံၪအနိၭ, ဒဲမၩဎွ့ၩ ဆၧလၧနၥံၪအစူၪ,နၥံၪစံၭ, ဆၧဆိၪလၧပဆိၪလၩ့ပၥၭ လၧမူၭခိၪအနးဎွၩမုၪ လၧပမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧ အဂး,ဒဲလူၫလၩ့ဆၧလုအီၩလၧအဂးနီၪ, ပမိမၩတီၩ လီၫ.နၥံၪမိမၩ ဘဲၫနၥံၪဆိၪလၩ့နၥံၪအၥၭအၥိၭတီၩ တီၩ,နၥံၪမိမၩဆၧ လၧနၥံၪဆိၪလၩ့နၥံၪအၥၭတၡါ",
			"26": "<sup>26</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ခိၭနၪယဟိဝၩအလူဆံၭ. ယုဒၫထီးအလူၬလၧအအီၪဝ့ၫ လၧခးအံဇံၭအဖၧၩ့ၥံၪ ဧ့,ယိခွါ,ယဆိၪလၩ့ယူၭယၥၭလၧယမံၩ့ဖၭဒိၪအမ့ၬ ယၫ,ယဟိဝၩစံၭဝ့ၫဒၪ, ၦလကိၭထၪ့လၧၩ့ဘၪယမံၩ့ လၧၦယုဒၫဖိၪအနိၭ လၧခးအံဇံၭထၧၫ့ဘံၪ့ယၫအဖၧၩ့",
			"27": "<sup>27</sup> တၭ,စံၭ,ကဆါယဟိဝၩမၧၫ့နီၪ,နးဂၩအ့ၬ.- ယိခွါ, ယမိယိအဝ့ၫၥံၪလၧဆၧအၧၩ့အဂး, မွဲလၧဆၧဂ့ၩအ ဂးအ့ၬ. ကယဲယုဒၫအၦၡၩ လၧအအီၪဝ့ၫလၧခးအံ ဇံၭအဖၧၩ့နီၪမိလူၬခွံၬလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲလၧဆၧၥၭဝံ",
			"28": "<sup>28</sup> လၩ့ဒိၩထီးအလူၬခွံၬဝ့ၫလီၫ.- တၭၦၡၩၥံၪၡၩခိၬဂၩ လၧအဖီၩ့ဖျ့ၭလၧနၭၥံၪဖၩ့ၥံၪနီၪ မိဂဲၫထဲၩ့စဲၪ့ထၪ့ခွံၬလၧ ခးအံဇံၭအဖၧၩ့ထီၩ့ လၧခးယုဒၫအဖၧၩ့လီၫ. တၭယု ဒၫအၡၩအီၪလၩ့ထး လၧအဂဲၫအီၪဝ့ၫလၧခးအံဇံၭအ ဖၧၩ့ထီးအလူၬနီၪ, မိၥ့ၪယၫလၧယဝ့ၫဒၪယလူမိခၧၫ့ ဧၪ,အဝ့ၫၥံၪအလူမိခၧၫ့ဧၪ, မွဲအလူမိခၧၫ့လဂၩဂၩလဲၪ နီၪ, မိၥ့ၪယၫဝ့ၫလီၫ.",
			"29": "<sup>29</sup> တၭအယီၩမိကဲၪထၪ့ဆၧမၩနဲၪ့လၧနၥံၪအဂး, လၧ ယမိစ့ၩရၫ့နၥံၪလၧဆၧအလးယီၩအဖၧၩ့, ယဟိဝၩ စံၭဝ့ၫဒၪဘဲၫၥိၭနၥံၪမိၥ့ၪယၫလၧယဆၧချဲၩ့ မိအီၪခၧၫ့",
			"30": "<sup>30</sup> လၧနၥံၪအဆၧအၧၩ့အဂးတၡါလီၫ.- ယဟိဝၩစံၭ ဘဲၫယီၩ,ယိခွါ, ယမိဖ့ၪလၫ့ခးအံဇံၭအစဎွၩ ဖၫရိၫ ဟိဖၫလၧအဒုၪအဒၩ အစူၪဖၧၩ့, ဒဲၦလၧအအၪ့ဎူၫ အၪ့ဎၬအၥၭမၧၫ့လဖၪအစူၪဖၧၩ့, ဘဲၫယဖ့ၪလၫ့ယုဒၫ အစဎွၩဇ့ၭဒကဲအၫလၧအဒုၪအဒၩ လၧအအၪ့ဎၬအ ၥၭမၧၫ့ဘၭဘလၧၫ့ အစဎွၩန့ၭဘူၫခၭန့ဇၫအစူၪဖၧၩ့ အၥိၭနီၪလီၫ."
		},
		"45": {
			"1": "<sup>1</sup> ထီးစနံၫရဲအၫအဖိၪခွၫစဘၫရၧၭကွ့ၭ ဆၧချဲၩ့လဖၪ နီၪလၧလံၬဖၧၩ့ လၧစယ့ၫရမဲအၫအနိၭ,လၧယုဒၫအ စဎွၩစယိၫဇဲအၫအဖိၪခွၫစယဟီအကံၫ့အနံၪ့ လံနံၪ့လ နံၪ့နီၪ, မီၪစယ့ၫရမဲအၫစံၭအဝ့ၫလၧဆၧချဲၩ့ယီၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- စဘၫရၧၭဧ့, ယဟိဝၩအံၫစရ့လၭအယွၩ",
			"3": "<sup>3</sup> စံၭနၧၩဘဲၫယီၩ,- နစံၭ,ယဘၪအၡၪ့လီၫ. အဂဲးဘဲၫ ယီၩယဟိဝၩအီၪက့ၪဆၧမၩခိမၩဝီၩ လၧယၥုၪ့အုၭ ၥၭအုၭအဖၫ့ခိၪလီၫ. ယဂၪ့အုၩ့ဂၪ့ထိၬတၭ, ယၥၭ",
			"4": "<sup>4</sup> လၩ့ဘဲၩတၭ,ယအီၪပွံၭၥ့ၪအ့ၬ.- နမိဘၪစံၭအဝ့ၫဘဲၫ ယီၩ,ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ဆၧလၧယမၩကဲၪ ထၪ့နီၪယမိမၩလၩ့ဎီးတၭ, ဆၧလၧယၥုၪ့လၩ့ဖျၭလၩ့ နီၪ,ယမိထ့ၭထၪ့ခွံၬ လၧခးထၧၫ့ဘံၪ့ယၫယီၩအဖၧၩ့ လီၫ.",
			"5": "<sup>5</sup> နအၪ့ဎူၫအၪ့ဎၬဆၧအဒိၪလဖၪလၧနဂးဆ့ဧၪ. အၪ့ ဎၬလဂ့ၩ. အဂဲးဘဲၫယီၩ,ယိခွါ, ယမိဒုၭဘၪဆၧဖံၭ ဆၧယၪထီးအလူၬ လၧဆၧအၧၩ့လီၫ. ယဟိဝၩစံၭဝ့ၫ ဒၪ.မွဲလါနၫ့တၭ,ထီးနလ့ၩဆၧလစီၪ့လါလါနီၪ, ယမိ ဖ့ၪလၫ့နၧၩလၧနၥၭမၧၫ့ လၧဆၧအၪ့ဂူၬန့လၧနဂးလီၫ."
		},
		"46": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪ မီၪစယ့ၫရမဲအၫလၧ ၦဆၨၩလဖၪအဂဲး, လၧအထၫ့ဒၩၦဆၨၩၥံၪ,ထၫ့ဒၩအံ",
			"2": "<sup>2</sup> ဇံၭ,- လၧအံဇံၭအစဎွၩဖၫရိၫနံခိၫအၥုၭမုခမျၧးအဂဲး လၧအအီၪဝ့ၫ လၧထံၫမိၡါယုၫပ့တံၫအနဲၩ့လၧကၫ ခမံၭအဖၧၩ့ လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ ကျီၪ့ဝ့ၫလၧယုဒၫအစဎွၩ စယိၫစဲအၫအဖိၪခွၫစယဟီ အကံၫ့အနံၪ့လံနံၪ့လနံၪ့နီၪလီၫ.",
			"3": "<sup>3</sup> တဲၩ့ဝဲၩနၥံၪဝ့ၫ ဆၧပဒၩ့ဒဲထၩ့ဖံၭၥံၪတၭ,ၥုၭဘူၭ",
			"4": "<sup>4</sup> လၧဆၧဒုၭၥုၭနီၪဘီၪ.- တဲၩ့ဝဲၩကၥ့ၪလဖၪတၭး ကၥ့ၪ ၥုၭဖိၪၥံၪဧ့, ထူၭထၪ့ကၥ့ၪဘီၪး အီၪဆၧၫ့ထုၪ့လၧနၥံၪ အခိၪလူၬၥုၭၥံၪ, ထူၭယုၩ့ယဲထၪ့နၥံၪအဖၩ့ၥံၪ, ဒဲၥိၭ",
			"5": "<sup>5</sup> ထၪ့ဆဲၫ့ထၭလဖၪနီၪဆံၭ.- မွဲယဒၪဘၪအဝ့ၫၥံၪၥၭမဲၪ ထၪ့တၭ,ထဲၩ့ထဲၩ့နီၪအဂဲးဘဲၫၥ့ၪလဲၪ. တၭအဝ့ၫၥံၪ အၡၩဆီၪ့လဖၪဘၪဆၧဒိၪလၩ့ထံၩဖါဝ့ၫတၭ, စဲၪ့ဖျိၭ နီၪဒဲလယိထဲၩ့ဘၪလၧအလးခဲၫ့နီၪး အဂဲးဘဲၫယီၩ",
			"6": "<sup>6</sup> ဆၧၥၭမဲၪအီၪဖီၩ့ဝ့ၫဝၬဝၬနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- ၦအ ခၪ့ဖျဲၪနီၪ, မွဲအထီးစဲၪ့ဖျိၭလဂ့ၩ. ဒဲၦအဆီၪ့ၥံၪမွဲအ ထီးဖီၩ့ဖျ့ၭလဂ့ၩ. အဝ့ၫၥံၪမိဘၪထၧၩ့လၩ့ထံၩဖါတီၩ လၧမုဖၩလခီၫ, လၧထံၫမိၡါယုၫပ့တံၫအနဲၩ့ထံၭနီၪ",
			"7": "<sup>7</sup> လီၫ.- ၦဂဲၫထၪ့ဘဲၫထံၫလုၬဘံၭဆၧအၥိၭနီၪမွဲၦလဖၪ လဲၪ.ထံၫလဖၪနီၪဆံၫပိၩ့ပၪ့ထၪ့ဝ့ၫ ဘဲၫထံၫမိၡါအၥိၭ",
			"8": "<sup>8</sup> နီၪလီၫ.- ခးအံဇံၭဂဲထုၪ့ဝ့ၫဘဲၫထံၫလၧအလုၬဘံၭ ဆၧအၥိၭနီၪး ဒဲအထံၫလဖၪဆံၫပိၩ့ပၪ့ထၪ့ဝ့ၫဘဲၫထံၫ မိၡါအၥိၭနီၪလီၫ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယမိလ့ၩထၪ့ မၩလုၬဘံၭခွံၬဂၪ့ခိၪ, ယမိမၩဂၭဂီၩ့ဒိၩ့ၥံၪဒဲအၦၡၩ",
			"9": "<sup>9</sup> လဖၪနီၪဆ့လီၫ.- ကၥ့ၪၥုၭၥံၪဧ့,ဂဲၫထၪ့နၥံၪဝ့ၫဘီၪး ဒဲ လဲၪ့ၥုၭၥံၪဧ့,စဲၪ့ဆီၪ့နၥံၪဝ့ၫဘီၪး တၭၦအဆီၪ့ၥံၪနီၪ, မွဲအဂဲၫထၪ့ဝ့ၫဒၪဘီၪး ၦအံၫၥအိပၠၫဖိၪၥံၪ, ဒဲၦလံဘၠၫ ဖိၪၥံၪ,လၧအဖီၪ့ထၩ့ဖံၭ, ဒဲၦလုဒၫဖိၪၥံၪလၧအဖီၪ့ဖဲၪ့",
			"10": "<sup>10</sup> ထၪ့ချံၫလီၫ.- အဂဲးဘဲၫယီၩမုဆၫလနံၩယီၩ မွဲယဟိ ဝၩၥုၭမုခမျၧးအယွၩအနံၩ, ဆၧဖ့ၪဆၧၫ့အမုနံၩဘဲၫ ၥိၭအမိစ့ၩရၫ့တီၩန့ အနၫ့ဆါဒၪဝ့ၫလၧအဒုၪအဒၩၥံၪ အကၠီၩ့နီၪလီၫ. နၭၥံၪမိအၪ့ခွံၬဆၧတၭ, မွဲအမိအၪ့ ဘျဲၩအၪ့ဒဲအီၩမၧၩ့ဝ့ၫလၧအဝ့ၫၥံၪအၥွံၪနီၪး အဂဲး ဘဲၫယီၩယဟိဝၩၥုၭမုခမျၧးအယွၩ အီၪလၧဆၧလု ထၪ့ဝ့ၫလၧခးမုဖၩနီၪ, လၧထံၫမိၡါယုၫပ့တံၫ အနဲၩ့ ထံၭလီၫ.",
			"11": "<sup>11</sup> ခးအံဇံၭအဖိၪမုၪနၩ့ဧ့, လ့ၩထၪ့နဝ့ၫလၧဂံလအၭ အဖၧၩ့တၭ, မၩန့ၥံၪ့စရံအထူၭနီၪဘီၪ. နမၩၥံၪ (ၥံၪ့ ဎွံၪ) အၪမံၩ့နီၪပျီၩပျီၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧမိမၩဘျၪ",
			"12": "<sup>12</sup> ထဲၩ့နၧၩအ့ၬ.- အဂဲးဘဲၫယီၩၦဆၨၩလဖၪနါဂၧၫ့ နဆၧ မ့ၬမဲအဂဲးတၭ, နဂၪ့ကိၭၡၭထၪ့နီၪ, မၩလၧၫ့ထၪ့ဎွ့ၩ ထၪ့ထံၫၥံၪခးၥံၪး အဂဲးဘဲၫယီၩၦအဆီၪ့နီၪအခၪ့ဘၪ ထၧၩ့တၭ, ဘၪထံၭလၧၦအဆီၪ့နီၪတၭ, အဝ့ၫၥံၪလၩ့ ထံၩဖါနံၫဂၩလူၬစီၪ့ဎးလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩအဆၧချဲၩ့ လၧအလီၩဘၪ မီၪစယ့ၫရမဲ အၫနီၪ, လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫမိဂဲၫ ကျီၪ့ခွံၬခးအံဇံၭအဂဲးအကၠီၪ့နီၪလီၫ.",
			"14": "<sup>14</sup> လီၩဖျီၪထၪ့နၥံၪဝ့ၫလၧအံဇံၭအဖၧၩ့, ဒဲမၩဂၧၫ့ထၪ့ ၥၩလၩ့ လၧမံဂဒီၫလၭအဖၧၩ့, ဒဲမၩဂၧၫ့ထၪ့ၥၩလၩ့ လၧနီဖၭအဖၧၩ့, ဒဲလၧတၫဖၫ့ဟ့ၭအဖၧၩ့ဆံၭး စံၭနၥံၪ ဝ့ၫ,ဆၧၫ့ထုၪ့ဂုးခၧၫ့, ဒဲတဲၩ့ဝဲၩနၥံၪအၥၭဘီၪး အဂဲး",
			"15": "<sup>15</sup> ဘဲၫယီၩနၭနီၪမိအၪ့ဂၭဂီၩ့ဆၧဝၬဖီၩ့နၧၩလီၫ.- နၡၩ အဒူၩၥံၪဘၪဆၧဝ့ၬခွံၬဝ့ၫနီၪ, မွဲအဂဲးဘဲၫၥ့ၪလဲၪ. အ ဝ့ၫၥံၪအီၪဆၧၫ့ထုၪ့လၥ့ၪဘၪနီၪ, အဂဲးဘဲၫယီၩယဟိ",
			"16": "<sup>16</sup> ဝၩနၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- အဝ့ၫဒၪဒုၭလၩ့ထံၩဖါၦအၪဂၩ တၭ,မွဲကဒၪယူၭလၩ့ထံၩဖါလဂၩလၧလဂၩအဖၫ့ခိၪ လဂၩလၧလဂၩအဖၫ့ခိၪလီၫ. တၭအဝ့ၫၥံၪစံၭ, ဂဲထုၪ့ ဘီၪ,မွဲပထဲၩ့ထဲၩ့ၡီၩ့လၧၦဆၨၩဒၪပဝ့ၫနီၪ, ဒဲလၧပခး လၧၦအီၪဖျဲၪဝ့ၫနီၪဆံၭး မွဲဘဲၫၥိၭပမိဖီၩ့ဖျ့ၭနၭလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪဂၪ့ကိၭၡၭထၪ့ထီးနီၪတၭ, အံဇံၭအစဎွၩဖၫ ရိၫဂၭဂီၩ့ယူၭ, ဒုၭဖီၩ့ခွံၬ ဆၧအဆၧၫ့အထီယူၭနီၪ",
			"18": "<sup>18</sup> လီၫ.- စဎွၩ, လၧအမံၩ့မွဲဆၧၥုၭမုခမျၧးအယဟိဝၩ နီၪ,စံၭဝ့ၫဒၪ, ဘဲၫယမၧၫ့ယဝ့ၫအၥိၭနီၪတၭး မွဲတၡါ ဘဲၫတၫဘီၫလၧခိၪလီၩ့ၥံၪအကျၩနီၪ, ဒဲဘဲၫကၫမလၭ လၧမၫဆမံၭနဲၩ့အၥိၭ, အဝ့ၫဒၪမိဂဲၫဘဲၫနီၪၥိၭလီၫ.",
			"19": "<sup>19</sup> နဝ့ၫဒၪဖိၪမုၪအီၪလၧအံဇံၭအဖၧၩ့ဧ့,တဲၩ့ဝဲၩနၥၭလၧ နမိလ့ၩနုၬ လၧဆၧအၪ့မၧၫ့ဎီးအဖၧၩ့နီၪဘီၪ. အဂဲး ဘဲၫယီၩနီဖၭနီၪမိဘၪဆၧဂၭဂီၩ့ဝ့ၫ, ဒဲအီၪယူဝ့ၫတၭ,",
			"20": "<sup>20</sup> ၦၡၩလအီၪဘၪနီၪလီၫ.- အံဇံၭမွဲချီမိအဎံၫအလၩဂ့ၩ ဘၪစဲၪတၭ, ဆၧဂၭဂီၩ့ဂဲၫဝ့ၫတၭ, ဂဲၫဝ့ၫလၧမုဖၩလ",
			"21": "<sup>21</sup> ခီၫနီၪလီၫ.- တၭအဝ့ၫၥံၪအၡၩအၪ့လံၩ့ဖိၪၥံၪလၧအ ကျၩနီၪ,မၩအၥၭဘဲၫချီဘီၪ့ဝ့ၫၥိၪဝ့ၫအၥိၭတၭ, အဝ့ၫ ၥံၪကၠၪကဒၩထဲၩ့အၥၭဆ့, မွဲအစဲၪ့ဖျိၭၡီၩ့ဝ့ၫတၭ, အ ဝ့ၫၥံၪလဆၧၫ့ထုၪ့ဘၪနီၪး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအ ဆၧၡၪ့ဆၧနၭအမုနံၩဘၪယူၭတၭ, အဝ့ၫၥံၪအဆၧစ့ၩ",
			"22": "<sup>22</sup> ရၫ့အထီနီၪဘၪယူၭဝ့ၫယူၭလီၫ.- တၭအဝ့ၫၥံၪအၥီၫ မိလ့ၩထၪ့ဝ့ၫဘဲၫဂူၥီၫအၥိၭနီၪး အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪမိလ့ၩဆၧ ဘဲၫၥုၭမုခမျၧးအၥိၭတၭး မိဂဲၫဘၪဝ့ၫ",
			"23": "<sup>23</sup> လၧကွၩၥံၪ, ဘဲၫၦဖ့ၬၥံၪ့ၥံၪအၥိၭလီၫ.- အဝ့ၫၥံၪမိခူၬ လၩ့ခွံၬအၥံၪ့အဒီၪ့လဖၪနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪး မွဲအၪ အၪလ့ၬအၪနဲၪ့ဒံၭထွ့ၥံၪတၭ, ၦဝံထၪ့နၬထၪ့ဝ့ၫၥ့ၪဝါ",
			"24": "<sup>24</sup> အ့ၬ.- အံဇံၭအဖိၪမုၪနီၪအၥၭဘံၪဘူၪတၭ, ဆၧမိဖ့ၪ လၫ့ခွံၬဝ့ၫ လၧၦမုဖၩအၡၩခမျၧးၥံၪ အစူၪဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> ၦၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩစံၭဝ့ၫဒၪ, ယိခွါ,ယမိစ့ၩရၫ့နိၫအၡၩခမျၧးၥံၪ, ဒဲဖၫရိၫ,ဒဲအံဇံၭ ဒဲအဝ့ၫၥံၪအယွၩလဖၪ, ဒဲအစဎွၩၥံၪဆ့လီၫ. ဖၫရိၫဒၪ လ့ၬ,ဒဲကယဲၦလၧအဒိၭနဲၩ့အၥၭလၧအဝ့ၫဒၪတၭး",
			"26": "<sup>26</sup> ယမိဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ, လၧၦလၧအအၪ့ဎၬအဝ့ၫၥံၪ အၥၭမၧၫ့အစူၪဖၧၩ့နီၪ, ဒဲလၧဘၭဘလၧၫ့အစဎွၩန့ၭ ဘူၫခၭန့ဇၫအစူၪဖၧၩ့, ဒဲလၧအဝ့ၫဒၪအခ့ၫအၡၩၥံၪ အစူၪဖၧၩ့လီၫ. လၧအလးခဲၫ့နီၪၦၡၩမိအီၪဝ့ၫလၧအ ဖၧၩ့ဘဲၫမုနံၩၥံၪလၧဖျိၩ့အၥိၭနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"27": "<sup>27</sup> မွဲလါနၫ့တၭယခ့ၫယၡၩစယၫကူၭဧ့, နဝ့ၫဒၪယီၩထီး ၥၭမဲၪလဂ့ၩး အံၫစရ့လၭဧ့း ထီးအၪ့ယိၪဆၧလဂ့ၩး အဂဲးဘဲၫယီၩယမိထိးထဲၩ့တၩ့ထဲၩ့နၧၩ လၧအယဲၩ့ နီၪ,ဒဲနချံၫနၥၪ လၧခးလၧအဝ့ၫၥံၪဘၪဆၧအၪ့မၧၫ့ဎီး ဝ့ၫနီၪးတၭစယၫကူၭ မိဂဲၫထဲၩ့ထဲၩ့ ဒဲအီၪပွံၭအီၪမုၬ ဝ့ၫဒၪနီၪ,ၦဒုၭၥၭမဲၪဝ့ၫအီၪနးဂၩအ့ၬ.",
			"28": "<sup>28</sup> ယခ့ၫယၡၩ စယၫကူၭဧ့,နဝ့ၫဒၪထီးၥၭမဲၪလဂ့ၩ, ယဟိဝၩစံၭဝ့ၫဒၪး အဂဲးဘဲၫယီၩယအီၪလၧနၥိၭတၭ, ကယဲၦဆၨၩၥံၪ လၧယဒုၭလ့ၩအီၪနၧၩအလးနီၪ, ယမိမၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪထီးအလူၬလီၫ. အ့ၪမွဲ နဝ့ၫဒၪယမိမၩဂၭဂီၩ့ နၧၩလူၬအ့ၬ. ယအၪ့ၥီၪ့နၧၩ ဘဲၫအံၩဘဲၫအိၩလါနၫ့တၭ, ယဒုၭဖီၩ့ဖျ့ၭနၧၩလၧဆၧ စ့ၩရၫ့ထီးအလူၬနီၪဆ့အ့ၬ."
		},
		"47": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪ မီၪစယ့ၫရမဲအၫလၧ အထၫ့ဒၩၦဖလံၡၫဖိၪၥံၪ, လၧဖၫရိၫလချႃၭကျီၪ့ဒံၭ",
			"2": "<sup>2</sup> ဘၪဂၫဇၫနီၪလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩး ထံၫလဖၪ မိဂဲၫထၪ့ဝ့ၫလၧမုဖၩလခီၫနီၪ, ဒဲမိကဲၪထၪ့ဝ့ၫဘဲၫထံၫ လုၬဘံၭဆၧအၥိၭတၭ, မိမၩလၩ့ဘံၭခးနီၪ, ဒဲကယဲ ဆၧအီၪလၧအဖၧၩ့ ထီးအလူၬတၭ, ဒိၩ့ ဒဲၦၡၩအီၪ လၧအဖၧၩ့နီၪး ထီးနီၪလဖၧၫ့ ၦၡၩၥံၪမိကိၭၡၭထၪ့ဒဲ ကယဲထံၫဖိၪခးဖိၪၥံၪ မိအိၩ့ယိၩ့ဝ့ၫထီးအလူၬလီၫ.",
			"3": "<sup>3</sup> လၧအကၥ့ၪဆီၪ့လဖၪဆ့ၪခၪ့အၥီၫနီၪ, ဒဲလၧလဲၪ့ၥုၭ ၥံၪလ့ၩဆၧဆီၪ့နီၪ, လၧလဲၪ့ပၪၥံၪအၥီၫ အကၠီၩ့တၭ, ဖါၥံၪနီၪမိယိကဒၩထဲၩ့လၧအဝ့ၫၥံၪ အဖိၪအလံၩအ့ၬး",
			"4": "<sup>4</sup> မွဲလၧအစူၪဆါအကၠီၩ့လီၫ.- မုနံၩလၧဆၧမိမၩဂၭဂီၩ့ ၦဖလံၡၫဖိၪထီးအလူၬနီၪဘၪဝ့ၫအကၠီၩ့တၭ, လၧအမိ ဒၪ့ထ့ၬခွံၬ တဲအၫဒဲဇဲဒၧၫ့ ကယဲၦမၩဆၧၩ့ၥံၪအီၪလၩ့ ထးဆုၬဆုၬး အဂဲးဘဲၫယီၩယဟိဝၩမိမၩဂၭဂီၩ့ၦဖလံ",
			"5": "<sup>5</sup> ၡၫဖိၪၥံၪ,ခးကၭဖတၧၫလကဲၩ့နီၪး- ဂၫဇၫအီၪချၩခိၪ, အၭၡကံလၫ့ ဘၪဆၧဒၪ့ထ့ၬခွံၬ, ဒဲၦအီၪလၧအဝ့ၫၥံၪ အခိၪလီၩ့ဆူၭဖၧၩ့နီၪး နမိဂ့ၬလၩ့နၥၭဆံၭယံၬလဲၪး",
			"6": "<sup>6</sup> နဝ့ၫဒၪယဟိဝၩအနၭဧ့, နလအီၪပွံၭဒံၭဘၪတၭ, မွဲ ဆၧမိအီၪဒံၭဆံၭယံၬလဲၪး ဖျၪ့နုၬထဲၩ့နၥၭ လၧနကၠိၭ",
			"7": "<sup>7</sup> ဖၧၩ့နီၪတၭ, အီၪပွံၭအီၪလၩ့မါပံၭဆံၭ.- မွဲအအီၪ ပွံၭမိၥ့ၪဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့မၧၫ့ ဝ့ၫထၫ့ဒၩအၭၡကံလၫ့ ဒဲထၫ့ဒၩမၫဆမံၭနဲၩ့နီၪ, မွဲအ အီၪက့ၪဝ့ၫအလးထီးနီၪလီၫ."
		},
		"48": {
			"1": "<sup>1</sup> ၦၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩစံၭဝ့ၫ ဘဲၫယီၩး နံဘိၫဘၪအၡၪ့နီၪ, အဂဲးဘဲၫယီၩ မွဲအအီၪ ယူဝ့ၫလီၫ. ကံၫရၥ့အံၫ့အၥၭဘံၪဘူၪတၭ, ဘၪဆၧမၩ န့ဝ့ၫလီၫ. မံၭစဂၭအၥၭဘံၪဘူၪဒဲအၪ့ယိၪဆၧလီၫ.",
			"2": "<sup>2</sup> ဆၧလမိအၪ့အူၭလၧၩ့ဘၪ မိအၭနီၪတၭ, လၧဟ့ၡ ဘၫ့အဖၧၩ့နီၪ, ၦၡၩကၩ့ကၩထၫ့ဒၩဝ့ၫလၧဆၧအၧၩ့ တၭးဂဲၫဘီၪ, တၭမွဲပဒၪ့ထ့ၬခွံၬၡီၩ့ဝ့ၫ လၧၦဆၨၩလ ဖၪအကျၩနီၪဘီၪ. တၭနမိဘၪဆၧခူၬလၩ့ခွံၬ နၧၩဆ့, မၭဒမၫ့ဧ့, နၭနီၪမိလီၩ့ဆီးနၧၩလီၫ.",
			"3": "<sup>3</sup> ၦဂၪ့အၥီၫမိဂဲၫထၪ့လၧဟီၫရနံၫ့အအီၪနီၪ, ဆၧမၩ",
			"4": "<sup>4</sup> ယူၭဝ့ၫဒဲဆၧဂၭဂီၩ့ဖၭဒိၪနီၪလီၫ.- မိအၭဘၪဆၧဂၭ ဂီၩ့ဝ့ၫးအဖိၪဒံၩဖိၪၥၪၥံၪ ဒုၭဂၧၫ့ထၪ့ ဆၧဂၪ့ကိၭၡၭ",
			"5": "<sup>5</sup> ထၪ့နီၪလီၫ.- မွဲမၬ,လၧဆၧလ့ၩထၪ့စိၩလၧလုဟံၭနီၪ, လၧအလ့ၩထၪ့ဝ့ၫအဘိၩ့ဘၭတၭ, ဆၧဂၪ့ဝ့ၫလထံၪ ဎးလဘီၩ့ဎးလီၫး အဂဲးဘဲၫယီၩ ဆၧလ့ၩလၩ့လၧဟီၫ ရနံၫ့နီၪ, ၦအဒုၪအဒၩၥံၪနါဂၧၫ့ယူၭဆၧဂၭဂီၩ့အကိၭ",
			"6": "<sup>6</sup> ၡၭထၪ့နီၪလီၫ.- စဲၪ့ဘီၪ, မၩဖီၩ့မၩဖျ့ၭနၥံၪအၥၭမၧၫ့ ဒၪနၥံၪဝ့ၫတၭး အီၪဘဲၫၥံၪ့ဎဲၫ့လၧမံၩ့လၬကျၩဖၧၩ့အ",
			"7": "<sup>7</sup> ၥိၭနီၪဆံၭ.- အဂဲးဘဲၫယီၩ နဒိၭနဲၩ့နၥၭလၧနဆၧမၩ ဒၪနဝ့ၫအဖၧၩ့, ဒဲလၧနဎၧၩ့နဎီၥံၪအဖၧၩ့အကၠီၩ့တၭ, နမိဘၪဆၧဖီၪ့ထၬနၧၩဆ့, ဒဲခံမီၭဘၪလ့ၩထၪ့လၧဆၧ အၪ့မၧၫ့ဎီးဝ့ၫအဖၧၩ့နီၪ, အီၪလၧအၡၩလုဆၧလဖၪ",
			"8": "<sup>8</sup> ဒဲအၦဒိၪဖၭဒိၪၥံၪစီၪ့ဎးလိၬအၥၭဆ့လီၫ.- တၭၦမၩ ဂၭဂီၩ့ဆၧမိထၪ့ဘၪဒိၩ့ၥံၪကိၭဒိၩ့ဒ့ၭဆုၬဆုၬနီၪ, ဒိၩ့ ဖီၩ့ဖျ့ၭနးစီၪ့အ့ၬ. ခိၪလီၩ့ဆူၭၥံၪမိဘၪဆၧဂၭဂီၩ့တၭ ဆၧပျၩ့ၥံၪမိဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫဒၪဆ့, ဘဲၫယဟိဝၩ",
			"9": "<sup>9</sup> ချဲၩ့ဆၧအၥိၭနီၪလီၫ.- ဘဲၫမိအၭ စဲၪ့ဖျိၭမိၥ့ၪအၥိၭ တၭ,ဒုၭထၫ့ထၪ့အဒံၭၥံၪဘီၪ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪ အဒိၩ့လဖၪမိဘၪအီၪယူဝ့ၫတၭ, ၦၡၩအီၪလၧအဖၧၩ့",
			"10": "<sup>10</sup> အ့ၬ.- ၦလၧအမၩယဟိဝၩအဆၧမၩ လၧဆၧအၪ့လီၫ ဝ့ၫအဖၧၩ့နီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭး ဒဲၦလၧအ ပဒၩ့အနၭလၧဆၧၥွံၪနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭ.",
			"11": "<sup>11</sup> မိအၭအီၪဘီၪ့ဝ့ၫခီၫလၧအၥၭဘၪ့တၭ, မွဲအဆၧၫ့နၩ့ အီၪဝ့ၫလၧဆၧအၥံၭအခၩအဖၫ့ခိၪတၭ, ဆၧလလူၫ လၩ့ဘၪဝ့ၫလၧဖၧၩ့လဖျိၪ့လၧလဖျိၪ့ထူထူနီၪ, မွဲအနုၬ ဘၪလၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအဖၧၩ့နီၪဆ့အ့ၬ. အခိးမွဲ အထဲးယိဆၧနီၪအီၪဒံၭဝ့ၫလၧအဖၧၩ့, ဒဲအနၧၫ့ဆၧနီၪ",
			"12": "<sup>12</sup> ဘၪဆၧအၪ့လဲၩခွံၬဝ့ၫဆ့အ့ၬ.- အခိးမွဲဆၧမၩအၥၭ ဘဲၫနီၪတၭ, ယိခွါ,ယဟိဝၩစံၭဘဲၫယီၩ, မုနံၩလဖၪ မိဘၪဝ့ၫလၧယမိအၪ့မၧၫ့ၦဘိၭဒံၩ့ခံၫ့ဆၧတၭ, မိမၩ ခီၫအဆၧဖၧၩ့လဖၪ, ဒဲမၩဂၭဂီၩ့ အထိၪ့ဆၧဖံၭၥံၪ",
			"13": "<sup>13</sup> လီၫ.- တၭမိအၭအမ့ၬမိမဲဝ့ၫလၧခံမီၭအကၠီၩ့နီၪ, ဘဲၫ အံၫစရ့လၭအဂံၪ့မ့ၬမဲဝ့ၫ လၧအဝ့ၫၥံၪအဆၧဒိၭနဲၩ့အ ၥၭလၧဘ့ၫၥလၭအၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> တၭနၥံၪစံၭ, ပဝ့ၫဒၪပမွဲၦအဆီၪ့ၥံၪ, ဒဲပဂဲးဆီၪ့ပ",
			"15": "<sup>15</sup> ဘၭဆီၪ့လၧဆၧဒုၭၥုၭအဂးမိၥ့ၪဘဲၫၥ့ၪလဲၪ.- မိအၭ ဘၪဆၧဂၭဂီၩ့ယူၭတၭ, စဲၪ့ထၪ့ခွံၬယူၭလၧအဒိၩ့ၥံၪ အဖၧၩ့ယူၭတၭ, အဖိၪၥၪခွၫလဖၪလၧအဘၪဆၧရွံန့ ဝ့ၫနီၪ,လ့ၩလၩ့ယူၭလၧဆၧမၩၥံၫအဖၧၩ့ယူၭ, စဎွၩ, လၧအမံၩ့မွဲၦၥုၭမုခမျၧးအယဟိဝၩနီၪ, စံၭဝ့ၫဒၪ.",
			"16": "<sup>16</sup> မိအၭအဆၧမၩဂၭဂီၩ့နီၪလၩ့ဘူၭဝ့ၫတၭ, အဆၧၡၪ့",
			"17": "<sup>17</sup> ဆၧနၭနီၪဂဲၫဝ့ၫချဲၫ့ချဲၫ့ဆ့လီၫ.- ကယဲၦၡၩအီၪဝၬဖီၩ့ ဝ့ၫၥံၪဧ့,ၥုၪ့အုၭၥၭအုၭလၧအဝ့ၫဒၪအကၠီၩ့ဆံၭ, ဒဲက ယဲၦလၧအၥ့ၪယၫအမံၩ့နီၪ, နၥံၪဝ့ၫဧ့,စံၭနၥံၪ,နိၪထိၭ ဘီၩ့ခၧၫ့ခါဝ့ၫဘဲၫၥ့ၪလဲၪၬ ဒဲဆၧနိၪဘီၩ့ဎံၫလၩနီၪၬ",
			"18": "<sup>18</sup> ၦအီၪလၧဒဲၫဘၫ့အဖၧၩ့, ဖိၪမုၪဧ့, ဂဲၫထဲၩ့လၩ့လၧန ဆၧလၩဖၩ့တၭ,ဆၧၫ့နၩ့လၧၥၭဝံထံၫအဖၧၩ့ဘီၪး အ ဂဲးဘဲၫယီၩ ၦမၩဂၭဂီၩ့မိအၭနီၪ မိဂဲၫဘၪနၧၩတၭ, မိ",
			"19": "<sup>19</sup> မၩဂၭဂီၩ့နထိၬခၧၫ့ၥံၪလီၫ.- ၦလၧအအီၪလၧအရိ အၧၫအဖၧၩ့လဂၩဧ့, အီၪဆၧၫ့ထုၪ့လၧအဖၧၩ့ၥၭနဲၩ့ တၭ,ယိဂူၪဆၧဘီၪ. ၦခွၫလၧအစဲၪ့ဖျိၭလဂၩနီၪ, ဒဲၦ မုၪလၧအစဲၪ့ဖီၩ့ဖျ့ၭနီၪ, အၪ့စၪ့ဝ့ၫတၭ,စံၭ, ဆၧမၩအ",
			"20": "<sup>20</sup> ၥၭဘဲၫၥ့ၪလဲၪ.- မိအၭအမ့ၬမဲယူၭ. အဂဲးဘဲၫယီၩဘၪ ဆၧမၩခါလၩ့ခွံၬယူၭ, အိၩ့ယိၩ့ဒဲဂၪ့ကိၭၡၭထၪ့ဘီၪ လီၩဘၪနၥံၪဝ့ၫ လၧအၫနၫ့အဖၧၩ့, လၧမိအၭဘၪဆၧ",
			"21": "<sup>21</sup> ဂၭဂီၩ့ဝ့ၫဒၪတၭ,- ဆၧစ့ၩရၫ့လၩ့ဘၪ ခးဆၧပျၩ့နီၪ တၭ,ဘၪဟိလၧၫ့, ဒဲဘၪယဟၫအဇၫ, ဒဲဘၪမံဖၫအၭ",
			"22": "<sup>22</sup> နီၪ,- ဒဲဘၪဒဲၫဘၫ့, ဒဲဘၪနံဘိၫ, ဒဲဘၪဘ့ၭၥဒံၭဘျၫၥ့",
			"23": "<sup>23</sup> အံၫ့,- ဒဲဘၪကံၫရၥ့အံၫ့, ဒဲဘၪဘ့ၭၥဂၫမလၭ, ဒဲဘၪ",
			"24": "<sup>24</sup> ဘ့ၭၥမံအၧၫ့,- ဒဲဘၫဂံရအီၭ, ဒဲဘၫဘီဇရၫ, ဒဲဘၪက ယဲဒိၩ့လဖၪလၧခးမိအၭဖၧၩ့, ဘူၭမွဲဂ့ၩ, ယဲၩ့မွဲဂ့ၩ, ထီးအလူၬလီၫ.",
			"25": "<sup>25</sup> မိအၭအနိၩ့နီၪ ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, အစူၪနီၪ ခါခွံၬဝ့ၫ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"26": "<sup>26</sup> ဒုၭအီၩမၧၩ့အဝ့ၫဒၪဘီၪး အဂဲးဘဲၫယီၩ မွဲအအီၪ က့ၪထၪ့ထီၫအၥၭထၫ့ဒၩယဟိဝၩလီၫ. မိအၭနီၪမိလွၫ လၩ့အၥၭ လၧအဆၧပၠိၭဒၪဝ့ၫအဖၧၩ့တၭ, ဆၧမိမၩ",
			"27": "<sup>27</sup> ကြၩ့ထမးဝ့ၫဒၪဆ့လီၫ.- အဂဲးဘဲၫယီၩနမၩ့ကြၩ့ထမး အံၫစရ့လၭနီၪ, မွဲအ့ၬဧၪ. ဆၧဒၪဘၪအဝ့ၫဒၪ လၧၦ အၪ့ဂူၪဆၧအကျၩဆ့ဧၪ. တၭကယဲဆၧလၧနချဲၩ့လၧ",
			"28": "<sup>28</sup> အဝ့ၫဒၪအဂဲးနီၪ, နဂံၩဂုနခိၪလီၫ.- ၦအီၪလၧမိအၭအ ဖၧၩ့,နၥံၪဝ့ၫဧ့း စဲၪ့ထၪ့ခွံၬလၧဒိၩ့ၥံၪတၭ, အီၪလၧလိး ၥံၪလဲၫ့ၥံၪအဖၧၩ့ဘီၪး ဘဲၫထိၪလွံ လၧအမၩအၥွံၫလၧ",
			"29": "<sup>29</sup> ဆၧအိၩဖၧၩ့အနဲၩ့ထံၭၥံၪဘီၪ.- ပနါဂၧၫ့မိအၭအၥၭ ထၪ့ထီၫအဂဲးတၭ, (မွဲအအီၪက့ၪထၪ့ထီၫအၥၭ ထီၫ ထီၫလ့ၬ) အဆၧထၪ့ထီၫ,ဒဲအဆၧၥူၪဂဲၩ, ဒဲအၥၭထၪ့",
			"30": "<sup>30</sup> ထီၫ,အမၩၥူၪဂဲၩအၥၭနီၪလီၫ.- အဆၧၥၭထၪ့နီၪ, ယၥ့ၪယၫ,ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲလါနၫ့တၭမွဲဆၧအ့ၬ.",
			"31": "<sup>31</sup> အဆၧၥူၪဂဲၩနီၪမွဲဆၧအဘျံၭအဘျၪလီၫ.- အခိးမွဲယ မိအိၩ့ယိၩ့လၧမိအၭအဂး, ဒဲဂၪ့ကိၭၡၭထၪ့ လၧမိအၭ ထီးအလူၬအဂးလီၫ. ယၥုၪ့အုၭၥၭအုၭလၧကၧၫဟံ",
			"32": "<sup>32</sup> ရ့ၭအၦၡၩအဂးလီၫ.- စံဘမၫအစဘံၭမုဧ့, ယမိဂၪ့ လၧနကၠီၩ့လၧယၫဇၧၫအဆၧဂၪ့နီၪ, နထဲၩ့နဖၫ့လ့ၩခၫ့ ဂၬမၫဆမံၭတၭ, မွဲအထီၩ့လၧမၫဆမံၭယၫဇၧၫဒၪလ့ၬ တၭး ၦလၧအမၩဂၭဂီၩ့ဆၧနီၪ ဂဲၫဘၪနဆၧၥူၪဆၧၥၪ",
			"33": "<sup>33</sup> ၥံၪ,ဒဲဘၪနစဘံၭအလးဆ့လီၫ.- တၭဆၧမၩန့ခွံၬဆၧ ၥၭထိၬဒဲဆၧမုၬလၩနီၪ လၧဆံၬၥံၪနၩၥံၪအဆၧလၧၫ့ လၧၫ့ဎွ့ၩဎွ့ၩ, ဒဲလၧခးမိအၭနီၪဆ့လီၫ. တၭယဒုၭလၩ့ မါယူၭစဘံၭထံၫလၧဆၧဘံၭဝ့ၫအလးလဖၪနီၪး ၦၡၩ ယဲးဝ့ၫလၧဆၧကိၭၡၭနီၪနးဂၩအ့ၬး ဆၧကိၭၡၭနီၪမွဲ",
			"34": "<sup>34</sup> ဆၧကိၭၡၭအ့ၬ.- လၧဟ့ၭၡဘၫ့အဆၧဂၪ့ကိၭနီၪဖိး လၧအံၫလအ့လံၫ, ဒဲထီၩ့လၧယၫဟၭ, အဝ့ၫၥံၪဒုၭဂၧၫ့ ထၪ့ယူၭအလူယူၭနီၪ, လၧဇိအၫဖိးလၧဟီၫရနံၫ့, ချီမိ အနံၪ့ၥၧၫ့နံၪ့, အဂဲးဘဲၫယီၩနံၪ့ရံၫ့အထံၫလဖၪဆ့မိအီၪ",
			"35": "<sup>35</sup> ယူဝ့ၫလီၫ.- တၭယဟိဝၩစံၭဝ့ၫ, လၧမိအၭအဖၧၩ့နီၪ ယမိဒုၭလၩ့မါၦလၧအလုထၪ့ဆၧလၧအလးထၪ့ထီၫ လဖၪး ဒဲၦလၧအဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧအယွၩလဖၪ",
			"36": "<sup>36</sup> နီၪလီၫ.- အခိးမွဲယၥၭမိၥီၫထၪ့ဘဲၫပံၩၥံၪၥီၫထၪ့အ ၥိၭလၧမိအၭအဂးတၭး ယၥၭမိၥီၫထၪ့ဘဲၫပံၩၥံၪၥီၫ လၧကၧၫဟံရ့ၭအဂးနီၪ အဂဲးဘဲၫယီၩအစူၪလးခၪ့",
			"37": "<sup>37</sup> ခိၪလၧအန့ဘၪဝ့ၫနီၪဂၭဂီၩ့ဝ့ၫဒၪလီၫ.- ကယဲၦလၧအ ခိၪဎွံၪချၩဝ့ၫတၭ, ကယဲၦအခၪလၬဆီၪ့ ဘၪဆၧထ့ၭ ခွံၬဝ့ၫတၭ,ဆၧဂ့ၬအလးအီၪဝ့ၫ လၧကယဲၦအစူၪအ",
			"38": "<sup>38</sup> လီၩ့ဒဲရၧၬအဆၧယၬအီၪလၧအယးဒံၩ့ၥံၪလီၫ.- လၧ မိအၭအဂံၪ့ခိၪၥံၪနီၪ ဆၧဂၪ့အုၩ့ဂၪ့ထိၬ မိအီၪဝ့ၫဎံၩ့ ဎံၩ့လ့ၬ,ဒဲလၧအဖၧၩ့ၥၭလဖၪနီၪဆ့တၭ, အဂဲးဘဲၫယီၩ ယမၩထ့ဖၭယူၭမိအၭ, ဘဲၫဖၧၩ့လၧအလဘၪဘၪပၥၭ",
			"39": "<sup>39</sup> အၥိၭနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- အဝ့ၫၥံၪမိအိၩ့ယိၩ့,ဆၧ ခါလၩ့ခွံၬနၭမၬကၨၬ မိကၠၪဒိၭချိၫ့အၥၭလၧဆၧမ့ၬမဲ နၭမၬကၨၬ ဘဲၫနီၪၥိၭမိအၭ မိကဲၪဆၧမၩကြၩ့ထမး ဝ့ၫ,ဒဲဆၧမ့ၬမဲဝ့ၫနီၪ လၧကယဲၦအီၪဖီၩ့ဝ့ၫဝၬဝၬကိၭဂၩ ဒ့ၭလီၫ.",
			"40": "<sup>40</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ယိခွါ, အဝ့ၫဒၪမိယူၩဝ့ၫ ဘဲၫလံၬကျီၫ့ကျီၫ့အၥိၭတၭ, မွဲအမိ",
			"41": "<sup>41</sup> ပၠၪလၩ့အဒံၭၥံၪ လၧမိအၭအဖၫ့ခိၪနီၪလီၫ.- ကၧၫရ အီၭဘၪဆၧမၩန့ဝ့ၫတၭ, အထိၬခၧၫ့လဖၪဘၪဆၧမၩ ၡုၭဝ့ၫဒၪတၭ, ၦၡၩအဆီၪ့လဖၪလၧမိအၭအဖၧၩ့, ထီး ဘၪမုနံၩနီၪမိမၩအၥၭဘဲၫၦမုၪ လၧအဂူၭဆၫအၥိၭနီၪ",
			"42": "<sup>42</sup> လီၫ.- တၭမိအၭမိဘၪဂၭဂီၩ့နီၪကဲၪလၧၫ့ၦဆၨၩအ့ၬ. အဂဲးဘဲၫယီၩ မွဲအမၩဒိၪထၪ့အၥၭ ထၫ့ဒၩယဟိဝၩ",
			"43": "<sup>43</sup> နီၪလီၫ.- ဆၧၥၭမဲၪဆၧဖၧၩ့ယိၬ, ဒဲဖျံၩခွၩ့မိဘၪနၧၩ,",
			"44": "<sup>44</sup> ၦအီၪလၧမိအၭဖၧၩ့လဂၩဧ့, ယဟိဝၩစံၭဝ့ၫဒၪ.- ၦ လၧအစဲၪ့လၧဆၧၥၭမဲၪအကၠီၩ့နီၪ, မိလၩ့ထ့ၬလၧဆၧ ဖၧၩ့ယိၬလီၫ. ဒဲၦလၧအဂဲၫထဲၩ့ထၪ့လၧဆၧဖၧၩ့ယိၬ နီၪမိဘၪဖျံၩခွၩ့တၭ, အဂဲးဘဲၫယီၩ ယမိဒုၭဘၪမိအၭ နီၪလၧအနံၪ့အလၩ လၧအဝ့ၫၥံၪမိဘၪဆၧစ့ၩရၫ့နီၪး",
			"45": "<sup>45</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- တၭၦလၧအစဲၪ့ဖျိၭလဖၪနီၪဆၧၫ့ ထုၪ့ဝ့ၫလၧဟ့ၭၡဘၫ့အလၩၡုၪအဖၧၩ့, လၧအဂဲးအ ဘၭလအီၪဘၪအကၠီၩ့း မွဲလါနၫ့ဘိၩ မ့ၪမိဂဲၫထၪ့ခွံၬ လၧဟ့ၭၡဘၫ့နီၪ, ဒဲမ့ၪလၪလၧစဲဟၫ့ အၥၭကျၩတၭ, မိအၪ့ခွံၬမိအၭအနိၪ့, ဒဲၦလၧအတုၩ့ထၪ့တုၩ့လၩ့ဆၧ အခိၪလဂၩအၥရဖူၩနီၪလီၫ.",
			"46": "<sup>46</sup> မိအၭဧ့,နဘၪဆၧအၡၪ့လီၫ. ခံမီၭအခ့ၫအၡၩၥံၪ ဘၪဆၧဂၭဂီၩ့ဝ့ၫး အဂဲးဘဲၫယီၩ နဖိၪခွၫလဖၪဘၪဆၧ ဖီၪ့န့အၪ့မၧၫ့ဎီးဝ့ၫး ဒဲနဖိၪမုၪၥံၪ ဆၧအၪ့မၧၫ့ဎီးဝ့ၫဆ့",
			"47": "<sup>47</sup> လီၫ.- မွဲလါနၫ့တၭ,မုနံၩထုၬလဖၪယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ ဒီၭမိအၭအဆၧအၪ့မၧၫ့ဎီးနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ. အ ယီၩမွဲမိအၭအဆၧစ့ၩရၫ့လီၫ."
		},
		"49": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩး အံၫစရ့လၭအဖိၪခွၫၥံၪမွဲအ အီၪနးဂၩအ့ၬဧၪ. ၦလၧအမိန့ၥၫဆၧနီၪ အီၪအ့ၬဧၪ. အဝ့ၫၥံၪအစဎွၩ န့ဘၪၥၫဂၭအခးနီၪ မွဲအဂဲးဘဲၫၥ့ၪ လဲၪးဒဲအၡၩလဖၪ အီၪလၧအဒိၩ့ၥံၪနီၪ မွဲဘၪလဲၪ.",
			"2": "<sup>2</sup> အခိးမွဲယဟိဝၩစံၭဝ့ၫး ယိခွါ, မုနံၩလဖၪမိဂဲၫ, လၧ ယမိဒုၭအီၪထၪ့ဆၧဒုၭၥုၭ အဆၧၥၭမဲၪအလးလၧအ မိဂၧၫ့ထၪ့ဝ့ၫဖိးလၧၦအၫမၧၫ့ဖိၪ အဒိၩ့ရၫဘၫအဖၧၩ့ နီၪလီၫ.တၭမွဲအမိကဲၪဆၧအပိၩ့အီၪယူဝ့ၫနီၪး ဒဲအ ဖိၪမုၪၥံၪမိဘၪဆၧဆူၭခွံၬလၧမ့ၪတၭး ထီးနီၪလဖၧၫ့ အံၫစရ့လၭမိကဲၪ ၦန့ၥၫဆၧလၧအဝ့ၫၥံၪအဆၧန့ၥၫလ",
			"3": "<sup>3</sup> ဖၪအလး, ယဟိဝၩစံၭဝ့ၫဒၪ,- ဟ့ၭၡဘၫ့ဧ့,အိၩ့ယိၩ့ နဝ့ၫဘီၪး လၧဟဲၫဘၪဆၧဂၭဂီၩ့အကၠီၩ့, ရၫဘၫအဖိၪ မုၪၥံၪဧ့,ဂၪ့ကိၭၡၭထၪ့နၥံၪဝ့ၫဘီၪး ခၧၩ့ထၪ့နယးဒံၩ့ လၧရၧၬအဆၧယၬတၭး ၥုၪ့အုၭၥၭအုၭလဲးလီၩ့လၧ ထနါၥံၪအနဲၩ့ထံၭနီၪဘီၪး အဝ့ၫၥံၪအစဎွၩ ဘၪလ့ၩ နုၬလၧဆၧအၪ့မၧၫ့ဎီးအဖၧၩ့, အၡၩလုဆၧလဖၪဒဲအ",
			"4": "<sup>4</sup> ၦဒိၪဖၭဒိၪၥံၪစီၪ့ဎးလိၬအၥၭဆ့လီၫ.- တၭနမၩဖိၫ နၥၭလၧခိၪလီၩ့ဆူၭလဖၪ အဖၧၩ့နီၪ, မွဲအဂဲးဘဲၫၥ့ၪ လဲၪး နခိၪလီၩ့ဆူၭနီၪယွၩလၩ့ဝ့ၫ, ဖိၪမုၪလၧအၥၭဂၭ ဂီၩ့း လၧအဒိၭနဲၩ့အၥၭ လၧအဎၧၩ့အဎီအဖၧၩ့တၭ,",
			"5": "<sup>5</sup> စံၭဝ့ၫ,မွဲပလၫမိဂဲၫလၧယအီၪလဲၪနီၪ,လဂၩဧ့,- ယိခွါ, ယဟိဝၩၥုၭမုခမျၧးအယွၩစံၭဝ့ၫဒၪ, ယမိဒုၭဂဲၫဆၧ ၥၭမဲၪလၧနလီၩ့နီၪ, လၧကယဲၦအီၪဖီၩ့နၧၩဝၬဝၬ ထီး အလူၬလီၫ. တၭဆၧမိနၫ့ထၪ့ခွံၬနၥံၪကိၭဂၩလၧအမ့ၬ ယၫဆုၬဆုၬတၭ, ၦလၧအလ့ၩဝံၩ့ဝၩ့နီၪဆၧမိကိၭကီၪ့ ဝ့ၫနးဂၩအ့ၬ.",
			"6": "<sup>6</sup> လၧခဲၫ့ထဲၩ့တၭ, ယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ ၦအၫမၧၫ့ဖိၪ အဆၧအၪ့မၧၫ့ဎီးဝ့ၫနီၪး ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"7": "<sup>7</sup> ၥုၭမုခမျၧး အယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, လၧတံမၧၫ့ အဖၧၩ့နီၪဆၧကိၪ့ၥ့ၪကိၪ့ဘၪအီၪလၧၩ့အ့ၬဧၪ. လၧၦ ကိၪ့ၥ့ၪကိၪ့ဘၪ အဆၧဒုၭကိၪ့နီၪဂၭဂီၩ့ဆ့ဧၪ, အဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪအဆၧကိၪ့ၥ့ၪကိၪ့ဘၪနီၪ, စဲၪ့လၩ့မါဆ့ဧၪ.- စဲၪ့ဖျိၭ ထဲၩ့ထဲၩ့ကဒၩထဲၩ့, အီၪလၧဆၧယိၬအဖၧၩ့ဘီၪ, ၦ အီၪလၧဒံဒၫ့ အဖၧၩ့ၥံၪဧ့း အဂဲးဘဲၫယီၩ ယမိဒုၭဂဲၫ ဘၪအဝ့ၫဒၪ လၧစအံစီၫအဆၧၡၪ့ဆၧနၭနီၪး အဆၧၫ့",
			"9": "<sup>9</sup> အထီလၧယမိစ့ၩရၫ့ဝ့ၫလီၫ.- ၦလၧအအၪ့ထုၫ့ကီၪ့ စဘံၭၥၪၥံၪ အ့ၪဂဲၫလၧနအီၪတၭ, အဝ့ၫၥံၪမိဒုၭအီၪ လၩ့ထးစဘံၭၥၪလနၩ့နၩ့နီၪမွဲအ့ၬဧၪ. ဆၧအၪ့ဂူၪအ့ၪ ဂဲၫလၧမုနၩလခီၫနီၪး အဝ့ၫၥံၪမိမၩဂၭဂီၩ့ဆၧထီးအန့",
			"10": "<sup>10</sup> ဘၪဆၧလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩလီၫ.- အ့ၪမွဲယမၩလိၩ့ကိၩ့ ယူၭစအံစီၫ, ဒဲယဒုၭဖျီၪထၪ့ယူၭအလး အီၪၥူၪဝ့ၫလ ဖၪတၭ, မွဲအမိအီၪက့ၪၥူၪခွံၬအၥၭၥ့ၪနးစီၪ့အ့ၬ, အချံၫ အၥၪဘၪဆၧဂၭဂီၩ့ယူၭ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, ဒဲၦအီၪလၧ",
			"11": "<sup>11</sup> အနဲၩ့ထံၭလဖၪတၭ, အဝ့ၫဒၪအီၪလၧၩ့အ့ၬ.- နဖိၪဎွ့ၪ လဖၪနီၪဒုၭအီၪလၩ့ထးဘီၪ, တၭယမိဒုၭမၧၫ့အဝ့ၫၥံၪ လီၫ.ဒဲနၡၩမုၪမဲၫၥံၪ, မွဲအဒိၭနဲၩ့အၥၭလၧယစူၪဖၧၩ့",
			"12": "<sup>12</sup> ဆံၭ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဝ့ၫဘဲၫယီၩး ယိခွါ, ၦလၧအဆၧစ့ၩရၫ့နီၪ, ထီးအီၩလိၫ့နီၪလဂ့ၩတၭ, မွဲအ အီၩမၧၩ့ဝ့ၫတၡါလ့ၬလီၫ. နမွဲၦလၧအမိဖီၩ့ဖျ့ၭ ဆၧ စ့ၩရၫ့စၪနီၪလူၬဆ့ဧၪ. နဖီၩ့ဖျ့ၭဆၧဒဲၩဘၭနီၪၥ့ၪအ့ၬး",
			"13": "<sup>13</sup> နမိဘၪအီၩတၡါလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဝ့ၫ ဒၪ,ယဆိၪလၩ့ယၥၭ လၧယနၫ့ဆါဒၪယဝ့ၫ, လၧဘီ ဇရၫဘၪကဲၪထၪ့ဆၧအီၪယူဝ့ၫအလး, ဆၧမၩကြၩ့ ထမးဝ့ၫ,ဆၧဎဲၫ့ထၬအလး, ဒဲဆၧဆိၪအၧၩ့အလး, ဒဲကယဲအဒိၩ့လဖၪထီးအလူၬနီၪ မိကဲၪထၪ့အလးဎဲၫ့",
			"14": "<sup>14</sup> ထၬလထံၪဎးလဘီၩ့ဎးလီၫ.- ယနါဂၧၫ့ယူၭဆၧလမံၩ့ လၧယဟိဝၩနီၪ, အၥီၫ့လဂၩဘၪဆၧအၪ့မၧၫ့ဝ့ၫလၧၦ ဆၨၩၥံၪအအီၪ, စံၭဝ့ၫ, ဂဲၫအီၪကီၪ့နၥံၪဝ့ၫ, ဒဲထၫ့ဒုၪ ဒၩအဝ့ၫနီၪဘီၪ. ဒဲဂဲထုၪ့လၧဆၧဒုၭၥုၭအဂးဘီၪ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩ,ယိခွါ, ယမိအီၪက့ၪနၧၩလၧအဆံၭလၧ ၦဆၨၩၥံၪအကျၩ, ၦလန့ဘၪဆၧယူၭယၪ့ လၧၦၡၩ",
			"16": "<sup>16</sup> အကျၩလီၫ.- နဆၧမၩၥၭမဲၪနီၪအၪ့လီၫန့ယၧၩ, ဒဲနၥၭ အဆၧထၪ့ထီၫ,ၦလၧအအီၪလၧလိးအိၩဖၧၩ့, နဝ့ၫဒၪ ယီၩလၧအဖီၪ့ထၬဆၧစီၩ့ခိၪနီၪး နမၩနၥွံၫထၪ့ထီၫ ဘဲၫလံၬကျီၫ့ကျီၫ့အၥိၭလါနၫ့တၭ, ယမိဂဲၫဆိၬလၩ့ခွံၬ",
			"17": "<sup>17</sup> နၧၩလၧအလးနီၪ,ယဟိဝၩစံၭဝ့ၫဒၪ.- အံဒၧၫ့နီၪဘၪ ကဲၪဆၧအီၪယူဝ့ၫအလးဆ့း ကယဲၦလၧအလဲးလီၩ့ဝ့ၫ နီၪမိထီၫမံၫထီၫမၪဝ့ၫဒၪ, ဒဲမိဒုၪဒွ့ၪဝ့ၫ လၧအဆၧၡၪ့",
			"18": "<sup>18</sup> ဆၧနၭၥံၪအကၠီၩ့လီၫ.- ဘဲၫလၧစီဒၧၫ့ဒဲဂမိရၫအဆၧ မၩဂၭဂီၩ့အဖၧၩ့နီၪ, ဒဲဒိၩ့ၥံၪအီၪဘူၭဆ့, ယဟိဝၩစံၭ ဝ့ၫဒၪ,ၦၡၩမိအီၪထီးနီၪနးဂၩအ့ၬး ဒဲၦၡၩအဖိၪခွၫ မိအီၪဂုးခၧၫ့လၧအဖၧၩ့နးဂၩဆ့အ့ၬ.",
			"19": "<sup>19</sup> ယိခွါ, အဝ့ၫဒၪမိဂဲၫထၪ့ဝ့ၫ,ဘဲၫဆၬလၥၧၫ့လၧယီၫ ဒၫ့အဆၧလုၬဘံၭအၥိၭနီၪ, ထၫ့ဒၩၦအဆီၪ့နီၪအီၪဝ့ၫ အလး အ့ၪမွဲယဝ့ၫဒၪယမိမၩၡုၭဝ့ၫ ဒဲဒုၭစဲၪ့ခွံၬလၧ အဝ့ၫဒၪလီၫ. ၦလၧအဘၪဆၧရွံန့ဝ့ၫဘဲၫၥိၭ ယမိအီၪ က့ၪလၧအဖၫ့ခိၪနီၪ, မွဲပလၫလဂၩလဲၪ. ၦလၧအလၩ့ ဂၬယၧၩမွဲၦလဂၩလဲၪး မွဲၦမိအီၪက့ၪလၩ့ဝဲၩဆၧအ ဆၧၫ့အထီလၧယဂးလဂၩလဲၪ. ၦယိၥိၪလဂၩလၧအ မိဆၧၫ့ထုၪ့လၧယမ့ၬယၫ, မွဲၦလဂၩလဲၪ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩအဆၧဒုၭကိၪ့နီၪ, ခိၭနၪဘီၪး လၧအထၫ့ဒၩအံဒၧၫ့နီၪး ဒဲအဆၧစ့ၩရၫ့လ ဖၪးလၧအစ့ၩရၫ့ဝဲၩဝ့ၫထၫ့ဒၩ ၦတံမၫ့ဖိၪ လဖၪနီၪ လီၫ.မွဲမၬလၧအဆံၭထုၬလၧၥိၪအဒီၪ့အကျၩနီၪ မိမီၩ့ ထၪ့ခွံၬဝ့ၫတၭ, မွဲမၬအဝ့ၫဒၪမိဒုၭအီၪယူအဝ့ၫၥံၪ အီၪ",
			"21": "<sup>21</sup> ဝ့ၫအလးလၧအကျၩနီၪလီၫ.- ဂၪ့ခိၪနီၪဝၭဝ့ၫလၧအ ဝ့ၫၥံၪလၩ့ထ့ၬနီၪအၥီၫအကၠီၩ့လီၫး လၧအဂၪ့ကိၭၡၭ ထၪ့အၥီၫနီၪဘၪဆၧဂၧၫ့ထၪ့ဝ့ၫ လၧထံၫဝီၩအဖၧၩ့နီၪ",
			"22": "<sup>22</sup> လီၫ.-ယိခွါ,အဝ့ၫဒၪမိဂဲၫထၪ့ယူၩဝ့ၫဘဲၫလံၬကျီၪ့ကျီၪ့ အၥိၭနီၪ, ဒဲယၩ့ထၪ့အဒံၭၥံၪလၧဘီဇရၫအဖၫ့ခိၪလီၫ. လၧမုနံၩနီၪ အံဒၧၫ့အၡၩဆီၪ့လဖၪ အၥၭမိမၩအၥၭ ဘဲၫၦမုၪလၧအဘၪဆၧဂူၭဆၫအၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> ဟၫမၭ ဒဲအၫဖၭ ဘၪဆၧမ့ၬမဲလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနါဂၧၫ့ဆၧပရၧၫ့အအၧၩ့တၭး အဝ့ၫၥံၪအၥၭ ဖံၪထၪ့ဝ့ၫး ဆၧၥုၪ့အုၭၥၭအုၭ အီၪလၧမၫဆမံၭဖၧၩ့",
			"24": "<sup>24</sup> တၭး အီၪဂုးဖုးၥ့ၪအ့ၬ.- ဒမၭစကၧၭလၩ့ဆါထဲၩ့တၭ, ကၠၪထဲၩ့အၥၭလၧအမိစဲၪ့ဖျိၭနီၭ, ဆၧၥၭမဲၪဖီၪ့ထၬဝ့ၫ ဒၪတၭးဆၧဂၪ့အုၩဂၪ့ထိၬ, ဆၧၥုၪ့အုၭၥၭအုၭ ဘဲၫၦ",
			"25": "<sup>25</sup> မုၪလၧအဘၪဆီၫ့အီၪန့အဖိၪအၥိၭနီၪလီၫ.- ဒိၩ့လၧ အဒိၭန့ဆၧစံၭထၪ့အၪ့အူၭ, ဆၧၥုၪ့ဎွံၫၥၭယီၫအဒိၩ့",
			"26": "<sup>26</sup> နီၪ,မွဲဘၪနီၫဆၧလဒုၭအီၪလၩ့ထးဘၪနီၪလဲၪၬ- မၩ အၥၭဘဲၫနီၪတၭ, အဖိၪၥၪခွၫလဖၪ မိလၩ့ထံၩဖါဝ့ၫ လၧအဖၧၩ့ၥၭလဖၪအဖၧၩ့နီၪး ဒဲကယဲၦၡၩၥုၭဖိၪၥံၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧမုနံၩနီၪ, ၥုၭမုခမျၧးအယ",
			"27": "<sup>27</sup> ဟိဝၩစံၭဝ့ၫဒၪ.- တၭယမိဒုၭခဲၩထၪ့မ့ၪလၧဒမၭစကၧၭ အခိၪဒၧၩ့ဖၧၩ့နီၪတၭ, မွဲအမိအၪ့ခွံၬစဘံၫ့ဟဒၭအနီး လဖၪနီၪလီၫ.",
			"28": "<sup>28</sup> ကံဒၧၫအဂဲးအကၠီၪ့, ဒဲဟၫဇိၫအဘၩ့အမုးၥံၪအဂဲး အကၠီၪ့း လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫကျီၪ့ ခွံၬဝ့ၫဒၪ,ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩး ဂဲထုၪ့နၥံၪဝ့ၫလ့ၩ",
			"29": "<sup>29</sup> ထၪ့လၧကံဒၧၫတၭ, မၩဂၭဂီၩ့ၦမုထၪ့ဖိၪဘီၪ.- အဝ့ၫ ၥံၪအတဲၩလဖၪ ဒဲအၥိၪဒီၪ့ၥံၪနီၪ, ဆၧမိမၩန့ခွံၬဝ့ၫဒၪ တၭး ၦၡၩမိမၩန့အဝ့ၫၥံၪအကလကၫလဖၪ, ဒဲအဖၧၩ့ ၥံၪထွ့ၫၥံၪထီးအလူၬ, ဒဲအကလအူၭၥံၪ လၧအနၫ့ဆါ ဒၪဝ့ၫအဂးတၭ, အဝ့ၫၥံၪမိကိၭၡၭထၪ့ဆၧနီၪး ဆၧၥၭ",
			"30": "<sup>30</sup> မဲၪအီၪထၪ့ဝၬဝၬဝ့ၫဒၪနီၪလီၫ.- စဲၪ့တၭလ့ၩဖိးလၧအ ယဲၩ့ဘီၪး ၦဟၫဇီၫဖိၪၥံၪဧ့,အီၪနၥံၪဝ့ၫလၧဆၧယိၬအ ဖၧၩ့ဘီၪး ယဟိဝၩစံၭဝ့ၫဒၪး အဂဲးဘဲၫယီၩ ဘၭဘ လၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫကိၪ့လိၬ, ကၩ့ကၩထၫ့ဒုၪ ဒၩနၥံၪတၭ, မွဲအကၩ့ကၩဝဲၩဆၧစ့ၩရၫ့လမံၩ့ ထၫ့ဒၩ",
			"31": "<sup>31</sup> နၥံၪလီၫ.- ဂဲထုၪ့လ့ၩထၪ့လၧၦဆၨၩ အီၪလၧစူၪလး ခၪ့ခိၪနီၪ, လၧအအီၪဝ့ၫလၧအၪ့ယိၪဆၧလအီၪဘၪနီၪ ဘီၪးယဟိဝၩစံၭဝ့ၫဒၪး အဝ့ၫၥံၪအတရၫ့ဒဲအနိၪဘီၩ့",
			"32": "<sup>32</sup> ၥံၪလအီၪဘၪး အီၪဒၪဆၧဘဲၫနီၪလီၫ.- အဝ့ၫၥံၪအက လအူၭလဖၪး မိကဲၪဆၧအၪ့ဂူၬန့း ဒဲအချီၥံၪအၪအၪ လ့ၬနီၪၦမိအၪ့ဂူၬန့း ဒဲၦလၧအလိၩ့အခၪလၬဆီၪ့နိၪ့ လဖၪယမိဒုၭလၩ့ပြံၩလၩ့ပၩလၧကယဲလံၩအီၪကိၭ ခီၫဒ့ၭလီၫ. တၭယမိဒုၭအီၪထၪ့ အဆၧၡၪ့ဆၧနၭနီၪ လၧအဂဲၫထၪ့ဝ့ၫ လၧဆၧနဲၩ့ဖၩကိၭခီၫဒ့ၭ, ယဟိဝၩ",
			"33": "<sup>33</sup> စံၭဝ့ၫဒၪ.- တၭဟၫဇၧၫမိကဲၪထၪ့အလးလၧၡီၩ့ၥံၪအ ဂး,ဒဲအလးအီၪယူဝ့ၫအဆိၩအကၠၪလီၫ. ၦၡၩမိအီၪ ထီးနီၪနးဂၩအ့ၬး ဒဲၦၡၩဖိၪခွၫအီၪဂုးခၧၫ့ လၧအဖၧၩ့ နးဂၩဆ့အ့ၬ.",
			"34": "<sup>34</sup> ယဟိဝၩအလူလၧအလၩ့ဘၪ မီၪစယ့ၫရမဲအၫ လၧအထၫ့ဒၩအံလၫ့နီၪ, လၧယုဒၫအစဎွၩဇ့ၭဒကဲအၫ ကဲၪထၪ့ၥၫ့စဎွၩနီၪ, စံၭဝ့ၫဒၪး",
			"35": "<sup>35</sup> ၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩး ယိခွါ,အံလၫ့ အချံၪနီၪ ယမိဘိၭခါခွံၬဝ့ၫ, အဝ့ၫၥံၪ အစီၩ့အမၩ့အ",
			"36": "<sup>36</sup> ခိၪလီၫ.- တၭလၧအံလၫ့အလီၩ့နီၪယမိဒုၭဂဲၫထၪ့လံၩ လံမံၩ့လၧမူၭခိၪလံခီၫလူၬတၭ, ယမိမၩလၩ့ပြံၩလၩ့ ပၩအဝ့ၫၥံၪ လၧလံၩနီၪထီးအလူၬလီၫ. တၭၦဆၨၩ နီၪ,လၧၦလၧအဘၪဆၧနၫ့ထၪ့ခွံၬ လၧအံလၫ့အဖၧၩ့",
			"37": "<sup>37</sup> လမိလ့ၩဘၪတၭ,အီၪဝ့ၫနးဆၨၩအ့ၬ.- တၭအံလၫ့ နီၪယမိဒုၭၥၭမဲၪ လၧအဒုၪအဒၩၥံၪ အမ့ၬယၫနီၪး ဒဲလၧၦလၧအအၪ့ဎၬ အၥၭမၧၫ့နီၪ အမ့ၬယၫဆ့လီၫ. တၭယမိဒုၭဂဲၫထၪ့ဆၧအၧၩ့ လၧအဝ့ၫၥံၪအလီၩ့,ယ ၥၭဆီၪ့ဒၪလ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ. တၭယမိအၪ့မၧၫ့",
			"38": "<sup>38</sup> နၭလ့ၩဆီးဝ့ၫ,ထီးယမၩလူၬခွံၬအဝ့ၫၥံၪလီၫ.- တၭယ မိအီၪက့ၪလၩ့ယလးဆီၩ့ဆီ လၧအံလၫ့အဖၧၩ့နီၪ,ဒဲမိ မၩဂၭဂီၩ့ခွံၬ အဝ့ၫၥံၪအစဎွၩ, ဒဲအၦဒိၪဖၭဒိၪလဖၪ နီၪးယဟိဝၩစံၭဝ့ၫဒၪ.",
			"39": "<sup>39</sup> အ့ၪမွဲလၧမုနံၩအထုၬလဖၪနီၪ, ဆၧမိမၩအၥၭ,လၧ ယမိဒုၭဂဲၫထဲၩ့ထဲၩ့ဒီၭ အံလၫ့လၧအဆၧအၪ့မၧၫ့ဎီး ဝ့ၫအဖၧၩ့နီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"50": {
			"1": "<sup>1</sup> ယဟိဝၩအလူ လၧအချဲၩ့ထၫ့ဒၩဘၭဘလၧၫ့,ဒဲ ထၫ့ဒၩၦခၫလဒံအၫဖိၪၥံၪအခး လၧမီၪစယ့ၫရမဲအၫနီၪ လီၫ.",
			"2": "<sup>2</sup> လီၩဘၪနၥံၪဝ့ၫလၧၦဆၨၩၥံၪအကျၩ, ဒဲမၩဂၧၫ့ထၪ့ ၥၩလၩ့, ဒဲအီၪက့ၪထၪ့ဆၧအလၫ့လမံၩ့း မၩဂၧၫ့ထၪ့ ၥၩလၩ့ဘီၪး ထီးမၩဘံၭခွံၬလဂ့ၩး စံၭ,ဘၭဘလၧၫ့ ဘၪဆၧမၩန့ဝ့ၫ, ဘံလၫဘၪဆၧမ့ၬမဲဝ့ၫ, မရိဒၭဘၪ ဆၧမၩလၩ့ဘျ့ၭဝ့ၫး အဆၧဂၩ့ဆၧဖၪ့ၥံၪဘၪဆၧမ့ၬမဲ",
			"3": "<sup>3</sup> ဝ့ၫ,ဒဲဘၪဆၧမၩလၩ့ဘျ့ၭဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩ လၧမုဖၩလခီၫနီၪ ၦဆၨၩလၧအထၫ့ဒၩဝ့ၫဂဲၫတၭ, မွဲ အမိမၩအခးအီၪယူဝ့ၫတၭ, ၦၡၩအီၪလၧအဖၧၩ့နး ဂၩအ့ၬ.အဝ့ၫၥံၪမိၥုၭခွံၬအၥၭ, မွဲအမိစဲၪ့ဒၪခွံၬဝ့ၫ, ၦၡၩဒဲဆၧဖိၪဆၧဎါနံၫခီၫလူၬလီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩစံၭဝ့ၫ,လၧမုနံၩလဖၪနီၪ, ဒဲအဆၧၫ့အထီ နီၪ,ၦအံၫစရ့လၭဖိၪၥံၪမိဂဲၫ, အဝ့ၫၥံၪဒဲၦယုဒၫဖိၪၥံၪ စီၪ့ဎးတၭ,လ့ၩဆၧလခီၫဂၪ့လခီၫတၭး အဝ့ၫၥံၪမိလ့ၩ",
			"5": "<sup>5</sup> ဆၧ,ဒဲမိအၪ့ဎၬယဟိဝၩအဝ့ၫၥံၪအယွၩလီၫ.- အဝ့ၫ ၥံၪဒိၭစိၩအမ့ၬၥံၪ လၧဇံအိၫ့နီၪ အၪ့စၪ့ဖၧၩ့ၥၭအဂဲး အကၠီၪ့,စံၭဝ့ၫဒၪ, ဂဲၫဘီၪ,မွဲပစဲၩဘုၭထၬၡီၩ့ပနၫ့ဆါ ဒၪပဝ့ၫလၧယဟိဝၩနီၪ လၧဆၧအုၩ့လၩ့လိၬပၥၭလ ထံၪဎးလဘီၩ့ဎး လၧဆၧလၥၭနၪ့လၧၩ့ဘၪနီၪဆံၭ.",
			"6": "<sup>6</sup> ယၡၩခမျၧးၥံၪ မွဲၥိၪလၩ့မါယူၭး အဝ့ၫၥံၪအၡၩယူၬ ၥိၪလဖၪဒုၭဂၭဖျိၭအဖၧၩ့ၥၭတၭ, ဒုၭကၠၪခွံၬအဝ့ၫၥံၪ လၧခိၪလီၩ့လဖၪတၭ, အဝ့ၫၥံၪလ့ၩဆၧနီၪစဲၪ့ထၪ့ခွံၬ လၧခိၪလီၩ့လစီၪ့ဘၪလစီၪ့တၭ, ၥၭနၪ့ခွံၬအဆၧအီၪ",
			"7": "<sup>7</sup> ပွံၭအလးလီၫ.- ကယဲၦလၧအဒၪအဝ့ၫၥံၪ အၪ့ခွံၬဝ့ၫ တၭး အဝ့ၫၥံၪအဒုၪအဒၩစံၭဝ့ၫ, ပမၪဘၪဆၧအ့ၬ, အ ဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၪဘၪယဟိဝၩနီၪး ဆၧတီၩဆၧ လီၩ့အီၪဝ့ၫအလး, ယဟိဝၩဒၪလ့ၬ, အဝ့ၫၥံၪအဖါလ ဖၪအဆၧယိလါနီၪလီၫ.",
			"8": "<sup>8</sup> စဲၪ့ထၪ့ခွံၬလၧဘၭဘလၧၫ့အၥၭကျၩ, ဒဲစဲၪ့ထၪ့ခွံၬ လၧၦခၫလဒံအၫဖိၪအခးဘီၪး ဒဲအီၪဘဲၫဘ့ၪဖၫၥံၪအ",
			"9": "<sup>9</sup> ၥိၭလၧအဒီၪ့လဖၪအမ့ၬယၫနီၪဘီၪ.- အဂဲးဘဲၫယီၩ, ယိခွါ,လၧခးမုဖၩနီၪ ယမိဒုၭဂဲထုၪ့ၦဆၨၩဖၭဒိၪၥံၪ အဆၧအီၪကီၪ့တၭ, ယမိဒုၭဂဲၫထၫ့ဒၩ ဘၭဘလၧၫ့ တၭ,အဝ့ၫၥံၪမိတဲၩ့ဝဲၩအနၫ့ဆါလဖၪလၧဆၧဒုၭထၫ့ ဒၩအဝ့ၫဒၪ, ဒဲမိမၩန့ဝ့ၫဒၪဆ့လီၫ. အဝ့ၫၥံၪအဖျါလဖၪ အီၪဘဲၫၦအဆီၪ့လၧအမၩယုၩယါဝ့ၫတၭ, ၦဂဲၫထဲၩ့ ပျီၩပျီၩနးဂၩအ့ၬ.",
			"10": "<sup>10</sup> ခၫလဒံအၫနီၪမိကဲၪဆၧအၪ့ဂူၬန့, ကယဲၦလၧ အအၪ့ဂူၬန့ဝ့ၫနီၪအၥုၪ့မိမံၫ့အၥၭမိမံၫ့ဆ့, ယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩနၥံၪအၥုၪ့မုၬၥၭမုၬတၭ, မွဲနၥံၪၥုၪ့ထိၬ ၥၭထိၬ,ၦလၧအမၩဂၭဂီၩ့ ယဆၧန့ၥၫ အလးၥံၪဧ့, အဂဲးဘဲၫယီၩ နၥံၪဘီၪ့ထၪ့ၥိၪထၪ့ဘဲၫချီမိလၧအအၪ့ အဆၪအလးမုၬတၭ,ဂၪ့ကိၭထၪ့ဘဲၫကၥ့ၪဖၫအၥိၭး",
			"12": "<sup>12</sup> နၥံၪအမိနီၪအမ့ၬမိမဲဝ့ၫ နၭနၭလ့ၬတၭ, ၦလၧအဆီၫ့ အီၪန့နၥံၪနီၪ အမ့ၬမိမဲဝ့ၫလီၫ. ယိခွါ,ၦဆၨၩၥံၪလၧ အခဲၫ့ထုၬနီၪ,မိအီၪဘဲၫမံၩ့လၬကျၩအၥိၭ, ဒဲဂၪ့ခိၪဎဲၫ့",
			"13": "<sup>13</sup> ထၬ,ဒဲဆၧပွ့ၪခိၪအလးနီၪလီၫ.- မွဲလၧယဟိဝၩအ ဆၧၥၭထၪ့အကၠီၩ့နီၪ, ၦၡၩမိအီၪလၧအဖၧၩ့အ့ၬး မွဲ အဘၪအီၪယူဝ့ၫ ဎံၩ့ဎံၩ့လ့ၬလီၫ. ကယဲၦလၧအလ့ၩ ဖီၩ့ခွံၬဘၭဘလၧၫ့နီၪ မိထီၫမံၫထီၫမၪကိၭဂၩဒ့ၭ, ဒဲမိ",
			"14": "<sup>14</sup> ဒုၪဒွ့ၪဆၧလၧအဆၧၡၪ့ဆၧနၭအကၠီၩ့လီၫ.- တဲၩ့ဝဲၩ နၥံၪအနၫ့ဆါၥံၪ လၧဆၧဒုၭထၫ့ဒၩဘၭဘလၧၫ့ဝၬဝၬ နီၪဘီၪ.ကယဲၦလၧအခၭချံၪ နၥံၪဝ့ၫဧ့, ခၭအဝ့ၫဒၪ ဘီၪးထီးလီၫ့ကီၩ့ဖျါၥံၪလဂ့ၩ, အဂဲးဘဲၫယီၩမွဲအမၪ",
			"15": "<sup>15</sup> ဘၪယဟိဝၩနီၪလီၫ.- ကိၭၡၭထၫ့ဒၩအဝ့ၫအီၪဖီၩ့ဝၬ ဝၬတၭ,မွဲအဖ့ၪလၫ့ယူၭအစူၪယူၭတၭ, အခၪ့ထံၭလ ဖၪဂၭဂီၩ့ယူၭ, အခိၪဒၧၩ့ၥံၪလၩ့ဎီးခွံၬတၭ, မွဲလၧယ ဟိဝၩစ့ၩရၫ့ဖ့ၪဆၧၫ့ဝ့ၫအကၠီၩ့နီၪလီၫ. မၩဆၧၫ့အဝ့ၫ အဆၧအၧၩ့ဆံၭ. ဘဲၫအဝ့ၫဒၪမၩဝ့ၫအၥိၭနီၪ မၩအ",
			"16": "<sup>16</sup> ဝ့ၫဘဲၫနီၪအၥိၭဆံၭ.- ဒၪ့ထ့ၬခွံၬ ၦဎွံၪဆၧချံၫနီၪလၧ ဘၭဘလၧၫ့,ဒဲၦလၧအဖီၪ့ထၭဂ့ၬ လၧကူၭဆၧအထီ နီၪဘီၪ. အဂဲးဘဲၫယီၩလၧအၥၭမဲၪနၭအၪ့မၧၫ့ဎီးဆၧ နီၪအကၠီၩ့တၭ, မွဲအကၠၪထဲၩ့ လၧအဆၨၩဒၪဝ့ၫကိၭ ဂၩဒ့ၭဆုၬဆုၬတၭ, မွဲအမိစဲၪ့ဖျိၭလၧအထံၫအခးဒၪ ဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"17": "<sup>17</sup> အံၫစရ့လၭမွဲၥိၪအီၪပြံၩပၩဝ့ၫ, ဆၬလၥၧၫ့ၥံၪနၫ့ ထၪ့ခွံၬဝ့ၫ, လၧအခၪ့ထံၭအစံရအၫအစဎွၩနီၪအၪ့ဂၭ ဂီၩ့အဝ့ၫတၭ, လၧအခဲၫ့ထုၬနီၪ ဘၭဘလၧၫ့ အစဎွၩ",
			"18": "<sup>18</sup> န့ၭဘူၫခၭန့ဇၫမၩခါခွံၬ အဎွံၪလဖၪနီၪလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭဆၧၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭ အယွၩနီၪ, စံၭဝ့ၫဘဲၫယီၩး ယိခွါ, ယမိစ့ၩရၫ့ဘၭဘ လၧၫ့အစဎွၩ ဒဲအထံၫအခးနီၪ, ဘဲၫယစ့ၩရၫ့အစံရ",
			"19": "<sup>19</sup> အၫအစဎွၩအၥိၭနီၪလီၫ.- တၭယမိဒုၭဂဲၫထဲၩ့ဒီၭအံၫ စရ့လၭထီၩ့လၧအအီၪဝ့ၫအလးတၭ, မွဲအမိဘုၪလၩ့ အၥၭလၧကၫမလၭဒဲဘၫၡၫ့, ဒဲလၧခိၪလီၩ့အံဖြံၫ့ ဒဲဂံ",
			"20": "<sup>20</sup> လအၭတၭ,အၥုၪ့မိမံၫ့အၥၭမိမံၫ့ဝ့ၫဒၪဆ့လီၫ.- လၧ မုနံၩလဖၪနီၪ, ဒဲလၧအဆၧၫ့အထီနီၪ, ယဟိဝၩစံၭဝ့ၫ, ဆၧမိအၪ့ဎၬအံၫစရ့လၭ အဆၧအၧၩ့နီၪတၭ, ဒၪဘၪ ဝ့ၫအ့ၬးဒဲယုဒၫအဆၧဒဲၩဘၭၥံၪတၭ,ဒၪဘၪဝ့ၫဆ့အ့ၬ. အဂဲးဘဲၫယီၩၦလၧယဒုၭအီၪလၩ့ထးလဖၪနီၪ, ယမိ မၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪလီၫ.",
			"21": "<sup>21</sup> လ့ၩထၫ့ဒုၪဒၩခးမ့ၫရၥ့အံၫ့နီၪဘီၪ, ထၫ့ဒၩအဝ့ၫ,ဒဲ ထၫ့ဒၩၦပံကီၭဖိၪၥံၪဘီၪ. မၩယူဝ့ၫဒဲမၩဂၭဂီၩ့ထီးအ လူၬလၧအဝ့ၫၥံၪအလးခဲၫ့ဆံၭး ယဟိဝၩစံၭဝ့ၫဒၪ,ဒဲ",
			"22": "<sup>22</sup> မၩဘဲၫယမၪလူၬနၧၩအၥိၭထီးအလူၬဆံၭ.- ဆၧဒုၭ ၥုၭအၥီၫအီၪလၧခးဖၧၩ့, ဒဲဆၧဂၭဂီၩ့ဖၭဒိၪဆ့လီၫ.",
			"23": "<sup>23</sup> ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫအစၭခုၪနီၪ ဘၪဆၧခါထူၬခွံၬယူၭ ကၨၬလၧၦဆၨၩၥံၪအကျၩနီၪ ဘၭဘလၧၫ့ကဲၪထၪ့",
			"24": "<sup>24</sup> ဆၧအီၪယူဝ့ၫအလးဆံၭဒိၪလဲၪး- ယအီၪက့ၪဖျံၩခွၩ့ လၧနဂးတၭ, ဆၧဖီၪ့ထၬနၧၩ, ဘၭဘလၧၫ့ဧ့,တၭနလ ၥ့ၪယၫဘၪနဝ့ၫတၭ, ဆၧဒၪဘၪနၧၩတၭ, ဖီၪ့ထၬနၧၩ ဆ့း အဂဲးဘဲၫယီၩ နထိၪဂဲၩနၥၭထၫ့ဒၩ ယဟိဝၩနီၪ",
			"25": "<sup>25</sup> လီၫ.- ယဟိဝၩဝဲထၪ့ဆၧအီၪက့ၪကီၪ့အစူၪဝဲၩၥံၪအ လးတၭ,မွဲအဂဲၫဆိၬထၪ့အၥၭခိထၪ့အစူၪဝဲၩလဖၪး အဂဲးဘဲၫယီၩဆၧမၩယီၩ မွဲယဟိဝၩဆၧၥုၭမုခမျၧး",
			"26": "<sup>26</sup> အယွၩအဆၧမၩလၧခၫလဒံအၫအခးဖၧၩ့လီၫ.- လၧ အနဲၩ့ထံၭထုၬလဖၪနီၪ ဂဲၫထၪ့ထၫ့ဒၩအဝ့ၫဘီၪးဝဲထၪ့ အဆၧအီၪက့ၪကီၪ့ အလးလဖၪတၭး မၩထၪ့ဝ့ၫဘဲၫ ဆၧအပိၩ့လဖၪအၥိၭး ဒဲမၩဂၭဂီၩ့ဝ့ၫထီးအလူၬတၭး",
			"27": "<sup>27</sup> ထီးဒုၭအီၪလၩ့ထးအဆၧနးမံၩ့လဂ့ၩ.- မၩၥံၫအချီ ဖၫၥံၪထီးအလူၬဘီၪး ဒုၭလ့ၩလၩ့အဝ့ၫၥံၪလၧဆၧမၩ ၥံၫအလးနီၪဘီၪး အဝ့ၫၥံၪဘၪဆၧၡၪ့လီၫၬ အဂဲးဘဲၫ ယီၩအမုနံၩနီၪဘၪယူၭဝ့ၫယူၭး အဆၧၫ့အထီလၧအ",
			"28": "<sup>28</sup> မိဘၪဆၧစ့ၩရၫ့နီၪလီၫ.- ၦလၧအစဲၪ့ဖျိၭ ဖီၩ့ဖျ့ၭလၧ ဘၭဘလၧၫ့နီၪအလူၥီၫထၪ့ဝ့ၫ လၧအမိလီၩဖျီၪထၪ့ လၧဇံအိၫ့အဖၧၩ့ ယဟိဝၩပယွၩ အဆၧဖ့ၪဆၧၫ့ဆၧ အၧၩ့နီၪ ဆၧလုဂံၪ့အဆၧဖ့ၪဆၧၫ့ ဆၧအၧၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> ကိၭကီၪ့ၦလၧအခၭချံၪလဖၪ ထၫ့ဒၩဘၭဘလၧၫ့နီၪ ဘီၪးကယဲၦလၧအခၭချံၪ, နၥံၪဝ့ၫဧ့,အီၪဖီၩ့အဝ့ၫဝၬ ဝၬနီၪတၭး အၡၩလၧအမိစဲၪ့ဖျိၭနီၪ ထီးဒုၭဖီၩ့ဖျ့ၭနး ဂၩလဂ့ၩ,ဧီၪ. ဖ့ၪဆၧၫ့အဆၧဘဲၫအမၩဒၪဝ့ၫအၥိၭ နီၪဘီၪးဘဲၫအဝ့ၫဒၪမၩဝ့ၫထီးအလူၬအၥိၭနီၪ မၩအ ဝ့ၫဘဲၫနီၪၥိၭဆံၭ. အဂဲးဘဲၫယီၩမွဲအအီၪက့ၪထၪ့ထီၫ အၥၭထၫ့ဒၩယဟိဝၩ, ထၫ့ဒၩ အံၫစရ့လၭ အၡၩ",
			"30": "<sup>30</sup> ဆံၫ့ဎံၪလဂၩနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အၡၩ ဖိၪၥၪခွၫၥံၪမိလၩ့ထံၩဖါဝ့ၫလၧဖၧၩ့ၥၭၥံၪအဖၧၩ့တၭ, အၡၩၥုၭမုခမျၧးလဖၪ ထီးအလူၬမိဘၪဆၧဒၪ့ထ့ၬခွံၬ",
			"31": "<sup>31</sup> ဝ့ၫလၧမုနံၩနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- ယိခွါ,ယဟိဝၩ ဆၧၥုၭမုခမျၧးအယွၩစံၭဝ့ၫဒၪ, ယထၫ့ဒုၪဒၩနၧၩ, ၦလၧအၥၭထၪ့ထီၫထုၬလဂၩဧ့, အဂဲးဘဲၫယီၩနမုနံၩ နီၪဘၪယူၭဝ့ၫယူၭ, အဆၧၫ့အထီလၧယမိစ့ၩရၫ့နၧၩ",
			"32": "<sup>32</sup> လီၫ- တၭၦအၥၭထၪ့ထီၫထုၬနီၪအခၪ့မိဘၪထံၭဒဲမိ လၩ့ထံၩဖါဝ့ၫတၭ, ၦလၧအမိဘိၭဂဲထုၪ့ဝ့ၫအီၪနးဂၩ အ့ၬးတၭယမိဒုၭခဲၩထၪ့မ့ၪလၧအဒိၩ့လဖၪအဖၧၩ့နီၪ မိအၪ့ခွံၬဆၧအီၪဖီၩ့ဝ့ၫဝၬဝၬ ထီးအလူၬလီၫ.",
			"33": "<sup>33</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဘဲၫယီၩး ၦအံၫစ ရ့လၭဖိၪဒဲၦယုဒၫဖိၪလဖၪ ဘၪဆၧအၪ့မၧၫ့ဎီးစီၪ့ဎး လီၫ.ဒဲကယဲၦလၧအဖီၪ့ဆီၪ့ဝ့ၫနီၪ, ခိၭထၬအဝ့ၫၥံၪ",
			"34": "<sup>34</sup> တၭဖျါခွံၬနီၪအၥၭအီၪနးဆံၭအ့ၬ.- ဆၧလၧအဎွ့ၩန့ ထဲၩ့အဝ့ၫၥံၪနီၪမွဲဆီၪ့လ့ၬတၭ, အမံၩ့မွဲဆၧၥုၭမုခမျၧး အယဟိဝၩလီၫ. အဝ့ၫဒၪမိချဲၩ့န့တၡါအဝ့ၫၥံၪအခွး နီၪ,ဘဲၫၥိၭအမိဒုၭအီၪပွံၭ ထံၫၥံၪခးၥံၪနီၪ, ဒဲမၩခိမၩ",
			"35": "<sup>35</sup> ဝီၩၦဘၭဘလၧၫ့ဖိၪလဖၪနီၪလီၫ.- နၭလၩ့ဘၪၦခၫလ ဒံအၫဖိၪလဖၪ,ယဟိဝၩစံၭဝ့ၫဒၪ, ဒဲၦဘၭဘလၧၫ့ဖိၪ လဖၪဆ့,ဒဲဘၪအၦဒိၪဖၭဒိၪလဖၪ,ဒဲဘၪအၡၩကိၪ့ၥ့ၪ",
			"36": "<sup>36</sup> လဖၪနီၪဆ့လီၫ.- နၭလၩ့ဘၪၦချဲၩ့ဘျံၭချဲၩ့ဘျၪလဖၪ တၭ,အဝ့ၫၥံၪကဲၪၦဂီၩ့ဖိၪလီၫ. နၭလၩ့ဘၪအၡၩဆီၪ့",
			"37": "<sup>37</sup> ၥံၪတၭ,အဝ့ၫၥံၪၥၭမဲၪထၪ့ဝ့ၫး- နၭလၩ့ဘၪအကၥ့ၪ လဖၪ,ဒဲအလဲၪ့ၥုၭၥံၪ, ဒဲလၧၦကျီၪမွံၩၥံၪအီၪလၧအ ၥၭကျၩနီၪတၭး အဝ့ၫၥံၪမိကဲၪ ဘဲၫၦမုၪအၥိၭး နၭ လၩ့ဘၪအဝ့ၫၥံၪ အဎၧၩ့အဎီတၭ, ဆၧမိအၪ့ဂူၬန့ဝ့ၫ",
			"38": "<sup>38</sup> ဒၪလီၫ.- အထံၫလဖၪမိလၩ့ၥံၭခွံၬဝ့ၫတၭ, မိဎဲၫ့ထၬဝ့ၫ ဒၪလီၫ. အဂဲးဘဲၫယီၩမွဲဆၧဂၩ့စိၭဖျၩအၥၭအခးနီၪ, အဝ့ၫၥံၪဖျႃထၪ့ဝ့ၫ လၧအဆၧဂၩ့ ဆၧဖၪ့ၥံၪအကၠီၩ့",
			"39": "<sup>39</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ဆၧဖိၪဆၧဎါမံၩ့ၥံၪအီၪ လၧပွ့ၪခိၪနီၪ, ဒဲဆၧဖိၪဆၧဎါမံၩ့ အီၪလၧကျိၩ့ၥံၪအ ဖၧၩ့နီၪမိအီၪဝ့ၫထီးနီၪ, ထိၪကလအူၭ မိအီၪလၧအ ဖၧၩ့တၭ,အဆိၩဆိၩအကၠၪကၠၪနီၪ ၦၡၩမိအီၪဝ့ၫထီး နီၪနးဂၩအ့ၬ. တၭလဆိၩဘၪလဆိၩနီၪ ၦၡၩမိအီၪဂုး ခၧၫ့ဝ့ၫထီးနီၪအ့ၬ.",
			"40": "<sup>40</sup> ဘဲၫယွၩမၩဂၭဂီၩ့စီဒၧၫ့ဒဲဂမိရၫအၥိၭနီၪ, ဒဲဒိၩ့လၧ အနဲၩ့ထံၭလဖၪနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, ဘဲၫနီၪၥိၭ ၦၡၩအီၪဂုးခၧၫ့ ထီးနီၪနးဂၩအ့ၬ, ၦၡၩအဖိၪခွၫနီၪ အီၪဂုးခၧၫ့လၧအဖၧၩ့နးဂၩအ့ၬ.",
			"41": "<sup>41</sup> ယိခွါ,ၦဆၨၩလၧမုဖၩလခီၫနီၪမိဂဲၫတၭ, ဒဲအဆၨၩ ဖၭဒိၪနီၪ,ဒဲလၧခးအနဲၩ့ထံၭလဖၪနီၪ စဎွၩၥံၪအၪဂၩ",
			"42": "<sup>42</sup> မိဂဲထုၪ့ဝ့ၫဒၪလီၫ.- အဝ့ၫၥံၪမိဖီၪ့ချံၪဒဲဖၩ့နီၪး အၥၭ အၧၩ့တၭ,ဒုၭနဲၪဆၧယၫ့ၥၭအ့ၬး အဝ့ၫၥံၪအလူမိၥီၫ ထၪ့ဘဲၫမၫဆမံၭအၥိၭ, ဒဲမိထူၬထၪ့ကၥ့ၪလဖၪနီၪ, အီၪတဲၩ့ဝဲၩအၥၭလၧဒုၭၥုၭအဂး, ဘဲၫၦၡၩဒုၭၥုၭဝ့ၫ",
			"43": "<sup>43</sup> အၥိၭနီၪ,ထၫ့ဒုၪဒၩနၧၩ,ဘၭဘလၧၫ့အဖိၪမုၪဧ့,- ဘၭ ဘလၧၫ့အစဎွၩနီၪနါဂၧၫ့အဝ့ၫၥံၪအပရၧၫ့တၭ, အစူၪ ၥံၪလၩ့ဆါထဲၩ့ဝ့ၫဒၪး ဆၧဂၪ့အုၩ့ဂၪ့ထိၬဖီၪ့ထၬဝ့ၫ, ဒဲအဂူၭဆၫဝ့ၫ ဘဲၫၦမုၪဆီၫ့အီၪန့အဖိၪအၥိၭနီၪလီၫ.",
			"44": "<sup>44</sup> ယိခွါ,အဝ့ၫဒၪမိဂဲၫထၪ့, မွဲဘဲၫဆၬလၥၧၫ့လၧယီၫဒၫ့ လုၬဘံၭဆၧအၥိၭနီၪ, ထီးလၧၦအဆီၪ့အီၪဝ့ၫအလး နီၪလီၫ. အ့ၪမွဲမိမၩၡုၭ အဝ့ၫၥံၪလၧအမိစဲၪ့ဒၪဝ့ၫနီၪ လီၫ.ၦလၧအဘၪဆၧရွံန့ဝ့ၫဘဲၫၥိၭ ယမိအီၪက့ၪလၧ အဖၫ့ခိၪနီၪ, မွဲၦလဂၩလဲၪ. တၭမွဲၦလၩ့ဂၬယၧၩလ ဂၩလဲၪး ၦလၧအမိဖၭနံၩဖၭၥၫ့ လၧယဂးနီၪ, မွဲၦလ ဂၩလဲၪ.ဒဲၦယိၥိၪနီၪ လၧအမိဆၧၫ့ထုၪ့လၧယမ့ၬယၫ, မွဲၦလဂၩလဲၪ.",
			"45": "<sup>45</sup> အခိးမွဲယဟိဝၩအဆၧဒုၭကိၪ့ လၧအကၩ့ကၩထၫ့ ဒၩဘၭဘလၧၫ့အဂဲးနီၪ, ခိၭနၪနၥံၪဝ့ၫဆံၭ. ဒဲအဆၧ စ့ၩရၫ့လဖၪ, လၧအစ့ၩရၫ့ဝဲၩဝ့ၫထၫ့ဒၩ ၦခၫလဒံအၫ အခးနီၪလီၫ. တၭဆၧအဆံၭထုၬလၧၥိၪဒီၪ့အကျၩနီၪ မိမီၩ့ထၪ့ခွံၬတၡါအဝ့ၫၥံၪလၧခီၫ့နီၪးမွဲမၬ, အဝ့ၫဒၪ",
			"46": "<sup>46</sup> ဒုၭအီၪယူအဝ့ၫၥံၪ အီၪဝ့ၫအလးလီၫ.- လၧဆၧမၩန့ ဘၭဘလၧၫ့နီၪအၥီၫအကၠီၩ့တၭ, ဂၪ့ခိၪဝၭဝ့ၫတၭ, အ ဆၧကိၭၡၭထၪ့နီၪ ဂၧၫ့ထၪ့ဝ့ၫ လၧၦဆၨၩၥံၪအကျၩ လီၫ."
		},
		"51": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ယိခွါ,ယမိဒုၭဂဲၫထၪ့လံၩ မၩဂၭဂီၩ့ဆၧနီၪထၫ့ဒၩဘၭဘလၧၫ့, ဒဲထၫ့ဒၩၦလဖၪ",
			"2": "<sup>2</sup> လၧအအီၪလၧအကျၩ ၦထၫ့ဒၩယၧၩနီၪး- တၭယမိ အၪ့မၧၫ့ၦဎၬဆၧလဖၪ လ့ၩလၧဘၭဘလၧၫ့တၭ, အ ဝ့ၫၥံၪမိဎၬဝ့ၫတၭ, မိမၩအီၪပျီၩအခးနီၪ အဂဲးဘဲၫ ယီၩလၧဆၧၡၪ့ဆၧနၭအမုနံၩနီၪ, ၦအီၪဝၬဖီၩ့ဝ့ၫလ",
			"3": "<sup>3</sup> ဖၪမိထၫ့ဒၩဝ့ၫလီၫ.- မွဲၦခၭဆၧလဖၪဖဲၪ့ထၪ့အချံၪတၭ, ထၫ့ဒၩၦလၧအဆိၬထၪ့အနၫ့ဆါဒၪဝ့ၫ လၧအဆဲၫ့ထၭ အဖၧၩ့နီၪတၭ, ထီးလီၫ့ကီၩ့အၡၩဖိၪၥၪခွၫလဖၪလ ဂ့ၩ,အၥုၭမုခမျၧးနီၪမၩဂၭဂီၩ့ခွံၬ ထီးအလူၬဆံၭ.",
			"4": "<sup>4</sup> တၭၦဘၪဆၧမၩၥံၫဝ့ၫလဖၪ လၩ့ထံၩဖါလၧၦခၫလဒံ အၫအခးဖၧၩ့နီၪ, ဒဲၦလၧအဘၪဆ့ၭဖျီၫ့ဝ့ၫ လၧအဖၧၩ့",
			"5": "<sup>5</sup> ၥၭၥံၪအဖၧၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩ လၧယွၩမွဲဂ့ၩ, လၧဆၧၥုၭမုအယဟိဝၩမွဲဂ့ၩနီၪ အံၫစရ့လၭဘၪဆၧ ခွံၬၡိၭဝ့ၫမွဲအ့ၬး ယုဒၫနီၪမွဲဆ့အ့ၬ, မွဲလါနၫ့ဘိၩအဝ့ၫ ၥံၪအခးလၧၫ့ဎွ့ၩလၧဆၧဒဲၩဘၭ, ထၫ့ဒၩအံၫစရ့လၭ",
			"6": "<sup>6</sup> အၡၩဆံၫ့ဎံၪလဂၩနီၪလီၫ.- စဲၪ့ထၪ့ခွံၬလၧဘၭဘ လၧၫ့အဖၧၩ့နီၪတၭ, မွဲၦၡၩမၩဖီၩ့ဖျ့ၭ အၥၭမၧၫ့ကိၭ ဂၩဒ့ၭဆုၬဆုၬဘီၪ. ထီးဘၪဆၧဒၪ့ထ့ၬခွံၬ လၧအဝ့ၫ ဒၪအဆၧအၧၩ့ဖၧၩ့နီၪလဂ့ၩး အဂဲးဘဲၫယီၩ အဆၧၫ့ အထီယီၩဘၪလၧယဟိဝၩ ဖ့ၪဆၧၫ့အဆၧအၧၩ့အထီး",
			"7": "<sup>7</sup> အဝ့ၫဒၪမိဖ့ၪထဲၩ့ဆၧလၧအကြၨၭန့ဘၪနီၪလီၫ.- ဘၭ ဘလၧၫ့မွဲလိၫ့ထီၫ့ လၧယဟိဝၩအစူၪဖၧၩ့နီၪ, လၧအ ဒုၭအီၩမၧၩ့ၦဂၪ့ခိၪဖိၪၥံၪထီးအလူၬလီၫ. အဝ့ၫဒၪအ စဘံၭထံၫနီၪၦဆၨၩလဖၪအီၩမၧၩ့ဝ့ၫ, အခိးမွဲၦဆၨၩ",
			"8": "<sup>8</sup> ၥံၪဖျႃထၪ့ဝ့ၫဒၪလီၫ.- ဘၭဘလၧၫ့လၩ့ထ့ၬၡုၭဝ့ၫတၭ ဂၭဂီၩ့ဝ့ၫဒၪလီၫ. အိၩ့ယိၩ့လၧအကၠီၩ့ဘီၪး မၩန့ၥံၪ့ စရံအထူၭ လၧအဆၧဆၫအဂးနီၪ, ဘၪလဘၪမိဘျၪ",
			"9": "<sup>9</sup> ထဲၩ့ဝ့ၫလီၫ.- ပဘၠၩ့ဘၭဘလၧၫ့အဆၧဆၫလါနၫ့တၭ, မွဲအဘျၪထဲၩ့ဝ့ၫအ့ၬး စဲၪ့ဒၪခွံၬအဝ့ၫဒၪတၭး မွဲပလ့ၩ ထီၩ့လဂၩဘၪလဂၩ လၧအခးဒၪဝ့ၫဆုၬဆုၬဘီၪ. အ ဂဲးဘဲၫယီၩအဝ့ၫဒၪအဆၧစ့ၩရၫ့နီၪ ထၪ့ဘၭယူၭလၧ မူၭခိၪတၭ, မွဲအဘၪဆၧဆိၬထၪ့ဝ့ၫ လၧဆၧဖိၭဖၫ့နီၪ",
			"10": "<sup>10</sup> လီၫ.- ယဟိဝၩဒုၭဂဲၫထၪ့ၦဆၧတီၩဆၧလီၩ့တၭး ဂဲၫ ဘီၪ, လၧဇံအိၫ့အဖၧၩ့နီၪ ပမိလီၩဖျီၪထၪ့ယဟိဝၩပ ယွၩအဆၧမၩလီၫ.",
			"11": "<sup>11</sup> ကျဲၩ့ထၪ့ဖျါၥံၪဘီၪ အၪ့ထုၫ့ကီၪ့ထၩ့ဖံၭၥံၪဘီၪး ယ ဟိဝၩထိၪဂဲၩၦမံဒၠၫ့ဖိၪၥံၪအစဎွၩလဖၪအၥၭတၭး မွဲ အကၩ့ကၩထၫ့ဒၩ ဘၭဘလၧၫ့ လၧအမိမၩဂၭဂီၩ့ခွံၬ ဝ့ၫဒၪး အဂဲးဘဲၫယီၩ မွဲယဟိဝၩဖ့ၪဆၧၫ့အဆၧအၧၩ့ တၭ,မွဲအဆၧလုဂံၪ့အဆၧဖ့ၪဆၧၫ့ အဆၧအၧၩ့နီၪ",
			"12": "<sup>12</sup> လီၫ.- အီၪက့ၪထၪ့ဆၧအလၫ့နီၪလၧဘၭဘလၧၫ့အခိၪ ဒၧၩ့ၥံၪအလီၩ့, မၩဆီၪ့ထၪ့ၦခိၭဆၧလဒီၪ့, အီၪက့ၪၦ ခိၭဆၧအလး, တဲၩ့ဝဲၩၦခိၭၥူၪဆၧလဖၪနီၪဘီၪ. အဂဲး ဘဲၫယီၩ ယဟိဝၩကၩ့ကၩမၩဂီၩ့ဆၧလၧ အချဲၩ့ဝဲၩ",
			"13": "<sup>13</sup> ထၫ့ဒၩၦဘၭဘလၧၫ့ဖိၪလဖၪနီၪလီၫ.- နဝ့ၫဒၪလၧနအီၪ လၧထံၫအၪအနဲၩ့ထံၭနီၪ, လၧနဎၧၩ့နဎီအၪအၪလ့ၬ လဂၩဧ့, နထုၬဘၪယူၭ, နၥၭကွံၩဆၧအဆၧတိၪ့နီၪ",
			"14": "<sup>14</sup> လၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭလီၫ.- ဆၧၥုၭမုခမျၧးအယဟိဝၩ နီၪဆိၪလၩ့အၥၭလၧအနၫ့ဆါဒၪဝ့ၫတၭ, စံၭဝ့ၫ,မွဲမၬ, ယမိမၩဎွ့ၩထၪ့နၧၩလၧၦၡၩၥံၪ, ဘဲၫၥံၭၥံၪအၥိၭတၭး အဝ့ၫၥံၪမိကိၭၡၭထၪ့ထၫ့ဒၩနၧၩလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪမၩ ကဲၪထၪ့ဂၪ့ခိၪလၧအစီၩ့အမၩ့နီၪ အဝ့ၫဒၪမၩဂုးခၧၫ့ ဝ့ၫလၧအဆၧကိၪ့ၥ့ၪကိၪ့ဘၪတၭ, လၧအၥၭကိၪ့ၥ့ၪအကၠီၩ့နီၪ, မွဲအဒုၭပၠၪလၩ့ မူၭခိၪ",
			"16": "<sup>16</sup> နီၪလီၫ.- ထီးအလူၥီၫထၪ့နီၪ ထံၫလၧမူၭခိၪဖၧၩ့ အီၪဝ့ၫအၪအၪလ့ၬတၭး မွဲအဒုၭအွံၩထၪ့ဝ့ၫ လၧဂၪ့ခိၪ အထုၬလဖၪလီၫ. မွဲအဒုၭအီၪထၪ့လၫ့ဝဲအဒံၭ လၧဆၧ ဆၧၩ့အၥိၭ, ဒဲဒုၭဂဲၫထၪ့လံၩ လၧအဆၧအီၪက့ၪကီၪ့",
			"17": "<sup>17</sup> အလးနီၪလီၫ.- လၧဆၧၥ့ၪယၫနီၪ ၦၡၩကိၭဂၩဒ့ၭ မၩအၥၭဘဲၫဆၧဖိၪဆၧဎါ အၥိၭတၭး ကယဲၦလၧ အစိၭဖျၩဆၧဂၩ့ၥံၪနီၪ, မွဲအဘၪဆၧမ့ၬမဲကိၭဂၩ ဒ့ၭလီၫ.အဆၧဂၩ့ၥိၫ့နီၪ မွဲဆၧအဘျံၭအဘျၪတၭ,",
			"18": "<sup>18</sup> အၥၪၡိၪအီၪလၧအဖၧၩ့နးဆံၭအ့ၬ.- မွဲဆၧပျီၩပျီၩတၭ, ၦမၩမၪဆၧအဆၧမၩလီၫ. အဝ့ၫၥံၪအဆၧစ့ၩရၫ့အ",
			"19": "<sup>19</sup> ဆၧၫ့အထီအ့ၪဘၪတၭ, မိဂၭဂီၩ့ဝ့ၫဒၪလီၫ.- စယၫ ကူၭအဂးနီၪ လၩ့ဂၬအဝ့ၫၥံၪမွဲအ့ၬး မွဲအဒုၭအီၪထၪ့ ဆၧထီးအလူၬအဂဲးလီၫ. တၭအံၫစရ့လၭမွဲ အဆၧ န့ၥၫအနိၪဘီၩ့လီၫ. အမံၩ့မွဲဆၧၥုၭမုခမျၧးအယဟိဝၩလီၫ.",
			"20": "<sup>20</sup> နဝ့ၫဒၪနမွဲယဒုၭၥုၭအစၭခုၪ ဒဲဒုၭဆၧအစူၪဝဲၩလဖၪ နီၪ, အဂဲးဘဲၫယီၩလၧနကၠီၩ့နီၪ, ယမိမၩဘျ့ၭၦဆၨၩ",
			"21": "<sup>21</sup> ၥံၪ,ဒဲလၧနကၠီၩ့ယမိမၩဂၭဂီၩ့ဘၩ့မုးၥံၪနီၪး- ဒဲလၧ နကၠီၩ့ယမိမၩခါခွံၬကၥ့ၪ ဒဲၦထူၬဝ့ၫလဂၩနီၪး ဒဲလၧ",
			"22": "<sup>22</sup> နကၠီၩ့ယမိမၩခါခွံၬလဲၪ့ၥုၭဒဲၦထူၬဝ့ၫနီၪး- လၧနကၠီၩ့ ဆ့ယမိမၩလၩ့ဘျ့ၭၦၡၩခွၫဒဲၦၡၩမုၪ, လၧနကၠီၩ့ယမိ မၩလၩ့ဘျ့ၭၦၥၭၡါဒဲၦၥၭဘၪ့း ဒဲလၧနကၠီၩ့ယမိမၩ",
			"23": "<sup>23</sup> လၩ့ဘျ့ၭၦဖိၪၥၪခွၫဒဲၦမုၪနၩ့း- ဒဲလၧနကၠီၩ့ဆ့, ယမိ မၩလၩ့ဘျ့ၭၦယိၥိၪဒဲအၥိၪလဒီၪ့း ဒဲလၧနကၠီၩ့ယမိ မၩလၩ့ဘျ့ၭၦမၩကၩလၧဂၪ့ခိၪ ဒဲအချီဖၫလခိၪး ဒဲလၧ နကၠီၩ့ယမိမၩလၩ့ဘျ့ၭ ၦၥုၭခိၪၥံၪဒဲၦပၧၩ့ဆၧလဖၪနီၪ လီၫ.",
			"24": "<sup>24</sup> တၭယမိဖ့ၪထဲၩ့ ဘၭဘလၧၫ့, ဒဲကယဲၦခၫလဒံအၫ ဖိၪလဖၪ အဆၧအၧၩ့ထီးအလူၬ လၧအဝ့ၫၥံၪမၩယူၭ လၧဇံအိၫ့လၧနၥံၪအမ့ၬယၫနီၪ ယဟိဝၩစံၭဝ့ၫဒၪး",
			"25": "<sup>25</sup> ယိခွါ, ယထၫ့ဒၩနၧၩ, ခိၪလီၩ့မၩဂၭဂီၩ့ဆၧဧ့, ယဟိ ဝၩစံၭဝ့ၫဒၪ, နဝ့ၫဒၪနမၩဂၭဂီၩ့ဂၪ့ခိၪ ထီးအလူၬတၭး ယမိယၩ့ထၪ့ယစူၪလၧနလီၩ့နီၪ, ဒဲချံးလၩ့ခွံၬနၧၩလၧ လိးၥံၪလဲၫ့ၥံၪနီၪ, ဒဲမၩနၧၩလၧခိၪလီၩ့ဆူၭခဲၩယူၭနီၪ",
			"26": "<sup>26</sup> လီၫ.- တၭလိးလဖၪလၧဆၧအနိၪ့အဂးမွဲဂ့ၩ, လၧအ ခၪ့ထံၭအဂးမွဲဂ့ၩ, ၦၡၩမၩန့လၧနၧၩအ့ၬး အ့ၪမွဲနဘၪ",
			"27": "<sup>27</sup> အီၪယူဝ့ၫအဆိၩအကၠၪနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.- အီၪ က့ၪထၪ့ဆၧအလၫ့လမံၩ့ လၧခးဖၧၩ့နီၪ, အူၪထၪ့ခွ့ၩ လၧၦဆၨၩၥံၪအကျၩ, တဲၩ့ဝဲၩၦဆၨၩၥံၪထၫ့ဒၩအဝ့ၫ ဒၪဘီၪးအၫရရၭ, မံနဲၫ, ဒဲအၭၡခံၫနၭအဘၩ့အမုးၥံၪ, ကိၭကီၪ့ထၫ့ဒၩအဝ့ၫဒၪတၭ, အီၪက့ၪထၪ့အခိၪထၫ့ဒၩ ဝ့ၫလဂၩး ဒုၭဂဲၫထၪ့ကၥ့ၪလဖၪဘဲၫၥံၭမုဆီၪ့ၡုၪဝ့ၫအ ၥိၭနီၪဘီၪ.",
			"28": "<sup>28</sup> တဲၩ့ဝဲၩၦဆၨၩၥံၪထၫ့ဒၩဝ့ၫ, ဒဲၦမံဒၠၫ့ဖိၪၥံၪအစဎွၩ လဖၪ,အဝ့ၫၥံၪအၥုၭခိၪလဖၪ, ဒဲအၡၩပၧၩ့ဆၧထီးအ လူၬၥံၪ,ဒဲအဘၩ့အမုးထံၫၥံၪခးၥံၪ ထီးအလူၬဘီၪး",
			"29": "<sup>29</sup> တၭခးနီၪမိဝၭထိၬဝၭတ့ၭဒဲၥုၪ့အုၭၥၭအုၭတၭး အဂဲး ဘဲၫယီၩယဟိဝၩအဆၧစ့ၩရၫ့ ထၫ့ဒၩဘၭဘလၧၫ့နီၪ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ ကိၭအမံၩ့ဒ့ၭဆ့လီၫ. မွဲအမိမၩ ဘၭဘလၧၫ့အခးဆၧအီၪယူဝ့ၫအလး, လၧၦၡၩအီၪနး",
			"30": "<sup>30</sup> ဂၩအ့ၬ.- ဘၭဘလၧၫ့နီၪအၡၩဆီၪ့လဖၪ မိဒုၭၥုၭအ ၥၭအီၪအ့ၬ, အဝ့ၫၥံၪအီၪဝ့ၫလၧအထိၬဖၧၩ့တၭ,အဂဲး အဘၭလၩ့ဆါထဲၩ့နီၪ, မွဲအမၩအၥၭ ဘဲၫၦမုၪၥံၪအ ၥိၭနီၪတၭ, ဆူၭခဲၩခွံၬအဂံၪ့ၥံၪအဎၫ့ၥံၪတၭ, အနိၪဘီၩ့ လဖၪဘၪဆၧမၩခါခွံၬဝ့ၫဒၪလီၫ.",
			"31": "<sup>31</sup> ၦၥိၫ့လံၬလဂၩစဲၪ့တလဲးလ့ၩဆီးစိၩ အဂူၫဂၩလဂၩ, ဒဲအၥီၫ့လဂၩ လ့ၩဆီးစိၩအဂူၫဂၩလဂၩဘဲၫၥိၭအမိ ဒုၭနဲၪဘၭဘလၧၫ့အစဎွၩ လၧဆၧမၩန့အဒိၩ့လၧအ",
			"32": "<sup>32</sup> နဲၩ့ထံၭနီၪတၭး- ဆၧမၩထၬယူၭဖၧၩ့ၥၭၥံၪတၭ, ဖီး ဘီၩ့ၥံၪနီၪအဝ့ၫၥံၪဆူၭခဲၩထၪ့ခွံၬယူၭလၧမ့ၪ, ဒဲၦၡၩ ဒုၭၥုၭလဖၪဘၪဆၧၥၭမဲၪဝ့ၫဒၪလီၫ.",
			"33": "<sup>33</sup> အဂဲးဘဲၫယီၩဆၧၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့ လၭအယွၩနီၪစံၭဝ့ၫဘဲၫယီၩး ဘၭဘလၧၫ့အဖိၪမုၪနီၪ မၩအၥၭဘဲၫခရဲးဖၧၩ့အၥိၭ, အဆၧၫ့အထီလၧအပျၧၩ့ ဝ့ၫနီၪဘၪယူၭဝ့ၫယူၭး မွဲလါနၫ့တၭ,မီခိၬနီၪကူၭဆၧ အဆၧၫ့အထီမိဘၪဝ့ၫလီၫ.",
			"34": "<sup>34</sup> ဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ အၪ့ဂီၩ့ခွံၬယၧၩ တၭ,မွဲအမၩလၩ့ဘျ့ၭခွံၬယၧၩတၭ, မၩယၧၩဘဲၫဖၧၩ့ အီၪခီၫအၥိၭအၪ့ယုလၩ့ယၧၩ ဘဲၫၡီၩ့အၥိၭတၭ, မၩ ဎွ့ၩအဂူၭဖိၫ့လၧယဆၧအၪ့အွံၪလဖၪတၭ, နၫ့ထၪ့ခွံၬ",
			"35": "<sup>35</sup> ယၧၩလီၫ.- ၦဇံအိၫ့ဖိၪၥံၪမိစံၭ, ၦမၩဆီၪ့ယၧၩဒဲယ ယၪနီၪ,မွဲအဘၪလၧဘၭဘလၧၫ့အလီၩ့ဘီၪး ဒဲယရု စလံၫ့မိစံၭ, ယၥွံၪနီၪ,မွဲအဘၪလၧၦခၫလဒံအၫဖိၪၥံၪ အလီၩ့ဘီၪ.",
			"36": "<sup>36</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဘဲၫယီၩး ယိခွါ,ယမိချဲၩ့နခွး, ဒဲမၩဆၧၫ့ဆၧအၧၩ့လၧနဂး နီၪးဒဲယမိမၩလၩ့ၥံၭခွံၬအထံၫၥံၪ ဒဲမၩဎဲၫ့ထၪ့အထံၫ",
			"37": "<sup>37</sup> ထၪ့ဖျိၭလဖၪနီၪလီၫ.- တၭဘၭဘလၧၫ့မိကဲၪထၪ့ဆၧ အပိၩ့လဖၪ, ထွံၪဂၪ့ခိၪအီၪဝ့ၫအလး, ဆၧထီၫမံၫထီၫ မၪဒဲဆၧဒုၪဒွ့ၪအလး, လၧၦၡၩအီၪဝ့ၫ နးဂၩအ့ၬ.",
			"38": "<sup>38</sup> အဝ့ၫၥံၪမိယုၩ့ဆၧဘဲၫ ဆၬလၥၧၫ့ၥံၪအၥိၭတၭ,မိဂၪ့",
			"39": "<sup>39</sup> ကိၭဘဲၫဆၬလၥၧၫ့ဖိၪအၥိၭနီၪလီၫ.- လၧအဝ့ၫၥံၪခိ ထၪ့အဘိၩ့ဘၭတၭ, ယမိမၩအဆၧဘိၪ့ဆၧထးၥံၪ တၭ,ယမိဒုၭအီၪမၧၩ့အဝ့ၫၥံၪ, ဘဲၫၥိၭအမိၥၭထိၬဝ့ၫ, ဒဲမံၫမၪဝ့ၫလထံၪဎးလဘီၩ့ဎးနီၪ, နၪ့ထၪ့ထဲၩ့လၧၩ့အ",
			"40": "<sup>40</sup> ၥၭအ့ၬး ယဟိဝၩစံၭဝ့ၫဒၪ.- တၭယမိဆိၬလၩ့အဝ့ၫၥံၪ ဘဲၫၥိၪဖိၪလၧၦမိမၩၥံၫဝ့ၫအဂးအၥိၭ, ဘဲၫၥိၪဖၫၥံၪ, ဒဲဘ့ၪဖၫၥံၪနီၪလီၫ.",
			"41": "<sup>41</sup> ၡံၡၭဘၪဆၧမၩန့ဝ့ၫဘဲၫၥ့ၪလဲၪၬ တၭဂၪ့ခိၪထီးအ လူၬအဆၧစံၭထၪ့အၪ့အူၭဝ့ၫနီၪ ဘၪၡုၭဝ့ၫဘဲၫၥ့ၪလဲၪၬ ဘၭဘလၧၫ့နီၪ ကဲၪထၪ့ဆၧထီၫမံၫထီၫမၪ လၧၦဆၨၩ",
			"42": "<sup>42</sup> ၥံၪအကျၩ ဘဲၫၥ့ၪလဲၪၬ မၫဆမံၭဂဲၫထၪ့ဘၪ လၧဘၭ ဘလၧၫ့အလီၩ့နီၪတၭ, အလပီၩလဖၪနီၪမၩလၩ့ဘံၭ",
			"43": "<sup>43</sup> အၡၩခမျၧးၥံၪလီၫ.- အဒိၩ့လဖၪကဲၪထၪ့ဆၧအလး အီၪယူဝ့ၫ, ဂၪ့ခိၪဎဲၫ့ထၬ, ဒဲမံၩ့လၬကျၩ, ခးလၧၦၡၩ လအီၪဘၪနးဂၩ, ဒဲၦၡၩဖိၪခွၫလ့ၩဖီၩ့နးဂၩဆ့အ့ၬး",
			"44": "<sup>44</sup> ဘၫလၭလၧဘၭဘလၧၫ့အဖၧၩ့နီၪ, ယမိစ့ၩရၫ့စၪတၭ, ဆၧလၧအယုလၩ့ဝ့ၫနီၪ ယမိဒုၭဂဲၫထၪ့ထဲၩ့ခွံၬလၧအ နိၭၦဆၨၩၥံၪမိဂဲၫယွၩကီၪ့လၧၩ့ လၧအဝ့ၫဒၪအအီၪ အ့ၬးမွဲကဒၪယူၭ,ဘၭဘလၧၫ့အခိၪဒၧၩ့နီၪ မိလၩ့ဎီး ခွံၬဝ့ၫဒၪလီၫ.",
			"45": "<sup>45</sup> ယၡၩခမျၧးၥံၪဧ့, စဲၪ့ထၪ့ခွံၬလၧအဝ့ၫဒၪအၥၭကျၩ နီၪဘီၪ, တၭမၩဖီၩ့ဖျ့ၭနၥံၪဝ့ၫ လဂၩအၥၭမၧၫ့ဒၪဝ့ၫ လဂၩအၥၭမၧၫ့ဒၪဝ့ၫဆုၬဆုၬ လၧယဟိဝၩအဆၧၥၭ",
			"46": "<sup>46</sup> ထၪ့ဆီၪ့နီၪဘီၪ.- မွဲနၥံၪအၥၭထီးလၩ့ဘဲၩလဂ့ၩး ဆၧ ဂၧၫ့ထၪ့ၥၩလၩ့လၧထံၫၥံၪခးၥံၪနီၪ, ထီးၥၭမဲၪလဂ့ၩး ဆၧဂၧၫ့ထၪ့ၥၩလၩ့လမံၩ့ မိဂဲၫထၪ့လၧလနံၪ့အဖၧၩ့ တၭ,အလးခဲၫ့နီၪနးနံၪ့ဒီၭ ဆၧဂၧၫ့ထၪ့ၥၩလၩ့ မိဂဲၫ ထၪ့ဝ့ၫလမံၩ့ဒၪတၭ, ဆၧမၩဆီၪ့လၧခးဖၧၩ့နီၪ, ၦပၧၩ့",
			"47": "<sup>47</sup> ဆၧလဂၩထၫ့ဒၩ ၦပၧၩ့ဆၧလဂၩဒၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယိခွါ,မုနံၩလဖၪနီၪမိဘၪဝ့ၫ, လၧယမိဒုၭ အီၪထၪ့ဆၧစ့ၩရၫ့ လၧဘၭဘလၧၫ့ အဆၧဂၩ့စိၭဖျၩ အၥၭလဖၪတၭး အထံၫအခးထီးအလူၬနီၪမိဘၪဆၧ မ့ၬမဲတၭ,ကယဲၦလၧအဘၪဆၧကျီၪ့ၥံၫဝ့ၫလဖၪမိလၩ့",
			"48": "<sup>48</sup> ထံၩဖါလၧအၥၭကျၩလီၫ.- ထီးနီၪလဖၧၫ့မူၭခိၪဒဲဂၪ့ ခိၪ,ဒဲကယဲဆၧအီၪလၧအဖၧၩ့ထီးအလူၬနီၪ, မိၥံၫကျံၩ ထၪ့လၧဘၭဘလၧၫ့အကၠီၩ့တၭး ၦလၧအမၩဂၭဂီၩ့ဝ့ၫ လဖၪမိဂဲၫလၧအအီၪလၧမုဖၩလခီၫနီၪ, ယဟိဝၩစံၭ",
			"49": "<sup>49</sup> ဝ့ၫဒၪ.- ၦလၧအဘၪဆၧကျီၪ့ၥံၫဝ့ၫလၧအံၫစရ့လၭအ ကျၩၥံၪဧ့,ဘၭဘလၧၫ့မိလၩ့ထံၩဖါဝ့ၫဆ့, ၦလၧအဘၪ ဆၧကျီၪ့ၥံၫဝ့ၫ လၧထံၫၥံၪခးၥံၪထၧၫ့ဘံၪ့ယၫနီၪမိလၩ့ ထံၩဖါဝ့ၫလၧဘၭဘလၧၫ့အၥိၭကိၭဂၩဒ့ၭလီၫ.",
			"50": "<sup>50</sup> ၦလၧအဖီၩ့ဖျ့ၭနၭ, နၥံၪဝ့ၫဧ့,စဲၪ့ထၪ့ခွံၬဘီၪ, ထီးအီၪဆၧၫ့ထုၪ့ဒၪဆၧနီၪလဂ့ၩ အီၪလၧအယဲၩ့ နီၪတၭ, နၪ့ထၪ့ထဲၩ့ယဟိဝၩဘီၪး မွဲယရုစလံၫ့နီၪ",
			"51": "<sup>51</sup> အီၪထၪ့လၧယၥၭခံဖၧၩ့နီၪဆံၭ.- ပနါဂၧၫ့ဆၧဒုၪဒွ့ၪ ဝ့ၫအကၠီၩ့တၭ, ပမ့ၬမဲပဝ့ၫလီၫ. ဆၧမ့ၬမဲနီၪမၩ လၩ့ဘံၭခွံၬပမ့ၬလဖၪး အဂဲးဘဲၫယီၩ ၦမွံၩလဖၪဂဲၫ ထီၩ့ယူၭ လၧယဟိဝၩအဂံၪ့အလးဆံၫ့ဎံၪၥံၪ အဖၧၩ့",
			"52": "<sup>52</sup> ယူၭလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယိခွါ,မုနံၩလဖၪနီၪ ဘၪဝ့ၫ,ယဟိဝၩစံၭ, လၧယမိဒုၭအီၪထၪ့ဆၧစ့ၩရၫ့ လၧဆၧဂၩ့စိၭဖျၩအၥၭအလီၩ့နီၪတၭ, လၧအထံၫ အခးကိၭစီၪ့ဒ့ၭနီၪ, ၦလၧအဘၪဆ့ၭဝ့ၫလဖၪနီၪ မိ",
			"53": "<sup>53</sup> ဂၪ့အုၩဝ့ၫကိၭဂၩဒ့ၭလီၫ.- ဘၭဘလၧၫ့အ့ၪထၪ့ဘၭ လၧမူၭခိၪနီၪ, ဒဲမၩဂုးထၪ့လါနၫ့အထိၬထီၫလ ဖၪတၭ,ၦမၩဂၭဂီၩ့ဆၧလဖၪမိစဲၪ့ထၪ့ လၧယ အီၪတၭမိလၩ့ဘၪအဝ့ၫဒၪ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"54": "<sup>54</sup> ဆၧဂၪ့ကိၭထၪ့အၥီၫနီၪ ဂဲၫထၪ့လၧဘၭဘလၧၫ့တၭ, ဆၧမၩဂၭဂီၩ့ဖၭဒိၪအၥီၫ လၧခးခၫလဒံအၫအဖၧၩ့နီၪ",
			"55": "<sup>55</sup> လီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩ မၩဂၭဂီၩ့ဘၭဘလၧၫ့ နီၪးဒဲဒုၭလၩ့မါပံၭအၥီၫဖၭဒိၪး ထီးအလပီၩလဖၪ ၥီၫထၪ့ဘဲၫထံၫဖၭဒိၪအၥိၭတၭ, အဝ့ၫၥံၪအလူၥီၫနီၪ",
			"56": "<sup>56</sup> ဂဲၫထၪ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩၦမၩဂၭဂီၩ့ ဆၧဂဲၫ ဘၪအဝ့ၫဒၪ,လၧဘၭဘလၧၫ့အလီၩ့ဒၪလ့ၬ, ဒဲအၡၩ ဆီၪ့ၥံၪဘၪဆၧဖီၪ့ထၬဝ့ၫ, အဝ့ၫၥံၪအချံၪလဖၪ ဘၪ ဆၧမၩခါခွံၬဝ့ၫထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩ ယဟိ ဝၩၦလၧအဖ့ၪဆၧၫ့ထဲၩ့ဆၧအယွၩနီၪ မိဖ့ၪထဲၩ့တၡါ",
			"57": "<sup>57</sup> ဆၧလီၫ.- တၭယမိဒုၭအီၩမၧၩ့အၦဒိၪဖၭဒိၪလဖၪ ဒဲအၡၩကိၪ့ၥ့ၪလဖၪ, အၥုၭခိၪၥံၪ, အၡၩပၧၩ့ဆၧလ ဖၪ,ဒဲအၡၩဆီၪ့ၥံၪတၭ, အဝ့ၫၥံၪမိမံၫမၪဝ့ၫလထံၪဎး လဘီၩ့ဎးတၭ, နၪ့ထၪ့ထဲၩ့လၧၩ့အၥၭအ့ၬးစဎွၩလၧ အမံၩ့မွဲဆၧၥုၭမုခမျၧးအယဟိဝၩနီၪ, စံၭဝ့ၫဒၪ.",
			"58": "<sup>58</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩ, ဘၭဘလၧၫ့ အခိၪဒၧၩ့ဖၭလဲၥံၪမိဘၪဆၧမၩလၩ့ဎီးခွံၬဝ့ၫဒၪ, ဒဲအ တရၫ့ထၪ့ထီၫလဖၪမိဘၪဆၧဆူၭခွံၬလၧမ့ၪ, ဒဲအၡၩ ခမျၧးၥံၪမိမၩဆၧပျီၩပျီၩလီၫ. ဒဲၦလဆၨၩနီၪလၧမ့ၪ အဂးတၭ,မၩပွံၭထၪ့အၥၭလီၫ.",
			"59": "<sup>59</sup> ဆၧအလူလၧမီၪစယ့ၫရမဲအၫမၪလူၬ စစံရအဲအၫ လၧအမွဲစနံၫရဲအၫအဖိၪခွၫ, လၧအမွဲစမ့ၫအစဲအၫအ ဖိၪခွၫ,ထီးအလ့ၩ လၧယုဒၫအစဎွၩဇ့ၭဒကဲအၫအၥိၭ နီၪ,ဖိးလၧဘၭဘလၧၫ့, လၧအပၧၩ့ဆၧလံနံၪ့လနံၪ့နီၪ လီၫ.တၭစစံၫရအဲအၫမွဲၦဒိၪဖၭဒိၪ လၧအမၩမုၬဆၧ",
			"60": "<sup>60</sup> လဂၩလီၫ.- တၭစယ့ၫရမဲအၫကွ့ၭလၧလံၬဖၧၩ့ကယဲ ဆၧအၧၩ့လၧအမိလၩ့ဘၪ ဘၭဘလၧၫ့ထီးအလူၬနီၪ, ကယဲဆၧချဲၩ့ယီၩဒၪလ့ၬ, လၧအဘၪဆၧကွ့ၭဝ့ၫထၫ့",
			"61": "<sup>61</sup> ဒၩဘၭဘလၧၫ့နီၪလီၫ.- တၭစယ့ၫရမဲအၫစံၭအစံၫရ အဲအၫနီၪ, နအ့ၪဂဲၫထီၩ့လၧဘၭဘလၧၫ့နီၪတၭ,နမိဒၪ",
			"62": "<sup>62</sup> ဘၪဒဲမိဖီဘၪဆၧချဲၩ့လဖၪယီၩထီးအလူၬး- ထီးနီၪ လဖၧၫ့,နမိဘၪစံၭ,ယဟိဝၩဧ့, နချဲၩ့ထၫ့ဒၩဆၧအလး ယီၩလၧနမိဒၪ့ထ့ၬခွံၬနီၪ, ဘဲၫၥိၭၦၡၩမွဲဂ့ၩ, ဆၧဖိၪ ဆၧဎါမွဲဂ့ၩ, ထီးအီၪလၧအဖၧၩ့နးမံၩ့လဂ့ၩး အ့ၪမွဲမိ",
			"63": "<sup>63</sup> အီၪယူဘၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.- နအ့ၪဖီဘၪ လံၬလဘံၪ့ယီၩထီးအဂီၩ့တၭ, ဆၧမိမၩအၥၭလၧ နဘၪစၧၩ့ထၬဝ့ၫလၧလိးနီၪ, ဒဲခွံၬလၩ့ဝ့ၫလၧယုၫပ့တံၫ",
			"64": "<sup>64</sup> အၥၭကျၩနီၪတၭး- နမိဘၪစံၭ, ဘဲၫနီၪၥိၭဘၭဘလၧၫ့ ဘၪလၩ့ဘၧၩ့ဝ့ၫတၭ, လၧဆၧအၧၩ့လၧယမိဒုၭဘၪ အလီၩ့နီၪ, မိဂဲထုၪ့ထဲၩ့ဝ့ၫနီၪနးဆိၭအ့ၬ. အဝ့ၫၥံၪမိ ဘၪဆၧပွံၭအၥၭလီၫ. ထီးအလးယီၩမွဲစယ့ၫရမဲအၫ အဆၧချဲၩ့လဖၪလီၫ."
		},
		"52": {
			"1": "<sup>1</sup> လၧစဇ့ၭဒကဲအၫထၪ့ၥၫ့ စဎွၩအလးနီၪ,မွဲအနံၪ့အီၪ နံၫဆံၫလနံၪ့တၭ, ပၧၩ့ဆၧလၧယရုစလံၫ့နီၪဆံၫလနံၪ့ လီၫ.အမိအမံၩ့မွဲနးဟၫမုတလၭ ၦလံဘနၫဖိၪစယ့ၫ",
			"2": "<sup>2</sup> ရမဲအၫအဖိၪမုၪနီၪလီၫ.- တၭအဝ့ၫဒၪမၩဆၧအၧၩ့လၧ ယဟိဝၩအမ့ၬၥၪဖၧၩ့နီၪ, ဘဲၫကယဲဆၧလၧစယဟီအ",
			"3": "<sup>3</sup> ကံၫ့မၩယူၭအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩလၧယဟိ ဝၩၥၭထၪ့ဆၧအကၠီၩ့နီၪ, ဆၧမၩအၥၭလၧယရုစလံၫ့ ဒဲလၧယုဒၫအဖၧၩ့နီၪ, မွဲအနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧအမ့ၬ ယၫတၭ, စဇ့ၭဒကဲအၫနီၪပိၩ့ထၪ့ထၫ့ဒၩဘၭဘလၧၫ့ အစဎွၩလီၫ.",
			"4": "<sup>4</sup> လၧအပၧၩ့ဆၧခွံၫနံၪ့လနံၪ့ လၩဆံၫဘံၪ့လဘံၪ့လၩ ထၪ့ဆံၫနံၩလနံၩနီၪ, ဆၧမၩအၥၭလၧဘၭဘလၧၫ့အ စဎွၩန့ၭဘူၫခၭန့ဇၫဂဲၫဝ့ၫ, အဝ့ၫဒၪဒဲအၥုၭမုခမျၧးၥံၪ ထီးအလူၬတၭ, ထၫ့ဒၩယရုစလံၫ့, ဒဲၥုၪ့တဲၩၥံၪထၫ့ဒၩ ဝ့ၫ,မၩထၪ့ထိၬလဖၪ ထၫ့ဒၩဝ့ၫအီၪဖီၩ့ဝၬဝၬနီၪလီၫ.",
			"5": "<sup>5</sup> ဘဲၫနီၪၥိၭဒိၩ့လဖၪဘၪဆၧဝၩ့ထၬဝ့ၫ ထီးအဘၪစဎွၩ ဇ့ၭဒကဲအၫအနံၪ့ဆံၫလနံၪ့နီၪလီၫ.",
			"6": "<sup>6</sup> တၭလၧလၩလံဘံၪ့လဘံၪ့, လၩထၪ့ခွံၫနံၩလနံၩနီၪ, ဆၧၥၭဝံလၩ့ဒိၩဘၪဒိၩ့နီၪနၭနၭလ့ၬတၭ, လၧထံၫၥံၪ",
			"7": "<sup>7</sup> ခးၥံၪအၡၩခမျၧးအဂးနီၪကိၪအီၪလၧၩ့အ့ၬ.- ထီးနီၪ လဖၧၫ့ဒိၩ့နီၪဘၪဆၧဘုၪ့ဖိးဝ့ၫတၭ, ကယဲၦၡၩၥုၭဖိၪ ၥံၪစဲၪ့ဖျိၭထီးအလူၬတၭ, စဲၪ့ထၪ့ခွံၬလၧဒိၩ့နီၪလၧမု နၩလခီၫလ့ၩဝ့ၫလၧဖၧၩ့ၥၭဘၪတရၫ့ အီၪလၧခိၪဒၧၩ့ နံၫထၧၫ့အဘိၩ့ဆၧၩ့ လၧအအီၪလၧစဎွၩ အကျိၭနီၪ အနဲၩ့ထံၭတၭ, (ၦခၫလဒံအၫဖိၪၥံၪ အီၪလၧဒိၩ့နဲၩ့ ထံၭဝၬဝၬနီၪး) အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဖိၬဖၧၩ့ၥၭလၧဆၧ",
			"8": "<sup>8</sup> ပျၩ့ဖၧၩ့လခီၫနီၪလီၫ.- အ့ၪမွဲၦခၫလဒံအၫအၥုၭမုခမျၧး လဖၪလီၩ့ဆီးစဎွၩတၭ, ချႃၭန့စဇ့ၭဒကဲအၫ လၧယ့ၫ ရခိၫအဆၧပျၩ့ဖၧၩ့လဖၪတၭး အဝ့ၫဒၪအၥုၭမုခမျၧး",
			"9": "<sup>9</sup> ၥံၪစဲၪ့ဒၪဝ့ၫလၩ့ပြံၩလၩ့ပၩဝ့ၫဒၪလီၫ.- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪဖီၪ့ထၬစဎွၩတၭ, ဆိၬထၪ့ဝ့ၫဖိးလၧခးဟၫမၭ လၧရံဘလၫနီၪ လၧဘၭဘလၧၫ့အစဎွၩအအီၪး ထီး နီၪလစီၪ့မွဲအစ့ၩရၫ့အဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> တၭဘၭဘလၧၫ့အစဎွၩကျီၪ့ၥံၪခွံၬ စဇ့ၭဒကဲအၫ အဖိၪခွၫၥံၪလၧအမ့ၬယၫလီၫ. မွဲအကျီၪ့ၥံၫခွံၬဆ့ယု",
			"11": "<sup>11</sup> ဒၫအၦဒိၪဖၭဒိၪၥံၪလၧရံဘလၫအဖၧၩ့လီၫ.- ထီးနီၪ လဖၧၫ့မွဲအမၩဘျီၪခွံၬ စဇ့ၭဒကဲအၫအမ့ၬၥၪလဖၪ တၭးဘၭဘလၧၫ့အစဎွၩစၧၩ့ထၬအဝ့ၫဒၪလၧၥွ့ၫထၭ, ဒဲဆိၬဝ့ၫထီၩ့လၧဘၭဘလၧၫ့တၭ, ဒူၭလၩ့ဝ့ၫလၧထီၫ့ ဖၧၩ့ထီးမုနံၩလၧအၥံၫဝ့ၫဒၪနီၪလီၫ.",
			"12": "<sup>12</sup> တၭလၧလၩယဲဘံၪ့လဘံၪ့အဖၧၩ့, လၩထၪ့ဆံၫနံၩ လနံၩနီၪ,လၧအမွဲဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ အနံၪ့လဆံၫခွံၫနံၪ့လနံၪ့နီၪ, ၦခိၭဆၧလဖၪအခိၪလၧ အမၩဘၭဘလၧၫ့အစဎွၩအခ့ၫအၡၩအဆၧမၩ, စန့ၭ ဘူၫဇၫရဒၫ့နီၪ, ဂဲၫထီၩ့လၧယရုစလံၫ့အဖၧၩ့တၭ,",
			"13": "<sup>13</sup> မွဲအဆူၭထၪ့ခွံၬယဟိဝၩအဂံၪ့း ဒဲစဎွၩအဂံၪ့နီၪးဒဲက ယဲဂံၪ့ၥံၪလၧယရုစလံၫ့အဖၧၩ့, ဒဲၦဒိၪၥံၪအဂံၪ့ထီးအလူၬ",
			"14": "<sup>14</sup> နီၪ,မွဲအဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- တၭၦခၫလဒံအၫ ဖိၪအၥုၭမုခမျၧးၥံၪလၧအအီၪ လၧၦခိၭဆၧလဖၪအ ခိၪအၥိၭထီးအလူၬလဖၪနီၪ မၩလၩ့ဎီးခွံၬယရုစလံၫ့ အခိၪဒၧၩ့ၥံၪအီၪဖီၩ့ဝၬဝၬနီၪလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့ ၦခိၭဆၧလဖၪအခိၪစန့ၭဘူၫဇၫရဒၫ့ ဆိၬခွံၬအၪ့မၧၫ့ဎီးၦၡၪ့ဖိၪယၬဖိၪၥံၪနီၪ, ဒဲၦခမျၧးၥံၪ, လၧအအီၪလၩ့ထးလၧဒိၩ့ဖၧၩ့လဖၪး ဒဲၦလၧအစဲၪ့ဒၪ ဆၧဘဲၫနီၪ, ဒဲၦလၧအစဲၪ့ထီၩ့လၧဘၭဘလၧၫ့အစဎွၩ",
			"16": "<sup>16</sup> အအီၪ, ဒဲၦခမျၧးဂူၫဂၩလဖၪဆ့လီၫ.- မွဲလါနၫ့ဘိၩၦ ခိၭဆၧလဖၪအခိၪစန့ၭဘူၫဇၫရဒၫ့နီၪ ဒုၭအီၪလၩ့ထး ထံၫၥံၪခးၥံၪ အၡၪ့ဖိၪယၬဖိၪလနၩ့နၩ့, ဘဲၫၥိၭအဝ့ၫ ၥံၪမိမၩစဘံၭမုအလး ဒဲမၩကၩလၧဆံၬၥံၪနၩၥံၪလီၫ.",
			"17": "<sup>17</sup> တၭထုၪ့ထီးဝီၩၥံၪ လၧအအီၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့ နီၪ,ဒဲဆၧအခၪ့လဖၪ, ဒဲကမၫထီးဝီၩလၧအအီၪလၧယ ဟိဝၩအဂံၪ့ဖၧၩ့နီၪ, ၦခၫလဒံအၫဖိၪၥံၪ မၩထ့ဖၭခွံၬ ဝ့ၫတၭ,ဆိၬအထီးဝီၩနီၪ ထီၩ့လၧဘၭဘလၧၫ့နီၪလီၫ.",
			"18": "<sup>18</sup> ဖၧၩ့ဖၭဒိၪၥံၪဆ့ဒဲဎ့ၬချီၩ့ပၪပဲၪၥံၪ, ဒဲဆၧထံၬခွံၬမ့ၪဘိၪ ၥံၪ,ဖၧၩ့ၥံၪထွ့ၫၥံၪ, ဒဲနိၪထိၩ့လဖၪ, ဒဲကယဲဖၧၩ့ထီးဝီၩ ၥံၪလၧအမၩဆၧလမံၩ့လါလါ လၧအဖၧၩ့နီၪ, အဝ့ၫ",
			"19": "<sup>19</sup> ၥံၪဆိၬခွံၬဝ့ၫဒၪလီၫ.- ဒဲဖၧၩ့ထၭပၪပဲၪၥံၪ, ဒဲထွ့ၫလဖၪ, ဒဲဖၧၩ့ဖၭဒိၪၥံၪ, ဒဲမ့ၪဒိၩ့အလးၥံၪ, ဒဲနိၪထိၩ့လဖၪ, ဒဲလိၫ့လဖၪး ဆၧလၧအမၩလၧထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲလၧ အမၩဝ့ၫ လၧကျိၪၥံၪစ့ၩၥံၪနီၪ, ၦခိၭဆၧဖိၪလဖၪအ",
			"20": "<sup>20</sup> ခိၪနီၪဆိၬထၪ့ခွံၬဝ့ၫဒၪလီၫ.- ထုၪ့ၥံၪနံၫထုၪ့, ကမၫလ ဖၧၩ့,ချီဖၫထီးဝီၩၥံၪလဆံၫနံၩဒုၩ လၧအအီၪလၧအဖၫ့ လၬ,လၧစဎွၩစီလမၧၫ့မၩထၪ့ဝ့ၫလၧယဟိဝၩအဂံၪ့ ဖၧၩ့နီၪလီၫ. ဖၧၩ့ၥံၪထွ့ၫၥံၪ ထီးအလူၬလဖၪအထီး",
			"21": "<sup>21</sup> ဝီၩနီၪအလယၧးအီၪအ့ၬ.- တၭထုၪ့ၥံၪနီၪ,အထၪ့ထီၫ မွဲလဆံၫဎိၭဖျါတၭ, ဆၧအခွၩ့လဆံၫနံၫဖျါအီၪဝၬဖီၩ့",
			"22": "<sup>22</sup> ဝ့ၫ,အတၪ့မွဲစူၪနိၩ့လံဘီၩ့, အီၪဝ့ၫအိၩချိၩလီၫ.- ဆၧ လၧအခိၪအဖၫ့ခိၪနီၪမွဲထီးဝီၩအထၪ့ထီၫ မွဲယဲဖျါထဲၫ့ ဎ့ၪအၥၭ,ဒဲၥလဲၩၥၪၥံၪ အီၪလၧဆၧလမံၩ့နီၪဝၬဝၬ တၭ,ဆၧထီးအလူၬနီၪမွဲထီးဝီၩလီၫ. ထုၪ့လထုၪ့ဒၪ",
			"23": "<sup>23</sup> နီၪအီၪလၧၥလဲၩၥၪလဖၪ ဘဲၫနီၪၥိၭဆ့လီၫ.- တၭ ၥလဲၩၥၪၥံၪအီၪဝ့ၫလပၪလပၪနီၪ ခွံၫဆံၫဎူၫဖျိၪ့တၭး ၥလဲၩၥၪနီၪ ထီးအလူၬလၧအဝၬဖီၩ့ဝ့ၫနီၪ, မွဲလယၩ လီၫ.",
			"24": "<sup>24</sup> တၭၦခိၭဆၧလဖၪအခိၪနီၪ မၩန့ၦလုဆၧအခိၪစစံၫ ရအဲအၫ, ဒဲၦလုဆၧနံၫဂၩလဂၩစဇ့ၭဖနဲအၫ, ဒဲၦပၧၩ့",
			"25": "<sup>25</sup> တရၫ့ၥၧၫ့ဂၩလဖၪး- လၧဒိၩ့ဖၧၩ့နီၪမွဲအမၩန့ၦဖၫဆွံၪ လဂၩ, လၧအအီၪလၧၦၥုၭဖိၪၥံၪအဖၫ့ခိၪတၭ, ၦလၧ အအီၪဘူၭ လၧစဎွၩအနၫ့ဆါနီၪ, လၧအဒၪန့ဝ့ၫလၧ ဒိၩ့ဖၧၩ့နီၪနွ့ၫဂၩး ဒဲၦၥုၭမုခမျၧး အၡၩကွ့ၭလံၬအ ခိၪ,လၧအကိၭကီၪ့ထံၫၥံၪခးၥံၪ အၡၩခမျၧးလဖၪ, ဒဲ ခးနီၪအၦၡၩခွၫဎူၫဆံၫ, လၧဆၧဒၪဘၪဝ့ၫလၧဒိၩ့အ",
			"26": "<sup>26</sup> ၥၭကျၩနီၪလီၫ.- တၭၦခိၭဆၧလဖၪအခိၪစန့ၭဘူၫဇၫ ရဒၫ့မၩန့အဝ့ၫၥံၪ ဒဲဂဲၫဆိၬဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩ",
			"27": "<sup>27</sup> အအီၪလၧရံဘလၫနီၪလီၫ.- တၭဘၭဘလၧၫ့အစဎွၩ ကျီၪ့အဝ့ၫၥံၪတၭ, မၩၥံၫဝ့ၫလၧရံဘလၫအဖၧၩ့, လၧ ခးဟၫမၭအဖၧၩ့နီၪလီၫ. ဘဲၫနီၪၥိၭယုဒၫဘၪဆၧဆိၬ ထၪ့ခွံၬလၧအခးဒၪဝ့ၫနီၪ, လၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫ အ ဖၧၩ့လီၫ.",
			"28": "<sup>28</sup> ၦၡၩလၧစန့ၭဘူၫခၭန့ဇၫ ဆိၬထၪ့ခွံၬလၧဆၧအၪ့ မၧၫ့ဎီးဝ့ၫအဖၧၩ့နီၪမွဲအယီၩး လၧနွ့ၫနံၪ့လနံၪ့အထး",
			"29": "<sup>29</sup> ဖၧၩ့နီၪ,မွဲၦယုဒၫဖိၪၥၧၫ့ထီၫ့နံၫဆံၫၥၧၫ့ဂၩလီၫ.- လၧ စန့ၭဘူၫခၭန့ဇၫ အနံၪ့လဆံၫဎိၭနံၪ့လနံၪ့နီၪ, မွဲအ ဆိၬထၪ့ခွံၬ လၧယရုစလံၫ့ လၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအ",
			"30": "<sup>30</sup> ဖၧၩ့ၦၡၩဎိၭယၩၥၧၫ့ဆံၫနံၫဂၩလီၫ.- လၧစန့ၭဘူၫခၭ န့ဇၫအနံၪ့နံၫဆံၫၥၧၫ့နံၪ့လနံၪ့နီၪ, ၦခိၭဆၧအခိၪစန့ၭ ဘူၫဇၫရဒၫ့ ဆိၬထၪ့ဝ့ၫ လၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫအဖၧၩ့ ၦဘၪဆဲၫ့လၧၦယုဒၫဖိၪၥံၪ, မွဲၦၡၩနွ့ၫယၩလံဆံၫယဲ ဂၩတၭ,ၦၡၩထီးအလူၬလဖၪမွဲလံထီၫ့ဎူၫယၩလီၫ.",
			"31": "<sup>31</sup> လၧယုဒၫအစဎွၩစယဟီအခံၫ့ အဆၧအၪ့မၧၫ့ဎီးဝ့ၫ အနံၪ့ၥၧၫ့ဆံၫနွ့ၫနံၪ့နီၪ, လၧလၩလဆံၫနံၫဘံၪ့လဘံၪ့ တၭ,လၩထၪ့နံၫဆံၫယဲနံၩနီၪ, ဆၧမၩအၥၭလၧဘၭ ဘလၧၫ့အစဎွၩ စအံဝ့ၫမရိၭဒၭ လၧအပၧၩ့ဆၧအခၪ့ ထံၭလနံၪ့နီၪ, ဆိၬထၪ့ယုဒၫအစဎွၩယဟီအခံၫ့အခိၪဎွံၪ တၭ,ထုၭထၪ့ခွံၬဝ့ၫလၧထီၫ့ဖၧၩ့နီၪ,",
			"32": "<sup>32</sup> ဒဲချဲၩ့မုၬလၩဆၧ လၧအဝ့ၫဒၪတၭ, အီၪက့ၪထၪ့အဝ့ၫဒၪ အလးဆီၩ့ဆီ လၧစဎွၩၥံၪအီၪလၧအၥိၭ လၧဘၭဘလၧၫ့အဖၧၩ့နီၪ အဖၫ့ခိၪတၭး အၪ့လဲၩခွံၬအကီၩ့အၥိၭ ဘၪဆဲၫ့လၧထီၫ့ဖၧၩ့နီၪလီၫ.-",
			"33": "<sup>33</sup> အဝ့ၫဒၪအၪ့ဆၧလၧအမ့ၬယၫလ ထံၪဎးလဘီၩ့ဎးလဆိၩဒၪအၥၭလီၫ.-",
			"34": "<sup>34</sup> လၧအဆၧအၪ့ ဆၧအီၩအဂးနီၪ, ဘၭဘလၧၫ့စဎွၩဖ့ၪလၫ့အၪ့ဝ့ၫအီၩ ဝ့ၫ,လၧလနံၩအဂးလနံၩအဂးဆုၬဆုၬ လဆိၩဒၪအ ၥၭထီၩ့လၩ့မုနံၩလၧအၥံၫဝ့ၫဒၪနီၪလီၫ."
		}
	}
};
module.exports = book;